var book = {
	"name": "၁ ကွ့ၭနဲၪ့ဆၧ",
	"numChapters": 29,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> စအၫဒၫ့, စစ့ၥၭ, စအံနိၭ, စက့နၫ့, စမဟၫလလံလၭ, စယၫရ့ၭ,",
			"3": "<sup>3</sup> စအံနၧၭ စမၥုစလၫ,စလၫမ့ၭ,- စနိအၫ,စ ၡံၫ့, စဟၫ့, ဒဲစယၫဖ့ၭလီၫ.",
			"5": "<sup>5</sup> စယၫဖ့ၭအဖိၪခွၫၥံၪနီၪး စဂိမၧၫ့, ဒဲစမၫဂီၭ,ဒဲစမၭဒ အဲၫ, ဒဲစယၫဝၫ့, ဒဲစတုဘလၭ, ဒဲစမံၫၡ့ၭ, ဒဲစတဲရၭ",
			"6": "<sup>6</sup> လီၫ.- တၭစဂိမၧၫ့အဖိၪခွၫၥံၪနီၪး စအၭၡခံၫနၭ, ဒဲစရဲ",
			"7": "<sup>7</sup> ဖၭ, ဒဲစတိၫဂၫမၫလီၫ.- တၭစယၫဝၫ့အဖိၪခွၫၥံၪး စ အံၫလဲၡၫ, ဒဲစတၫၡံၭ, စကံတံၫ့, ဒဲစဒိၫဒၫနံၫ့လီၫ.",
			"8": "<sup>8</sup> စဟၫ့အဖိၪခွၫၥံၪနီၪး စကုၡၫ, ဒဲစမံၫဇရံၫ့,စပုတၫ,",
			"9": "<sup>9</sup> ဒဲစကၫနအၫ့လီၫ.- တၭစကုၡၫ အဖိၪခွၫၥံၪနီၪး စဇံ ဘၫ,ဒဲစဟၭဝလၫ, ဒဲစစၭဘတၫ, ဒဲစရၫအမၫ, ဒဲစစၭ ဘထံၫခၫလီၫ. တၭစရၫအမၫအဖိၪခွၫၥံၪနီၪ, စၡံဘၫ,",
			"10": "<sup>10</sup> ဒဲစဒံဒၫ့လီၫ.- တၭစကုၡၫထၪ့ဖိၪစနံမရီၭး တၭအဝ့ၫ",
			"11": "<sup>11</sup> ဒၪကဲၪၦၥ့ၪဆၧလၧဂၪ့ခိၪချိၫ့ယီၩလီၫ.- တၭစမံၫဇရံၫ့ ထၪ့ဖိၪစလုဒံၫ့, ဒဲစအၨအမံၫ့, ဒဲစလဟ့ဘံၫ့,ဒဲစနၭတုၫ",
			"12": "<sup>12</sup> ဟံၫ့,- ဒဲစပၭစံၫ့,ဒဲစကၭစလုအံၫ့, (တၭၦဖလံၡၫဖိၪ ၥံၪလၩ့ဆၨၩထဲၩ့ လၧအဝ့ၫဒၪ) ဒဲစကၭဖၥိရံၫ့လီၫ.",
			"13": "<sup>13</sup> တၭစကၫနအၫ့ထၪ့ဖိၪ အဖိၪဝဲၡါစဇဲဒၧၫ့, ဒဲစဟ့ၥၭ, ၦယ့ဘုၫဖိၪဆ့, ဒဲၦအၫမီၫဖိၪ,ဒဲၦဂၧဂၫဖိၪ,",
			"14": "<sup>14</sup> ဒဲၦဟံ",
			"16": "<sup>16</sup> ဝဲၫဖိၪ,ဒဲၦအၫကၫဖိၪ, ဒဲၦစံၫနဲၫဖိၪ,- ဒဲၦအၫဝၭဖိၪ,ဒဲ ၦဟၫမၫဖိၪနီၪလီၫ.",
			"17": "<sup>17</sup> စၡံၫ့အဖိၪခွၫၥံၪနီၪး စအံၫလၫ့,ဒဲစအၭၡၧၫ,ဒဲစအၫ ဖၭစၭ,ဒဲစလုဒၭ, ဒဲစအၫရၫ့, ဒဲစအၧဇၫ,ဒဲစဟုလၭ,ဒဲ",
			"18": "<sup>18</sup> စဂံၥၧၫ,ဒဲစမံၫၡ့ၭလီၫ.- တၭစအၫဖၭစၭထၪ့ဖိၪစၡံ",
			"19": "<sup>19</sup> လၫး တၭစၡံလၫနီၪထၪ့ဖိၪစအံၫဘၧၫလီၫ.- တၭလၧ စအံၫဘၧၫအဂးအဖိၪခွၫအီၪဖျဲၪဝ့ၫနံၫဂၩနီၪး အလဂၩ အမံၩ့မွဲစပံလ့ၭ, အဂဲးဘဲၫယီၩလၧအဝ့ၫဒၪအမုနံၩလ ဖၪနီၪဂၪ့ခိၪဘၪဆၧအၪ့နၩ့ဖၭဝ့ၫဒၪလီၫ. တၭအထၧၫ့",
			"20": "<sup>20</sup> ဖုဝဲအမံၩ့မွဲစယီၭတၫ့လီၫ.- တၭစယီၭတၫ့ထၪ့ဖိၪစ အၫလမိဒၭ,ဒဲစၡံၫလ့ၭ, ဒဲစဟၫဇၫမ့ၫဝံၭ,ဒဲစယံရၫ, စဟဒိရၫ့ဆ့, ဒဲစယုဇလၭ,ဒဲစဒံၭလၫ,",
			"21": "<sup>21</sup> ဒဲစအံဘ",
			"23": "<sup>23</sup> လၭ,ဒဲစအဘံမအ့လၭ,ဒဲစၡံဘၫ,- ဒဲစအိၫဖၧၫ, ဒဲစ ဟၭဝလၫ, ဒဲစယိဘၭလီၫ. အယီၩထီးအလူၬၥံၪမွဲစ ယီၭတၫ့အဖိၪခွၫလဖၪလီၫ. စၡံၫ့,စအၫဖၭစၭ,စၡံလၫ,",
			"24": "<sup>24</sup> စအံဘၧၫ,စပံလ့ၭ, စရုၫ,",
			"26": "<sup>26</sup> စစံရၨၭ,စနၫဟီၫ,စတံရၫ,- စအၫဘြၫ့, လၧ အမွဲစအၫဘြဟၫ့လီၫ.",
			"28": "<sup>28</sup> စအၫဘြဟၫ့အဖိၪခွၫၥံၪနီၪး စအံစၭဒဲစအံၫၡမၫအ့ လၭလီၫ.",
			"29": "<sup>29</sup> အဝ့ၫၥံၪအဆိၩလဖၪမွဲအယီၩး စအံၫၡမၫအ့လၭ အဝဲၡါနီၪ,စနဘ့ယီၭး ထီးနီၪလဖၧၫ့စကံဒၧၫ, ဒဲစအၭ",
			"30": "<sup>30</sup> ဒဘ့လၭ,ဒဲစမံဘစၫ့,- စမံၡမၫ,ဒဲစဒုမၫ,စမၫစၫ,စဟၫ",
			"31": "<sup>31</sup> ဒၭ,ဒဲစတံမၫ,- စယံတၧၫ,စနၫဖ့ၭ,ဒဲစက့ဒမၫလီၫ.စအံၫ ၡမၫအ့လၭအဖိၪခွၫၥံၪမွဲအနီၪလီၫ. တၭစအၫဘြဟၫ့",
			"32": "<sup>32</sup> အၥံၪမၫနးကတုရၫအဖိၪခွၫၥံၪး- အဝ့ၫဒၪအီၪဖျဲန့စဇံ မရၫ့,ဒဲစယီၭၡၫ့, ဒဲစမံဒၫ့,ဒဲစမံဒအၫ့, ဒဲစအံၡဘၭ, ဒဲစရှုအၫလီၫ. တၭစယီၭၡၫ့အဖိၪခွၫၥံၪနီၪး စၡံဘၫ,",
			"33": "<sup>33</sup> ဒဲစဒံဒၫ့လီၫ.- တၭစမံဒအၫ့အဖိၪခွၫၥံၪနီၪး စအံဖၫ,ဒဲ စအံဖၧၫ,ဒဲစဟ့နီၭ, ဒဲစအဘဲဒၫ,ဒဲစအ့ၫလဒၫအၫလီၫ. အယီၩထီးအလူၬၥံၪ မွဲနးကတုရၫအဖိၪခွၫလဖၪလီၫ.",
			"34": "<sup>34</sup> တၭစအၫဘြဟၫ့ထၪ့ဖိၪစအံစၭ, စအံစၭနီၪအဖိၪ",
			"35": "<sup>35</sup> ခွၫၥံၪး စအံစီၫဒဲစအံၫစရ့လၭလီၫ.- စအံစီၫအဖိၪခွၫ ၥံၪနီၪး စအံလဲဖၭ, စရုၫအ့လၭ,ဒဲစဇံအၧၭ,ဒဲစယၫ",
			"36": "<sup>36</sup> လအ့လၩ့,ဒဲစကိရၫလီၫ.- စအံၫလဲဖၭအဖိၪခွၫၥံၪနီၪး စတံမၫ့,ဒဲစအိၫမၫ, ဒဲစဇံဇ့ၫ,ဒဲစဂၫတၫ့, စကံနၭ,ဒဲ",
			"37": "<sup>37</sup> စတံမနၫ,ဒဲစအၫမလ့ၭလီၫ.- စရုၫအ့လၭအဖိၪခွၫၥံၪ နီၪး စနၫဟၭ, ဒဲစဇံရၫ,စၡၫမနၫ,ဒဲစမံဇၫလီၫ.",
			"38": "<sup>38</sup> တၭစစံအၫအဖိၪခွၫၥံၪနီၪး စလိတၫ့, ဒဲစၡိဘလၭ, ဒဲစဇံဘအၧၫ့,ဒဲစအၫနၫ,ဒဲစဒဲၡိၫ့,ဒဲစအံဇၫ,ဒဲစဒဲၡၫ့လီၫ.",
			"39": "<sup>39</sup> စလိတၫ့အဖိၪခွၫၥံၪနီၪး စဟိရဲၫ,ဒဲစဟိမၫ့,တၭနးတံ",
			"40": "<sup>40</sup> မနၫမွဲစလိတၫ့အဖိၪမုၪလီၫ.- စၡိဘလၭအဖိၪခွၫလဖၪ နီၪး စအလဲအၫ့,ဒဲစမၫ့အဟၭ,ဒဲစအံဘလၭ,စၡံဖဲၫ, ဒဲစအိနၫ့လီၫ. တၭစဇံဘအၧၫ့အဖိၪခွၫၥံၪနီၪး စအအဲ",
			"41": "<sup>41</sup> အၫ,ဒဲစအၫနၫလီၫ.- စအၫနၫအဖိၪခွၫၥံၪနီၪး စဒဲၡိၫ့, တၭစဒဲၡိၫ့အဖိၪခွၫၥံၪနီၪး စအၫမရၫ့, ဒဲစအ့ၡဘၫ့,ဒဲ",
			"42": "<sup>42</sup> စအံၥၫ့,ဒဲစခံရၫ့လီၫ.- စအံဇၧၫအဖိၪခွၫၥံၪနီၪး စဘံ လဟၫ့,ဒဲစဇၫဝၫ့,ဒဲစယၫကၫ့လီၫ. စဒဲၡၫ့အဖိၪခွၫလ ဖၪနီၪး စအၧဇၫ, ဒဲစအၫရၫ့လီၫ.",
			"43": "<sup>43</sup> တၭအံၫစရ့လၭဖိၪၥံၪအစဎွၩလချႃၭအီၪထၪ့ဒံၭဘၪ နီၪ,စဎွၩၥံၪလၧအပၧၩ့ခးအံဒၧၫ့မွဲအယီၩး စဘံအီၫအ ဖိၪခွၫစဘံလၫ, တၭအဝ့ၫဒၪအဒိၩ့နီၪ အမံၩ့မွဲဒံၪ့ဟၫ",
			"44": "<sup>44</sup> ဘၫလီၫ.- တၭထီးစဘံလၫၥံၫဝ့ၫနီၪ, ၦဘီဇရၫဖိၪစဇံ ရၫအဖိၪခွၫ စယိဘၭနီၪ ပၧၩ့ဆၧလၧအဝ့ၫဒၪ အလး",
			"45": "<sup>45</sup> လီၫ.- တၭထီးစယိဘၭၥံၫဝ့ၫနီၪ, ၦခးတံမၫ့ဖိၪစဟုၡၫ့",
			"46": "<sup>46</sup> ပၧၩ့ဆၧလၧအလးလီၫ.- တၭထီးစဟုၡၫ့ၥံၫဝ့ၫနီၪ,စဘံ ဒၭအဖိၪခွၫစဟၫဒၭ, လၧအကျီၪ့မံဒအၫ့ လၧမိအၭအ ဆၧပျၩ့ဖၧၩ့နီၪ, ပၧၩ့ဆၧလၧအလးလီၫ. အဝ့ၫဒၪအ",
			"47": "<sup>47</sup> ဒိၩ့အမံၩ့မွဲအၫဝံၭလီၫ.- တၭထီးစဟၫဒၭၥံၫဝ့ၫနီၪ,ၦ",
			"48": "<sup>48</sup> မၭစံၭကၫဖိၪစစၫ့မျၫ ပၧၩ့ဆၧလၧအလးလီၫ.- တၭ ထီးစစၫ့မျၫၥံၫဝ့ၫနီၪ, ၦရဟိဘိၭဖိၪ စၡၫအၧလၭလၧ",
			"49": "<sup>49</sup> ထံၫမိၡါနဲၩ့နီၪပၧၩ့ဆၧလၧအလးလီၫ.- တၭထီးစၡၫ အၧလၭၥံၫဝ့ၫနီၪ, စအၭဘိၫအဖိၪခွၫစဘၫအလၭဟၫ",
			"50": "<sup>50</sup> နၫ့ပၧၩ့ဆၧလၧအလးလီၫ.- တၭထီးစဘၫအလၭဟၫ နၫ့ၥံၫဝ့ၫနီၪ, စဟၫဒၭပၧၩ့ဆၧလၧအလး, အဝ့ၫဒၪအ ဒိၩ့အမံၩ့မွဲပၫအဲၫး ဒဲအမၫအမံၩ့မွဲနးမဟ့တဘ့ၫလၭ လၧအမွဲနးမၫတြ့ၭ အဖိၪမုၪ စမ့ဇဟၭ အဖိၪမုၪနီၪ",
			"51": "<sup>51</sup> လီၫ.- တၭစဟၫဒၭနီၪၥံၫဝ့ၫဒၪဆ့လီၫ. တၭအံဒၧၫ့အ စခၩ့ၥံၪမွဲစခၩ့တံမနၫ, စခၩ့အလဲအၫ, စခၩ့ယံၭၥ့ၭ, စခၩ့အဟိၫလံဘမၫ စခၩ့အံလၫ,စခၩ့ဝဲနၫ့,",
			"52": "<sup>52</sup> စခၩ့",
			"54": "<sup>54</sup> ကံနၭ,စခၩ့တံမၫ့,စခၩ့မံဘဇၫ,- စခၩ့မၭဂဒံၫအ့လၭ, စခၩ့အဲရၫ့လီၫ. အံဒၧၫ့အစခၩ့လဖၪမွဲၦလဖၪနီၪလီၫ."
		},
		"2": {
			"1": "<sup>1</sup> တၭအံၫစရ့လၭအဖိၪခွၫၥံၪမွဲအယီၩး စရုဘံၫ့,စစံ မအၧၫ့,စလံဝဲၫ,ဒဲစယုဒၫ,စအံစခၫ,ဒဲစဇ့ၭဘလၧၫ့,",
			"2": "<sup>2</sup> စဒၫ့,စယိၥၭ ဒဲစဘံၪ့ယမံၫ့,စနၭၥလဲၫ,စဂၭ,ဒဲစအၭ ၡၧၫနီၪလီၫ.",
			"3": "<sup>3</sup> စယုဒၫအဖိၪခွၫၥံၪနီၪး စအၧၫ,ဒဲစအိၫနၫ့,ဒဲစၡံလၫး အဝ့ၫၥံၪၥၧၫ့ဂၩနီၪၦကၫနအၫ့ဖိၪစရှုအၫအဖိၪမုၪအီၪ ဖျဲၪန့လၧအဂးလီၫ. တၭစယုဒၫအဖိၪဝဲၡါစအၧၫနီၪ, အၧၩ့ဝ့ၫလၧယဟိဝၩအမ့ၬယၫတၭ, အဆၧမၩၥံၫဝ့ၫ",
			"4": "<sup>4</sup> လီၫ.- တၭအဒဲၪနးတၫမၫအီၪဖျဲၪန့စဖၫရ့ၭ, ဒဲစဇံရၫ လၧအဂးလီၫ. ၦယဲဂၩထီးအလူၬယီၩမွဲစယုဒၫအဖိၪ ခွၫၥံၪလီၫ.",
			"5": "<sup>5</sup> စဖၫရ့ၭအဖိၪခွၫနီၪး စဟ့ဇရၧၫ့,ဒဲစဟၫမုၫလၭနီၪ",
			"6": "<sup>6</sup> လီၫ.- တၭစဇံရၫအဖိၪခွၫၥံၪနီၪး စဇံမရဲၫ,ဒဲစအံၥၫ့, ဒဲစဟံမၫ့,ဒဲစကၫလကီလၭ,ဒဲစဒၫရၫး ထီးအလူၬမွဲယဲ",
			"7": "<sup>7</sup> ဂၩလီၫ.- တၭစကၫမဲၫအဖိၪခွၫၥံၪနီၪး စအၫခၫ့,မွဲၦလၧ အမၩခိမၩဝီၩ အံၫစရ့လၭဖိၪၥံၪ, လၧအမၩမၪဆၧ",
			"8": "<sup>8</sup> လၧဆၧဆိၪအၧၩ့အကၠီၩ့နီၪလီၫ.- တၭစအံၥၫ့အဖိၪ ခွၫၥံၪနီၪး စအၭဇရဲအၫလီၫ. တၭစဟ့ဇရၧၫ့အဖိၪခွၫ",
			"9": "<sup>9</sup> ၥံၪဆ့,လၧဆၧအီၪဖျဲၪန့လၧအဂး- စယ့ၫရမအ့လၭ, ဒဲစရၫ့ဒဲစခလုဘ့ၫလီၫ.",
			"10": "<sup>10</sup> တၭစရၫ့နီၪထၪ့ဖိၪစအမံနဒၭး တၭစအမံနဒၭနီၪ",
			"11": "<sup>11</sup> ထၪ့ဖိၪစနၫၡိၫ့,ၦယုဒၫဖိၪၥံၪအစခၩ့နီၪး- တၭစနၫၡိၫ့ ထၪ့ဖိၪစစၫလမၫတၭ, စစၫလမၫထၪ့ဖိၪ စဘိအၭ,",
			"12": "<sup>12</sup> တၭစဘိအၭနီၪထၪ့ဖိၪစအိဘ့ၭ, တၭစအိဘ့ၭနီၪထၪ့",
			"13": "<sup>13</sup> ဖိၪစယ့ၭစံၫ,- တၭစယ့ၭစံၫနီၪထၪ့ဖိၪၥံၪ, အဝဲၡါစအံၫ လဲအၭ,ဒဲနံၫဂၩလဂၩစအဘံနဒၭ, ဒဲၥၧၫ့ဂၩလဂၩစၡံ",
			"14": "<sup>14</sup> မၫ,- လံဂၩလဂၩနီၪစနၥၫ့နအ့လၭ, ယဲဂၩလဂၩနီၪစ",
			"15": "<sup>15</sup> ရၭဒအဲၫ,- ဎူၫဂၩလဂၩနီၪစအိဇံၫ့, နွ့ၫဂၩလဂၩနီၪစ",
			"16": "<sup>16</sup> ဒၫဝံၭး- အဝ့ၫဒၪအဖုမုၪၥံၪမွဲနးဇ့ၫရုၫအဲအၫ နးအၭဘ ဂၫလၭနီၪလီၫ. တၭနးဇ့ၫရုၫအဲအၫ အဖိၪခွၫၥံၪနီၪး စအၭဘၡဲၫ, ဒဲစယိအၭ,ဒဲစအၫစဟ့လၭၥၧၫ့ဂၩလီၫ.",
			"17": "<sup>17</sup> တၭနးအၭဘဂၫလၭအီၪဖျဲၪန့စအၫမစၫး တၭစအၫမ စၫအဖါနီၪမွဲၦအံၫၡမၫအ့လၭဖိၪ စယ့ၥၧၫနီၪလီၫ.",
			"18": "<sup>18</sup> တၭစဟ့ဇရၧၫ့အဖိၪခွၫစကၫလ့ၭထၪ့ဖိၪလၧအမၫ နးအဇုဘၫး ဒဲနးယၫရအီၭ,အဝ့ၫဒၪအဖိၪခွၫၥံၪမွဲအ",
			"19": "<sup>19</sup> ယီၩး စယံၡၧၫ,ဒဲစၡိဘၭ,ဒဲစအၫဒၫ့လီၫ.- ထီးနးအဇု ဘၫနီၪၥံၫဝ့ၫတၭ, စကၫလ့ၭမၩန့နးအ့ဖၭနီၪ, လၧအ",
			"20": "<sup>20</sup> အီၪဖျဲၪန့စဟၧလၧအဂးလီၫ.- တၭစဟၧနီၪ ထၪ့ဖိၪ စယုရဲၫး တၭစယုရဲၫနီၪ ထၪ့ဖိၪစဘ့ၫဇလံၫအ့လၭ",
			"21": "<sup>21</sup> လီၫ.- လၧခဲၫ့ထဲၩ့နီၪတၭ, စဟ့ဇရၧၫ့လ့ၩနုၬလၧစဂံလ အၭအဖါစမၫခၧၫအဖိၪမုၪအအီၪတၭ, ထီးအၥၭအီၪ အနံၪ့ဎူၫဆံၫနီၪအီၪဎုၬလၧအဝ့ၫဒၪလီၫ. တၭၦမုၪနီၪ",
			"22": "<sup>22</sup> အီၪဖျဲၪန့စစံဂၧၭလၧအဂးလီၫ.- စစံဂၧၭနီၪထၪ့ဖိၪစယ့ အၧၫတၭ, အဝ့ၫဒၪအီၪလၧဒိၩ့နံၫဆံၫၥၧၫ့ဒိၩ့လၧခးဂံ",
			"23": "<sup>23</sup> လအၭအဖၧၩ့နီၪလီၫ.- တၭလၧယ့အၧၫအဒိၩ့ၥံၪအ မ့ၬယၫနီၪ, အဝ့ၫဒၪမၩန့ဂ့ၭၡၧၫ,ဒဲအၫရၫ့ဆ့လၧအ ဝ့ၫၥံၪအစူၪဖၧၩ့, ဒဲကံနၭနီၪဒဲအဒိၩ့လဖၪဆ့, မွဲဒိၩ့ဎူၫ ဆံၫလီၫ. တၭဒိၩ့လဖၪနီၪထီးအလူၬ မွဲစဂံလအၭအ",
			"24": "<sup>24</sup> ဖါစမၫခၧၫအဖိၪခွၫၥံၪအဒိၩ့လီၫ.- တၭစဟ့ဇရၧၫ့နီၪ ၥံၫထလၧၫ့ခွံၬ လၧကၫလ့ၭအံဖၭအဖၧၩ့, ထီးနီၪလ ဖၧၫ့စဟ့ဇရၧၫ့အမၫ နးအဘဲအၫ အီၪဖျဲၪန့ လၧစအၭ ၡၧၫအဂး, လၧအမွဲစတကိအၫအဖါနီၪလီၫ.",
			"25": "<sup>25</sup> တၭစဟ့ဇရၧၫ့အဖိၪဝဲၡါစယ့ၫရမအ့လၭအဖိၪခွၫ ၥံၪနီၪ,အဝဲၡါစရၫ့,ဒဲစဘုနၫ,ဒဲစအိရံၫ့,ဒဲစအိဇံၫ့,ဒဲစ",
			"26": "<sup>26</sup> အဟဲယၫနီၪလီၫ.- တၭစယ့ၫရမအ့လၭအီၪလၧအမၫ မွဲဒၪလဂၩဆ့, လၧအမံၩ့မွဲနးအၭတရၫ,စအိနၫ့အမိနီၪ",
			"27": "<sup>27</sup> လီၫ.- တၭစယ့ၫရမအ့လၭအဖိၪဝဲၡါစရၫ့နီၪအဖိၪခွၫ",
			"28": "<sup>28</sup> ၥံၪ,မွဲစမၫအၭ,ဒဲစယၫမံၫ့,ဒဲစအံကၧၫလီၫ.- တၭစအိ နၫ့နီၪအဖိၪခွၫၥံၪ,မွဲစၡၫမအဲၫဒဲစယၫဒၫလီၫ. တၭစ ၡၫမအဲၫနီၪအဖိၪခွၫၥံၪး စနၫဒၭ,ဒဲစအၭဘၡၧၫလီၫ.",
			"29": "<sup>29</sup> တၭစအၭဘၡၧၫ အမၫအမံၩ့မွဲနးအဘဲဟလၭတၭ,",
			"30": "<sup>30</sup> မွဲအအီၪဖျဲၪန့လၧစအၫဘၫ့, ဒဲစမိလံၭအဂးလီၫ.- တၭ စနၫဒၭအဖိၪခွၫလဖၪနီၪ,စစံလ့ၭ,ဒဲစအၭပအံၫ့း အ့ၪ",
			"31": "<sup>31</sup> မွဲစစံလ့ၭနီၪအဖိၪလအီၪဘၪတၭၥံၫဝ့ၫဒၪလီၫ.- တၭ စအၭပအံၫ့အဖိၪခွၫး စအဲၡဲၫလီၫ. တၭစအဲၡဲၫအဖိၪ ခွၫ,စၡံၡၫ့လီၫ. တၭစၡံၡၫ့အဖိၪ မွဲနးအၫလ့ၫလီၫ.",
			"32": "<sup>32</sup> တၭစၡၫမအဲၫအထၧၫ့ဖုဝဲခွၫစယၫဒၫအဖိၪခွၫၥံၪနီၪး စယ့ၥၧၫ,ဒဲစစၪ့နၥၫ့း တၭစယ့ၥၧၫနီၪအဖိၪလအီၪဘၪ",
			"33": "<sup>33</sup> တၭၥံၫဝ့ၫဒၪလီၫ.- တၭစစၪ့နၥၫ့ အဖိၪခွၫၥံၪနီၪး စဖံ လ့ၭ,ဒဲစဇၫဇၫလီၫ. စယ့ၫရမအ့လၭအဖိၪခွၫၥံၪမွဲအ နီၪလီၫ.",
			"34": "<sup>34</sup> တၭစၡံၡၫ့အဖိၪခွၫအီၪအ့ၬ, မွဲန့ၫအဖိၪမုၪၥံၪလီၫ. တၭစၡံၡၫ့နီၪ အီၪလၧအဎီးအၡၩခွၫ ၦအံဇံၭဖိၪ,အ",
			"35": "<sup>35</sup> မံၩ့မွဲစယၫဟၫလီၫ.- တၭစၡံၡၫ့နီၪဖ့ၪလၫ့အဖိၪမုၪ လၧအဎီးအၡၩခွၫ စယၫဟၫလၧအမၫအဂးတၭ, မွဲ အအီၪဖျဲၪန့အဖိၪခွၫစအၭတ့ၫ လၧအဝ့ၫဒၪအဂး",
			"36": "<sup>36</sup> လီၫ.- တၭစအၭတ့ၫထၪ့ဖိၪစနၫၥၫ့, စနၫၥၫ့နီၪထၪ့ဖိၪ",
			"37": "<sup>37</sup> စဇၫဘၭတၭ,စဇၫဘၭနီၪထၪ့ဖိၪစအ့ၭပလၭ,- စအ့ၭ ပလၭနီၪထၪ့ဖိၪစအိဘ့ၭတၭ, စအိဘ့ၭနီၪထၪ့ဖိၪစယံ",
			"38": "<sup>38</sup> ဟုၫတၭ,- စယံဟုၫနီၪထၪ့ဖိၪ စအၭဇရဲအၫတၭ, စ",
			"39": "<sup>39</sup> အၭဇရဲအၫနီၪထၪ့ဖိၪစဟ့လ့ၭတၭ,- စဟ့လ့ၭနီၪထၪ့ ဖိၪစအ့ၫလအ့စၫတၭ, စအ့ၫလအ့စၫနီၪ ထၪ့ဖိၪစစံၫ",
			"40": "<sup>40</sup> အၫ့မဲၫတၭ,- စစံၫအၫ့မဲၫနီၪ ထၪ့ဖိၪစၡၫလၧၫ့တၭ,စ",
			"41": "<sup>41</sup> ၡၫလၧၫ့နီၪထၪ့ဖိၪ စယ့ၭအမဲအၫတၭ,- စယ့ၭအမဲ အၫနီၪထၪ့ဖိၪစအံၫလံၭၡမၫလီၫ.",
			"42": "<sup>42</sup> တၭစယ့ၫရမအ့လၭအထၧၫ့ဖုဝဲခွၫ စကၫလ့ၭအဖိၪ ခွၫၥံၪမွဲအဖိၪဝဲၡါစမံၡၫ, လၧအမွဲစဇံဖၭအဖါနီၪး ဒဲစ",
			"43": "<sup>43</sup> ဟံဘြၧၫ့အဖါစမၫရၡၫအဖိၪခွၫၥံၪနီၪလီၫ.- တၭစဟံ ဘြၧၫ့အဖိၪခွၫၥံၪနီၪး စကိရၫ,ဒဲစတၭပုအၫ,ဒဲစရံကံၫ့,",
			"44": "<sup>44</sup> ဒဲစၡံမၫလီၫ.- တၭစၡံမၫနီၪထၪ့ဖိၪစရၫဟၫ့, စယီကိၫ အၫ့အဖါနီၪလီၫ. တၭစရံကံၫ့ထၪ့ဖိၪစၡၫမအဲၫလီၫ.",
			"45": "<sup>45</sup> တၭစၡၫမအဲၫအဖိၪခွၫမွဲစမၫအၧၫ့တၭး စမၫအၧၫ့နီၪ",
			"46": "<sup>46</sup> မွဲစဘ့ၭၥဇၧၫအဖါလီၫ.- တၭစကၫလ့ၭအၥံၪမၫနးအံ ဖၫနီၪအီၪဖျဲၪန့စဟံၫရၫ့, ဒဲစမိဇၫ, ဒဲစဂၫဇ့ၭး တၭစ",
			"47": "<sup>47</sup> ဟၫရၫ့နီၪထၪ့ဖိၪစဂၫဇ့ၭး- ဒဲစယၫဒအဲၫအဖိၪခွၫလ ဖၪနီၪး စရံဇံၫ့,ဒဲစယိၥၫ့,ဒဲစဂံၡံၫ့,ဒဲစပံလ့ၭ,ဒဲစအံဖၭ,",
			"48": "<sup>48</sup> ဒဲစၡၫအၭလီၫ.- စကၫလ့ၭအၥံၪမၫနးမၫအခၫနီၪ,အီၪ",
			"49": "<sup>49</sup> ဖျဲၪန့စၡံဘၧၫ,ဒဲစတၧၫဟၫနၫလီၫ.- မွဲအအီၪဖျဲၪန့စမၭ မၪနၫအဖါစရၫအၭနီၪဆ့, ဒဲစမၭဘံနၫအဖါစၡံဝ့ၫနီၪး ဒဲစဂံဘံၫအၫအဖါနီၪး တၭစကၫလ့ၭအဖိၪမုၪမွဲနး အၭစၫလီၫ.",
			"50": "<sup>50</sup> တၭစဟၧအဖိၪခွၫစကၫလ့ၭအဖိၪခွၫၥံၪမွဲအယီၩ, အဝဲၡါစအ့ဖတၫး စၡိဘလၭစကၧၫယၭယံအရံၫ့",
			"51": "<sup>51</sup> အဖါနီၪ,- စစၫလမၫစဘ့ၭၥလံၫဟံၫ့အဖါနီၪ, စဟၫ",
			"52": "<sup>52</sup> ရ့ၭစဘ့ၭၥဂၫဒၧၫအဖါနီၪလီၫ.- စကၧၫယၭယံအရံၫ့ အဖါစၡိဘလၭနီၪအီၪလၧအဖိၪခွၫၥံၪး စဟၫရိၫအံၫ,",
			"53": "<sup>53</sup> ဒဲၦမၫ့အဟၭဖိၪၥံၪဖိၭဖၫ့နီၪလီၫ.- ဒဲကၧၫယၭယံအ ရံၫ့အဂံၪ့ဒီၪ့လဖၪနီၪဆ့တၭ, ၦအံၥြဲၫဖိၪၥံၪၦဖုဟဲဖိၪ ၥံၪ,ဒဲၦရှုမ့ၫဖိၪၥံၪ,ဒဲၦမံၭၡရၫဖိၪၥံၪတၭး ၦဒရံအၫဖိၪ ၥံၪ,ဒဲၦအ့ၭၡတီၫလဲၫဖိၪၥံၪလၩ့ဆၨၩထဲၩ့လၧအဝ့ၫၥံၪ",
			"54": "<sup>54</sup> လီၫ.- တၭစစၫလမၫအဖိၪခွၫၥံၪနီၪး စဘ့ၭၥလံၫဟံၫ့, ဒဲၦနတီၭဖၥဲၫဖိၪၥံၪ,ၦအၭရီၭဖိၪ, ၦဘ့ၭၥယိအၭဖိၪ,",
			"55": "<sup>55</sup> ၦမ့ၪလဟၭဖိၪၥံၪဖိၭဖၫ့နီၪ, ၦဇိရၫဖိၪၥံၪလီၫ.- ဒဲၦကွ့ၭ လံၬၥံၪအဂံၪ့ဒီၪ့လဖၪလၧအအီၪလၧယၫဘ့ၭ, ၦတဲရၭ ဖိၪၥံၪ,ၦၡံမအၭဖိၪၥံၪ, ၦစခအ့ၫၥဲဖိၪၥံၪလီၫ. အယီၩ လဖၪမွဲၦကံၫ့နဲၭဖိၪၥံၪလၧအလၩ့ဆၨၩ လၧစဟ့မၭ, လၧအမွဲစရံခၭအဂံၪ့ဖိၪၥံၪအဖါနီၪလီၫ."
		},
		"3": {
			"1": "<sup>1</sup> တၭစဒၫဝံၭအဖိၪခွၫၥံၪ, လၧဆၧအီၪဖျဲၪန့အဂးလၧ ဟံဘြၧၫ့အဖၧၩ့နီၪမွဲအယီၩး အဝဲၡါစအၫမနၧၫ့, ၦ ယ့ၭစအ့လၭဖိၪနးအဟံၫ့နိၫအၫ့အဖိၪး နံၫဂၩလဂၩ စဒၫ့နအ့လၭ, ၦကၫမလၭဖိၪနးအၭဘဂၫလၭအဖိၪး",
			"2": "<sup>2</sup> ၥၧၫ့ဂၩလဂၩ,စအၭဘစလၧၫ့, ဂ့ၡၧၫအစဎွၩစတၫလမ့ၫ အဖိၪမုၪနးမၫအခၫအဖိၪး လံဂၩလဂၩ,စအၭဒနဲယၫ",
			"3": "<sup>3</sup> နးဟၭဂံၭအဖိၪး- ယဲဂၩလဂၩ,စၡ့ၭဖတဲအၫ, နးအၭ ဘတၫလၭအဖိၪး ဎူၫဂၩလဂၩ,စအံၭၥံၫအၫ့အမၫနး",
			"4": "<sup>4</sup> အ့ၭလၫနီၪအဖိၪလီၫ.- ၦဎူၫဂၩလဖၪယီၩဆၧအီၪဖျဲၪ န့အဂးလၧဟံဘြၧၫ့အဖၧၩ့နီၪး တၭမွဲအပၧၩ့ဆၧထီး နီၪနွ့ၫနံၪ့ဒဲလၩဎူၫဘံၪ့း ဒဲလၧယရုစလံၫ့အဖၧၩ့နီၪ,မွဲ",
			"5": "<sup>5</sup> အပၧၩ့ဆၧအနံၪ့ၥၧၫ့ဆံၫၥၧၫ့နံၪ့လီၫ.- ဆၧအီၪဖျဲၪန့အ ဂးလၧယရုစလံၫ့အဖၧၩ့နီၪမွဲၦလဖၪယီၩး စၡံမအၫ, ဒဲစၡိဘၭ,ဒဲစနၫၥၫ့,ဒဲစစီလမၧၫ့, လံဂၩနီၪ,မွဲစအၫမ",
			"6": "<sup>6</sup> အ့လၭအဖိၪမုၪနးဘ့ၭၥရှုအၫအဖိၪး- စအံၭဘဟၫ",
			"7": "<sup>7</sup> ဆ့,ဒဲစအံၫလံၭၡမၫ,ဒဲစအံၫလ့ၭဖလ့ၭ,- ဒဲစနိဂၫ,ဒဲစ",
			"8": "<sup>8</sup> နံဖ့ၭ,ဒဲစယဖဲအၫ,- ဒဲစအံၫလံၭၡမၫ, ဒဲစအံၫလဲအဒၫ,",
			"9": "<sup>9</sup> ဒဲစအံၫလံၭဖလ့ၭ,ခွံၫဂၩလီၫ.- ၦထီးအလူၬလဖၪနီၪ မွဲစဒၫဝံၭအဖိၪခွၫၥံၪတၭး အၥံၪမၫလဖၪအဖိၪခွၫၥံၪ အီၪဒံၭ,ဒဲအဝ့ၫၥံၪအထၧၫ့ဖုဝဲမုၪနးတၫမၫနီၪဆ့လီၫ.",
			"10": "<sup>10</sup> စစီလမၧၫ့အဖိၪခွၫ မွဲစရံၫဟဘိအၫ့, အဖိၪခွၫစအ",
			"11": "<sup>11</sup> ဘဲၫအၫ,အဖိၪခွၫစအၫစၫ, အဖိၪခွၫစယဟီၡဖၭ,- အ ဖိၪခွၫစယိရၫ့, အဖိၪခွၫစအၫဟဇဲအၫ,အဖိၪခွၫစယိ",
			"12": "<sup>12</sup> အၭ,- အဖိၪခွၫစအၫမဇဲအၫ,အဖိၪခွၫစအၭဇရဲအၫ,",
			"13": "<sup>13</sup> အဖိၪခွၫစယိၥၫ့,- အဖိၪခွၫစအၫဟဇ့ၭ, အဖိၪခွၫစ",
			"14": "<sup>14</sup> ဟ့ၭဇကဲအၫ,အဖိၪခွၫစမနၭစ့ၫ,- အဖိၪခွၫစအၫမၧၫ့, အဖိၪခွၫစယိၫစဲအၫလီၫ.",
			"15": "<sup>15</sup> တၭစယိၫစဲအၫအဖိၪခွၫၥံၪနီၪး အဝဲၡါ စယိၫဟၫ နၫ့,နံၫဂၩလဂၩစယဟီအကံၫ့,ၥၧၫ့ဂၩလဂၩစဇ့ၭဒကဲ အၫ,လံဂၩလဂၩစၡၫလၧၫ့လီၫ.",
			"16": "<sup>16</sup> တၭစယဟီအကံၫ့အဖိၪခွၫၥံၪနီၪး အဖိၪခွၫစယ့ၭ",
			"17": "<sup>17</sup> ကနဲအၫ,အဖိၪခွၫစဇ့ၭဒကဲအၫလီၫ.- စယ့ၭကနဲအၫ အဖိၪခွၫၥံၪနီၪ စအၭစၧၫ, အဖိၪခွၫစလၫၥအ့လၭ,",
			"18": "<sup>18</sup> စမၫလခဲရၫ့ဆ့, ဒဲစပဒၫယၫ,ဒဲစၡန့ဇၫ, ဒဲစယ့ၭခမဲ အၫဆ့,ဒဲစဟီၭၡမၫ ဒဲစန့ၭဒဘဲအၫလီၫ.",
			"19": "<sup>19</sup> တၭစပဒၫယၫအဖိၪခွၫၥံၪနီၪး စဇရၧၭဘဘ့ၫလၭ, ဒဲစၡံမအဲၫတၭး စဇရၧၭဘဘ့ၫလၭ အဖိၪခွၫၥံၪနီၪး စမၡၧလၫ့,ဒဲစဟၫ့အနဲအၫ, ဒဲအဝ့ၫၥံၪအဖုမုၪနးၡံလိၫ",
			"20": "<sup>20</sup> မ့ၭး- ဒဲစဟရှုဘၫ,ဒဲစအိၫဟ့လၭ, ဒဲစဘ့ၫရကဲအၫ, ဒဲစဟၭစဒဲအၫ, စယုၫၡၭဘၡ့ၭ, ယဲဂၩလဖၪနီၪလီၫ.",
			"21": "<sup>21</sup> တၭစဟၫ့အနဲအၫအဖိၪခွၫၥံၪနီၪး စပ့ၫလတဲအၫ, ဒဲစယစ့ယၫး စရ့ၭဖဲအၫအဖိၪခွၫၥံၪ, စအၫနၫ့အဖိၪ ခွၫၥံၪ,စအိၫဘဒဲအၫအဖိၪခွၫၥံၪ, စၡ့ၭခနဲအၫအဖိၪ ခွၫၥံၪလီၫ.",
			"22": "<sup>22</sup> တၭစၡ့ၭခနဲအၫအဖိၪခွၫၥံၪနီၪး စၡ့ၫမအဲအၫ,ဒဲစ ၡ့ၫမအဲအၫအဖိၪခွၫၥံၪး စဟၭတၧၭ, ဒဲစအံၭဂအၫ လၭ,ဒဲစဘရဲအၫ, ဒဲစနံၫအရဲအၫ,ဒဲစၡၫဖၭ,ဎူၫဂၩလ ဖၪနီၪလီၫ.",
			"23": "<sup>23</sup> တၭစနံၫအရဲအၫအဖိၪခွၫၥံၪနီၪး စအံၫလအံနအဲၫ, ဒဲစဟ့ၭဇကဲအၫ, ဒဲစအၭစကၫ့, ၥၧၫ့ဂၩလဖၪနီၪလီၫ.",
			"24": "<sup>24</sup> တၭစအံၫလအံနအၫအဖိၪခွၫၥံၪနီၪး စဟီၭဒ့ၫအဲ အၫ,ဒဲစအံၫလဲအၡံၭ, ဒဲစပ့ၫလအဲအၫ,ဒဲစအၭကၧၭ,ဒဲ စယိၫဟၫနၫ့ ဒဲစဒၫလအဲအၫ, ဒဲစအန့နဲၫ,နွ့ၫဂၩလဖၪ နီၪလီၫ."
		},
		"4": {
			"1": "<sup>1</sup> စယုဒၫအဖိၪခွၫၥံၪနီၪး စဖၫရ့ၭ,စဟ့ဇရၧၫ့,ဒဲစကၫ",
			"2": "<sup>2</sup> မဲၫ,ဒဲစဟၧၫ,ဒဲစၡိဘလၭလီၫ.- တၭစၡိဘလၭနီၪအ ဖိၪခွၫစရံၫအအဲအၫထၪ့ဖိၪစယၫဟၭတၭ, စယၫဟၭ နီၪထၪ့ဖိၪစအဟုမအဲၫ, ဒဲစလၫဟၭလီၫ. အယီၩမွဲၦ",
			"3": "<sup>3</sup> ဇိရၫဖိၪၥံၪအဂံၪ့ဒီၪ့လဖၪနီၪလီၫ.- တၭစအံၫတၫ့အဖါ နီၪအဖိၪမွဲအယီၩး စယ့ၭစအ့လၭ, ဒဲစအံၡမၫ,ဒဲစအံ ဒဘၭး တၭအဝ့ၫၥံၪအဖုမုၪနီၪအမံၩ့မွဲနးဟ့ၫဇအ့ၫလ",
			"4": "<sup>4</sup> ပိနံၫး- ဒဲစဂံဒီၫအဖါပံၩနုအ့လၭ, ဒဲစဟုၡၫအဖါစအံ ဇၧၫ့နီၪလီၫ. တၭစဟၧၫ့အဖိၪခွၫၥံၪမွဲအယီၩး အဝဲ ၡါစအ့ၭဖတၫ လၧအမွဲစဘ့ၭၥလံၫဟံၫ့အဖါနီၪလီၫ.",
			"5": "<sup>5</sup> တၭစတကိအၫအဖါစအၭၡၧၫနီၪ အမၫအီၪနံၫဂၩ,",
			"6": "<sup>6</sup> နးဟံလၫ,ဒဲနးနၫအရၫလီၫ.- တၭနးနၫအရၫအီၪဖျဲၪန့ စအဟုဇၫ့,ဒဲစဟံဖၧၫ, ဒဲစတံမၫ့အဲၫ,ဒဲစဟၫအအၭ ၡတၫရဲလဖၪနီၪလၧအဂးလီၫ. နးနၫအရၫအဖိၪခွၫၥံၪ",
			"7": "<sup>7</sup> မွဲအနီၪလီၫ.- တၭနးဟံလၫအဖိၪခွၫၥံၪမွဲစဇ့ရ့ၭ, ဒဲစ",
			"8": "<sup>8</sup> ယ့ၫဇိအၫ,ဒဲစအ့ၭၥနၫ့လီၫ.- တၭစကိဇၫထၪ့ဖိၪစအၫ နၧၭ,ဒဲစဇိၫဘံဘၫ, ဒဲစဟၫရၧၫ့အဖိၪခွၫစဟၫဟ့လၭ အဂံၪ့ဒီၪ့လဖၪနီၪလီၫ.",
			"9": "<sup>9</sup> တၭစယၫဘ့ၭလဂၩနီၪ ဘၪဆၧလၩဆၧဖၩ့အၪနဲၪ့ ဒံၭအထၧၫ့ဖုဝဲၥံၪး တၭအမိကိၭအမံၩ့စယၫဘ့ၭ, စံၭ ဝ့ၫ,အဂဲးဘဲၫယီၩ ယဆီၫ့အီၪန့ဝ့ၫလၧဆၧၥုၪ့အုၭၥၭ",
			"10": "<sup>10</sup> အုၭအဖၧၩ့လီၫ.- တၭစယၫဘ့ၭနီၪ ကိၭထၪ့အံၫစရ့ လၭအယွၩတၭ, စံၭဝ့ၫ,ယယွၩဧ့, ယဆိၫ့လၧနမိဆိၪ ဂ့ၩတၡါယၧၩ, ဒဲမၩလဲထၪ့ယခးအနဲၩ့ထံၭ,ဒဲလၧနစူၪ မိမၩဘိၭမၩဆၧၩ့ယၧၩ, ဒဲလၧနမိမၩဖီၩ့မၩဖျ့ၭလါ ယၧၩလၧဆၧအၧၩ့နီၪဆံၭ. တၭယွၩဖ့ၪလၫ့ဆၧလၧ အအၪ့ကံၩ့ဝ့ၫနီၪဆ့လီၫ.",
			"11": "<sup>11</sup> တၭစခ့ၫလၧၭထၧၫ့ဖုဝဲလၧ စရှုအၫထၪ့ဖိၪစမံတၧၫ,",
			"12": "<sup>12</sup> လၧအမွဲစအ့ၭၡတၧၫ့အဖါနီၪလီၫ.- တၭစအ့ၭၡတၧၫ့ နီၪထၪ့ဖိၪစဘ့ၭၥရၫဖၫ, ဒဲစပစံအၫ,ဒဲစအၧၫနဟၭအ ဖါစတဟံၫနၫနီၪလီၫ. တၭအယီၩမွဲရံခၫအၡၩခွၫလ",
			"13": "<sup>13</sup> ဖၪနီၪလီၫ.- တၭစကံနၭအဖိၪခွၫၥံၪနီၪး စအီၭၥနံၫအ့ လၭ,ဒဲစစံရအဲအၫတၭး စအီၭၥနံၫအ့လၭအဖိၪခွၫၥံၪ",
			"14": "<sup>14</sup> နီၪ,စဟၫတၭလီၫ.- တၭစမံၪ့အိၫၥဲၫထၪ့ဖိၪစအီၭဖၫ, ဒဲစစံရအဲအၫထၪ့ဖိၪစယိအၭ, မွဲခါရၡံၫ့အခိၪလီၩ့ဆူၭ ဖၧၩ့အဖါနီၪလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪမွဲၦလၧအ",
			"15": "<sup>15</sup> မၩဆၧၥ့ၪအၪမံၩ့လီၫ.- တၭစယဖၧၫနံၫအဖိၪခွၫစကၫ လ့ၭအဖိၪခွၫၥံၪစအဲရုၫ, စအံလၫ,ဒဲစနၫအၫ့း ဒဲစအံလၫ",
			"16": "<sup>16</sup> အဖိၪခွၫၥံၪအဖိၪခွၫစကံနၭဒၪလ့ၬလီၫ.- တၭစယဟၫ လလံၫလၭၥံၪနီၪး စဇံဖၭ,ဒဲစဇဲဖၫ,စတံၫရအ့ၫ,ဒဲစအၫ",
			"17": "<sup>17</sup> ခံၫအ့လၭလီၫ.- တၭစအ့ဇရၫအဖိၪခွၫၥံၪနီၪး စယံၥၧၫ ဒဲစမံရ့ၭ,ဒဲစအံဖၧၫ, ဒဲစယၫလၧၫ့း တၭအနီၪလဖၪ မွဲစဖၫရိၫအဖိၪမုၪနးဘၥဲအၫလၧ စမံရ့ၭမၩန့နီၪအဖိၪ ခွၫၥံၪတၭး အဝ့ၫဒၪအီၪဖျဲၪန့နးမံရအၫ့ဆ့, ဒဲစၡၫမအဲၫ,",
			"18": "<sup>18</sup> ဒဲစအ့ၭၡတ့ၫမိအၫအဖါစအံၭၡဘၫလီၫ.- တၭအမၫ နးယံဟဒဲအၫနီၪ အီၪဖျဲၪန့စဂံဒီၫအဖါစယ့ရ့ၭ, ဒဲစစိ ကိၫအဖါစဟံဘၧၫ, ဒဲစဇၫ့အိအၫအဖါစယကုၥအ့",
			"19": "<sup>19</sup> လၭလီၫ.- တၭအမၫနးဟိၫဒဲအၫစနၫဟၫ့ လၧအမွဲၦ ဂၫမ့ၫဖိၪစကဲလၫ, ဒဲၦမၫအခၫဖိၪ, စအ့ၭၡတ့ၫမိအၫ",
			"20": "<sup>20</sup> ၥံၪအဖါအထၧၫ့ဖုဝဲမုၪနီၪ, အဖိၪခွၫၥံၪလီၫ.- တၭစၡဲ မၧၫ့အဖိၪခွၫၥံၪနီၪ, စအၫမနၧၫ့,ဒဲစရံၫ့နၫ, စဘံၫ့ဟၫ နၫ့,ဒဲစတဲလၧၫ့လီၫ. တၭစအဲၡဲၫအဖိၪခွၫၥံၪနီၪ, စဇိ ဟ့ၭ,ဒဲစဘံၫ့ဇိဟ့ၭလီၫ.",
			"21": "<sup>21</sup> စယုဒၫအဖိၪခွၫစၡံလၫအဖိၪခွၫၥံၪနီၪး စလံခၫအ ဖါစအၧၫ,ဒဲစမၫရၡၫအဖါစလၫအဒၫ, ဒဲၦဘၪဆဲၫ့လၧ စအၭၡဘံၫအၫအဂံၪ့နီၪ, ၦလၧအထၬဆၧဘွၩဖျ့ၫလံၬ ကံၭအဂံၪ့ဒီၪ့လဖၪနီၪ, ဒဲယိကံၫ့,ဒဲၦဘၪဆဲၫ့လၧခိၫဇံ",
			"22": "<sup>22</sup> ဘၫ,ဒဲစယိအၭ,- ဒဲစစၫရၭ,အဝ့ၫဒၪပၧၩ့ဆၧလၧမိအၭ ဒဲယ့ရှုၫဘၫလံဟံၫ့အဖၧၩ့လီၫ. ဆၧလဖၪယီၩမွဲဆၧ",
			"23": "<sup>23</sup> လၧဖျိၩ့လံၩလံၩနီၪလီၫ.- တၭၦလဖၪယီၩ မွဲၦတဲၩ့ ဖၧၩ့ၥံၪ, ဒဲၦအီၪဝ့ၫလၧၥံၪ့ၥံၪဝၪၥံၪဘၪဆၧၥုၪ့လၩ့ဝ့ၫ အလးဒဲဝၩ့လဖၪအဖၧၩ့တၭး အီၪဝ့ၫထီးနီၪလၧစဎွၩ အၥိၭဒဲမၩဆၧလၧအဂးနီၪလီၫ.",
			"24": "<sup>24</sup> စစံမအၧၫ့အဖိၪခွၫၥံၪ,မွဲစန့ၫမုအ့လၭ, ဒဲစယၫမံၫ့,",
			"25": "<sup>25</sup> ဒဲစယရ့ၭ,ဒဲစဇံရၫ, ဒဲစၡၫအၧလၭး- အဖိၪခွၫစၡၫ",
			"26": "<sup>26</sup> လၧၫ့,အဖိၪခွၫစမံဘစၫ့, အဖိၪခွၫစမံၡမၫလီၫ.- တၭစ မံၡမၫအဖိၪခွၫၥံၪနီၪး အဖိၪခွၫစဟၫမုၫအ့လၭ,အဖိၪ",
			"27": "<sup>27</sup> စဇၫခၧၫ,အဖိၪခွၫစၡံမအဲၫလီၫ.- တၭစၡံမအဲၫအဖိၪ ခွၫလဖၪအီၪလဆံၫဎူၫဂၩ ဒဲအဖိၪမုၪၥံၪဎူၫဂၩလီၫ. အ့ၪမွဲအထၧၫ့ဖုဝဲၥံၪအဖိၪအလံၩ အီၪအၪအ့ၬတၭ,အ ဝ့ၫၥံၪအဂံၪ့ဒီၪ့လဖၪ အၪထၪ့ဘဲၫစယုဒၫအဖိၪအလံၩ",
			"28": "<sup>28</sup> လဖၪအၥိၭနီၪဆ့အ့ၬ.- တၭအဝ့ၫၥံၪအီၪဝ့ၫ လၧဘံ",
			"29": "<sup>29</sup> အၧၫၡံၫဘၫ,ဒဲမိလဒၫ, ဒဲဟၫဇၫရှုအလၭ,- ဒဲလၧဘံ",
			"30": "<sup>30</sup> လဟၫ,ဒဲလၧအံဇံၫ့, ဒဲလၧတိလၭ,- ဒဲလၧဘ့ၫၥုၫအ့",
			"31": "<sup>31</sup> လၭ,ဒဲလၧဟီမၫ,ဒဲလၧဇံၭလၭ,- ဒဲလၧဘ့ၭၥမၫက ဘီၭ,ဒဲလၧဟၫဇၫစူစံၫ့, ဒဲလၧဘ့ၭၥဘံရအဲၫ,ဒဲလၧၡၫ အရၫအံၫ့အဖၧၩ့နီၪလီၫ. အယီၩမွဲအဝ့ၫၥံၪအဒိၩ့လ",
			"32": "<sup>32</sup> ဖၪထီၩ့လၩ့စဒၫဝံၭ ကဲၪစဎွၩအထီနီၪလီၫ.- အဝ့ၫၥံၪ အတဝၫ့လဖၪနီၪ,မွဲအံတၫ့, ဒဲအၫအံၫ့,ဒဲရံမၧၫ့,ဒဲထိ ခံၫ့,ဒဲအၫၡၫ့,ယဲဒိၩ့ၥံၪ, ဒဲကယဲတဝၫ့ၥံၪလၧအအီၪဝၬ",
			"33": "<sup>33</sup> ဖီၩ့ဒိၩ့လဖၪနီၪ ထီၩ့လၧဘၫအလၭနီၪလီၫ.- တၭအ ယီၩမွဲအလးလဖၪ လၧအဝ့ၫၥံၪအီၪဝ့ၫ, ဒဲအဆၧလၩ့",
			"34": "<sup>34</sup> ဆိၩထဲၩ့နီၪလီၫ.- တၭစမၡိဘၭ,ဒဲစယၫ့မလ့ၭ,ဒဲစအၫ",
			"35": "<sup>35</sup> မဇဲအၫအဖိၪခွၫစယိစဘၫး- ဒဲစယိၫအ့လၭ, ဒဲစယံ ဟုၫလၧအမွဲစယီၭဘဲအၫအဖိၪခွၫ, လၧအမွဲစစံၫရအဲၫ",
			"36": "<sup>36</sup> အၫအဖိၪခွၫ, လၧအမွဲစအၫစအ့လၭအဖိၪခွၫ,- ဒဲစ အံၫလအံနအဲၫ, ဒဲစယၫအၭကဘၫ, ဒဲစယ့ၫၡဟၫအဲ အၫ,ဒဲစအၭစအဲအၫ, ဒဲစအၫဒဲၫအ့လၭ, ဒဲစယ့ၭစံၫမ",
			"37": "<sup>37</sup> အ့လၭ,ဒဲစဘံၫ့အအဲအၫ,- ဒဲစဇဲဇၫ,လၧအမွဲစၡဲဖဲၫအ ဖိၪခွၫ,လၧအမွဲစအၫလၫ့အဖိၪခွၫ, လၧအမွဲစယ့ၭဒ့ ယၫအဖိၪခွၫ, လၧအမွဲစၡံမရဲၫအဖိၪခွၫ,လၧအမွဲစၡ့ၫ",
			"38": "<sup>38</sup> မအဲအၫအဖိၪခွၫတၭး- ၦလဖၪယီၩလၧအမံၩ့ၥံၪဖျီၪ ထၪ့နီၪ, မွဲစခၩ့ၥံၪလၧအဝ့ၫၥံၪအဂံၪ့ဒီၪ့လဖၪး တၭအ ဝ့ၫၥံၪအဖါလဖၪအဂံၪ့အၪထၪ့ဝ့ၫအၪအၪလ့ၬဆ့လီၫ.",
			"39": "<sup>39</sup> တၭအဝ့ၫၥံၪလ့ၩထီၩ့ လၧဆၧလ့ၩနုၬ လၧဂံဒီၫအ လးနီၪ,ထီၩ့လၧခိၪလီၩ့ဆူၭဖၧၩ့မုထၪ့လခီၫ, ဘဲၫၥိၭ အမိအၪ့ဎၬန့အလး လၧအဆၧဖိၪဆၧဎါ အဒီၪ့လဖၪ",
			"40": "<sup>40</sup> မိအၪ့အဆၪနီၪလီၫ.- တၭမွဲအဒၪဘၪဆၧအၪ့အဆၪ အလးနီၪ အဆၧအီၪအၪအၪလ့ၬ ဒဲဂ့ၩမၬဆ့တၭ, ခး နီၪလဲလဲလ့ၬ, ဒဲၦၡၩၥံၪအီၪမုၬ, ဒဲဘၪလိၬအိၭလိၬအ ၥၭ,အဂဲးဘဲၫယီၩၦဘၪဆဲၫ့လၧစဟၫ့နီၪအီၪဝ့ၫထီး",
			"41": "<sup>41</sup> နီၪလၧဖျိၩ့လံၩလံၩလီၫ.- လၧယုဒၫအစဎွၩဟ့ၭဇကဲ အၫအမုနံၩလဖၪနီၪ, ၦလဖၪလၧအမံၩ့အီၪကွ့ၭအၥၭ ယီၩဂဲၫကျီၪ့ခွံၬအဝ့ၫၥံၪအတဲၩလဖၪ, ဒဲအလးလၧၦ ၡၩအီၪဝ့ၫလၧဆၧဒၪန့ဝ့ၫထီးနီၪတၭ, မၩဂၭဂီၩ့တၡါ ဆၧလဖၪနီၪထီးအလူၬ ထီၩ့လၩ့မုဆၫလနံၩယီၩတၭ, အီၪဝ့ၫလၧအဝ့ၫၥံၪအလးလဖၪဆ့လီၫ. အဂဲးဘဲၫယီၩ အဆၧဖိၪဆၧဎါအဒီၪ့ၥံၪ အၪ့အဆၪအလး အီၪဝ့ၫ",
			"42": "<sup>42</sup> လီၫ.- တၭအဝ့ၫၥံၪလနၩ့နၩ့, စစံမအၧၫ့အဖိၪခွၫၥံၪ, ၦၡၩယဲယၩလဖၪ, လ့ၩထီၩ့လၧခိၪလီၩ့ စံအၫတၭ, အဝ့ၫၥံၪအခိၪလဖၪမွဲစပ့ၫလတဲအၫ, ဒဲစနံၫအရဲအၫ, ဒဲစရ့ၭဖဲအၫ, ဒဲစအၧၭဇအ့လၭ, ဒဲစအဲၡဲၫအဖိၪခွၫၥံၪ",
			"43": "<sup>43</sup> လီၫ.- တၭၦအၫမလ့ၭဖိၪၥံၪ လၧအဖီၩ့ဖျ့ၭဆၧတၭ, အီၪဝ့ၫထီးနီၪထီၩ့လၩ့လၧမုဆၫလနံၩယီၩ, အဝ့ၫၥံၪ ကျီၪ့ၥံၫခွံၬဝ့ၫဒၪလီၫ."
		},
		"5": {
			"1": "<sup>1</sup> တၭအံၫစရ့လၭအဖိၪဝဲၡါ စရုဘံၫ့အဖိၪခွၫၥံၪနီၪ, (အဂဲးဘဲၫယီၩအဝ့ၫဒၪမွဲအဝဲၡါလါနၫ့နီၪး လၧအမၩ စံၪစၪအဖါအလးမံၫအကၠီၩ့တၭ, အဝဲၡါအလးနီၪ,ဆၧ ဖ့ၪလၫ့ထဲၩ့လၧအံၫစရ့လၭအဖိၪခွၫ စယိၥၭအဖိၪခွၫ ၥံၪတၭး ဆၧလၩ့ဆိၩထဲၩ့အဆရၫ့နီၪဘၪဆဲၫ့လၧဝဲၡါ",
			"2": "<sup>2</sup> အ့ၬး- အဂဲးဘဲၫယီၩစယုဒၫမၩနၧၩ့မၩစၪအထၧၫ့ဖုဝဲ ၥံၪ,ဒဲၦဘၪဆဲၫ့လၧအဝ့ၫဒၪမွဲၦပၧၩ့ဆၧအခိၪး အ့ၪမွဲ",
			"3": "<sup>3</sup> ဆၧဝဲၡါအလးနီၪဘၪဆဲၫ့လၧစယိၥၭလီၫ.-) အံၫစရ့ လၭအဖိၪဝဲၡါစရုဘံၫ့အဖိၪခွၫၥံၪနီၪ, စဟၫနီၭ,ဒဲစပၫ",
			"4": "<sup>4</sup> လုၫ,ဒဲစဟ့ဇရၧၫ့,ဒဲစကၫမဲၫလီၫ.- စယိၫအ့လၭအဖိၪ ခွၫၥံၪနီၪး အဖိၪခွၫစၡ့ၫမအဲအၫ, အဖိၪခွၫစဂီၭ,အဖိၪ",
			"5": "<sup>5</sup> ခွၫစၡံမအဲၫ,- အဖိၪခွၫစမဲခၫ,အဖိၪခွၫစရံၫမအဲအၫ,",
			"6": "<sup>6</sup> အဖိၪခွၫစဘၫအလၭ,- အဖိၪခွၫစဘံၫအံရၫတၭ,အ ဝ့ၫဒၪအစံရအၫအစဎွၩစဘံလဂၭပ့ၫလနံစၧၫဆိၬန့ခွံၬ ဝ့ၫဒၪတၭး မွဲၦရုဘံၫ့ဖိၪၥံၪအခိၪနီၪလီၫ.",
			"7": "<sup>7</sup> ထီးဆၧတွၭန့အဝ့ၫၥံၪအဆိၩလဖၪ အဆၧလၩ့ဆိၩ ထဲၩ့အဆရၫ့နီၪး အဝ့ၫဒၪအထၧၫ့ဖုဝဲၥံၪအဂံၪ့ဒီၪ့လဖၪ အခိၪနီၪး မွဲစယအ့လၭ,ဒဲစဇ့ၭကရဲအၫ, ဒဲစဘံလၫ,",
			"8": "<sup>8</sup> လၧအမွဲစအၫဇၭအဖိၪခွၫ,- လၧအမွဲစၡံမၫအဖိၪခွၫ, လၧအမွဲစယိအ့လၭ အဖိၪခွၫတၭ, အဝ့ၫဒၪအီၪလၧ အရိအၧၫအဖၧၩ့တၭး ထီၩ့ဒၪလ့ၬလၧနံဘိၫ ဒဲဘၫအ",
			"9": "<sup>9</sup> လၭမံအၫ့နီၪး- ဒဲအဝ့ၫဒၪအီၪလၧမုထၪ့လခီၫ ထီၩ့လၧ ၡါမုနၧၫ့ဖၫ လၧထံၫမိၡါယုၫဖ့တံၫနီၪ, အဂဲးဘဲၫယီၩ လၧခးဂံလအၭနီၪ အဝ့ၫၥံၪအဆၧဖိၪဆၧဎါအၪထၪ့",
			"10": "<sup>10</sup> ဝ့ၫအၪအၪလ့ၬလီၫ.- တၭလၧစစီလူၫအနံၩလဖၪနီၪ, အဝ့ၫၥံၪဒုၭၥုၭလၧၦဟၫဂၫဖိၪလဖၪး လၧအလၩ့ထ့ၬ ဝ့ၫလၧအဝ့ၫၥံၪအစူၪအကၠီၩ့တၭ, မွဲအအီၪလၧအဝ့ၫ ၥံၪအတဲၩဖၧၩ့ထူၩလ့ၬလၧခးဂံလအၭ မုထၪ့လခီၫထီး အလူၬဆ့လီၫ.",
			"11": "<sup>11</sup> တၭစဂၭအဖိၪခွၫၥံၪ အီၪဎၩ့လၧအဝ့ၫၥံၪ, လၧခး",
			"12": "<sup>12</sup> ဘၫၡၫ့အဖၧၩ့နီၪထီၩ့လၧစၫလကၫလီၫ.- အခၪ့ထံၭ လဂၩစယိအ့လၭ, ဒဲနံၫဂၩလဂၩစၡၫဖၫ့, ဒဲစယအၫ",
			"13": "<sup>13</sup> န့ၫ,ဒဲစၡၫဖၭလၧဘၫၡၫ့အဖၧၩ့လီၫ.- တၭအဝ့ၫၥံၪ အထၧၫ့ဖုဝဲလဖၪဘၪဆဲၫ့လၧအဖါၥံၪအဂံၪ့နီၪ, မွဲစမဲၫ ခအ့လၭဒဲစမၡၧလၫ့,ဒဲစၡံဘၫ, ဒဲစယိရအဲၫ,ဒဲစယၫ",
			"14": "<sup>14</sup> ခၫ့,ဒဲစဇဲအၫ,ဒဲစဟံဘၧၫၥံၪ, နွ့ၫဂၩလီၫ.- အယီၩမွဲ စအဘဲဟလၭ အဖိၪခွၫၥံၪတၭ, အဝ့ၫဒၪမွဲစဟုရ့ၫအ ဖိၪခွၫ,စယရိအၫအဖိၪခွၫ, စဂံလအၭအဖိၪခွၫ,စမဲၫ ခအ့လၭအဖိၪခွၫ, စယၡံၭၡအဲၫအဖိၪခွၫ, စယၫဒိၫ",
			"15": "<sup>15</sup> အဖိၪခွၫ,စဘၧဇၭအဖိၪခွၫနီၪး- စအၫဟဲၫလၧအမွဲ စအၭဘဒဲအ့လၭအဖိၪခွၫ, စဂုနဲၫအဖိၪခွၫတၭ, အဝ့ၫ",
			"16": "<sup>16</sup> ဒၪမွဲအဝ့ၫၥံၪအဖါလဖၪအခိၪနီၪလီၫ.- တၭအဝ့ၫၥံၪ အီၪလၧဘၫၡၫ့အဖၧၩ့လၧဂံလအၭနီၪ, ဒဲလၧအဒိၩ့ၥံၪ တဝၫ့ၥံၪအဖၧၩ့ ဒဲၡၫရၧၫ့အလးဝၬဖီၩ့ဝ့ၫအဖၧၩ့နီၪ,",
			"17": "<sup>17</sup> ဒဲအနဲၩ့ထံၭလဖၪနီၪဆ့လီၫ.- အယီၩလဖၪထီးအလူၬ ဘၪဆဲၫ့လၧဆၧလီၩဆိၩအဆၧရၫ့ လၧယုဒၫအစဎွၩ ယိၥၫ့အမုနံၩလဖၪ, ဒဲလၧအံၫစရ့လၭအစဎွၩယ့ၫရဘိ အၫ့အမုနံၩလဖၪနီၪလီၫ.",
			"18": "<sup>18</sup> တၭစရုဘံၫ့အဖိၪခွၫၥံၪ, ဒဲၦဂၭဖိၪၥံၪ, ဒဲစမနၭစ့ၫ အလၧခီၫဒီၪ့နီၪ, လၧအမွဲၦၥၭဒူၩဂဲးဆီၪ့, ၦလၧအဆိၬ ထၩ့ဖံၭဒဲနၭၥံၪဖၩ့ၥံၪ, ဒဲခၭချံၪၥ့ၪ,ဒဲၦလၧအဒုၭၥုၭၥ့ၪ ဆီၪ့လ့ၬတၭ, ၦလဖၪနီၪမွဲလံလၬလံထီၫ့နွ့ၫယၩဎူၫ",
			"19": "<sup>19</sup> ဆံၫ,လၧအလ့ၩထၪ့ဘဲၫၥိၭအမိဒုၭၥုၭနီၪလီၫ.- တၭ အဝ့ၫၥံၪဒုၭၦဟၫဂၫဖိၪတၭ, ဒဲစယံတၧၫ,ဒဲစနံဖံၭ,ဒဲ",
			"20": "<sup>20</sup> စနိဒၭလီၫ.- တၭအဝ့ၫၥံၪဘၪဆၧမၩဘိၭမၩဆၧၩ့ဝ့ၫ လၧအထၫ့ဒုၪဒၩၦလဖၪနီၪ, ၦဟၫဂၫဖိၪၥံၪလၩ့ထ့ၬ လၧအဝ့ၫၥံၪအစူၪဖၧၩ့, ဒဲကယဲၦအီၪလၧအဝ့ၫၥံၪအ ၥိၭထီးအလူၬနီၪး အဂဲးဘဲၫယီၩၦၡၩနီၪကိၭထၪ့အ ယွၩလၧအဒုၭဆၧအဖၧၩ့တၭ, အဝ့ၫဒၪခိၭနၪအဝ့ၫၥံၪ အဆၧအၪ့ကံၩ့နီၪ, အဂဲးဘဲၫယီၩအဝ့ၫၥံၪဒိၭနဲၩ့အၥၭ",
			"21": "<sup>21</sup> လၧအဖၧၩ့လီၫ.- တၭမွဲအမၩန့အဝ့ၫၥံၪအဆၧဖိၪဆၧ ဎါလဖၪထီးအလူၬး ကလအူၭလဖၪယဲလၬ, ဒဲၥိၪလ ဖၪနံၫကုၬယဲလၬ, ဒဲကၥ့ၪယီၩ့လဖၪနံၫထီၫ့, ဒဲၦၡၩၥံၪ",
			"22": "<sup>22</sup> လကုၬနီၪလီၫ.- အဂဲးဘဲၫယီၩ လၧယွၩအဆၧဒုၭၥုၭ နီၪအကၠီၩ့တၭ, လၩ့ထ့ၬၥံၫဝ့ၫအၪဂၩဆ့လီၫ. တၭမွဲ အအီၪလၧအဝ့ၫၥံၪအလး ထီၩ့လၩ့အဘၪဆၧဖီၪ့န့ အၪ့မၧၫ့ဎီးဝ့ၫနီၪလီၫ.",
			"23": "<sup>23</sup> တၭစမနၭစ့ၫအလခီၫဒီၪ့အဖိၪၥံၪ အီၪလၧခးဖၧၩ့ နီၪး အဝ့ၫၥံၪအၪထၪ့လၧဘၫၡၫ့ ထီၩ့လၧဘၫအလၭ ဟၧမၧၫ့ဒဲစံနၧၫဒဲထီၩ့လၧခိၪလီၩ့ဟၧမၧၫ့နီၪလီၫ.",
			"24": "<sup>24</sup> တၭအဝ့ၫၥံၪအဖါလဖၪအဂံၪ့နီၪ အၡၩကဲၪအခိၪ ၥံၪမွဲအယီၩ,စအံၫဖၧၫဒၪလ့ၬ, ဒဲစအံၡဲၫ,ဒဲစအံၫလဲၫ အ့လၭ,စအၫဇရ့ၫအ့လၭဒဲစယ့ၫရမဲအၫ, ဒဲစဟီၭဒဂဲ အၫ,ဒဲစယၫဒအ့လၭတၭး အဝ့ၫၥံၪမွဲၦၥၭဒူၩဂဲးဆီၪ့, အမံၩ့ၥံၪဘၪဆၧဂၧၫ့ထၪ့ၥၩလၩ့နီၪ, မွဲအဝ့ၫၥံၪအဖါ လဖၪအဂံၪ့အၡၩကဲၪအခိၪၥံၪနီၪလီၫ.",
			"25": "<sup>25</sup> တၭအဝ့ၫၥံၪမၩမၪထၫ့ဒုၪဒၩ အဖါလဖၪအယွၩနီၪ, ဒဲလ့ၩမၩမၪထွ့ၫထံၫဖိၪခးဖိၪအယွၩလဖၪ, လၧယွၩ",
			"26": "<sup>26</sup> မၩဂၭဂီၩ့လၧအမ့ၬယၫနီၪလီၫ.- တၭအံၫစရ့လၭအ ယွၩထိၪဂဲထုၪ့အစံရအၫအစဎွၩ စပၧလၭအၥၭ,ဒဲအ စံရအၫအစဎွၩစတံလဂၭပ့ၫလနံစၧၫအၥၭတၭ, အဝ့ၫ ဒၪဆိၬခွံၬအဝ့ၫၥံၪ, ၦရုဘံၫ့ဖိၪဒၪလ့ၬ, ဒဲၦဂၭဖိၪၥံၪနီၪ, ဒဲမနၭစ့ၫလခီၫဒီၪ့တၭ, လ့ၩန့အဝ့ၫၥံၪ ထီၩ့လၧဟၫ လၫဒဲဟၫဘၧၫ, ဒဲဟၫရၫ, ဒဲဖိးလၧထံၫမိၡါဂိဇံၫ့နီၪ, ထီၩ့လၩ့လၧမုဆၫလနံၩယီၩလီၫ."
		},
		"6": {
			"1": "<sup>1</sup> စလံဝဲၫအဖိၪခွၫလဖၪနီၪး စဂၧၡၧၫ့,စကိဟၭ,ဒဲစမ",
			"2": "<sup>2</sup> ရၫရဲၫၥံၪလီၫ.- တၭစကိဟၭအဖိၪခွၫလဖၪနီၪး စအၫ မရၫ့,စအံၭဇဟၫ,ဒဲဟံဘြၧၫ့, ဒဲစအၧၭဇဲၫအ့လၭၥံၪ",
			"3": "<sup>3</sup> လီၫ.- တၭစအၫမရၫ့အဖိၪလဖၪနီၪ စအၫရၧၫ့,ဒဲစမိ စ့ၭ,ဒဲနးမံရအၫ့ၥံၪလီၫ. စအၫရၧၫ့အဖိၪခွၫလဖၪနီၪ ဆ့း စနၫဒၭ,ဒဲစအဘဲဟုၫ, စအံၫလအ့ဇၧၫ ဒဲစအံၥမၫ",
			"4": "<sup>4</sup> ၥံၪလီၫ.- စအံၫလအ့ဇၧၫထၪ့ဖိၪစဖံနအၭ, စဖံနအၭနီၪ",
			"5": "<sup>5</sup> ထၪ့ဖိၪစအဘံၭရှုၫအၫတၭ,- စအဘံၭရှုၫအၫနီၪထၪ့",
			"6": "<sup>6</sup> ဖိၪစဘၧၭကဲၫနီၪထၪ့ဖိၪစအၧၭဇဲၫတၭ,- စအၧၭဇဲၫ နီၪထၪ့ဖိၪစဇ့ၫရအဲအၫတၭ, စဇ့ၫရအဲအၫနီၪထၪ့ဖိၪ",
			"7": "<sup>7</sup> စမရၫယီၭတၭ,- စမရၫယီၭနီၪထၪ့ဖိၪ စအၫမရဲအၫ",
			"8": "<sup>8</sup> တၭ,စအၫမရဲအၫနီၪထၪ့ဖိၪစအဟံၭတၧၭတၭ,- စ အဟံၭတၧၭနီၪ ထၪ့ဖိၪစဇၫဒီၭတၭ, စဇၫဒီၭနီၪထၪ့",
			"9": "<sup>9</sup> ဖိၪစအဟံၭမအၭတၭ,- စအဟံၭမအၭနီၪ ထၪ့ဖိၪစ အၭဇရဲအၫတၭ, စအၭဇရဲအၫနီၪထၪ့ဖိၪစယိၫဟၫ",
			"10": "<sup>10</sup> နၫ့တၭ,- စယိၫဟၫနၫ့နီၪထၪ့ဖိၪစအၭဇရဲအၫ, (တၭ အဝ့ၫဒၪမွဲၦကဲၪထၪ့ ၦလုထၪ့ဆၧ လၧဆၧလုအဂံၪ့ ဖၧၩ့,လၧစစီလမၧၫ့ မၩကဲၪထၪ့ဝ့ၫ လၧယရုစလံၫ့အ",
			"11": "<sup>11</sup> ဖၧၩ့လီၫ.-) တၭစအၭဇရဲအၫနီၪထၪ့ဖိၪစအၫမရဲအၫ",
			"12": "<sup>12</sup> တၭ,စအၫမရဲအၫနီၪထၪ့ဖိၪစအဟံၭတၧၭတၭ,- စအ ဟံၭတၧၭနီၪထၪ့ဖိၪစဇၫဒီၭတၭ, စဇၫဒီၭနီၪထၪ့ဖိၪစ",
			"13": "<sup>13</sup> ၡၫလၧၫ့တၭ,- စၡၫလၧၫ့နီၪထၪ့ဖိၪစဟံၫလကဲအၫ",
			"14": "<sup>14</sup> တၭ,စဟံၫလကဲအၫနီၪထၪ့ဖိၪစအၭဇရဲအၫတၭ,- စ အၭဇရဲအၫနီၪထၪ့ဖိၪစစံၫရအဲအၫတၭ, စစံၫရအဲအၫ",
			"15": "<sup>15</sup> နီၪထၪ့ဖိၪစယဟီၭဇဒၭတၭ,- ထီးယဟိဝၩဆိၬခွံၬယု ဒၫဒဲယရုစလံၫ့လၧစန့ၭဘူၫခၭန့ဇၫအစူၪဖၧၩ့နီၪ, စ ယဟီၭဇဒၭအီၪလၧအဝ့ၫၥံၪအကျၩဆ့လီၫ.",
			"16": "<sup>16</sup> စလံဝဲၫအဖိၪခွၫလဖၪနီၪး စဂၧၡၧၫ့,စကိဟၭ,ဒဲစ",
			"17": "<sup>17</sup> မရၫရဲၫၥံၪလီၫ.- တၭစဂၧၡၧၫ့အဖိၪခွၫၥံၪအမံၩ့မွဲဘဲၫ",
			"18": "<sup>18</sup> ယီၩး စလံဘနဲၫ,ဒဲစၡံမအဲၫၥံၪလီၫ.- တၭစကိဟၭအ ဖိၪခွၫလဖၪနီၪး စအၫမရၫ့,ဒဲစအံၭဇဟၫ,ဒဲစဟံဘြၧၫ့",
			"19": "<sup>19</sup> ဒဲစအၧၭဇဲအ့လၭၥံၪလီၫ.- တၭစမရၫရဲၫအဖိၪခွၫၥံၪ",
			"20": "<sup>20</sup> နီၪး စမၫလံၫ,ဒဲစမုၡဲၫၥံၪလီၫ.- တၭစလံဝဲၫအဂံၪ့ဒီၪ့ လဖၪဘၪဆဲၫ့ လၧအဝ့ၫၥံၪအဖါလဖၪနီၪမွဲဘဲၫယီၩ,",
			"21": "<sup>21</sup> လၧစဂၧၡၧၫ့နီၪး အဖိၪခွၫစလံဘနဲၫ, အဖိၪခွၫစယၫ ဟၭ,အဖိၪခွၫစဇံၫ့မၫ, အဖိၪခွၫစယိအၫ, အဖိၪခွၫ စအံၭဒိၫ,အဖိၪခွၫစဇံရၫ, အဖိၪခွၫစယအၭတရ့ၫၥံၪ",
			"22": "<sup>22</sup> လီၫ.- တၭစကိဟၭအဖိၪခွၫလဖၪနီၪး အဖိၪခွၫစအမံ",
			"23": "<sup>23</sup> နဒၭ, အဖိၪခွၫစကိရၫ, အဖိၪခွၫစအၭစၧၫ,- အဖိၪခွၫ စအ့လကနၫ,ဒဲအဖိၪခွၫစအဘဲအစၭ, ဒဲအဖိၪခွၫစအၭ",
			"24": "<sup>24</sup> စၧၫ,- အဖိၪခွၫစတၫဟၭ, အဖိၪခွၫစယုၫရအ့လၭ, အဖိၪခွၫစအၧၭဇဲအၫ, ဒဲအဖိၪခွၫစၡၫအၧလၭၥံၪလီၫ.",
			"25": "<sup>25</sup> တၭစအ့လကနၫအဖိၪခွၫလဖၪနီၪး စအၫမစ့အၫ,ဒဲစ",
			"26": "<sup>26</sup> အဟဲမီၭၥံၪလီၫ.- စအ့လကနၫး တၭစအ့လကနၫအ ဖိၪခွၫလဖၪနီၪး အဖိၪခွၫစဇိဖ့ၫ,ဒဲအဖိၪခွၫစနၭဟၭ,",
			"27": "<sup>27</sup> အဖိၪခွၫစအံၫလဲအၭ, အဖိၪခွၫစယရိဟၫ့, အဖိၪခွၫ",
			"28": "<sup>28</sup> စအ့လကနၫၥံၪလီၫ.- တၭစစၫမုၫအ့လၭအဖိၪခွၫလ",
			"29": "<sup>29</sup> ဖၪနီၪး အဝဲၡါစဝၭၡနဲၫ, ဒဲစအဘဲအၫၥံၪလီၫ.- တၭ စမရၫရဲၫအဖိၪခွၫလဖၪနီၪး စမၫလံၫ, အဖိၪခွၫစလံ",
			"30": "<sup>30</sup> ဘနဲၫ,အဖိၪခွၫစၡံမအဲၫ, အဖိၪခွၫစအၧၭဇၫ,- အဖိၪ ခွၫစၡံမအဲၫ, အဖိၪခွၫစဟၭဂဲအၫ, အဖိၪခွၫစအၭစဲ အၫၥံၪလီၫ.",
			"31": "<sup>31</sup> လၧဎယွၩၭတလၫနီၪ အီၪပွံၭဝ့ၫအလးခဲၫ့တၭ, ၦလၧ စဒၫဝံၭအီၪက့ၪလၧၦၥံၫကျံၩဆၧလၧ ယဟိဝၩ အဂံၪ့ဖၧၩ့နီၪအခိၪၥံၪမွဲၦလဖၪယီၩ, တၭအဝ့ၫၥံၪမၩအဆၧ ဖံၭဆၧမၩဘၪဆဲၫ့လၧအၥံၫကျံၩဆၧလၧ ဆၧအီၪကီၪ့အ ကျၩလၧတဲၩဆံၫ့ဎံၪအီၪဝ့ၫအလးနီၪ, ထီၩ့လၩ့လၧစ စီလမၧၫ့မၩထၪ့ယဟိဝၩအဂံၪ့လၧ ယရုစလံၫ့အဖၧၩ့",
			"32": "<sup>32</sup> နီၪလီၫ.- ထီးနီၪလဖၧၫ့အဝ့ၫၥံၪ မၩအဆၧဖံၭဆၧမၩ ဘဲၫဆၧဒုၭနဲၪအလးအီၪဝ့ၫထူထူ အၥိၭနီၪလီၫ.",
			"33": "<sup>33</sup> တၭၦလၧအမၩလၧအဖိၪအလံၩအၥိၭလဖၪနီၪမွဲ အယီၩလီၫ. ၦကိဟၭဖိၪလဖၪအဖိၪခွၫၥံၪ, မွဲၦၥံၫ ကျံၩဆၧစဟံမၫ့, စယိၫအ့လၭအဖိၪခွၫ, စၡံမုၫအ့လၭ",
			"34": "<sup>34</sup> အဖိၪခွၫ,- စအ့လကနၫအဖိၪခွၫ, စယရိဟၫ့အဖိၪ",
			"35": "<sup>35</sup> ခွၫ,စအံၫလအ့လၭအဖိၪခွၫ,စတိအၫအဖိၪခွၫ,- စဇုၭ အဖိၪခွၫ,စအ့လကနၫအဖိၪခွၫ, စမၫဟၭအဖိၪခွၫ,စ",
			"36": "<sup>36</sup> အၫမစ့အဲၫအဖိၪခွၫ,- စအ့လကနၫအဖိၪခွၫ,စယိၫအ့ လၭအဖိၪခွၫ, စအၭဇရဲအၫအဖိၪခွၫ, စဇ့ဖနဲအၫအ",
			"37": "<sup>37</sup> ဖိၪခွၫ,- စတၫဟၭအဖိၪခွၫ, စအၭစၧၫအဖိၪခွၫ, စအ",
			"38": "<sup>38</sup> ဘဲအစၭအဖိၪခွၫ, စကိရၫအဖိၪခွၫ,- စအံၭဇဟၫအ ဖိၪခွၫ,စကိဟၭအဖိၪခွၫ,စလံဝဲၫအဖိၪခွၫ, စအံၫစရ့",
			"39": "<sup>39</sup> လၭအဖိၪခွၫနီၪလီၫ.- တၭအထၧၫ့ဖုဝဲခွၫစအၫစဖၭမွဲ ၦဆၧၫ့ထုၪ့လၧအစူၪထွ့ၪလခီၫနီၪ, စအၫစဖၭလၧအမွဲ",
			"40": "<sup>40</sup> စဘ့ၫရကဲအၫအဖိၪခွၫ, စၡံမအၫအဖိၪခွၫ,- စမဲၫခအ့ လၭအဖိၪခွၫ, စဘ့ၫအစဲအၫအဖိၪခွၫ,စမၫလခဲအၫအ",
			"41": "<sup>41</sup> ဖိၪခွၫ,- စအ့ၭၥနဲၫအဖိၪခွၫ,စဇံရၫအဖိၪခွၫ,စအၭဒ",
			"42": "<sup>42</sup> အဲအၫအဖိၪခွၫ,- စအံၥၫ့အဖိၪခွၫ,စဇံၫ့မၫအဖိၪခွၫ,",
			"43": "<sup>43</sup> စၡံမအဲၪအဖိၪခွၫ,- စယၫဟၭအဖိၪခွၫ, စဂၧၡၧၫ့အ ဖိၪခွၫ,စလံဝဲၫအဖိၪခွၫနီၪလီၫ.",
			"44": "<sup>44</sup> တၭအဝ့ၫၥံၪအထၧၫ့ဖုဝဲနီၪ, စမရၫရဲၫအဖိၪခွၫလဖၪ အီၪလၧစူၪစ့ၪလခီၫး စအံၥၫ့လၧအမွဲစကံၭၡဲၫအဖိၪ",
			"45": "<sup>45</sup> ခွၫ,စအၭဘဒဲၫအဖိၪခွၫ, စမၫလၧၭအဖိၪခွၫ,- စဟၭၡ ဘဲအၫအဖိၪခွၫ, စအၫမဇဲအၫအဖိၪခွၫ, စဟံၫလကဲ",
			"46": "<sup>46</sup> အၫအဖိၪခွၫ,- စအၫမဇဲၫအဖိၪခွၫ,စဘၫ့အဲၫအဖိၪခွၫ,",
			"47": "<sup>47</sup> စၡၫမၧၫအဖိၪခွၫ,- စမၫလံၫအဖိၪခွၫ စမုၡဲၫအဖိၪခွၫ,",
			"48": "<sup>48</sup> စမရၫရဲၫအဖိၪခွၫ, စလံဝဲၫအဖိၪခွၫနီၪလီၫ.- အဝ့ၫၥံၪ အထၧၫ့ဖုဝဲလဖၪဆ့, ၦလံဝဲၫဖိၪၥံၪ, ဘၪဆၧအီၪက့ၪ ဝ့ၫလၧကယဲဆၧဖံၭဆၧမၩ လမံၩ့လါလါဘၪဆဲၫ့လၧ ယွၩအဂံၪ့တဲၩဆံၫ့ဎံၪလစီၪ့နီၪလီၫ.",
			"49": "<sup>49</sup> အ့ၪမွဲစအၫရၧၫ့ဒဲအဖိၪခွၫလဖၪ လုထၪ့ဆၧလုမ့ၪ လၧဆၧလုလးအလီၩ့နီၪ, ဒဲလၧဆၧနၧၫ့မၧၫ့အဆၧလု လးဆ့တၭ, ကယဲဆၧမၩထီးအလူၬဘၪဆဲၫ့လၧအလး ဆံၫ့ဎံၪထုၬ, ဒဲဆၧမၩဖီၩ့ဖျ့ၭလၧအံၫစရ့လၭအဂးနီၪ, ဘဲၫယွၩအခ့ၫအၡၩ စမိစ့ၭမၪလူၬဝ့ၫအၥိၭနီၪ, မၩဝ့ၫ",
			"50": "<sup>50</sup> ဒၪလီၫ.- တၭစအၫရၧၫ့အဖိၪခွၫလဖၪမွဲအယီၩး အဖိၪ ခွၫစအံၫလအ့ဇၧၫအဖိၪခွၫစဖံနအၭ, အဖိၪခွၫစအဘံၭ",
			"51": "<sup>51</sup> ရှုၫအၫ,- အဖိၪခွၫစဘၧၭကဲၫ, အဖိၪခွၫစအၧၭဇဲၫ,",
			"52": "<sup>52</sup> အဖိၪခွၫစဇ့ၫရဟဲအၫ,- အဖိၪခွၫစမရၫယီၭ, အဖိၪခွၫ",
			"53": "<sup>53</sup> စအၫမရဲၫအၫ, အဖိၪခွၫစဟံၭတၧၭ,- အဖိၪခွၫစဇၫ ဒီၭ,အဖိၪခွၫစအဟံမအၭၥံၪလီၫ.",
			"54": "<sup>54</sup> တၭစအၫရၧၫ့အဖိၪခွၫလဖၪ, လၧအဘၪဆဲၫ့လၧၦ ကိဟၭဖိၪအဂံၪ့ဒီၪ့ၥံၪအထိၬလဖၪ လၧအဝ့ၫၥံၪအခး အနဲၩ့ထံၭနီၪ, ဒဲအအီၪအလးလဖၪမွဲဘဲၫယီၩး အဂဲး",
			"55": "<sup>55</sup> ဘဲၫယီၩအဝ့ၫၥံၪအလးဆၧဖၭန့ဝ့ၫဒၪလီၫ.- တၭၦလ ဖၪဖ့ၪလၫ့အဝ့ၫၥံၪလၧဟံဘြၧၫ့ လၧခးယုဒၫအဖၧၩ့,ဒဲ",
			"56": "<sup>56</sup> ဆၧအီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬဆ့လီၫ.- အ့ၪမွဲဆံၬၥံၪနၩ ၥံၪဘၪဆဲၫ့လၧဒိၩ့, ဒဲတဝၫ့လဖၪနီၪ, အဝ့ၫၥံၪဖ့ၪလၫ့",
			"57": "<sup>57</sup> လၧစယဖၧၫနံၫအဖိၪခွၫစကၫလ့ၭလဂၩနီၪလီၫ.- တၭ စအၫရၧၫ့အဖိၪခွၫလဖၪ အဝ့ၫၥံၪဖ့ၪလၫ့ ယုဒၫအဒိၩ့ လဖၪ,ဟံဘြၧၫ့, ဒိၩ့ဖလ့ၬ, ဒဲလံဘနၫ, ဒဲဆၧအီၪဖီၩ့ အနဲၩ့ထံၭဝၬဝၬဆ့, ဒဲယၭတၧၫ, ဒဲအ့ၭၡတ့ၫမိအၫ, ဒဲ ဆၧအီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬဆ့, ဒဲဟဲလံၫ့,ဒဲဆၧအီၪဖီၩ့ အနဲၩ့ထံၭဝၬဝၬဆ့, ဒံဘၧၫ ဒဲဆၧအီၪဖီၩ့အနဲၩ့ထံၭ",
			"58": "<sup>58</sup> ဝၬဝၬဆ့,- ဒဲအၫၡၫ့ဒဲဆၧအီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬဆ့,",
			"59": "<sup>59</sup> ဒဲဘ့ၭၥၡံမ့ၭဒဲဆၧအီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬဆ့,- ဒဲလၧ ဆၧဘၪဆဲၫ့လၧစဘံၪ့ယမံၫ့အဒီၪ့နီၪး ဂံဘၫဒဲဆၧအီၪ ဖီၩ့အနဲၩ့ထံၭဝၬဝၬဆ့, ဒဲအၫလမ့ၭဒဲဆၧအီၪဖီၩ့အနဲၩ့ ထံၭဝၬဝၬဆ့, ဒဲအၫ့နၥီၭဒဲဆၧအီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬ နီၪဆ့လီၫ. တၭကယဲဒိၩ့ထီးအလူၬၥံၪဘၪဆဲၫ့လၧအ",
			"60": "<sup>60</sup> ဝ့ၫၥံၪအဂံၪ့ဒီၪ့လဖၪနီၪ, မွဲလဆံၫၥၧၫ့ဒိၩ့လီၫ.- တၭ စကိဟၭအဖိၪခွၫလဖၪ လၧအအီၪလၩ့ထးလၧဂံၪ့ဒီၪ့ နီၪဘၪဆဲၫ့လၧအဝ့ၫဒၪအဒီၪ့တၭ, ဆၧဖ့ၪလၫ့ဒိၩ့လဖၪ ဘၪဆဲၫ့လၧလခီၫဒီၪ့, ဘဲၫပစံၭဆၧအၥိၭစမနၭစ့ၫအ",
			"61": "<sup>61</sup> လခီၫဒီၪ့နီၪ,- ဒိၩ့ဆံၫဒိၩ့ဘဲၫဆၧဖၭဝ့ၫအၥိၭနီၪလီၫ.",
			"62": "<sup>62</sup> တၭလၧစဂၧၡၧၫ့အဖိၪခွၫလဖၪအဂံၪ့ဒီၪ့ၥံၪထီးအ လူၬနီၪ,ဘၪဆဲၫ့လၧစအံစခၫအဒီၪ့, ဒဲလၧစအၭၡၧၫအ ဒီၪ့နီၪ,ဒဲလၧစနၭၥလဲၫအဒီၪ့ လၧဘၫၡၫ့အဖၧၩ့နီၪ, လဆံၫၥၧၫ့ဒိၩ့လီၫ.",
			"63": "<sup>63</sup> လၧစမရၫရဲၫအဖိၪခွၫၥံၪအဂံၪ့ဒီၪ့လဖၪ ထီးအလူၬ နီၪ,ဆၧဖ့ၪလၫ့ဘဲၫအဖၭဝ့ၫအၥိၭ, ဘၪဆဲၫ့လၧစရုဘံၫ့ အဒီၪ့နီၪ,ဒဲလၧစဂၭအဒီၪ့နီၪ, ဒဲလၧစဇ့ၭဘလၧၫ့အဒီၪ့",
			"64": "<sup>64</sup> နီၪ,လဆံၫနံၫဒိၩ့လဖၪလီၫ.- တၭၦအံၫစရ့လၭဖိၪလ ဖၪဖ့ၪလၫ့ၦလံဝဲၫဖိၪၥံၪဒိၩ့လဖၪနီၪ ဒဲဆၧအီၪဖီၩ့လၧ",
			"65": "<sup>65</sup> အနဲၩ့ထံၭၥံၪဝၬဝၬဆ့လီၫ.- တၭအဝ့ၫၥံၪဖ့ၪလၫ့ဘဲၫ အဖၭဝ့ၫအၥိၭနီၪ, ဘၪဆဲၫ့လၧစယုဒၫအဖိၪခွၫလဖၪ အဒီၪ့နီၪ, ဒဲလၧစစံမအၧၫ့အဖိၪခွၫလဖၪအဒီၪ့နီၪ,ဒဲလၧ စဘံၪ့ယမံၫ့အဖိၪလဖၪအဒီၪ့နီၪ, ဒိၩ့လဖၪ,လၧဆၧ ကိၭထၪ့အမံၩ့ၥံၪနီၪလီၫ.",
			"66": "<sup>66</sup> တၭစကိဟၭအဖိၪခွၫၥံၪ အဂံၪ့ဒီၪ့လဖၪနီၪအီၪလၧ ဒိၩ့လဖၪလၧအဝ့ၫၥံၪအခးအနဲၩ့ထံၭ, ဘၪဆဲၫ့လၧစ",
			"67": "<sup>67</sup> အံဖံၫ့အဒီၪ့နီၪလီၫ.- တၭၦလဖၪဖ့ၪလၫ့အဝ့ၫၥံၪလၧ ဒိၩ့ဖလ့ၬလဖၪ,ၡံခံၫ့လၧခိၪလီၩ့အံဖံၫ့, ဒဲဆၧအီၪဖီၩ့ အနဲၩ့ထံၭဝၬဝၬဆ့း ဒဲဂံဇၧၫဆ့ဒဲဆၧအီၪဖီၩ့အနဲၩ့ထံၭ",
			"68": "<sup>68</sup> ဝၬဝၬနီၪ,- ဒဲယီၭမံအၫ့ဒဲဆၧအီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬ နီၪ,ဒဲဘ့ၭၥဟိရၧၫ့ဒဲ ဆၧအီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬနီၪ,",
			"69": "<sup>69</sup> ဒဲအၭဇလၧၫ့ဒဲဆၧအီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬနီၪ, ဒဲဂၭၥ",
			"70": "<sup>70</sup> ရံမၧၫ့ဒဲဆၧအီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬနီၪး- ဒဲဘၪဆဲၫ့လၧ စမနၭစ့ၫလခီၫဒီၪ့နီၪး အၫနၧၫဒဲဆၧအီၪဖီၩ့အနဲၩ့ထံၭ ဝၬဝၬနီၪ, ဒဲဘံၫလံအၫ့ ဒဲဆၧအီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬ နီၪ,လၧစကိဟၭအဖိၪခွၫလဖၪ အဂံၪ့ဒီၪ့လၧအအီၪ လၩ့ထးနီၪအဂးလီၫ.",
			"71": "<sup>71</sup> လၧစဂၧၡၧၫ့အဖိၪခွၫလဖၪနီၪ, ဆၧဖ့ၪလၫ့ဘၪဆဲၫ့ လၧစမနၭစ့ၫအလခီၫဒီၪ့အဂံၪ့ဒီၪ့နီၪ, လၧဂိလၫ့လၧ ဘၫၡၫ့အဖၧၩ့ဒဲဆၧအီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬနီၪ, ဒဲအၭ",
			"72": "<sup>72</sup> ၡတ့ၫရီၭဒဲဆၧအီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬနီၪး- ဒဲဘၪဆဲၫ့ လၧအံစခၫအဒီၪ့နီၪး က့ၭဒ့ၭဒဲဆၧအီၪဖီၩ့အနဲၩ့ထံၭ ဝၬဝၬနီၪ, ဒ့ၫဘရၭဒဲဆၧအီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬနီၪ,",
			"73": "<sup>73</sup> ဒဲရၫမီၭဒဲဆၧအီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬနီၪ, ဒဲအၫနံၫ့ဒဲ",
			"74": "<sup>74</sup> ဆၧအီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬနီၪး- ဒဲဘၪဆဲၫ့လၧစအၭ ၡၧၫအဒီၪ့နီၪ, မၫၡလၭဒဲဆၧအီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬ",
			"75": "<sup>75</sup> နီၪ,ဒဲအၭဘဒၫ့ဒဲဆၧအီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬနီၪ,- ဒဲ ဟၧၭကီၭဒဲဆၧအီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬနီၪ, ဒဲရံဟီၭဒဲ",
			"76": "<sup>76</sup> ဆၧအီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬနီၪး- ဒဲဘၪဆဲၫ့လၧစနၭၥ လဲၫအဒီၪ့နီၪး က့ၭဒ့ၭလၧဂၫလလံၫအဖၧၩ့ဒဲဆၧအီၪ ဖီၩ့အနဲၩ့ထံၭဝၬဝၬနီၪ, ဒဲဟၫမၫ့ဒဲဆၧအီၪဖီၩ့အနဲၩ့ ထံၭဝၬဝၬနီၪ, ဒဲကၧၫယၭၥ့အံၫ့ ဒဲဆၧအီၪဖီၩ့အနဲၩ့ ထံၭဝၬဝၬနီၪလီၫ.",
			"77": "<sup>77</sup> လၧစမရၫရဲၫအဖိၪ လၧအအီၪလၩ့ထးလဖၪနီၪ, ဆၧဖ့ၪလၫ့ဝ့ၫး ဘၪဆဲၫ့လၧဇ့ၭဘလၧၫ့အဒီၪ့နီၪ, ရံ မၧၫ့ဒဲဆၧအီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬနီၪ, တၫဘၧၫဒဲဆၧ",
			"78": "<sup>78</sup> အီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬနီၪး- ဒဲလၧယီၫဒၫ့ဝါလခီၫနီၪ, ဎၩ့လၧယ့ၫရခိၫလၧယီၫဒၫ့အမုထၪ့လခီၫတၭ, ဆၧဖ့ၪ လၫ့ဝ့ၫ,ဘၪဆဲၫ့လၧစရုဘံၫ့နီၪ, ဘံဇၧၫလၧမံၩ့လၬ ကျၩဒဲဆၧအီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬနီၪ, ဒဲယၫဇၫဆၧ",
			"79": "<sup>79</sup> အီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬနီၪ,- က့ဒမီၭဆ့ဒဲဆၧအီၪဖီၩ့ အနဲၩ့ထံၭဝၬဝၬနီၪ, မံၫဖၫအၭဒဲဆၧအီၪဖီၩ့အနဲၩ့ထံၭ",
			"80": "<sup>80</sup> ဝၬဝၬနီၪး- ဒဲဘၪဆဲၫ့လၧစဂၭအဒီၪ့နီၪး ရၫမီၭလၧဂံ လအၭအဖၧၩ့ဒဲဆၧအီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬနီၪ, မၫဟ",
			"81": "<sup>81</sup> နၫအံၫ့ဒဲဆၧအီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬနီၪ,- ဒဲဟ့ၭၡဘၫ့ ဒဲဆၧအီၪဖီၩ့အနဲၩ့ထံၭဝၬဝၬနီၪ, ယၫဇၧၫဒဲဆၧအီၪ ဖီၩ့အနဲၩ့ထံၭဝၬဝၬနီၪလီၫ."
		},
		"7": {
			"1": "<sup>1</sup> တၭစအံစခၫအဖိၪခွၫလဖၪနီၪ, မွဲစတိလၫ,ဒဲစဖု",
			"2": "<sup>2</sup> အၫ,စယၫၡၧၭ,ဒဲစၡံမရၧၫ့လံဂၩလီၫ.- တၭစတိလၫအ ဖိၪခွၫလဖၪနီၪ, မွဲစအၧၭဇဲၫ,ဒဲစရ့ၭဖအဲအၫ, စရဲၫအ့ လၭ,ဒဲစယၫမအဲၫ,ဒဲစယ့ၭဘစၫ့, ဒဲစၡံၫမုၫအ့လၭၥံၪ, လၧအမွဲအဝ့ၫၥံၪအဖါအဂံၪ့ခိၪၥံၪ, ဘၪဆဲၫ့လၧစတိ လၫနီၪလီၫ. အဝ့ၫၥံၪမွဲၦလၧအဂဲးဆီၪ့ ဘၭဆီၪ့အီၪ လၧအစီၩ့အမၩ့ လၧအဆိၩၥံၪအကျၩနီၪတၭး လၧစ ဒၫဝံၭအမုနံၩလဖၪနီၪ, အဝ့ၫၥံၪအဆၧဝံဆၧနၬ မွဲနံၫ",
			"3": "<sup>3</sup> လၬနံၫထီၫ့ဎူၫယၩလဖၪနီၪလီၫ.- တၭစအၧၭဇဲၫအဖိၪ ခွၫလဖၪနီၪ, မွဲစအံၭစံအဲအၫး ဒဲစအံၭစံအဲအၫအဖိၪ ခွၫလဖၪနီၪ, စမဲၫခအ့လၭ,ဒဲစအိၫဘဒဲအၫ, ဒဲစယိၫအ့ လၭ,ဒဲစအၡဲအၫ, ယဲဂၩနီၪလီၫ. အဝ့ၫၥံၪထီးအလူၬ မွဲၦၡၩအခိၪလီၫ.",
			"4": "<sup>4</sup> တၭအဝ့ၫၥံၪဘဲၫအဆိၩလဖၪအၥိၭ လၧအဘၪဆဲၫ့ အဖါၥံၪအဂံၪ့နီၪ, အီၪလၧၥုၭဖိၪအဒီၪ့လဖၪ လၧအ ဒုၭဆၧအဂး, ၦၥၧၫ့လၬဎူၫထီၫ့း အဂဲးဘဲၫယီၩအဝ့ၫ",
			"5": "<sup>5</sup> ၥံၪအမၫၥံၪ ဒဲအဖိၪခွၫၥံၪအီၪအၪဂၩလီၫ.- တၭအဝ့ၫ ၥံၪအထၧၫ့ဖုဝဲလဖၪ လၧစအံစခၫအဂံၪ့ဒီၪ့ၥံၪထီးအ လူၬအကျၩနီၪ, မွဲၦၡၩဂဲးဆီၪ့ဘၭဆီၪ့လၧအစီၩ့အမၩ့ တၭ,အ့ၪဝံထၪ့နၬထၪ့အဝ့ၫၥံၪ ထီးအလူၬဘဲၫအဆၧ လီၩဆိၩအဆရၫ့အၥိၭနီၪ, မွဲၦဎိၭလၬနွ့ၫထီၫ့လီၫ.",
			"6": "<sup>6</sup> တၭဆၧဘၪဆဲၫ့လၧစဘံၪ့ယမံၫ့နီၪ, မွဲစဘံလၫ,ဒဲ",
			"7": "<sup>7</sup> စဘံခၧၫ, ဒဲစယ့ၭဒအ့လၭ,ၥၧၫ့ဂၩနီၪလီၫ.- တၭစဘံ လၫအဖိၪခွၫၥံၪနီၪ, မွဲစအ့ဇဘၫ့,ဒဲစအၧၭဇဲၫ, ဒဲစအၧၭ ဇဲၫအ့လၭ,ဒဲစယ့ၫရမီၭ, ဒဲစအဲရဲၫ,ယဲဂၩး မွဲအဝ့ၫၥံၪ အဖါလဖၪအဂံၪ့ခိၪၥံၪ, ၦအဂဲးဆီၪ့ဘၭဆီၪ့အၥၭဒူၩ တၭး ဆၧဝံထၪ့နၬထၪ့ဘဲၫအလီၩဆိၩအဆရၫ့အၥိၭ",
			"8": "<sup>8</sup> နီၪ,နံၫလၬနံၫထီၫ့ ဒဲၥၧၫ့ဆံၫလံဂၩနီၪလီၫ.- တၭစဘံ ခၧၫအဖိၪခွၫၥံၪနီၪ, စဇံၫမဲရၫ,ဒဲစယိအၭ, ဒဲစအံၫလအ့ ဇၧၫ,ဒဲစအံၫလအံနအဲၫ ဒဲစအီမြဲၫ,ဒဲစယ့ၫရမီၭ, ဒဲစအ ဘဲၫအၫ,ဒဲစအၫ့နၥီၭ, ဒဲစအၫလမ့ၭလီၫ. အယီၩထီး",
			"9": "<sup>9</sup> အလူၬမွဲစဘံခၧၫအဖိၪခွၫၥံၪလီၫ.- အဝ့ၫၥံၪမွဲအဖါလ ဖၪအဂံၪ့ခိၪၥံၪ, ၦအဂဲးဆီၪ့ဘၭဆီၪ့အၥၭဒူၩတၭ, အ ဆၧဝံထၪ့နၬထၪ့ဘဲၫဆၧလီၩဆိၩအဆရၫ့အၥိၭနီၪ, မွဲ",
			"10": "<sup>10</sup> နံၫလၬဒဲနံၫယၩနီၪလီၫ.- တၭစယ့ၭဒၫအ့လၭအဖိၪခွၫ ၥံၪနီၪ,စဘံလဟၫ့း ဒဲစဘံလဟၫ့အဖိၪခွၫၥံၪနီၪ,စဇံ အၧၭ,ဒဲစဘံၪ့ယမံၫ့, ဒဲစအံဟၧၭ,ဒဲစခံၫန့အနၫ, ဒဲစဇံ",
			"11": "<sup>11</sup> ၥၫ့,ဒဲစၥၫၡံၭ, ဒဲစအဟံၭၡဟၧၫလီၫ.- အယီၩထီးအ လူၬမွဲစယ့ၭအ့လၭအဖိၪခွၫလဖၪနီၪ, အဝ့ၫၥံၪအဖါလ ဖၪအခိၪၥံၪ, ၦအဂဲးဆီၪ့ဘၭဆီၪ့အၥၭဒူၩ, လလၬနွ့ၫ ထီၫ့နံၫယၩနီၪ ၦလၧအလ့ၩထၪ့ဒုၭၥုၭလၧဆၧဒုၭလိၬ",
			"12": "<sup>12</sup> အဖၧၩ့နီၪၥ့ၪဆ့လီၫ.- စၡၧၭဖံၫ့ဆ့, ဒဲစဟၧၭဖံၫ့, မွဲစ အၧအဖိၪၥံၪ, ဒဲစအၫဟၧၫအဖိၪခွၫနီၪ, စဟုၡံၫ့လီၫ.",
			"13": "<sup>13</sup> တၭစနၭၥလဲၫအဖိၪခွၫၥံၪနီၪ, စယၫဇအ့လၭ,ဒဲစ ဂုနဲၫ,ဒဲစယ့ဇၧၫ, ဒဲစၡၫလၧၫ့,လၧအမွဲနးဘံလဟၫအ ဖိၪခွၫၥံၪလီၫ.",
			"14": "<sup>14</sup> တၭစမနၭစ့ၫအဖိၪခွၫၥံၪနီၪ, စအၭၡရဲၫအ့လၭလၧ ဆၧအီၪဖျဲၪန့အဂး (အၥံၪမၫၦအၫရၫ့ဖိၪနီၪ အီၪဖျဲၪ",
			"15": "<sup>15</sup> န့စဂံလအၭအဖါစမၫခၧၫနီၪတၭး- စမၫခၧၫနီၪန့အ မၫလၧစဟၧၭဖံၫ့ ဒဲစၡၧၭဖံၫ့အထၧၫ့ဖုဝဲမုၪ, လၧအဝ့ၫ ဒၪအထၧၫ့ဖုဝဲမုၪနီၪအမံၩ့မွဲနးမၫအခၫး) တၭနံၫဂၩ လဂၩမွဲဇံၫလိဖဟၭး တၭစဇံၫလိဖဟၭနီၪ အီၪလၧ",
			"16": "<sup>16</sup> အဖိၪမုၪၥံၪလီၫ.- တၭစမၫခၧၫအမၫ နးမၫအခၫနီၪအီၪ ဖျဲၪန့အဖိၪခွၫတၭ, ကိၭဝ့ၫအမံၩ့စပ့ရ့ၭတၭး အထၧၫ့ ဖုဝဲခွၫအမံၩ့မွဲစၡံရ့ၭတၭ, အဖိၪခွၫၥံၪနီၪမွဲစယုလၫ့ဒဲ",
			"17": "<sup>17</sup> စရဘံၫ့နီၪလီၫ.- တၭစယုလၫ့အဖိၪခွၫၥံၪ, စဘံဒၫ့လီၫ. စဂံလအၭ အဖိၪခွၫၥံၪမွဲအယီၩ, စမၫခၧၫ အဖိၪခွၫ,",
			"18": "<sup>18</sup> စမနၭစ့ၫ အဖိၪခွၫလီၫ.- တၭအထၧၫ့ဖုဝဲမုၪ နးဟၫ့မိ လက့ၭအီၪဖျဲၪန့စအဲၡီၭ, ဒဲစအၭဘအံဇၧၫ, ဒဲစမဟၫ",
			"19": "<sup>19</sup> လၫၥံၪလီၫ.- တၭစၡံမဲဒၫအဖိၪခွၫၥံၪနီၪမွဲစအဟဲအၫ့, ဒဲစၡံခံၫ့, ဒဲစလံကဟံၫ, ဒဲစအနဲအၭၥံၪလီၫ.",
			"20": "<sup>20</sup> တၭစအံဖြံၫ့အဖိၪခွၫၥံၪနီၪး စရှုၥလၫ,ဒဲအဖိၪခွၫစ ဘရ့ၭ,ဒဲအဖိၪခွၫစတၫဟၭ, ဒဲအဖိၪခွၫစအ့လဒၫ,ဒဲ",
			"21": "<sup>21</sup> အဖိၪခွၫစတၫဟၭ,- ဒဲအဖိၪခွၫစဇၫဘၭ, ဒဲအဖိၪခွၫ စရှုၥလၫ, ဒဲစအံဇၧၫ,ဒဲစအံလၭ, အဝ့ၫဒၪမွဲၦလၧထံၫ ဖိၪခးဖိၪၥံၪၦဂၭဖိၪလဖၪကျီၪ့ၥံၫခွံၬဝ့ၫ, အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪဂဲၫလၩ့ဘဲၫၥိၭအမိဖီၪ့ဆိၬခွံၬ ၦၡၩအဆၧဖိၪ",
			"22": "<sup>22</sup> ဆၧဎါၥံၪလီၫ.- တၭအဝ့ၫၥံၪအဖါစအံဖြံၫ့နီၪဘၪမီၪ့ ဘၪမၬအၪနံၩအၪၥၫ့ၥံၪ, ဒဲအထၧၫ့ဖုဝဲၥံၪဂဲၫဘဲၫၥိၭအ",
			"23": "<sup>23</sup> မိမၩမုၬထၪ့ဝ့ၫနီၪလီၫ.- ထီးအလ့ၩနုၬ လၧအမၫအ အီၪနီၪ,အဝ့ၫဒၪဒၧၩ့ထၪ့တၭ, အီၪဖျဲၪန့အဖိၪခွၫတၭ, ဖျိၬဝ့ၫအမံၩ့စဘံၫရ့အၫ, အဂဲးဘဲၫယီၩ ဆၧအၧၩ့ဘၪ",
			"24": "<sup>24</sup> အဂံၪ့ဖိၪၥံၪလီၫ.- (တၭအဖိၪမုၪမွဲနးၡံရၫ, လၧအမၩ ထၪ့ဘ့ၭၥဟိရံၫ့လၧလၬ, ဒဲလၧထၭဆ့,ဒဲအၧဇံၫ့ၡံရၫ)",
			"25": "<sup>25</sup> လီၫ.- တၭအဖိၪခွၫမွဲစရ့ဖၫ, ဒဲစရ့ၭၡံၫဖၫဆ့,ဒဲအဖိၪ",
			"26": "<sup>26</sup> ခွၫစတံလၫ, ဒဲအဖိၪခွၫစတၫဟၫ့,- ဒဲအဖိၪခွၫစလၫအ ဒၫ့,အဖိၪခွၫစအၫမဟၧၭ, အဖိၪခွၫစအံၫလံၭၡမၫး",
			"27": "<sup>27</sup> အဖိၪခွၫစနၫ့, အဖိၪခွၫစယီရှုၫအ့ၫၥံၪလီၫ.",
			"28": "<sup>28</sup> တၭအဝ့ၫၥံၪအဆၧန့ဘၪဒဲအီၪဝ့ၫအလးနီၪ, မွဲဘ့ၥ လၭဒဲအတဝၫ့ၥံၪ, ဒဲနၫအရၫ့လၧမုထၪ့လခီၫ,ဒဲဂံဇၧၫ လၧမုနုၬလခီၫ, ဒဲအတဝၫ့ၥံၪနီၪး ၡံခံၫ့ဆ့ဒဲတဝၫ့ၥံၪဘၪ ဆဲၫ့လၧအနီၪ, ထီၩ့လၧဂၫဇၫ ဒဲအတဝၫ့ဘၪဆဲၫ့လၧ",
			"29": "<sup>29</sup> အနီၪ,- ဒဲလၧမနၭစ့ၫအဖိၪအလံၩ အခးနဲၩ့ထံၭနီၪ, မွဲဘ့ၭၥၡံအၫ့ဒဲအတဝၫ့ၥံၪနီၪ, တၭတၫအနၭဒဲအတဝၫ့ ၥံၪနီၪ,မဂံၭဒိၫဒဲအတဝၫ့ၥံၪနီၪ, ဒီၫဒဲအတဝၫ့ၥံၪနီၪလီၫ. စအံၫစရ့လၭအဖိၪခွၫ စယိၥၭ အဖိၪအလံၩလဖၪအီၪ ဝ့ၫလၧဆၧယီၩလဖၪအဖၧၩ့လီၫ.",
			"30": "<sup>30</sup> စအၭၡၧၫအဖိၪခွၫၥံၪနီၪး စအံမနၫ,ဒဲစအံၫစုအၫ, ဒဲအံၫစုအဲၫ, ဒဲစဘံၫရဲအၫ,ဒဲအဝ့ၫၥံၪအထၧၫ့ဖုဝဲမုၪနး",
			"31": "<sup>31</sup> စံၫရၫလီၫ.- တၭစဘံၫရဲအၫအဖိၪခွၫၥံၪနီၪ, စဟံဘၧၫ, ဒဲစမၫလခံၫအ့လၭ, လၧအမွဲစဘၧၫဇၫဝံၭ အဖါနီၪ",
			"32": "<sup>32</sup> လီၫ.- တၭစဟံဘၧၫနီၪထၪ့ဖိၪစယၭဖျ့ၭ, ဒဲစၡိမၧၫ,ဒဲ",
			"33": "<sup>33</sup> စဟိၥၫ့,ဒဲအဝ့ၫၥံၪအထၧၫ့ဖုဝဲမုၪနးရှုအၫနီၪလီၫ.- တၭ စယၭဖျ့ၭအဖိၪခွၫၥံၪနီၪး စပၫစၭ,ဒဲစဘံၫမဟၫလၭ, ဒဲစအၭၡဝၭလီၫ. တၭစယၭဖျ့ၭအဖိၪအလံၩလဖၪမွဲ",
			"34": "<sup>34</sup> အနီၪလီၫ.- တၭစၡၫမၧၫအဖိၪခွၫၥံၪနီၪး စအၫဟဲၫ,ဒဲ",
			"35": "<sup>35</sup> စရိဂၫ,ဒဲစယဟၧၭဘၫ,ဒဲစအၫရၫ့လီၫ.- တၭအထၧၫ့ ဖုဝဲခွၫစဟံလံၫ့အဖိၪခွၫၥံၪနီၪး စဇိဖၫ, ဒဲစအံမနၫ,ဒဲ",
			"36": "<sup>36</sup> စၡံလ့ၭ,ဒဲစအၫမလၭၥံၪလီၫ.- စဇိဖၫအဖိၪခွၫၥံၪနီၪး စစုအၫ,ဒဲစဟၫနံဖၧၫ, ဒဲစရှုအလၭ,ဒဲစဘံရဲၫ, ဒဲစအံ",
			"37": "<sup>37</sup> မရၫ,- ဒဲစဘံဇၧၫ,ဒဲစဟီၭ, ဒဲစၡၫ့မၫ,ဒဲစၡံလၡၫ,ဒဲစ",
			"38": "<sup>38</sup> အံၥၫ့, ဒဲစဘံၫအံရၫလီၫ.- တၭစယ့ၥၧၫအဖိၪခွၫၥံၪ",
			"39": "<sup>39</sup> နီၪး စယဖၧၫနံၫ,ဒဲစပံစဖၫ, ဒဲစအၫရၫနီၪလီၫ.- တၭစ အၧလၫအဖိၪခွၫၥံၪနီၪး စအၫရၫ,ဒဲစဟၫနအ့လၭ,ဒဲစ ရဇဲအၫနီၪလီၫ.",
			"40": "<sup>40</sup> ၦထီးအလူၬလဖၪနီၪ မွဲစအၭၡၧၫအဖိၪအလံၩ,အ ဝ့ၫၥံၪအဖါအဂံၪ့အခိၪလဖၪ, ၦရွံန့ဖိၪ, ၦဂဲးဆီၪ့ဘၭ ဆီၪ့အၥၭဒူၩ, လၧၦဒိၪၥံၪအကျၩအခိၪလဖၪနီၪလီၫ. တၭၦဘၪဆဲၫ့ လၧဆၧလီၩဆိၩအဆရၫ့နီၪ, ၦလၧအ ဒုၭၥုၭၥ့ၪလၧဆၧဒုၭၥုၭအဖၧၩ့နီၪ, အဆၧဝံဆၧနၬ, မွဲ ၦၡၩနံၫလၬဎူၫထီၫ့လီၫ."
		},
		"8": {
			"1": "<sup>1</sup> တၭစဘံၪ့ယမံၫ့နီၪ ထၪ့ဖိၪအဖိၪဝဲၡါစဘံလၫ,နံၫ ဂၩလဂၩစအၭၡဘ့လၭ, ၥၧၫ့ဂၩလဂၩစအဟၫရၫ, လံဂၩလဂၩစနိဟၫ, ဒဲယဲဂၩလဂၩစရၫဖၫလီၫ.",
			"2": "<sup>2</sup> တၭ စဘံလၫအဖိၪခွၫၥံၪနီၪး မွဲစအၭဒၫ,ဒဲစဂံရၫ,ဒဲစအဘဲ",
			"4": "<sup>4</sup> ဟၧၭ,- ဒဲစအဘံၭရှုၫအ့ၫ, ဒဲစနၫအမၫ့,ဒဲစအဟိအၫ,",
			"5": "<sup>5</sup> ဒဲစဂံရၫ,ဒဲစၡဖုဖၫ့,ဒဲစဟုရၫ့ၥံၪလီၫ.- တၭစအံဟၧၭ",
			"6": "<sup>6</sup> အဖိၪခွၫလဖၪနီၪမွဲအယီၩး- ၦလဖၪယီၩမွဲၦဂံဘၫဖိၪ အဖါၥံၪအခိၪလဖၪတၭ, အဝ့ၫၥံၪၥုၭအလးထီးလၧမၪ့",
			"7": "<sup>7</sup> အဟၭး- ဒဲစနၫအမၫ့,ဒဲစအဟဲအၫ, ဒဲစဂံရၫၥံၪ,အဝ့ၫ ဒၪၥုၭခွံၬအဝ့ၫၥံၪအလးတၭ, ထၪ့ဖိၪစအၧၭဇၫ,ဒဲအဟဲ",
			"8": "<sup>8</sup> အၧၭၥံၪလီၫ.- တၭစၡၫဟရံၫ့ထၪ့ဖိၪလၧမိအၭအထံၫ အခးဖၧၩ့နီၪ, လၧအဒုၭစဲၪ့ခွံၬအဝ့ၫၥံၪအလးခဲၫ့တၭ,",
			"9": "<sup>9</sup> အမၫၥံၪမွဲနးဟုၡံၫ့ဒဲနးဘအၫရၫလီၫ.- တၭလၧအမၫ နးဟိဒ့ၭနီၪမွဲအထၪ့ဖိၪစယိဘၭ, ဒဲစဇံၭဘဲအၫ,ဒဲစမံ",
			"10": "<sup>10</sup> ၡၫ,ဒဲစမၫလခၫ့,- ဒဲစယံအၧၭ,ဒဲစၡၭခဲအၫ,ဒဲစမံၫရမၫ",
			"11": "<sup>11</sup> နီၪလီၫ. အနီၪမွဲအဖိၪခွၫၥံၪဖါလဖၪအခိၪၥံၪလီၫ.- ဒဲ လၧနးဟုၡံၫ့နီၪမွဲအထၪ့ဖိၪစအဟံၭတၧၭ, ဒဲစအ့ၫလ",
			"12": "<sup>12</sup> ပၫအ့လၭလီၫ.- စအ့ၫလပၫအ့လၭအဖိၪခွၫၥံၪး စအံ ဘၧၫ,ဒဲစမဲၡၫ့, ဒဲစၡၫမ့ၭ,လၧအမၩထၪ့အိနိၫ, ဒဲလီၭ အီၪလၧအတဝၫ့လဖၪနီၪဆ့လီၫ.",
			"13": "<sup>13</sup> စဘံၫရဲအၫဆ့, ဒဲစၡံမၫနီၪ, လၧအမွဲၦအၭဇ လၧၫ့ဖိၪလဖၪ အဖါၥံၪအခိၪနီၪ, လၧအနၫ့ထၪ့ခွံၬ",
			"14": "<sup>14</sup> ၦဂၫၥၭဖိၪလဖၪနီၪလီၫ.- တၭစအဟဲအိၫ, စၡၫၡၭ,",
			"15": "<sup>15</sup> ဒဲယ့ၫရမီၭ,- ဒဲစစၭဘဒဲအၫ, ဒဲစအၫရၭ, ဒဲစအၫ",
			"16": "<sup>16</sup> ဒၧၫ,- ဒဲစမဲၫခအ့လၭ, ဒဲစအံစပၫ, ဒဲစယိဟၫနီၪ, မွဲအဘံၫရဲအၫအဖိၪခွၫၥံၪလီၫ.",
			"17": "<sup>17</sup> တၭစဇ့ၭဘဒဲအၫ,ဒဲစၡၧလၫ့,ဒဲစဟ့ဇကဲၫ, ဒဲစ",
			"18": "<sup>18</sup> ဟံဘၧၫ, ဒဲစအံၭၡမံၫရ့ၫဆ့, ဒဲစယ့ၭဇလဲအၫ,ဒဲစယိ ဘၭၥံၪ, မွဲစအ့ၫလပၫအ့လၭအဖိၪခွၫလဖၪလီၫ.",
			"19": "<sup>19</sup> တၭစယၭကံၫ့, ဒဲစဇံၭခြဲၫ,ဒဲစဇၭဘဒဲၫ,- ဒဲစအံၫ",
			"21": "<sup>21</sup> လအံနအဲၫ,ဒဲစဇံလဝ့ၫ,ဒဲစအံလအ့လၭ,- ဒဲစအၭ ဒအဲအၫ,ဒဲစဘံၫရအဲအၫ, ဒဲစၡံမရၭနီၪ, မွဲစၡံမ",
			"22": "<sup>22</sup> ဟဲၫအဖိၪခွၫလဖၪနီၪလီၫ.- တၭစအံၭၡပၫ့,ဒဲစဟံ",
			"23": "<sup>23</sup> ဘၧၫ,ဒဲစအံၫလအ့လၭ,- ဒဲစအၭဘဒၫ့,ဒဲစဇံၭခြဲၫ,",
			"24": "<sup>24</sup> ဒဲစဟၫနၫ့,- ဒဲစဟၫ့အနဲအၫ, ဒဲစအံလၫ့စအၫ့",
			"25": "<sup>25</sup> တၥဲယၫ,-ဒဲစအံၭဖဒဲအၫ,စပနူၫအ့လၭ, စၡၫၡၭ",
			"26": "<sup>26</sup> အဖိၪခွၫၥံၪလီၫ.- ဒဲစၡၫ့ၡၫရ့အဲၫ,ဒဲစၡံၫဟရဲအၫ,",
			"27": "<sup>27</sup> ဒဲစအၭၥလဲအၫ,- ဒဲစယၫရစဲအၫ,ဒဲစအံၫလဲယၫ,",
			"28": "<sup>28</sup> ဒဲစဇ့ၭခြဲၫ,စယရိဟၫ့အဖိၪခွၫၥံၪလီၫ. ၦလဖၪနီၪမွဲၦ ဖါၥံၪအခိၪလဖၪတၭ, လၧအဆိၩဒၪဝ့ၫနီၪမွဲအကဲၪစ ခၩ့ၥံၪနီၪလီၫ. တၭအဝ့ၫၥံၪအီၪလၧယရုစလံၫ့အဖၧၩ့ နီၪလီၫ.",
			"29": "<sup>29</sup> တၭစဂံဘအၧၫ့အဖါနီၪ အီၪလၧဂံဘအၧၫ့အဖၧၩ့",
			"30": "<sup>30</sup> တၭး အမၫအမံၩ့မွဲနးမၫအခၫ,- ဒဲအဖိၪခွၫဝဲၡါနီၪမွဲ စအၭဘဒၫ့ဒဲစဇၧၫ,ဒဲစကံၭ, ဒဲစဘၫအလၭ,ဒဲစနၫဒၭ, ဒဲစဂံဒီၫ, ဒဲစအဟဲအိၫ, ဒဲစဇၫခၧၫလီၫ.",
			"31": "<sup>31</sup> တၭစ မံကျီၭထၪ့ဖိၪစၡံမအၫနီၪလီၫ. တၭၦလဖၪယီၩအီၪ လၧအထၧၫ့ဖုဝဲၥံၪအၥိၭလၧ ယရုစလံၫ့အဖၧၩ့ဆဲၫဎၩ့ လၧအဝ့ၫၥံၪလီၫ.",
			"33": "<sup>33</sup> တၭစနၧၫထၪ့ဖိၪစကံၭ, ဒဲစကံၭနီၪ ထၪ့ဖိၪ စစီလူၫ,ဒဲစစီလူၫနီၪ ထၪ့ဖိၪစစၪ့နၥၧၫ့, ဒဲစမၫလ",
			"34": "<sup>34</sup> ခရှုအၫ,ဒဲစအဘံနဒၭ,ဒဲစအ့ၭၡဘၪလၭနီၪလီၫ.- တၭ စစၪ့နၥၧၫ့အဖိၪခွၫနီၪ, မွဲစမ့ၫရဘၫအလၭတၭ, စမ့ၫရ",
			"35": "<sup>35</sup> ဘၫအလၭနီၪထၪ့ဖိၪစမဲခၫလီၫ.- တၭစမဲခၫအဖိၪခွၫ လဖၪနီၪ, စပဲၥၫ့,ဒဲစမံလ့ၭ, ဒဲစတၪရံၫအၫ,ဒဲစအၫဟ",
			"36": "<sup>36</sup> ဇၭလီၫ.- တၭစအၫဟဇၭနီၪ ထၪ့ဖိၪစယဟိအဒၫ့ တၭ,စယဟိအဒၫ့နီၪထၪ့ဖိၪစအၫလမ့ၭ, ဒဲစအၭဇမၫ",
			"37": "<sup>37</sup> ဝ့ၭ,ဒဲစဇံမရဲၫး- တၭစဇံမရဲၫနီၪထၪ့ဖိၪစမိဇၫ, ဒဲစမိ ဇၫနီၪထၪ့ဖိၪစဘံနအၫး စရၫဖၫမွဲအဖိၪခွၫ, အဖိၪခွၫ",
			"38": "<sup>38</sup> စအ့ၫလအ့စၫ, အဖိၪခွၫစအၫဇလၭဆ့တၭး- စအၫဇ လၭနီၪအီၪ လၧအဖိၪခွၫၥံၪဎူၫဂၩ, လၧအမံၩ့အီၪဝ့ၫ ဘဲၫယီၩး စအၭစကၫ့, ဒဲစဘီၭအံၫရုၫ, ဒဲစအံၡမ့ၫအ့ လၭ, ဒဲစၡံၫအရဲအၫ, ဒဲစအိၫဘဒဲအၫ, ဒဲစဟၫနၫ့ၥံၪ လီၫ. ၦလဖၪနီၪထီးအလူၬ မွဲစအၫဇလၭအဖိၪခွၫၥံၪ",
			"39": "<sup>39</sup> လီၫ.- ဒဲအထၧၫ့ဖုဝဲစအံၡ့ၭနီၪ, အဖိၪခွၫၥံၪမွဲအဖိၪဝဲ ၡါစယုလၫ့, နံၫဂၩလဂၩစဇံဟၧၭ, ဒဲၥၧၫ့ဂၩလဂၩစ",
			"40": "<sup>40</sup> အံၫလံၭဖလ့ၭလီၫ.- တၭစယုလၫ့, အဖိၪခွၫလဖၪမွဲၦ ဂဲးဆီၪ့ဘၭဆီၪ့ၥၭဒူၩ, ခၭချံၪၥ့ၪ, ဒဲအဖိၪခွၫအီၪအၪ ဂၩး ဒဲအဖိၪခွၫအဖိၪခွၫၥံၪ အီၪလယၩယဲဆံၫလီၫ. ၦ လဖၪနီၪ ထီးအလူၬ မွဲစဘံၪ့ယမံၫ့ အဖိၪခွၫလဖၪနီၪ လီၫ."
		},
		"9": {
			"1": "<sup>1</sup> ဘဲၫနီၪၥိၭအံၫစရ့လၭထီးအလူၬ ဘၪဆၧဝံထၪ့နၬ ထၪ့ဝ့ၫလၧဆၧလီၩဆိၩအဆရၫ့နီၪတၭး ယိခွါ, အဝ့ၫ ၥံၪကွ့ၭအၥၭလၧအံၫစရ့လၭ ဒဲယုဒၫအစဎွၩၥံၪအလံၬ ဖၧၩ့တၭ, လၧအဝ့ၫၥံၪအဆၧမၪအကၠီၩ့နီၪ, မွဲအဘၪ ဆၧဆိၬခွံၬဝ့ၫထီၩ့လၧ ဘၭဘလၧၫ့အဖၧၩ့နီၪလီၫ.",
			"2": "<sup>2</sup> တၭၦၡၩၥံၪ လၧအအီၪဆိၫ လၧအဆၧန့ၥၫလဖၪ လၧအဒိၩ့ၥံၪအဖၧၩ့နီၪ မွဲၦအံၫစရ့လၭဖိၪ, ၦလုဆၧ လဖၪ,ၦလံဝဲၫဖိၪလဖၪ, ဒဲၦန့ၭၥနံဖိၪလဖၪနီၪလီၫ.",
			"3": "<sup>3</sup> တၭစယုဒၫအဖိၪအလံၩ အီၪလၧယရုစလံၫ့အဖၧၩ့း ဒဲစဘံၪ့ယမံၫ့အဖိၪအလံၩဆ့, ဒဲစအံဖံၫ့ဒဲစမနၭစ့ၫအ ဖိၪအလံၩလဖၪဆ့လီၫ.",
			"4": "<sup>4</sup> စယုၥအဲၫ မွဲစအၫမဟၧၭအဖိၪခွၫ, စအီမြဲၫအဖိၪ ခွၫ,စအံမရဲၫအဖိၪခွၫ, စဘၫ့အဲၫအဖိၪခွၫဘၪဆဲၫ့လၧ စဖၫရ့ၭအဖိၪၥံၪနီၪ, လၧအမွဲစယုဒၫအဖိၪခွၫနီၪလီၫ.",
			"5": "<sup>5</sup> တၭၦဘၪဆဲၫ့လၧၦၡလိနဲၫဖိၪၥံၪး အဖိၪဝဲၡါစအၭစဲ",
			"6": "<sup>6</sup> အၫ,ဒဲအဝ့ၫဒၪအဖိၪခွၫလဖၪလီၫ.- တၭစဇံရၫအဖိၪ ခွၫၥံၪး စလံယုၫအ့လၭ, ဒဲအဝ့ၫၥံၪအထၧၫ့ဖုဝဲလဖၪဎူၫ ယၩခွံၫဆံၫလီၫ.",
			"7": "<sup>7</sup> တၭစဘံၪ့ယမံၫ့အဖိၪခွၫလဖၪနီၪး စမၡၧလၫ့အ ဖိၪခွၫစစၫလုၫ, စဟီၭဒဝဲအၫအဖိၪခွၫ, စဟၭစနုအၫအ ဖိၪခွၫ,ဒဲစအံၫဘနဲအၫလၧ အမွဲစယရိဟၫ့အဖိၪခွၫ,",
			"8": "<sup>8</sup> ဒဲစအံၫလၫလၧအမွဲစအၧၭဇဲၫအဖိၪခွၫ, စမံၭခြဲၫအဖိၪ ခွၫ,ဒဲစမၡၧလၫ့လၧအမွဲစၡ့ၭဖတဲအၫအဖိၪခွၫ, စရုၫ",
			"9": "<sup>9</sup> အံလၭအဖိၪခွၫ,စအံၭဘနဲယၫအဖိၪခွၫး- အဝ့ၫၥံၪအ ထၧၫ့ဖုဝဲလဖၪ ဘဲၫဆၧလီၩဆိၩအဆရၫ့အၥိၭခွံၫယၩ ယဲဆံၫဎူၫဂၩလီၫ. ၦထီးအလူၬလဖၪနီၪ မွဲဖါၥံၪအခိၪ လဖၪလၧအဝ့ၫၥံၪအဖါလဖၪအဂံၪ့ဖၧၩ့နီၪလီၫ.",
			"10": "<sup>10</sup> တၭၦဘၪဆဲၫ့လၧၦလုဆၧလဖၪနီၪး မွဲစဒ့ယၫ,ဒဲ",
			"11": "<sup>11</sup> စယဟီအရံၭ,ဒဲစယၫခံၫ့,- ဒဲစအၭဇရဲအၫလၧအမွဲ စဟံၫလကဲအၫအဖိၪခွၫ, စမၡၧလၫ့အဖိၪခွၫ, စဇၫဒီၭ အဖိၪခွၫ,စမရၫယီၭအဖိၪခွၫ, စအဟံၭတၧၫအဖိၪခွၫ",
			"12": "<sup>12</sup> တၭ,အဝ့ၫဒၪပၧၩ့ယွၩအဂံၪ့နီၪလီၫ.- ဒဲစအၭဒအဲအၫ, စယရိဟၫ့အဖိၪခွၫ, စပၭၡၧၫအဖိၪခွၫ, စမၫလခဲယၫ အဖိၪခွၫ, ဒဲစမၫလစဲအၫ, စအဒဲၫအ့လၭအဖိၪခွၫ,စ ယါဇရၫ, စမၡၧလၫ့အဖိၪခွၫ, စမၡံလမံၭအဖိၪခွၫ, စအံမၧၫအဖိၪခွၫနီၪလီၫ.",
			"13": "<sup>13</sup> ဒဲအဝ့ၫၥံၪအထၧၫ့ဖုဝဲလဖၪ, လၧအမွဲအဝ့ၫၥံၪ အဖါလဖၪအဂံၪ့အခိၪၥံၪ, မွဲလထီၫ့နွ့ၫယၩဎူၫဆံၫဂၩး ၦအဂဲးဆီၪ့ဘၭဆီၪ့ၥၭဒူၩ လၧဆၧဖံၭဆၧမၩအဂး ဘၪဆဲၫ့လၧယွၩအဂံၪ့နီၪလီၫ.",
			"14": "<sup>14</sup> တၭၦဘၪဆဲၫ့လၧၦလံဝဲၫဖိၪလဖၪနီၪး စၡ့ၫမအဲ အၫ, စဟၭၡၧၭအဖိၪခွၫ, လၧအမွဲစအၭစကၫ့အဖိၪခွၫ, စဟၭၡဘဲအၫအဖိၪခွၫနီၪ, စမရၫရဲၫ အဖိၪခွၫလဖၪ",
			"15": "<sup>15</sup> တၭ,- စဘၭဘၭကၧၫ, စဟံရ့ၭ, ဒဲစဂၫလလၭ,ဒဲစမၫ တၫနဲအၫစမဲခၫအဖိၪခွၫ, စဇံၭခြဲၫအဖိၪခွၫ, စအၫစၭ",
			"16": "<sup>16</sup> အဖိၪခွၫနီၪး- ဒဲစအိၫဘဒဲအၫလၧအမွဲစၡံမအဲအၫအ ဖိၪခွၫ, စဂၫလလၭအဖိၪခွၫ, စယ့ၭဒုၫၥၫအဖိၪခွၫ, ဒဲ စဘ့ၫရခဲအၫလၧအမွဲစအၫစၫအဖိၪခွၫ, စအ့လကၫနၫ အဖိၪခွၫတၭ, အဝ့ၫဒၪအီၪ လၧၦနတီၭဖၥဲၭဖိၪၥံၪအ တဝၫ့လဖၪအဖၧၩ့လီၫ.",
			"17": "<sup>17</sup> ၦလၧအပၧၩ့တရၫ့ၥံၪနီၪ, စၡၫလၧၫ့, ဒဲစအၭကၧၭ, ဒဲစတၫလမၧၫ့, ဒဲစအဟဲမၫ့,ဒဲအဝ့ၫၥံၪအထၧၫ့ဖုဝဲလ",
			"18": "<sup>18</sup> ဖၪလီၫ. စၡၫလၧၫ့နီၪမွဲအခိၪတၭ,- အဝ့ၫဒၪပၧၩ့စဎွၩ အတရၫ့လၧမုထၪ့လခီၫနီၪခီးဘိၩ့နဲၪ့ယီၩလီၫ. အဝ့ၫ ၥံၪမွဲၦပၧၩ့တရၫ့ လၧၦလံဝဲၫအဖိၪအလံၩအဒီၪ့လဖၪ",
			"19": "<sup>19</sup> အကျၩနီၪလီၫ.- တၭစၡၫလၧၫ့နီၪ မွဲစကိရံၫအဖိၪခွၫ, စအဘဲအစၭအဖိၪခွၫ, စကိရၫအဖိၪခွၫ, ဒဲအဝ့ၫဒၪအ ထၧၫ့ဖုဝဲၥံၪ, ၦဘၪဆဲၫ့လၧအဖါအဂံၪ့နီၪ, ၦကိရၫဖိၪ လဖၪ, လၧအပၧၩ့ဆၧမၩလဖၪတၭ, ခိၭတရၫ့ၥံၪဘၪ ဆဲၫ့လၧတဲၩဆံၫ့ဎံၪနီၪဆ့လီၫ. တၭအဝ့ၫၥံၪအဖါလ ဖၪနီၪပၧၩ့ယဟိဝၩအၡၩခမျၧးၥံၪနီၪ, မွဲအခိၭဆၧလ့ၩ",
			"20": "<sup>20</sup> နုၬအလးလီၫ.- တၭစဖံနအၭလၧအမွဲစအံၫလအ့ဇၫ အဖိၪခွၫနီၪ မွဲၦပၧၩ့ဆၧလၧအဝ့ၫၥံၪအဖၫ့ခိၪ ဘဲၫလၧ",
			"21": "<sup>21</sup> အၥၫ့အၥိၭတၭ, ယဟိဝၩအီၪလၧအၥိၭဆ့လီၫ.- စမၡ့ လမဲအၫအဖိၪခွၫ, စဇ့ၭခရဲအၫနီၪပၧၩ့ဆၧအီၪကီၪ့အ",
			"22": "<sup>22</sup> တဲၩအတရၫ့နီၪလီၫ.- ၦထီးအလူၬလဖၪနီၪလၧဆၧရွံ န့ဝ့ၫဘဲၫၥိၭအမိပၧၩ့တရၫ့လဖၪ, မွဲၦနံၫယၩလဆံၫနံၫ ဂၩလီၫ. အဝ့ၫၥံၪဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫဘဲၫဆၧလီၩ ဆိၩအဆရၫ့အၥိၭ လၧအဝ့ၫၥံၪအတဝၫ့လဖၪအဖၧၩ့ နီၪး ၦလၧစဒၫဝံၭ ဒဲစစၫမုၫအ့လၭ, မီၪလဂၩနီၪ,အီၪ",
			"23": "<sup>23</sup> က့ၪဝဲၩအဝ့ၫၥံၪအလးလၧအမၩဆၧနီၪလီၫ.- ဘဲၫနီၪ ၥိၭအဝ့ၫၥံၪဒဲအဖိၪအလံၩလဖၪနီၪ ပၧၩ့ယဟိဝၩအဂံၪ့ အတရၫ့လဖၪနီၪ, မွဲတဲၩဆံၫ့ဎံၪအဂံၪ့နီၪ, ဘဲၫၦအၪ့",
			"24": "<sup>24</sup> နၩ့ဖၭဝ့ၫလဆၫ့လဆၫ့အၥိၭနီၪလီၫ.- ၦပၧၩ့တရၫ့ၥံၪ အီၪဝ့ၫလံစီၪ့နီၪ, လၧမုထၪ့,မုနုၬ,မုဖၩ, မုခံၫ့နီၪလီၫ.",
			"25": "<sup>25</sup> တၭအဝ့ၫၥံၪအထၧၫ့ဖုဝဲလဖၪ, လၧအအီၪလၧတဝၫ့ ၥံၪအဖၧၩ့နီၪ, ဘၪဂဲၫအၪ့လဲၩအလးလၧအဝ့ၫၥံၪနီၪ,",
			"26": "<sup>26</sup> နွ့ၫၥၫ့လဘျၩ့နွ့ၫၥၫ့လဘျၩ့နီၪလီၫ.- အဂဲးဘဲၫယီၩၦ လံဝဲၫဖိၪလဖၪယီၩ, ၦပၧၩ့တရၫ့အခိၪလံဂၩနီၪ, အီၪ လၧဆၧအီၪက့ၪအဝ့ၫၥံၪအလးတၭ, မွဲအအီၪလၧဒူၭ ၥံၪ,ဒဲယွၩအဂံၪ့အအီၪက့ၪကီၪ့ဆၧ အလးအဖၫ့ခိၪနီၪ",
			"27": "<sup>27</sup> လီၫ.- တၭအဝ့ၫၥံၪမံၫအီၪဖီၩ့ယွၩအဂံၪ့ဝၬဝၬနီၪး အ ဂဲးဘဲၫယီၩ ဆၧအီၪဝ့ၫလၧအဝ့ၫၥံၪအစူၪဖၧၩ့တၭ, မွဲ အဝ့ၫၥံၪဘၪဝဲထၪ့လၧဂီၩလခီၫ ကိၭဖၧၫ့ဒ့ၭဆ့လီၫ.",
			"28": "<sup>28</sup> တၭၦဘၪဆဲၫ့လၧအဝ့ၫၥံၪလနၩ့နၩ့နီၪ ဘၪယိထဲၩ့ခွါ ထဲၩ့ၦမၩဆၧအဎၧၩ့အဎီၥံၪ, ဘဲၫၥိၭအမိဂဲၫဆိၬနုၬဒဲ",
			"29": "<sup>29</sup> ၥိၫ့ထၪ့ခွံၬဘဲၫအဆၧဝံအီၪဝ့ၫအၥိၭနီၪလီၫ.- ၦလနၩ့ နၩ့ဘၪဆၧအီၪက့ၪဝ့ၫ ဘဲၫၥိၭအမိယိထဲၩ့ခွါထဲၩ့ထွ့ၫ ၥံၪ,ဒဲကယဲဆၧအဎၧၩ့အဎီ ဘၪဆဲၫ့လၧလးဆံၫ့ဎံၪနီၪ, ဒဲကိၪမုၬအဂ့ၩ, ဒဲစဘံၭထံၫ, ဒဲၥိၪ,ဒဲလီၪဘၩ့,ဒဲဆၧနၧၫ့",
			"30": "<sup>30</sup> မၧၫ့လဖၪနီၪလီၫ.- တၭၦလုဆၧအဖိၪခွၫၥံၪ လနၩ့နၩ့ မၩၥိၪဂုၪဆၧလမံၩ့မံၩ့ လၧဆၧနၧၫ့မၧၫ့လဖၪနီၪလီၫ.",
			"31": "<sup>31</sup> တၭစမၭတၥဲအၫ, ဘၪဆဲၫ့လၧၦလံဝဲၫဖိၪၥံၪ မွဲၦကိရၫ ဖိၪစၡၫလၧၫ့အဖိၪဝဲၡါတၭ, အဝ့ၫဒၪအီၪလၧအလး ပၧၩ့ဆၧလၧၦမၩဝ့ၫ လၧဆၧပၪပဲၪလဖၪ အဖၧၩ့နီၪ",
			"32": "<sup>32</sup> လီၫ.- အဝ့ၫၥံၪအထၧၫ့ဖုဝဲၥံၪ, ဘၪဆဲၫ့လၧၦကိရၫဖိၪ လဖၪ, ပၧၩ့ဆၧမ့ၬယၫအကိၪနီၪ, ဘဲၫၥိၭအမိတဲၩ့ဝဲၩ",
			"33": "<sup>33</sup> ဝ့ၫလၧမးၥံၫအနံၩကိၭဖၧၫ့ဒ့ၭလီၫ.- အယီၩလဖၪမွဲၦ ၥံၫကျံၩဆၧတၭ, လၧၦလံဝဲၫဖိၪၥံၪအဖါလဖၪအကျၩ နီၪ,မွဲၦအခိၪၥံၪတၭး အီၪပျီၩဖျ့ၭလၧဒူၭလဖၪအဖၧၩ့ လီၫ.အဂဲးဘဲၫယီၩမွဲအဘၪမၩဆၧဖံၭဆၧမၩနီၪ မု",
			"34": "<sup>34</sup> ဆၫဆၫမုနၩနၩဆ့လီၫ.- ၦလံဝဲၫဖိၪအဖါၥံၪ အခိၪလ ဖၪယီၩ, မွဲၦအခိၪၥံၪ လထံၪဎးလၧအဆိၩလဖၪအ ကျၩး ၦလဖၪယီၩအီၪဝ့ၫ လၧယရုစလံၫ့အဖၧၩ့နီၪ လီၫ.",
			"35": "<sup>35</sup> တၭစဂံဘအၧၫ့အဖါနီၪ အီၪလၧဂံဘအၧၫ့အဖၧၩ့,",
			"36": "<sup>36</sup> စယဟဲအ့လၭနီၪ,အမၫအမံၩ့မွဲနးမၫအခၫတၭး- အဖိၪ ခွၫဝဲၡါမွဲစအၭဘဒၫ့, ထီးနီၪလဖၧၫ့စဇၧၫ,ဒဲစကံၭ,ဒဲစ ဘၫအလၭ,ဒဲစနၧၫ, ဒဲစနၫဒၭ,ဒဲစဂံဒီၫ, ဒဲစအဟဲအီၫ,",
			"37": "<sup>37</sup> ဒဲစဇ့ၭခရဲအၫ,ဒဲစမံကျီၭလီၫ. တၭစမံကျီၭနီၪထၪ့ဖိၪ စၡံမအၫ့လီၫ. တၭအဝ့ၫၥံၪအီၪဆ့လၧအထၧၫ့ဖုဝဲအ ၥိၭလၧယရုစလံၫ့အဖၧၩ့ဆဲၫဎၩ့လၧ အထၧၫ့ဖုဝဲၥံၪနီၪ",
			"38": "<sup>38</sup> လီၫ.- တၭစနၧၫထၪ့ဖိၪစကံၭတၭ, စကံၭနီၪထၪ့ဖိၪစစီ လူၫတၭး စစီလူၫနီၪထၪ့ဖိၪစစၪ့နၥၧၫ့, ဒဲစမၫလခရှု",
			"39": "<sup>39</sup> အၫ,ဒဲစအဘံနဒၭ,ဒဲစအံၭၡဘၫအလၭၥံၪလီၫ.- တၭ စစၪ့နၥၧၫ့အဖိၪခွၫနီၪ, မွဲစမ့ၫရဘၫအလၭတၭး စမ့ၫရ",
			"40": "<sup>40</sup> ဘၫအလၭနီၪ, ထၪ့ဖိၪစမဲခၫလီၫ.- တၭစမဲခၫအဖိၪခွၫ",
			"41": "<sup>41</sup> လဖၪနီၪ,စပဲၥၫ့, ဒဲစမံလ့ၭ,ဒဲစတၫရံၫအၫ,ဒဲစအၫဟ",
			"42": "<sup>42</sup> ဇၭၥံၪလီၫ.- တၭစအၫဟဇၭနီၪ,ထၪ့ဖိၪစယၫရၫတၭ, စယၫရၫနီၪထၪ့ဖိၪစအၫလမ့ၭ, ဒဲစအၭဇမၫဝ့ၭ,ဒဲစဇံ",
			"43": "<sup>43</sup> မရဲၫတၭး စဇံမရဲၫနီၪထၪ့ဖိၪစမိဇၫး- တၭစမိဇၫနီၪ ထၪ့ဖိၪစဘံနအၫတၭး စရ့ၭဖဲအၫမွဲအဖိၪခွၫ, အဖိၪခွၫ",
			"44": "<sup>44</sup> စအံၫလအ့ဇၫ, အဖိၪခွၫစအၫဇလၭနီၪဆ့လီၫ.- တၭ စအၫဇလၭနီၪ အဖိၪခွၫၥံၪအီၪဎူၫဂၩ, လၧအမံၩ့အီၪ ဝ့ၫဘဲၫယီၩ, စအၭစကၫ့, စဘီၭအံၫရုၫ, ဒဲစအံၭၡမၫ အ့လၭ,ဒဲစၡံၫအရဲအၫ, ဒဲစအိၫဘဒဲအၫ, ဒဲစဟၫနၫ့ၥံၪ လီၫ. ၦလဖၪနီၪမွဲစအၫဇလၭအဖိၪခွၫၥံၪလီၫ."
		},
		"10": {
			"1": "<sup>1</sup> တၭၦဖလံၡၫဖိၪလဖၪ ဒုၭၥုၭထၫ့ဒုၪဒၩအံၫစရ့လၭ နီၪး ၦၡၩအံၫစရ့လၭဖိၪၥံၪ စဲၪ့ဖျိၭခွံၬလၧၦဖလံၡၫဖိၪ ၥံၪအမ့ၬယၫတၭ, ဘၪဆၧကျီၪ့ခွံၬဝ့ၫနီၪလၩ့ထံၩဖါဝ့ၫ",
			"2": "<sup>2</sup> လၧခိၪလီၩ့ဂံၫလဘိအၫအဖၧၩ့လီၫ.- တၭၦဖလံၡၫဖိၪ ၥံၪလီၩ့ဆီးစစီလူၫဒဲအဖိၪခွၫလဖၪနီၪး တၭၦဖလံၡၫ ဖိၪၥံၪကျီၪ့ၥံၫခွံၬစစၪ့နၥၧၫ့, ဒဲစအဘံနဒၭ,ဒဲစမၫလခရှု",
			"3": "<sup>3</sup> အၫ,စစီလူၫအဖိၪခွၫၥံၪလီၫ.- တၭဆၧဒုၭၥုၭနီၪထၫ့ ဒုၪဒၩစစီလူၫနၭနၭလ့ၬတၭး ၦခၭချံၪလဖၪ ခၭဘၪအ ဝ့ၫတၭ, မွဲအဘၪထံၭဆၫလၧၦခၭချံၪလဖၪနီၪလီၫ.",
			"4": "<sup>4</sup> ထီးနီၪလဖၧၫ့ စစီလူၫစံၭ ၦလၧအဆိၬ အစူၪဝဲၩလဂၩ နီၪ,ထုၭထၪ့နနၭတၭ ဆ့ၭဖျီၫ့ယၧၩဘီၪ ၦလၧအလ ဘၪဘၪဆၧကူၭတရံၭလဖၪယီၩ မိဂဲၫမၩအၧၩ့မၩနၭ ဘၪခိၬယၧၩလီၫ. အ့ၪမွဲၦဆိၬအစူၪဝဲၩလဂၩနီၪမၩဝ့ၫ အ့ၬ,အဂဲးဘဲၫယီၩ ၥၭမဲၪဆၧဒိၪမၬလီၫ. အခိးမွဲစစီ လူၫမၩန့နၭလဘံၪ့တၭ, ထိၪလၩ့ထံၩဖါအၥၭ လၧအ",
			"5": "<sup>5</sup> လီၩ့လီၫ.- ထီးၦဆိၬအစူၪဝဲၩလဂၩဒၪဘၪလၧစစီလူၫ ၥံၫဝ့ၫတၭ, ထိၪလၩ့ထံၫဖါအၥၭ လၧနၭအလီၩ့ဘဲၫနီၪ",
			"6": "<sup>6</sup> ၥိၭဆ့တၭ,ၥံၫဝ့ၫဒၪလီၫ.- အခိးမွဲစစီလူၫၥံၫဝ့ၫ ဒဲအဖိၪ ခွၫၥၧၫ့ဂၩလဖၪတၭ, အဂံၪ့ဖိၪထီးအလူၬၥံၫဝ့ၫလစီၪ့",
			"7": "<sup>7</sup> ဎးလီၫ.- ထီးၦၡၩအံၫစရ့လၭဖိၪၥံၪထီးအလူၬလၧအ အီၪလၧခိၪလီၩ့ဆူၭဖၧၩ့နီၪ ဒၪဘၪလၧအဝ့ၫၥံၪစဲၪ့ဖျိၭ, ဒဲစစီလူၫ ဒဲအဖိၪခွၫလဖၪၥံၫဝ့ၫနီၪတၭ, ထီးနီၪလဖၧၫ့ အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬလၧအဒိၩ့လဖၪစဲၪ့ဖျိၭဆ့တၭး ၦဖ လံၡၫဖိၪလဖၪဂဲၫအီၪဝ့ၫလၧအဖၧၩ့နီၪလီၫ.",
			"8": "<sup>8</sup> ကဲဂီၩခိၬနီၪ ထီးၦဖလံၡၫဖိၪၥံၪဂဲၫအၪ့မၩန့ဆၧလၧ အအီၪဝ့ၫလၧၦၥံၫလဖၪအလီၩ့နီၪတၭ ဆၧမၩအၥၭ လၧအဝ့ၫၥံၪဒၪဘၪ လၧစစီလူၫဒဲအဖိၪခွၫလဖၪ လၩ့",
			"9": "<sup>9</sup> ထံၩဖါဝ့ၫလၧခိၪလီၩ့ဂံၫလဘိအၫအလီၩ့နီၪလီၫ.- ထီး အဝ့ၫၥံၪဘဲၪ့လၩ့ခွံၬအဝ့ၫဒၪအဆၧတၭ, မွဲအမၩန့အ ခိၪဎွံၪနီၪ,ဒဲအစူၪဝဲၩလဖၪနီၪတၭ, အၪ့မၧၫ့ဆၧလၧၦ ဖလံၡၫဖိၪအခးဝၬဝၬနီၪ, ဘဲၫၥိၭအမိဆိၬ ဆၧပရၧၫ့ ထီၩ့လၧအဝ့ၫၥံၪအဆၧဂၩ့ဆၧဖၪ့အအီၪ, ဒဲလၧၦခမျၧး",
			"10": "<sup>10</sup> လဖၪဆ့လီၫ.- အဝ့ၫၥံၪအီၪက့ၪအဝ့ၫဒၪအစူၪဝဲၩနီၪ လၧအဝ့ၫၥံၪအယွၩလဖၪအဂံၪ့ဖၧၩ့တၭ, မၩထၬအဝ့ၫ ဒၪအခိၪဎွံၪလၧဒၫဂၫ့အဆၧလုအဂံၪ့ဖၧၩ့နီၪလီၫ.",
			"11": "<sup>11</sup> ထီးၦယ့ဘ့ၭဂံလအၭၥံၪထီးအလူၬ နါဂၧၫ့ကယဲဆၧ လမံၩ့လါလါ လၧၦဖလံၡၫဖိၪၥံၪမၩယူၭလၧစစီလူၫ",
			"12": "<sup>12</sup> နီၪတၭ,- အဝ့ၫၥံၪဂဲထုၪ့တၭ, ကယဲၦဆီၪ့ၥံၪထီးအ လူၬနီၪ,မၩန့ခွံၬစစီလူၫအမိၡါ, ဒဲအဖိၪခွၫလဖၪအမိ ၡါနီၪ, ဂဲၫထဲၩ့ဆိၬအဝ့ၫၥံၪ ထီၩ့လၧယၫဘ့ၭနီၪ, ခုၪ့ လၩ့ဘၧၩ့ခွံၬအဎွံၪလဖၪ လၧၥံၪ့ထိၭဖၫအဖၫ့လၬလၧ ယၫဘ့ၭအဖၧၩ့ဒဲဒုၪဆၧအၪ့ဆၧအီၩနွ့ၫနံၩလီၫ.",
			"13": "<sup>13</sup> အခိးမွဲစစီလူၫၥံၫလၧအမၩမၪဆၧအကၠီၩ့ လၧအ မၪဘၪယဟိဝၩနီၪ, လၧအထၫ့ဒုၪဒၩယဟိဝၩအလူ, လထီးန့ဘၪဝ့ၫ, ဒဲလၧအအၪ့စၪ့ဆၧလၧၦလၧဆၧနၪ အီၪလၧအလီၩ့, ဘဲၫၥိၭအမိၥ့ၪယၫဆၧအကၠီၩ့နီၪး",
			"14": "<sup>14</sup> လအၪ့စၪ့ဘၪလၧယဟိဝၩး အခိးမွဲဘဲၫနီၪတၭ,အဝ့ၫ ဒၪကျီၪ့ၥံၫခွံၬအဝ့ၫ, ဒဲဖ့ၪလၫ့ထဲၩ့အဘၩ့အမုးနီၪလၧ စယ့ၭစံၫအဖိၪခွၫ စဒၫဝံၭနီၪလီၫ."
		},
		"11": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ အံၫစရ့လၭထီးအလူၬအီၪကိၩ့အီၪ ကီၪ့လၧစဒၫဝံၭအအီၪလၧဟံဘြၧၫ့အဖၧၩ့တၭ, စံၭဝ့ၫ,",
			"2": "<sup>2</sup> ယိခွါ,ပဝ့ၫဒၪယီၩ ပမွဲနဎွံၪဒဲနယၪလီၫ.- လၧနီၪအမ့ၬ ယၫ,လၧအၥၫ့နီၪ, လၧစစီလူၫကဲၪစဎွၩဒၪလ့ၬ,နဝ့ၫဒၪ ယီၩမွဲၦလၧအလ့ၩၥိၫ့ထၪ့ ဒဲဂဲၫထဲၩ့န့အံၫစရ့လၭနီၪ တၭး ယဟိဝၩနယွၩစံၭနၧၩ, နဘၪယိထဲၩ့ခွါထဲၩ့ယ ၡၩခမျၧးအံၫစရ့လၭနီၪတၭ, နဘၪကဲၪၦပၧၩ့ဆၧလၧ",
			"3": "<sup>3</sup> ယၡၩခမျၧးအံၫစရ့လၭနီၪအဖၫ့ခိၪဆ့လီၫ.- အခိးမွဲ အံၫစရ့လၭအၥုၪ့က့ၭၥၭၡါ ထီးအလူၬလဖၪဂဲၫလၧ စဎွၩအအီၪ လၧဟံဘြၧၫ့တၭး စဒၫဝံၭအုၩ့လၩ့အၥၭ လၧအဝ့ၫၥံၪ လၧဟံဘြၧၫ့အဖၧၩ့ လၧယဟိဝၩအမ့ၬ ယၫနီၪလီၫ. တၭအဝ့ၫၥံၪဂုၪစဒၫဝံၭစဎွၩ လၧအံၫစရ့ လၭအဖၫ့ခိၪ, ဘဲၫယဟိဝၩအလူအီၪဝ့ၫလၧမီၪစစၫမုၫ အ့လၭအၥိၭနီၪလီၫ.",
			"4": "<sup>4</sup> တၭစဒၫဝံၭ ဒဲအံၫစရ့လၭ ထီးအလူၬနီၪလ့ၩထီၩ့ လၧယရုစလံၫ့, လၧအမွဲယံဘၧၭနီၪး အနီၪမွဲအလး လၧၦယံဘၧၭဖိၪၥံၪအၡၩထံၫဖိၪခးဖိၪလဖၪနီၪ အီၪ",
			"5": "<sup>5</sup> ဝ့ၫလီၫ.- တၭယံဘၧၭအၡၩထံၫဖိၪခးဖိၪလဖၪစံၭစဒၫ ဝံၭနီၪ နမိဂဲၫနုၬဘၪထီးယီၩအ့ၬ. မွဲလါနၫ့ဘိၩစဒၫဝံၭ",
			"6": "<sup>6</sup> မၩန့ဇံအိၫ့အထိၬ, လၧအမွဲစဒၫဝံၭအဒိၩ့လီၫ.- တၭ စဒၫဝံၭစံၭဝ့ၫ, ၦလဂၩဂၩလၧအကျီၪ့ခွံၬဆိၫၦယံဘၧၭ ဖိၪလဖၪနီၪ, မိကဲၪၦဒိၪဒဲၥုၭခိၪလီၫ. အခိးမွဲနးဇ့ၫရုၫ အဲအၫအဖိၪခွၫစယိအၭနီၪ လ့ၩထၪ့ဆိၫဝ့ၫတၭ, မွဲအ",
			"7": "<sup>7</sup> ခိၪလီၫ.- တၭစဒၫဝံၭအီၪလၧထိၬဖၧၩ့နီၪး အခိးမွဲဘဲၫ",
			"8": "<sup>8</sup> နီၪတၭ,အဝ့ၫၥံၪကိၭဝ့ၫလၧစဒၫဝံၭအဒိၩ့လီၫ.- တၭ အဝ့ၫဒၪမၩကဲၪထၪ့ဒိၩ့ဝၬဝၬ, လၧမံလိၫဒၪလ့ၬ ဝၬဝၬ လီၫ.တၭစယိအၭနီၪမၩဂ့ၩထၪ့ ဒိၩ့အလးဂူၫဂၩနီၪဆ့",
			"9": "<sup>9</sup> လီၫ.- အခိးမွဲစဒၫဝံၭနီၪဒိၪထၪ့ဆီၪ့ထၪ့ထူထူဆ့,အဂဲး ဘဲၫယီၩဆၧၥုၭမုခမျၧးအယဟိဝၩနီၪ အီၪလၧအၥိၭ လီၫ.",
			"10": "<sup>10</sup> အယီၩမွဲၦဆီၪ့လၧစဒၫဝံၭအၥိၭ အခိၪလဖၪနီၪအ ဝ့ၫၥံၪမၩဆီၪ့ထၪ့အၥၭလၧအဝ့ၫဒၪအၥိၭ လၧအဘၩ့ အမုးအဖၧၩ့, ဒဲလၧအံၫစရ့လၭထီးအလူၬဘဲၫၥိၭအမိ ဒုၭကဲၪစဎွၩဘဲၫယဟိဝၩအလူအီၪဝ့ၫ လၧအံၫစရ့လၭ",
			"11": "<sup>11</sup> အဂဲးအကၠီၪ့အၥိၭနီၪလီၫ.- တၭၦဆီၪ့လဖၪအီၪလၧ စဒၫဝံၭအၥိၭအဆၧဝံဆၧနၬနီၪမွဲအယီၩ, ၦဟၭမနဲၭ ဖိၪစၡိဘအၫ့မွဲၦၥုၭခိၪလဖၪအခိၪး အဝ့ၫဒၪဆိၬထၪ့ အဖၩ့ထၫ့ဒုၪဒၩၦၥၧၫ့ယၩ လၧအဘၪဆၧမၩၥံၫဝ့ၫလ",
			"12": "<sup>12</sup> ဖၧၫ့ဎးလီၫ.- လၧအဝ့ၫဒၪအလးခဲၫ့မွဲစဒိဒိၫအဖိၪခွၫ စအံၫလအ့ဇၫ, ၦအဟိဟဲၭဖိၪလဂၩ, ဘၪဆဲၫ့လၧၦ",
			"13": "<sup>13</sup> ဆီၪ့ၥၧၫ့ဂၩနီၪလီၫ.- အဝ့ၫဒၪအီၪလၧစဒၫဝံၭအၥိၭလၧ ပၭစဒၫ့မံၫ့နီၪ, အလးလၧၦဖလံၡၫဖိၪၥံၪအီၪကီၪ့ဝ့ၫလၧ ဆၧဒုၭၥုၭအဂးတၭး အဝၩ့ထီးနီၪလစီၪ့ဎွ့ၩဝ့ၫလၧဘုၪ မုယီၩလီၫ. တၭၦခမျၧးလဖၪစဲၪ့ဖျိၭဝ့ၫလၧၦဖလံၡၫ",
			"14": "<sup>14</sup> ဖိၪၥံၪအမ့ၬယၫနီၪလီၫ.- တၭအဝ့ၫၥံၪအီၪက့ၪအနၫ့ ဆါၥံၪလၧဆၧလဝၩ့နီၪအၥၭကျၩတၭ, မၩဖီၩ့မၩဖျ့ၭ အဝ့ၫဒဲကျီၪ့ၥံၫခွံၬၦဖလံၡၫဖိၪလဖၪနီၪတၭး ယဟိဝၩ မၩဖီၩ့ဖျ့ၭအဝ့ၫၥံၪလၧဆၧဖီၩ့ဖျ့ၭဖၭဒိၪနီၪဆ့လီၫ.",
			"15": "<sup>15</sup> တၭၦၥၧၫ့ဂၩဘၪဆဲၫ့ လၧၦအခိၪၥၧၫ့ဆံၫနီၪ, လ့ၩ လၩ့လၧစဒၫဝံၭ အလိးမုလၧအဒၧလၫ့ အအိၩဖၧၩ့နီၪး တၭၦဖလံၡၫဖိၪအၥုၭမုခမျၧးလဖၪ ၥုၪ့အတဲၩၥံၪလၧ",
			"16": "<sup>16</sup> ရ့ၭဖအံၫ့အခိၪလီၩ့ဆူၭဖၧၩ့နီၪလီၫ.- လၧအထီနီၪ စဒၫဝံၭအီၪဝ့ၫလၧထိၬဖၧၩ့တၭ ၦဖလံၡၫဖိၪလဖၪအီၪ",
			"17": "<sup>17</sup> ကီၪ့အလးမွဲလၧဘ့ၭၥလံၫဟံၫ့နီၪလီၫ.- တၭစဒၫဝံၭ ဆိၫ့န့ဆၧနီၪ စံၭဝ့ၫဒၪ,မွဲပလၫမိဒုၭအီၩယၧၩထံၫအီၪ လၧဘ့ၭၥလံၫဟံၫ့အထံၫဖၧၩ့ လၧတရၫ့ထံၭနီၪလဂၩ",
			"18": "<sup>18</sup> လဲၪၬ- တၭၦၥၧၫ့ဂၩနီၪ လ့ၩဖျီၫ့ဆီၪ့ၦဖလံၡၫဖိၪအၥုၭ မုခမျၧးတၭ, အၪ့ဒုၪ့ထံၫလၧဘ့ၭၥလံၫဟံၫ့အထံၫဖၧၩ့ လၧတရၫ့ထံၭနီၪ, မၩန့ဝ့ၫဂဲၫထဲၩ့န့လၧစဒၫဝံၭအအီၪ",
			"19": "<sup>19</sup> နီၪလီၫ. မွဲလါနၫ့ဘိၩစဒၫဝံၭအီၩဝ့ၫဒၪအ့ၬ.- အ့ၪမွဲဂါ လၩ့ခွံၬဝ့ၫလၧယဟိဝၩအဂးတၭ, စံၭဝ့ၫဒၪ, မွဲယထီး မၩဆၧဘဲၫယီၩလၩလါလဂ့ၩ ၦလဖၪယီၩဆိၬအၥၭ မၧၫ့လၧဆၧၥၭမဲၪအလးတၭ, မွဲယမိအီၩအဝ့ၫၥံၪ အၥွံၪဆ့ဧၪ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪဂဲၫဆိၬဝ့ၫ အၥၭ မၧၫ့အီၪလၧဆၧၥၭမဲၪအဖၧၩ့နီၪလီၫ. မၩအၥၭဘဲၫနီၪ တၭအီၩဝ့ၫဒၪအ့ၬ. ၦဆီၪ့ၥၧၫ့ဂၩနီၪမၩဆၧလဖၪယီၩ လီၫ.",
			"20": "<sup>20</sup> တၭစယိအၭအထၧၫ့ဖုဝဲခွၫ စအၭဘၡဲၫနီၪမွဲၦၥၧၫ့ ဂၩနီၪအခိၪလီၫ. အဂဲးဘဲၫယီၩလၧအဆိၬထၪ့ အဖၩ့ ထၫ့ဒုၪဒၩၦၥၧၫ့ယၩ မၩၥံၫဝ့ၫ အကၠီၩ့နီၪတၭ, အမံၩ့",
			"21": "<sup>21</sup> အီၪလၧၦၥၧၫ့ဂၩနီၪအကျၩလီၫ.- လၧၦၥၧၫ့ဂၩနီၪအ ကျၩအဝ့ၫဒၪ အလၩအဖၩ့အၪနဲၪ့ ၦနံၫဂၩနီၪး အဂဲး ဘဲၫယီၩမွဲအဝ့ၫၥံၪအခိၪလီၫ. မွဲလါနၫ့ဘိၩန့ၫဒံၭ ၦအ ခၪ့ထံၭၥၧၫ့ဂၩနီၪအ့ၬ.",
			"22": "<sup>22</sup> ၦလၧအဆီၪ့အဖိၪခွၫ ဘၪဆဲၫ့လၧကၭဘဇံၫလၭ စယဟီအဒၫအဖိၪခွၫစဘံၫ့နအဲအၫနီၪ, မၩဆၧဖၭဒိၪ အၪမံၩ့တၭး ကျီၪ့ၥံၪၦဆီၪ့ဘဲၫဆၬလၥၧၫ့အၥိၭ, ၦမိ အၭဖိၪနံၫဂၩနီၪး တၭမွဲအလ့ၩလၩ့ဆ့ မၩၥံၫဆၬလ ၥၧၫ့လၧဆၧဖၧၩ့အဖၧၩ့နီၪ, ထီးအဘၪမူၭခိၪဖီၫ ဂဲၫ",
			"23": "<sup>23</sup> လၩ့အနံၩနီၪလီၫ.- တၭမွဲအမၩၥံၫၦအံဇံၭဖိၪလဂၩ, ၦၡၩလၧအဂၩ့နီၪထၪ့ထီၫယဲဖျါတၭး လၧၦအံဇံၭဖိၪ နီၪအစူၪဖၧၩ့ဖၩ့လဘံၪ့ မွဲဘဲၫၦထၭထၪအထၪခိၪၥိၭ နီၪတၭး အဝ့ၫဒၪလ့ၩလၩ့လၧအအီၪလၧနိၪထိၭလဘီၩ့ တၭ, အၪ့ဂူၬန့ဖၩ့လၧၦအံဇံၭဖိၪနီၪအစူၪဖၧၩ့တၭ, မၩ",
			"24": "<sup>24</sup> ၥံၫအဝ့ၫလဂၩ လၧအဖၩ့ဒၪဝ့ၫနီၪလီၫ.- ဆၧလဖၪနီၪ စယဟီအဒၫအဖိၪခွၫ စဘံၫ့နအဲအၫနီၪ မၩဝ့ၫတၭ,န့",
			"25": "<sup>25</sup> ဘၪအမံၩ့လၧၦဆီၪ့ၥၧၫ့ဂၩအကျၩလီၫ.- ယိခွါ,အဝ့ၫ ဒၪန့ဆၧလၩဖၩ့ လၧၦၥၧၫ့ဆံၫအကျၩလါနၫ့တၭ,မွဲအ န့ၫဒံၭၦၥၧၫ့ဂၩအ့ၬ. တၭစဒၫဝံၭအီၪက့ၪအဝ့ၫလၧၦ ခိၭဆၧလဖၪအဖၫ့ခိၪလီၫ.",
			"26": "<sup>26</sup> တၭၦဆီၪ့ဘၪဆဲၫ့လၧၥုၭဖိၪအဒီၪ့လဖၪနီၪ, မွဲစယိ အၭအထၧၫ့ဖုဝဲစအၫစဟ့လၭ, ၦဘၪဆဲၫ့လၧဘ့ၭၥလံ",
			"27": "<sup>27</sup> ဟံၫ့စဒိဒိၫအဖိၪခွၫစအ့ၫလဟၫနၫ့,- ၦဟၫရိၫဖိၪစၡၫ့",
			"28": "<sup>28</sup> မီၭ,ၦပ့ၫလနဲၭဖိၪစဟံလဇၫ,- ၦတကိအၫဖိၪစအံၭ က့ၭအဖိၪခွၫစအဲရၫ, ၦအၫ့တၥဲၭဖိၪစအၭဘအံဇၧၫ,",
			"29": "<sup>29</sup> ၦဟုၡၫဖိၪစစံၭဘခ့ၫ,ၦအဟိအၫဖိၪစအဲလ့ၫ,- ၦနတီၭ",
			"30": "<sup>30</sup> ဖၥဲၭဖိၪစမဟၫရအဲၫ, ၦနတီၭဖၥဲၭဖိၪ စဘၫအနၫအ",
			"31": "<sup>31</sup> ဖိၪခွၫစဟံလ့ၭ,- ၦဂံဘအၫဖိၪဘၪဆဲၫ့လၧစဘံၪ့ယမံၫ့ အဖိၪအလံၩစရဲဘ့ၫအဖိၪခွၫစအံၭၥအဲၫ, ၦပံၫလၥၧၫ့",
			"32": "<sup>32</sup> ဖိၪစဘံၫ့နအဲအၫ,- စဟုရ့ၫဘၪဆဲၫ့ လၧဂၫအၭအ",
			"33": "<sup>33</sup> ထံၫချိၬလဖၪး ၦအၫဘၫဖိၪစအဘဲၫအ့လၭ,- ၦဘဟၫ ရၧၫ့ဖိၪစအၭဇမၫဝ့ၭ, ၦၡၩအၫလဘနဲၭဖိၪ စအံၫလဲ",
			"34": "<sup>34</sup> အဘၫ,- ၦဂဲဇၧၫဖိၪစဟၫၡံၫ့အဖိၪခွၫလဖၪ ၦဟၫရၫ",
			"35": "<sup>35</sup> ဖိၪစၡၫဂံၫအဖိၪခွၫ စစၪ့နၥၧၫ့,- ၦဟၫရၫဖိၪစစၫကၫ",
			"36": "<sup>36</sup> အဖိၪခွၫစဟဲအၫ့, စအၧၫအဖိၪခွၫ စအ့လဖၫလၭ,",
			"37": "<sup>37</sup> ၦမ့ၭခရၭဖိၪစဟံဖၧၫ, ၦဝ့ၫလိၫနဲၭဖိၪစအဟဲယၫ,",
			"38": "<sup>38</sup> ၦကၫမလၭဖိၪစဟ့ဇရိၫ, စအ့ၭဇဘဲၫအဖိၪခွၫစနၫအ",
			"39": "<sup>39</sup> ရ့ၫ,- စနၫၥၫ့အထၧၫ့ဖုဝဲခွၫစယိၫအ့လၭ, စဟၭဂရဲၫ",
			"40": "<sup>40</sup> အဖိၪခွၫစမံၭဘဟၫ,- ၦအၫမၧၫ့ဖိၪစဇံလ့ၭ, ၦဘရိ ၥဲၫဖိၪစနဟၫရဲၫ, ၦဆိၬစယိအၭအစူၪဝဲၩ နးဇ့ၫရုၫအဲ",
			"41": "<sup>41</sup> အၫအဖိၪခွၫ,- ၦအံၭၥ့ၫဖိၪစအဲရၫ, ၦအံၭၥ့ၫဖိၪစဂၫ ရ့ၭ,ၦဟံၥၭဖိၪစယုၫရဲအၫ, စအၫလဲၫအဖိၪခွၫစဇၫ",
			"42": "<sup>42</sup> ဘၭ,- ၦရုဘံၫ့ဖိၪစၡဲဇၫအဖိၪခွၫစအဒဲနၫ, မွဲၦရုဘံၫ့",
			"43": "<sup>43</sup> ဖိၪအၥုၭခိၪတၭ, ၦၥၧၫ့ဆံၫအီၪလၧအၥိၭ,- စမၫအခၫ",
			"44": "<sup>44</sup> အဖိၪခွၫစဟၫနၫ့, ၦမံၭၥနဲၭဖိၪစယီၭၡဖၭ,- ၦအၭၡ တရၫဖိၪစအၧၭဇဲၫ, ၦအရိအၧၫဖိၪစဟိၥၫ့အဖိၪခွၫၥံၪ",
			"45": "<sup>45</sup> စၡၫမၫဒဲစယဟဲၫအ့လၭ,- စၡံမရဲၫအဖိၪခွၫစယ့ဒၭ",
			"46": "<sup>46</sup> အ့လၭ,ဒဲအထၧၫ့ဖုဝဲခွၫၦတဲဇၭဖိၪစယိဟၫ,- ၦမဟၫ ဝံၭဖိၪစအံၫလအ့လၭ ဒဲစယ့ၫရဘဲၫ,ဒဲစယီၭစဝဲအၫ, လၧအမွဲစအ့ၫလန့အၫ အဖိၪခွၫလဖၪ, ဒဲၦမိအၭဖိၪစ",
			"47": "<sup>47</sup> အံၭၥမၫ,- စအံၫလအ့လၭ, စအိဘ့ၭ,ဒဲၦမ့ၭစိၫဘၫဖိၪ စယၫစအ့လၭနီၪလီၫ."
		},
		"12": {
			"1": "<sup>1</sup> တၭလၧစကံၭအဖိၪခွၫ စစီလူၫနီၪ အကၠီၩ့စဒၫဝံၭ အီၪက့ၪၥူၪအၥၭ လၧဇံလၭအဖၧၩ့ အဘိၩ့ဘၭနီၪ, ၦလၧအဂဲၫလၧအအီၪ မွဲၦလဖၪယီၩလီၫ. အဝ့ၫၥံၪ ဘၪဆဲၫ့လၧၦအဆီၪ့ မၩဘိၭမၩဆၧၩ့ဆၧ လၧဆၧဒုၭ",
			"2": "<sup>2</sup> ၥုၭအဖၧၩ့ဆ့လီၫ.- အဝ့ၫၥံၪအီၪလၧအစူၪဝဲၩချံၪလဖၪ တၭ, လၧအခၭဖျါလၧချံၪၥံၪမွဲဂ့ၩ, ခွံၬလိးၥံၪမွဲဂ့ၩ. မၩဝ့ၫလၧစူၪထွ့ၪၥ့ၪ လၧစူၪစ့ၪၥ့ၪနံၫခီၫလူၬ, လၧစစီ လူၫအထၧၫ့ဖုဝဲခွၫဒၪလ့ၬ ဘၪဆဲၫ့လၧစဘံၪ့ယမံၫ့နီၪ",
			"3": "<sup>3</sup> လီၫ.- အခိၪလဂၩမွဲစအဟဲၫအံဇၧၫ, ထီးနီၪလဖၧၫ့စ ယိအၭ, ၦဂံဘံၫအၫဖိၪစၡ့ၫမအၫအဖိၪခွၫလဖၪ, ဒဲစ ယံၫဇအ့လၭ, ဒဲစပံၫလ့ၭ, လၧအမွဲစအၭဇမၩဝ့ၭအ",
			"4": "<sup>4</sup> ဖိၪခွၫလဖၪ,ဒဲစဘ့ရခၫ, ဒဲၦအၫ့တၥဲၭဖိၪစယံဟုၫ,- ဒဲ ၦဂံၭဘအၫ့ဖိၪ စအံၭစမၫအဲအၫနီၪ မွဲၦအဆီၪ့လၧၦ ၥၧၫ့ဆံၫအကျၩ, ဒဲအီၪလၧၦၥၧၫ့ဆံၫအဖၫ့ခိၪလီၫ. ဒဲ စယ့ၫရမဲအၫ, ဒဲစယဟၭဇအ့လၭ, ဒဲစယိၫဟၫနၫ့,ဒဲၦ",
			"5": "<sup>5</sup> ဂၫဒရၫဖိၪစယီၭၡဘၭ,- စအံၫလုဇအဲၫ,ဒဲစယ့ၫရမီၭ, ဒဲစဘံၫအလဲအၫ ဒဲစၡ့ၫမရဲအၫ,ဒဲၦဟၫရုဖဲၭဖိၪစၡ့ၫ",
			"6": "<sup>6</sup> ဖတဲအၫ,- ဒဲစအ့လကၫနၫ,ဒဲစယစဲအၫ ဒဲစအဇၧၫရ အ့လၭ,ဒဲစယိၫအံဇၧၫ, ဒဲၦကိၫရၫဖိၪစယၡိဘအၫ့,",
			"7": "<sup>7</sup> ဒဲစယိၫအံလၫ, ဒဲစဇၭဘဒဲအၫ,လၧအမွဲစယရိဟၫ့အ ဖိၪခွၫလဖၪဘၪဆဲၫ့လၧဂံဒီၫနီၪလီၫ.",
			"8": "<sup>8</sup> ၦလဖၪဘၪဆဲၫ့လၧၦဂၭဖိၪနီၪ မၩလၩ့ဖၭဒၪအၥၭ လ့ၩလၧစဒၫဝံၭအအီၪ နုၬလၧထိၬဖၧၩ့လၧမံၩ့လၬကျၩ တၭး အဝ့ၫၥံၪမွဲၦအဆီၪ့, ၦၡၩဒုၭဆၧ, ကြၨၭလၧဒုၭ ၥုၭအဂး, မွဲအဖီၪ့ထၩ့ဖံၭဒဲဆၧပဒၩ့ၥ့ၪတၭ, အဝ့ၫၥံၪ အမ့ၬၥံၪမၩအၥၭ ဘဲၫဆၬလၥၧၫ့ၥံၪ အမ့ၬအၥိၭနီၪ, အခၪ့ဖျဲၪဘဲၫခံၫဘၩ့ၥံၪ လၧခိၪလီၩ့လဖၪအလီၩ့အၥိၭ",
			"9": "<sup>9</sup> နီၪး- အခၪ့ထံၭစအံဇၧၫ, နံၫဂၩလဂၩစအိၫဘဒဲအၫ,",
			"10": "<sup>10</sup> ၥၧၫ့ဂၩလဂၩစအံၫလဲအၭ,- လံဂၩလဂၩစမံၭၡမၫ့နၫ,",
			"11": "<sup>11</sup> ယဲဂၩလဂၩ စယ့ၫရမဲအၫ,- ဎူၫဂၩလဂၩစအၭတ့ၫ,",
			"12": "<sup>12</sup> နွ့ၫဂၩလဂၩစအံၫလဲၫအ့လၭ,- ဎိၭဂၩလဂၩစယိဟၫ",
			"13": "<sup>13</sup> နၫ့, ခွံၫဂၩလဂၩစအ့ၫလဇၫဘၭ,- ဆံၫဂၩလဂၩစယ့ၫ",
			"14": "<sup>14</sup> ရမဲအၫ, ဆံၫလဂၩလဂၩစမၭခဘၫနၫၥံၪလီၫ.- အဝ့ၫ ၥံၪမွဲစဂၭအဖိၪခွၫၥံၪ, ၥုၭမုခမျၧးအခိၪလဖၪတၭး ၦ ဆံၭထုၬအီၪလၧၦလယၩ အဖၫ့ခိၪ, ဒဲအဒိၪထုၬအီၪ",
			"15": "<sup>15</sup> လၧၦလထီၫ့အဖၫ့ခိၪလီၫ.- အယီၩလဖၪမွဲၦလၧအခၫ့ ဂၬထံၫယီၫဒၫ့လၧလၩအခၪ့ထံၭလဘံၪ့, အထီထီးထံၫ မိၡါနီၪဒိၪထၪ့တၭ, ထံၫနီၪလုၬဘံၭလၩ့ယွၩလၧအနဲၩ့ ထံၭဎံၩ့ဎံၩ့လ့ၬလီၫ. တၭအဝ့ၫၥံၪနၫ့ထၪ့ခွံၬ ကယဲၦ အီၪလၧခိၪလီၩ့ဆူၭဖၧၩ့နီၪ ကိၭဂၩဒ့ၭ, လၧမုထၪ့ဒဲလၧ မုနုၬနံၫခီၫလူၬလီၫ.",
			"16": "<sup>16</sup> တၭၦဘၪဆဲၫ့လၧစဘံၪ့ယမံၫ့ ဒဲစယုဒၫနီၪဂဲၫထီၩ့",
			"17": "<sup>17</sup> လၧစဒၫဝံၭအအီၪလၧထိၬနီၪလီၫ.- တၭစဒၫဝံၭလ့ၩ ထၪ့ဒၪဘၪဝ့ၫနီၪ, ချဲၩ့ထၪ့စံၭအဝ့ၫၥံၪး နၥံၪအ့ၪဂဲၫလၧ ဆၧဘၪလိၬ အိၭလိၬ ဘဲၫၥိၭ နၥံၪမိမၩဘိၭ မၩဆၧၩ့ ယၧၩတၭ, ယၥၭမိဘၪဆၧဆၭဘုၭထၬဝ့ၫလၧနၥံၪဆ့ လီၫ. အ့ၪမွဲနၥံၪဂဲၫဘဲၫၥိၭ နၥံၪမိဖ့ၪလၫ့ခွံၬ ၥူၪယၧၩ လၧယဒုၪယဒၩအစူၪဖၧၩ့နီၪ, လၧမၩမၪဆၧလမံၩ့မံၩ့ လအီၪဘၪလၧယစူၪဖၧၩ့တၭ, မွဲပဖါၥံၪအယွၩနီၪယိ",
			"18": "<sup>18</sup> လၩ့ဆၧနီၪ, ဒဲစ့ၩရၫ့ဝ့ၫဆံၭ.- ထီးနီၪလဖၧၫ့ၥၭနီၪလၩ့ ဘၪစအၫမစ့အဲၫ, လၧအမွဲၦဒိၪလဖၪအခိၪတၭ,စံၭဝ့ၫ ဒၪ,စဒၫဝံၭဧ့ ပမွဲနဝ့ၫ, ဒဲအီၪလၧနအီၪလခီၫ, စယ့ၭစံၫ အဖိၪခွၫနဝ့ၫဒၪလဂၩဧ့း ဆၧဘၪလိၬအိၭလိၬ, ဆၧဘၪ လိၬအိၭလိၬအီၪလၧနၧၩ, ဒဲဆၧဘၪလိၬအိၭလိၬအီၪ လၧၦမၩဘိၭမၩဆၧၩ့နၧၩဆ့း အဂဲးဘဲၫယီၩနယွၩနီၪ မၩဘိၭမၩဆၧၩ့နၧၩလီၫ. ထီးနီၪလဖၧၫ့ စဒၫဝံၭထိး ဆၧၫ့အဝ့ၫၥံၪ, ဒဲအီၪက့ၪအဝ့ၫၥံၪလၧၦလဒီၪ့နီၪအခိၪ လဖၪလီၫ.",
			"19": "<sup>19</sup> ထီးအဝ့ၫဒၪဂဲၫလၧ ၦဖလံၡၫဖိၪလဖၪအၥိၭလၧအ မိဒုၭၥုၭထၫ့ဒၩစစီလူၫနီၪ, ၦဘၪဆဲၫ့လၧစမနၭစ့ၫလနၩ့ လၩ့ဘၪလၧစဒၫဝံၭအအီၪတၭး မွဲလါနၫ့ဘိၩမၩနၧၩ့ ဝ့ၫအ့ၬး အဂဲးဘဲၫယီၩ ၦဖလံၡၫဖိၪၥံၪ အၦဒိၪလဖၪ ကိၪ့လိၬအၥၭတၭ, ဒုၭစဲၪ့ခွံၬအဝ့ၫနီၪ, စံၭဝ့ၫဒၪ,မွဲအမိ လၩ့ဘၪလၧအကဆါစစီလူၫအအီၪလခီၫ လၧပခိၪဎွံၪ",
			"20": "<sup>20</sup> အဂးလီၫ.- အဝ့ၫဒၪလ့ၩလၧဇံလၭအဘိၩ့ဘၭနီၪ, ၦဘၪဆဲၫ့လၧစမနၭစ့ၫလဖၪ လၩ့ဘၪလၧအအီၪ, မွဲစ အၭဒနၫ, ဒဲစယီၭဇဘၭ,ဒဲစယ့ၭဒဲၫအ့လၭ, ဒဲစမဲၫခၫအ့ လၭ,ဒဲစယီၭဇဘၭ, ဒဲစအံၫလဲဟုၫ, ဒဲစဇံလၥဲၫ, ၦအ",
			"21": "<sup>21</sup> ထီၫ့ၥံၪအခိၪလဖၪဘၪဆဲၫ့လၧစမနၭစ့ၫနီၪလီၫ.- တၭ အဝ့ၫၥံၪမၩဆၧၩ့စဒၫဝံၭလၧၦအဒီၪ့နီၪး အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪကိၭဂၩဒ့ၭ, မွဲၦအဆီၪ့ဒဲမွဲၦၥုၭမုခမျၧးအခိၪ",
			"22": "<sup>22</sup> ၥံၪလီၫ.- အဂဲးဘဲၫယီၩအဆၧၫ့အထီနီၪ, ၦလၧအဂဲၫ မၩဆၧၩ့စဒၫဝံၭလခီၫနီၪ, ဂဲၫလၧအအီၪလနံၩဘၪလ နံၩလနံၩဘၪလနံၩ ထီးအဎွ့ၩၦၥုၭမုခမျၧးဖၭဒိၪ, ဘဲၫ ယွၩအၥုၭမုခမျၧးအၥိၭနီၪလီၫ.",
			"23": "<sup>23</sup> တၭၦလၧအတဲၩ့ဝဲၩအၥၭ လၧဆၧဒုၭၥုၭအဂးအီၪ လၧအစူၪဝဲၩၥံၪနီၪ, ဂဲၫလၧစဒၫဝံၭအအီၪလၧဟံဘြၧၫ့ အဖၧၩ့နီၪ, အဒီၪ့ၥံၪအဆၧဝံဆၧနၬလဖၪမွဲအယီၩး အ ဝ့ၫၥံၪဂဲၫဘဲၫၥိၭအမိကၠၪခွံၬ အဘၩ့အမုး လၧစစီလူၫ အစူၪဖၧၩ့တၭ, ဒုၭအီၪလၧစဒၫဝံၭ ဘဲၫယဟိဝၩအလူ",
			"24": "<sup>24</sup> အထၫအီၪဝ့ၫအၥိၭနီၪလီၫ.- ၦယုဒၫဖိၪလၧအဖီၪ့ဆိၬ ထၩ့ဖံၭ,ဒဲဖၩ့, မွဲဎူၫထီၫ့ဎိၭယၩ, လၧအတဲၩ့ဝဲၩအၥၭ",
			"25": "<sup>25</sup> အီၪလၧစူၪဝဲၩၥံၪလၧဆၧဒုၭၥုၭအဂးလီၫ.- ၦဘၪဆဲၫ့ လၧၦစံမအၧၫ့ဖိၪၥံၪ, ၦအဆီၪ့အၥၭဒူၩ လၧဒုၭၥုၭအ",
			"26": "<sup>26</sup> ဂး,မွဲနွ့ၫထီၫ့လယၩလီၫ.- ၦဘၪဆဲၫ့လၧၦလံဝဲၫဖိၪၥံၪ",
			"27": "<sup>27</sup> လံထီၫ့ဎူၫယၩလီၫ.- တၭစယဟီအဒၫနီၪမွဲၦၥိၫ့ၦအၫ ရၧၫ့ဖိၪၥံၪတၭ, ၦအီၪလၧအၥိၭနီၪမွဲၦၥၧၫ့ထီၫ့နွ့ၫယၩ",
			"28": "<sup>28</sup> လီၫ.- ဒဲစဇၫဒီၭ,ၦၥၭဘၪ့အဂဲးဆီၪ့အၥၭဒူၩ, ဒဲၦဘၪ ဆဲၫ့လၧအဖါအဂံၪ့နီၪ ၦအခိၪၥံၪနံၫဆံၫနံၫဂၩလီၫ.",
			"29": "<sup>29</sup> ၦဘၪဆဲၫ့လၧၦဘံၪ့ယမံၫ့ဖိၪၥံၪ, လၧအမွဲစစီလူၫအဘူၭ အထံးၥံၪး ၥၧၫ့ထီၫ့လီၫ. အဂဲးဘဲၫယီၩ ထီးအထီနီၪ ၦဘၪဆဲၫ့လၧအဝ့ၫၥံၪ အအၪထုၬလဖၪနီၪအီၪလၧစစီ",
			"30": "<sup>30</sup> လူၫအၥိၭလခီၫလီၫ.- ၦဘၪဆဲၫ့လၧစအံဖြံၫ့အဖိၪၥံၪ, နံၫလၬဎိၭယၩ, မွဲၦအဆီၪ့အၥၭဒူၩ, ၦလၧအမံၩ့ဂၧၫ့ ထၪ့ၥၩလၩ့ လၧအဝ့ၫၥံၪအဖါၥံၪအဂံၪ့ထီးအလူၬနီၪ",
			"31": "<sup>31</sup> ဆ့လီၫ.- တၭၦဘၪဆဲၫ့လၧစမနၭစ့ၫ အလခီၫဒီၪ့နီၪ, လလၬဎိၭထီၫ့, ၦလၧဆၧကိၭထၪ့အမံၩ့ ဘဲၫၥိၭအမိ",
			"32": "<sup>32</sup> ဂဲၫဒုၭကဲၪထၪ့စဒၫဝံၭလၧစဎွၩနီၪလီၫ.- တၭၦဘၪဆဲၫ့ လၧစအံစခၫအဖိၪလဖၪ, ၦကိၪ့ဆၧၥ့ၪလၧဆၧဘၪ ဆဲၫ့အဆၧၫ့အထီနီၪ, ဘဲၫၥိၭအမိၥ့ၪယၫ ဆၧလၧအံၫ စရ့လၭကြၨၭမၩလမံၩ့လါလါတၭး အဝ့ၫၥံၪအခိၪလ ဖၪမွဲနံၫယၩတၭ, အဝ့ၫၥံၪအထၧၫ့ဖုဝဲလဖၪထီးအလူၬ",
			"33": "<sup>33</sup> နီၪအီၪလၧအစူၪဖၧၩ့လီၫ.- ၦဘၪဆဲၫ့လၧစဇ့ၭဘလၧၫ့, ၦလ့ၩထၪ့ဒုၭဆၧၥ့ၪ, ၦဒုၭယုၩယါၥုၭ, ဖီၪ့ဆၧဒုၭၥုၭ အစူၪဝဲၩၥ့ၪ,မွဲၦယဲလၬလီၫ. မွဲအတဲၩ့ဝဲၩအၥၭတၭ,",
			"34": "<sup>34</sup> အီၪလၧအၥၭနံၫဖျိၪ့အ့ၬ.- တၭၦဘၪဆဲၫ့လၧစနၭၥလဲၫ နီၪ,ၦအခိၪလဖၪလထီၫ့, ဒဲၦအီၪလၧအဝ့ၫၥံၪအၥိၭ",
			"35": "<sup>35</sup> လၧထၩ့ဖံၭဒဲဖၩ့ၥံၪနီၪ, ၥၧၫ့လၬနွ့ၫထီၫ့လီၫ.- တၭၦဘၪ ဆဲၫ့လၧၦဒၫ့ဖိၪလဖၪလၧအဒုၭယုၩယါၥုၭနီၪ, ၦနံၫလၬ",
			"36": "<sup>36</sup> ဎိၭထီၫ့ဎူၫယၩလီၫ.- တၭၦဘၪဆဲၫ့လၧစအၭၡၧၫ,ၦ",
			"37": "<sup>37</sup> လ့ၩထၪ့ဒုၭဆၧ, ဒုၭယုၩယါၥုၭနီၪ,ၦလံလၬလီၫ.- တၭ လၧယီၫဒၫ့ဝါလခီၫနီၪ, ၦရုဘံၫ့ဖိၪဒဲၦဂၭဖိၪ, ဒဲမနၭစ့ၫ လခီၫဒီၪ့နီၪ, ၦအီၪလၧဆၧဒုၭၥုၭအစူၪဝဲၩလဖၪလမံၩ့ လါလါထီးအလူၬနီၪ, မွဲၦလကုၬဒဲနံၫလၬလီၫ.",
			"38": "<sup>38</sup> အနီၪထီးအလူၬ ၦဒုၭၥုၭအီၪတဲၩ့ဝဲၩအၥၭနီၪ ဂဲၫ ထီၩ့လၧဟံဘြၧၫ့ လၧအၥၭလၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩဘဲၫၥိၭ အမိဒုၭကဲၪထၪ့စဒၫဝံၭနီၪ လၧအံၫစရ့လၭထီးအလူၬ အစဎွၩလီၫ. တၭအံၫစရ့လၭအဂူၫဂၩ ထီးအလူၬဆ့ အီၪလၧအၥၭလဖျိၪ့ဎး ဘဲၫၥိၭအမိဒုၭကဲၪစဒၫဝံၭလၧ",
			"39": "<sup>39</sup> စဎွၩလီၫ.- တၭအဝ့ၫၥံၪအီၪထီးနီၪ အၪ့ဆၧအီၩဆၧ လၧစဒၫဝံၭအၥိၭၥၧၫ့ၥၫ့လီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪ",
			"40": "<sup>40</sup> အထၧၫ့ဖုဝဲၥံၪတဲၩ့ဝဲၩဆၧလၧအဂးလီၫ.- လၧနီၪအမ့ၬ ယၫၦလၧအအီၪဘူၭလဖၪနီၪ, စအံစခၫ ဒဲစဇ့ၭဘ လၧၫ့,ဒဲစနၭၥလဲၫၥံၪဂဲၫဆိၬကိၪ ဒဲကၥ့ၪယီၩ့ၥံၪ, ဒဲက လအူၭၥံၪ,ဒဲကၥ့ၪလၩၥံၪ, ဒဲလၧချီဖၫၥံၪအလီၩ့,ဒဲဆၧ ယၪ,ကိၪမုၬ, ကိၪပၪပဲၪ,ချိၪ့ဒိၩ့ၥၪ, ဒဲစဘံၭၥၪခုၫၥံၪ, ဒဲစဘံၭထံၫ,ဒဲၥိၪ, ဒဲချီဖၫၥံၪ ၥိၪၥံၪဘ့ၪၥံၪအၪအၪလ့ၬး အဂဲးဘဲၫယီၩ လၧအံၫစရ့လၭအဖၧၩ့နီၪ ဆၧၥၭထိၬ အီၪဝ့ၫလီၫ."
		},
		"13": {
			"1": "<sup>1</sup> တၭစဒၫဝံၭကၩ့ကၩလိၬအၥၭ လၧၦအထီၫ့ၥံၪအခိၪ, ဒဲၦအယၩၥံၪအခိၪလဖၪ, ဒဲလၧကယဲၦလ့ၩၥိၫ့ဆၧလ",
			"2": "<sup>2</sup> ဂၩလါလါကိၭဂၩဒ့ၭလီၫ.- တၭစဒၫဝံၭစံၭၦအံၫစရ့ လၭအဆၧအီၪကီၪ့ထီးအလူၬၥံၪ, အ့ၪဘၪနၥံၪအၥၭ ဒဲအ့ၪဂဲၫဝ့ၫလၧယဟိဝၩပယွၩဆ့တၭး မွဲပအၪ့မၧၫ့လၩ့ ဆၧလၧပထၧၫ့ဖုဝဲၥံၪအအီၪဎံၩ့ဎံၩ့လ့ၬတၭ, ကယဲၦ အီၪလၩ့ထးလၧအံၫစရ့လၭအခးဖၧၩ့ ကိၭစီၪ့ဒ့ၭနီၪ, ၦလုဆၧၥံၪဒဲၦလံဝဲၫဖိၪၥံၪ အီၪလၧအဝ့ၫၥံၪအၥိၭလၧ အဝ့ၫၥံၪအဒိၩ့လဖၪအဖၧၩ့ ဒဲအီၪလၧအနဲၩ့ထံၭဝၬဝၬ ဘဲၫၥိၭအဝ့ၫၥံၪ မိဂဲၫအီၪကိၩ့အီၪကီၪ့ လၧပအီၪယီၩ",
			"3": "<sup>3</sup> လီၫ.- တၭမွဲပဂဲၫဆိၬၡီၩ့ပယွၩအတလၫလၧပအီၪယီၩ ဘီၪ. အဂဲးဘဲၫယီၩလၧစစီလူၫအမုနံၩလဖၪနီၪပအၪ့",
			"4": "<sup>4</sup> ကံၩ့အၪ့ယၫဆၧလၧအဝ့ၫနီၪဆ့အ့ၬ.- တၭဆၧအီၪကီၪ့ ထီးအလူၬၥံၪစံၭလၧအမိမၩဝ့ၫဘဲၫနီၪၥိၭဆ့း အဂဲးဘဲၫ ယီၩဆၧနီၪလမံၩ့ဂ့ၩဝ့ၫလၧ ၦခမျၧးၥံၪထီးအလူၬအမ့ၬ ၥၪဖၧၩ့လီၫ.",
			"5": "<sup>5</sup> အခိးမွဲစဒၫဝံၭ ကိၭကီၪ့အံၫစရ့လၭထီးအလူၬလၧ ၡဲဟီၫဘၪဆဲၫ့လၧအံဇံၭ, ထီၩ့လၧဆၧလ့ၩနုၬလၧဟ့ မၭအဖၧၩ့နီၪ, ဘဲၫၥိၭအမိဂဲၫဆိၬယွၩအတလၫလၧအ",
			"6": "<sup>6</sup> အီၪဝ့ၫလၧကၧယၭယံအရံၫ့နီၪလီၫ.- တၭစဒၫဝံၭလ့ၩ ထၪ့,ဒဲအံၫစရ့လၭထီးအလူၬဆ့ ထီၩ့လၧဘၫအလၫ, မွဲကၧယၭယံအရံၫ့, လၧအဘၪဆဲၫ့လၧယုဒၫဘဲၫၥိၭ အမိဂဲၫထဲၩ့ဆိၬခွံၬယဟိဝၩယွၩအတလၫလၧအအီၪ ဝ့ၫလၧခ့ၫရူၬၥံၪအဘိၩ့ဆၧၩ့, လၧအမံၩ့အီၪဝ့ၫလၧအ",
			"7": "<sup>7</sup> လီၩ့နီၪလီၫ.- တၭအဝ့ၫၥံၪဆိၬထၪ့ခွံၬ ယွၩအတလၫ လၧစအဘံနဒၭအဂံၪ့နီၪ လၧလဲၪ့ချီအၥၫ့အဖၧၩ့တၭ,",
			"8": "<sup>8</sup> စအၭဇၫဒဲစအဟဲအိၫၥံၪနၫ့လဲၪ့နီၪလီၫ.- တၭစဒၫဝံၭ ဒဲအံၫစရ့လၭထီးအလူၬဒံၩ့ဆၧဆီၪ့ဆီၪ့လ့ၬ, ဒဲၥံၫကျံၩ ဆၧ,ဒဲအီၪလၧနါဒံၩ့ၥံၪ, ဒဲလၧၥၫ့ထီးၥံၪ,ဒဲလၧစံၩ့စံၩ့",
			"9": "<sup>9</sup> ၥံၪ,ဒဲလၧခွ့ၩၥံၪလီၫ.- ထီးအဝ့ၫၥံၪဂဲၫထီၩ့လၧစနၫခၧၫ့ အခရဲးဖၧၩ့နီၪ, စအၧဇၫယူၬစိၩအစူၪဘဲၫၥိၭအမိမၩ ဂုးတလၫနီၪး အဂဲးဘဲၫယီၩ ချီၥံၪမၩဝၭဝ့ၫဒၪလီၫ.",
			"10": "<sup>10</sup> တၭယဟိဝၩအၥၭထၪ့ခဲၩထၪ့ထၫ့ဒၩ စအၧဇၫနီၪကျီၪ့ ဝ့ၫ,အဂဲးဘဲၫယီၩမွဲလၧအယူၬထၪ့အစူၪ လၧတလၫနီၪ",
			"11": "<sup>11</sup> အကၠီၩ့တၭ, ၥံၫဝ့ၫထီးနီၪလၧယွၩအမ့ၬယၫလီၫ.- လၧ ယဟိဝၩမၩဖိးလၧစအၧဇၫအကၠီၩ့နီၪ, စဒၫဝံၭအၥၭ ဆၫတၭ, ဆၧကိၭအလးထီးနီၪလၧဖ့ရ့ၭအၧဇၫထီးမု",
			"12": "<sup>12</sup> ဆၫလနံၩယီၩလီၫ.- တၭမုလနံၩနီၪစဒၫဝံၭၥၭမဲၪယွၩ, စံၭဝ့ၫဒၪ, မွဲယဂဲၫဆိၬယွၩအတလၫလၧယအီၪမိၥ့ၪဘဲၫ",
			"13": "<sup>13</sup> ၥ့ၪလဲၪ.- အခိးမွဲစဒၫဝံၭလဂဲၫဆိၬဘၪတလၫလၧအနၫ့ ဆါအအီၪလၧစဒၫဝံၭအဒိၩ့ဖၧၩ့နီၪ, အ့ၪမွဲအဆိၬထၪ့ ဝ့ၫလၧၦဂံတဲၭဖိၪ, စအိၫဘဒံဒၧၫ့အဂံၪ့ဖၧၩ့နီၪလီၫ.",
			"14": "<sup>14</sup> တၭယွၩအတလၫနီၪ အီၪလၧစအိၫဘဒံဒၧၫ့အဂံၪ့ ဖၧၩ့လၧအဂံၪ့ဒီၪ့အၥိၭလၩၥၧၫ့ဘံၪ့လီၫ. တၭယဟိ ဝၩဆိၪဂ့ၩစအိၫဘဒံဒၧၫ့အဂံၪ့ ဒဲကယဲအဆၧအီၪထီး အလူၬနီၪဆ့လီၫ."
		},
		"14": {
			"1": "<sup>1</sup> တၭတဲအၫအစဎွၩစဟဲရၫ့လဂၩနီၪ အၪ့မၧၫ့အၥီၫ့ ၥံၪလ့ၩလၧစဒၫဝံၭအအီၪတၭ, ဖ့ၪလၫ့ၥံၪ့ၡိၫအ့ရ့ၭ, ဒဲပၠၩ့ၥမါၥံၪ, ဒဲလဲၬၥမါၥံၪ, ဘဲၫၥိၭအမိမၩထၪ့ဂံၪ့လၧ",
			"2": "<sup>2</sup> အဝ့ၫဒၪအဂးလီၫ.- တၭစဒၫဝံၭၥ့ၪယၫလၧယဟိဝၩ မၩဂုးခၧၫ့အဝ့ၫလၧစဎွၩ လၧအံၫစရ့လၭအဖၫ့ခိၪနီၪး အဂဲးဘဲၫယီၩ အဘၩ့အမုးဘၪဆၧအီၪက့ၪထၪ့ထီၫ ဝ့ၫလၧအခ့ၫအၡၩအံၫစရ့လၭနီၪအကၠီၩ့လီၫ.",
			"3": "<sup>3</sup> တၭစဒၫဝံၭမၩအၪထၪ့အမၫၥံၪ လၧယရုစလံၫ့နီၪ လီၫ. တၭစဒၫဝံၭထၪ့ဖိၪဒံၭ အဖိၪခွၫၥံၪ ဒဲအဖိၪမုၪၥံၪ",
			"4": "<sup>4</sup> ဆ့လီၫ.- တၭအဖိၪၥံၪလၧအန့ဘၪဝ့ၫလၧယရုစလံၫ့အ ဖၧၩ့နီၪအမံၩ့မွဲဘဲၫယီၩး စၡၫ့မုအၫ,ဒဲစၡိဘၭ, ဒဲစနၫ",
			"5": "<sup>5</sup> ၥၫ့,ဒဲစစီလမၧၫ့,- ဒဲစအံၭဘဟၫ, ဒဲစအ့ၫလရှုအၫ,",
			"6": "<sup>6</sup> ဒဲစအ့ၫလပၫလ့ၭ,- ဒဲစနိဂၫ, ဒဲစနံဖ့ၭ, ဒဲစယဖဲအၫ,",
			"7": "<sup>7</sup> ဒဲစအံၫလံၭၡမၫ, ဒဲစဘံၫအလဲအဒၫ,ဒဲစအံၫလံၭဖလ့ၭ လီၫ.",
			"8": "<sup>8</sup> တၭထီးၦဖလံၡၫဖိၪၥံၪနါဂၧၫ့ လၧစဒၫဝံၭဘၪဆၧ ဂုၪဝ့ၫလၧစဎွၩ လၧအံၫစရ့လၭထီးအလူၬအဖၫ့ခိၪၦဖ လံၡၫဖိၪၥံၪထီးအလူၬ လ့ၩထၪ့အၪ့ဎၬစဒၫဝံၭနီၪလီၫ. စဒၫဝံၭနါဂၧၫ့တၭ, လ့ၩထၪ့လၧခီၫ့ထၫ့ဒုၪဒၩအဝ့ၫၥံၪ",
			"9": "<sup>9</sup> လီၫ.- တၭၦဖလံၡၫဖိၪၥံၪဂဲၫပၩလၩ့အၥၭ လၧရ့ၭဖ",
			"10": "<sup>10</sup> အံၫ့အခိၪလီၩ့ဆူၭဖၧၩ့နီၪလီၫ.- တၭစဒၫဝံၭ အၪ့စၪ့ ဆၧလၧယွၩတၭ, စံၭဝ့ၫ, မွဲယဘၪလ့ၩထၪ့ထၫ့ဒုၪဒၩၦ ဖလံၡၫဖိၪလဖၪဆ့ဧၪ. တၭမွဲနမိဖ့ၪလၫ့အဝ့ၫၥံၪလၧ ယစူၪဖၧၩ့ဆ့ဧၪ. တၭယဟိဝၩနီၪ စံၭဆၧၫ့ဝ့ၫ, လ့ၩ ထၪ့ဘီၪး အဂဲးဘဲၫယီၩ ယမိဖ့ၪလၫ့အဝ့ၫၥံၪလၧနစူၪ",
			"11": "<sup>11</sup> ဖၧၩ့လီၫ.- အခိးမွဲအဝ့ၫၥံၪဂဲၫထီၩ့လၧဘၫအလၭပ့ၫ ရဇံၫ့တၭ,စဒၫဝံၭကျီၪ့ခွံၬအဝ့ၫၥံၪထီးနီၪလီၫ. ထီးနီၪ လဖၧၫ့စဒၫဝံၭစံၭဝ့ၫဒၪ, ယွၩဘုၪ့ဖိးဆၧလၧယဒုၪယ ဒၩလဖၪအဖၫ့ခိၪလၧယစူၪအကၠီၩ့တၭ, မၩအၥၭဘဲၫ ထံၫၥံၪဖိးထၪ့ရှုၭဝ့ၫအၥိၭနီၪလီၫ. မၩအၥၭဘဲၫနီၪတၭ အလးထီးနီၪ အဝ့ၫၥံၪကိၭထၪ့အမံၩ့ ဘၫအလၭပ့ၫရ",
			"12": "<sup>12</sup> ဇံၫ့နီၪလီၫ.- တၭထီးအဝ့ၫၥံၪအီၪက့ၪလၩ့ထးအယွၩ လဖၪထီးနီၪ, စဒၫဝံၭမၪလူၬဆၧတၭ, ၦၡၩဆူၭထၪ့ ခွံၬဝ့ၫလၧမ့ၪလီၫ.",
			"13": "<sup>13</sup> တၭၦဖလံၡၫဖိၪၥံၪ ပၩလၩ့ဒီၭအၥၭ လၧခိၪလီၩ့ ဆူၭဖၧၩ့နီၪး အခိးမွဲဘဲၫနီၪတၭစဒၫဝံၭအၪ့စၪ့ဒီၭဆၧ",
			"14": "<sup>14</sup> လၧယွၩနီၪး- တၭယွၩစံၭအဝ့ၫဒၪ, ထီးလ့ၩထၪ့ဆီး အဝ့ၫၥံၪလဂ့ၩး အ့ၪမွဲကၠၪခွံၬနၥၭလၧအဝ့ၫၥံၪအအီၪ တၭ,ဂဲၫထၪ့လၧအဝ့ၫၥံၪအဖၫ့ခိၪ ဆဲၫဎၩ့လၧၥံၪ့ထိ",
			"15": "<sup>15</sup> ဆၪလဖၪအအီၪနီၪဆံၭး- တၭဆၧမိမၩအၥၭထီးနနါ ဂၧၫ့ဆၧၥီၫလၧၥံၪ့ထိဆၪလဖၪအခံၫနီၪ, ထီးနီၪလဖၧၫ့ နဘၪလ့ၩထၪ့ဒုၭဆၧတၭး အဂဲးဘဲၫယီၩယွၩလ့ၩဝဲၩ ဝ့ၫလၧနမ့ၬယၫနီၪဘဲၫၥိၭအမိကျီၪ့ခွံၬ ၦဖလံၡၫဖိၪအ",
			"16": "<sup>16</sup> ၥုၭမုခမျၧးၥံၪလီၫ.- အခိးမွဲစဒၫဝံၭမၩဝ့ၫ ဘဲၫယွၩမၪ လူၬဝ့ၫအၥိၭတၭး ကျီၪ့ခွံၬၦဖလံၡၫဖိၪ အၥုၭမုခမျၧး ၥံၪလၧဂံဘအၧၫ့ထီၩ့လၧဂၫဇၧၫနီၪလီၫ.",
			"17": "<sup>17</sup> တၭစဒၫဝံၭအလၩအဖၩ့ ဂၧၫ့ထၪ့ၥၩလၩ့လၧထံၫၥံၪ ခးၥံၪထီးအလူၬး တၭယဟိဝၩဒုၭအီၪထၪ့ဆၧၥၭမဲၪ အဝ့ၫဒၪလၧၦဆၨၩၥံၪထီးအလူၬအကျၩလီၫ."
		},
		"15": {
			"1": "<sup>1</sup> တၭစဒၫဝံၭမၩအဂံၪ့ၥံၪ လၧစဒၫဝံၭအဒိၩ့ဖၧၩ့နီၪ, ဒဲတဲၩ့ဝဲၩအလးလၧယွၩအတလၫအဂးနီၪ, ဒဲမၩထၪ့",
			"2": "<sup>2</sup> တဲၩလၧအဂးလီၫ.- ထီးနီၪလဖၧၫ့စဒၫဝံၭစံၭဝ့ၫ,အ့ၪ လမွဲဘၪၦလံဝဲၫဖိၪၥံၪ, ၦဆိၬယွၩအတလၫနီၪကြၨၭ ၦနးဂၩအ့ၬ. အဂဲးဘဲၫယီၩ ယဟိဝၩရွံန့အဝ့ၫၥံၪ ဘဲၫ ၥိၭအမိဆိၬယွၩအတလၫနီၪ, ဒဲမၩအခ့ၫအၡၩအဆၧ မၩအဆိၩဆိၩအကၠၪကၠၪလီၫ.",
			"3": "<sup>3</sup> တၭစဒၫဝံၭကိၭကီၪ့အံၫစရ့လၭထီးအလူၬ လၧယ ရုစလံၫ့နီၪ, ဘဲၫၥိၭအမိဂဲၫထၪ့န့ယဟိဝၩအတလၫ ထီၩ့လၧအလး လၧအတဲၩ့ဝဲၩဝ့ၫ လၧအဂးနီၪလီၫ.",
			"4": "<sup>4</sup> စဒၫဝံၭဒုၭအီၪကီၪ့စအၫရၧၫ့ ဒဲၦလံဝဲၫဖိၪလဖၪတၭး",
			"5": "<sup>5</sup> လၧစကိဟၭအဖိၪခွၫၥံၪ, စခၩ့ယုၫရအ့လၭနီၪ,ဒဲအ",
			"6": "<sup>6</sup> ထၧၫ့ဖုဝဲၥံၪလယၩနံၫဆံၫတၭး- လၧစမရၫရဲၫအဖိၪ ခွၫၥံၪး စခၩ့အၭစအဲအၫနီၪ, ဒဲအထၧၫ့ဖုဝဲၥံၪနံၫယၩနံၫ",
			"7": "<sup>7</sup> ဆံၫတၭး- လၧစဂၧၡၧၫ့အဖိၪခွၫၥံၪး စခၩ့ယိၫအ့လၭ,",
			"8": "<sup>8</sup> ဒဲအထၧၫ့ဖုဝဲလယၩၥၧၫ့ဆံၫတၭး- လၧစအံၫလံၭဇဖၫ့ အဖိၪခွၫၥံၪ, စခၩ့ၡ့ၫမအဲအၫ ဒဲအထၧၫ့ဖုဝဲၥံၪနံၫယၩ",
			"9": "<sup>9</sup> တၭ,- လၧစဟံဘြၧၫ့အဖိၪခွၫၥံၪး စခၩ့အံၫလအ့လၭ,",
			"10": "<sup>10</sup> ဒဲအထၧၫ့ဖုဝဲၥံၪဎိၭဆံၫတၭး- လၧစအၧၭဇဲၫအ့လၭ အဖိၪခွၫၥံၪစခၩ့အမံနဒၭ, ဒဲအထၧၫ့ဖုဝဲၥံၪလယၩလ ဆံၫနံၫဂၩလီၫ.",
			"11": "<sup>11</sup> တၭစဒၫဝံၭကိၭန့ၦလုဆၧလဖၪ စဇၫဒီၭဒဲစအဘဲအ ၥၫနီၪ,ဒဲၦလံဝဲၫဖိၪၥံၪ,စယုၫရဲၫအ့လၭ, စအၭစအဲအၫ, ဒဲစယိၫအ့လၭ, စၡ့ၫမအဲအၫ,ဒဲစအံၫလဲၫအ့လၭ,ဒဲစ",
			"12": "<sup>12</sup> အၫမံနဒၭတၭး- စံၭအဝ့ၫၥံၪ, နၥံၪဝ့ၫဒၪယီၩမွဲၦလံဝဲၫ ဖိၪအဖါၥံၪ အခိၪလဖၪတၭး နၥံၪဝ့ၫဒၪယီၩ ဒဲနၥံၪအ ထၧၫ့ဖုဝဲၥံၪ မၩဆံၫ့ထၪ့နၥံၪအၥၭ, ဘဲၫၥိၭနၥံၪမိဂဲၫ ထၪ့ဆိၬန့ယဟိဝၩအံၫစရ့လၭ အယွၩ အတလၫနီၪ,",
			"13": "<sup>13</sup> ထီၩ့လၧအလး လၧယတဲၩ့ဝဲၩန့အဂးနီၪဘီၪ.- အဂဲး ဘဲၫယီၩမွဲနၥံၪလမၩဘၪလၧအခၪ့ထံၭလဘျၩ့အကၠီၩ့ နီၪ,ယဟိဝၩပယွၩမၩဖိးဆၧလၧပကျၩ, အဂဲးဘဲၫယီၩ မွဲလၧပလအၪ့ဎၬဘၪအဝ့ၫဒၪ ဘဲၫဖၧၩ့ၥၭလၧပကြၨၭ မၩအၥိၭနီၪလီၫ.",
			"14": "<sup>14</sup> အခိးမွဲၦလုဆၧ ဒဲၦလံဝဲၫဖိၪၥံၪ မၩဆံၫ့ထၪ့အၥၭ ဘဲၫၥိၭအမိဂဲၫထၪ့ဆိၬ ယဟိဝၩအံၫစရ့လၭအယွၩ",
			"15": "<sup>15</sup> အတလၫနီၪလီၫ.- တၭၦလံဝဲၫဖိၪလဖၪယိၭန့ယွၩအ တလၫနီၪလၧအနိၪယိၭဘီၩ့ လၧအဝ့ၫၥံၪအခိၬထံၭ ခိၪနီၪ,ဘဲၫစမိစ့ၭမၪလူၬဝ့ၫ ဘဲၫယဟိဝၩအလူအထၫ အၥိၭနီၪလီၫ.",
			"16": "<sup>16</sup> တၭစဒၫဝံၭလီၩဘၪၦလံဝဲၫဖိၪၥံၪအခိၪလဖၪ, ဘဲၫ ၥိၭအဝ့ၫၥံၪမိအီၪက့ၪထၪ့ အထၧၫ့ဖုဝဲလဖၪ လၧၦၥံၫ ကျံၩဆၧလၧအဒံၩ့ဆၧလဖၪ, အီၪလၧၥၫ့ထီးၥံၪ နါဒံၩ့ ၥံၪ,စံၩ့စံၩ့ၥံၪ,ၥီၫထၪ့ဝ့ၫ, လၧအထုၭထၪ့အလူလၧဆၧ",
			"17": "<sup>17</sup> ၥုၪ့ထိၬၥၭထိၬနီၪလီၫ.- အခိးမွဲၦလံဝဲၫဖိၪၥံၪ, အီၪက့ၪ စယိၫအ့လၭအဖိၪခွၫစဟံမၫ့နီၪး ဒဲအထၧၫ့ဖုဝဲလဖၪ, စဘ့ၫရခဲအၫအဖိၪခွၫစအၫစၭး ဒဲအဝ့ၫၥံၪအထၧၫ့ဖုဝဲ လဖၪစမရၫရဲၫအဖိၪခွၫၥံၪ, စကုၫၡဲယၫအဖိၪခွၫစအံၫၥၫ့,",
			"18": "<sup>18</sup> ဒဲအဝ့ၫၥံၪအထၧၫ့ဖုဝဲလဖၪ လၧအၥိၭနံၫဆၫ့လ ဆၫ့နီၪး စဇ့ၭခရဲအၫ,စဘံၫ့,ဒဲစယအၫဇအ့လၭ,ဒဲစၡ မံၫရမီၭ,ဒဲစယဟဲၫအ့လၭ, ဒဲစအၧနဲၫ,ဒဲစအံၫလဲအၭ, ဒဲစဘံၫ့နအဲအၫဒဲစမၫအစဲအၫ, ဒဲစမၭတၥဲအၫ,ဒဲစအံၫ လံၭဖလ့ၬ,ဒဲစမံၭကနဲအၫ, ဒဲစအိၫဘဒံဒၧၫ့,ဒဲစယအဲၫ",
			"19": "<sup>19</sup> အ့လၭ,ၦခိၭတရၫ့လဖၪလီၫ.- ဘဲၫနီၪအၥိၭၦၥံၫကျံၩ ဆၧလဖၪ,စဟံမၫ့, စအၫစၭ,ဒဲစအံၥၫ့,ၦမၩၥီၫဆၧလၧ",
			"20": "<sup>20</sup> စံၩ့စံၩ့ထီးဘၩ့း- ဒဲဇ့ၭခရဲအၫ,ဒဲစအၫဇအ့လၭ, ဒဲၡ မံၫရမီၭ,ဒဲစယဟဲၫအ့လၭ, ဒဲစအၧနဲၫ,ဒဲစအံၫလဲအၭ, ဒဲစမၫအစဲအၫ ဒဲစဘံၫ့နအဲအၫ,လၧၥၫ့ထီးအၫလမီၭ",
			"21": "<sup>21</sup> ၥံၪး- ဒဲစမၭတၥဲအၫ, ဒဲစအံၫလံၭဖလ့ၭ, ဒဲစမံၭကနဲ အၫ,ဒဲစအိၫဘဒံဒၧၫ့, ဒဲစယအဲၫအ့လၭ, ဒဲစအၭဇဇဲ အၫလၧနါဒံၩ့ ၡ့ၫမနံၭၥံၪ ဘဲၫဆၧဂ့ၩထုၬ အၥိၭနီၪ လီၫ.",
			"22": "<sup>22</sup> တၭၦလံဝဲၫဖိၪအခိၪ, စခ့ၫနနဲအၫနီၪမွဲလၧၥံၫကျံၩ ဆၧအဂးလီၫ. တၭအဝ့ၫဒၪနၪၥ့ၪဆၧၥံၫကျံၩအဂဲးအ",
			"23": "<sup>23</sup> ကၠီၪ့နီၪ,မွဲအၥီၪ့လိၪဆၧဘဲၫနီၪလီၫ.- တၭစဘ့ၫရခဲအၫ ဒဲစအ့လကနၫၥံၪမွဲၦပၧၩ့တရၫ့လၧတလၫနီၪအဂးလီၫ.",
			"24": "<sup>24</sup> တၭစၡ့ၭဘနဲအၫ, ဒဲစယဟီၡဖၭ,ဒဲစနၥၫ့နအ့လၭ, ဒဲစအၫမစ့အဲၫ,ဒဲစဇ့ၭခရဲအၫ, ဒဲစဘံၫ့နအဲအၫ,ဒဲစအံၫ လအ့ဇၫၥံၪ,မွဲၦလုဆၧနီၪ, ဒဲအူၪထၪ့ခွ့ၩၥံၪလၧယွၩ အတလၫအမ့ၬယၫလီၫ. စအိၫဘဒံဒၧၫ့, ဒဲစယဟဲအၫ ၥံၪမွဲၦပၧၩ့တရၫ့လၧတလၫနီၪအဂးလီၫ.",
			"25": "<sup>25</sup> ဘဲၫနီၪၥိၭစဒၫဝံၭ, ဒဲအံၫစရ့လၭအၥုၪ့က့ၭၥၭၡါလ ဖၪ,ဒဲၦအထီၫ့ၥံၪအခိၪလဖၪလ့ၩမၩန့ယဟိဝၩအဆၧ အုၩ့လၩ့အတလၫအီၪဝ့ၫ လၧစအိၫဘဒံဒၧၫ့အဂံၪ့နီၪ",
			"26": "<sup>26</sup> လၧဆၧၥုၪ့ထိၬၥၭထိၬဆ့လီၫ.- တၭဆၧမၩအၥၭထီး ယွၩမၩဆၧၩ့ၦလံဝဲၫဖိၪၥံၪ လၧအယိၭန့ ယဟိဝၩအ ဆၧအုၩ့လၩ့အတလၫနီၪတၭ, အဝ့ၫၥံၪလုထၪ့ ချီဖၫ",
			"27": "<sup>27</sup> နွ့ၫဒုၩဒဲၥိၪဖၫနွ့ၫဒုၩဆ့လီၫ.- တၭစဒၫဝံၭၥိၭထၪ့ဝိၬ လိၫ့လၧဆၧဘွၩဖျ့ၫလံၬကံၭ, ဒဲၦလံဝဲၫဖိၪ ထီးအလူၬ ဆ့လၧအယိၭန့တလၫနီၪ ဒဲၦၥံၫကျံၩဆၧလဖၪ,ဒဲၦၥံၫ ကျံၩဆၧလဖၪအခိၪ စခ့ၫနနဲအၫလၧအဝ့ၫၥံၪအၥိၭ လီၫ. စဒၫဝံၭအီၪလၧအ့ဖိၭဆ့လၧ ဆၧဘွၩဖျ့ၫလံၬကံၭ",
			"28": "<sup>28</sup> လဘံၪ့လီၫ.- ဘဲၫနီၪၥိၭအံၫစရ့လၭထီးအလူၬဂဲၫထၪ့ ဆိၬယဟိဝၩအဆၧအုၩ့လၩ့အတလၫနီၪ, လၧဆၧကိၭ ၡၭထၪ့,ဒဲလၧခဲၫၥံၪအၥီၫ, ဒဲခွ့ၩၥံၪ,ဒဲလၧစံၩ့စံၩ့ၥံၪ,မၩ ၥီၫထၪ့ဆၧလၧၥၫ့ထီးၥံၪ, ဒဲလၧနါဒံၩ့ၥံၪလီၫ.",
			"29": "<sup>29</sup> ဆၧမၩအၥၭလၧယဟိဝၩ, အဆၧအုၩ့လၩ့အတ လၫနီၪဂဲၫထီၩ့လၧစဒၫဝံၭအဒိၩ့တၭ, စစီလူၫအဖိၪမုၪ နးမဲၫခၫလၭ ယိလၩ့ဆၧလၧတရၫ့လံၩတၭ, ဒၪဘၪ စဎွၩဒၫဝံၭနီၪဂဲထုၪ့လံ, ဒဲဒံၩ့ဆၧတၭး မွဲအအီၪက့ၪၥၭ လိၪအဝ့ၫဒၪလၧအၥၭခံဖၧၩ့လီၫ."
		},
		"16": {
			"1": "<sup>1</sup> အခိးမွဲအဝ့ၫၥံၪဂဲၫဆိၬန့ယွၩအတလၫနီၪတၭ, အီၪ က့ၪဝ့ၫလၧတဲၩအၥၭကျၩ လၧစဒၫဝံၭတဲၩ့ဝဲၩန့အဂး လီၫ.တၭအဝ့ၫၥံၪလုထၪ့ဆၧလုမ့ၪလဖၪ, ဒဲဆၧလုဘၪ",
			"2": "<sup>2</sup> လိၬအိၭလိၬလဖၪ လၧယွၩအမ့ၬယၫလီၫ.- ထီးစဒၫ ဝံၭလုထၪ့ဆၧလုမ့ၪလဖၪ, ဒဲဆၧလုဘၪလိၬအိၭလိၬလ ဖၪဂီၩ့တၭ, မွဲအဆိၪဂ့ၩၦခမျၧးၥံၪ လၧယဟိဝၩအမံၩ့",
			"3": "<sup>3</sup> အဖၧၩ့နီၪလီၫ.- တၭအဝ့ၫဒၪဖ့ၪလၫ့ အံၫစရ့လၭၥံၪ ကိၭဂၩဒ့ၭဆုၬဆုၬ, အမုၪဂ့ၩအခွၫဂ့ၩ, ကယဲၦၡၩလ ဂၩလါလါနီၪ, လဂၩကိၪလလီၪ့, ဒဲဆၧယၪဂ့ၩလကဲၩ့ ဒဲဆၧအီၩလခွၭလီၫ.",
			"4": "<sup>4</sup> တၭမွဲအအီၪက့ၪ ၦလံဝဲၫဖိၪလနၩ့ လၧအမိဘၪမၩ ဆၧမၩလၧယဟိဝၩအတလၫအမ့ၬယၫနီၪ, ဒဲကွ့ၭနဲၪ့ ဆၧ,ဒဲစံၭထၪ့အၪ့အူၭယဟိဝၩအံၫစရ့လၭအယွၩအ",
			"5": "<sup>5</sup> ခိးအတၩနီၪလီၫ.- ၦအခိၪစအၫစၭ, ဒဲနံၫဆၫ့လဆၫ့ စဇ့ၭခရဲအၫ, စယအဲၫအ့လၭ,ဒဲစၡမံၫရမီၭ,ဒဲစယ ဟဲၫအ့လၭ,ဒဲစမၭတၥဲအၫ, ဒဲစအံၫလဲအၭ,ဒဲစဘံၫ့န အဲအၫ, ဒဲစအိၫဘဒံဒၧၫ့ၥံၪး ဒဲစယအဲၫအ့လၭနီၪအီၪ လၧၥၫ့ထီးဒဲနါဒံၩ့ၥံၪတၭး အ့ၪမွဲစအၫစၭနီၪမၩၥီၫဆၧ",
			"6": "<sup>6</sup> လၧစံၩ့စံၩ့ၥံၪတၭး- စဘံၫ့နအဲအၫဆ့ဒဲစယဟၫဇအ့ လၭၦလုဆၧလဖၪအီၪလၧခွ့ၩၥံၪလၧယွၩအဆၧအုၩ့ လၩ့အတလၫနီၪအမ့ၬယၫလထံၪဎးလဘီၩ့ဎးလီၫ.",
			"7": "<sup>7</sup> ထီးနီၪလဖၧၫ့လၧမုလနံၩဎးနီၪ စဒၫဝံၭဖ့ၪလၫ့ဆိၫ ဆၧစံၭထၪ့အၪ့အူၭ ယဟိဝၩအခိးအတၩ အထၭခိၪ ယီၩလၧစအၫစၭဒဲအထၧၫ့ဖုဝဲလဖၪအစူၪဖၧၩ့လီၫ.",
			"8": "<sup>8</sup> စံၭထၪ့အၪ့အူၭယဟိဝၩအခိးအတၩ, ကိၭထၪ့အ မံၩ့, ဒုၭၥ့ၪယၫအဆၧမၩလၧၦခမျၧးအကျၩဆံၭ.",
			"9": "<sup>9</sup> ၥံၫကျံၩထၪ့အဝ့ၫဒၪ, ၥံၫကျံၩထၭခိၪၥံၪလၧအဝ့ၫဒၪး ချဲၩ့ဒုၪ့လိၬနၥံၪဝ့ၫ လၧအဆၧမၩလၩ့လၭ ထီးအလူၬ အဂဲးအကၠီၪ့ဆံၭ.",
			"10": "<sup>10</sup> မၩဖိၫလိၫနၥံၪအၥၭ လၧအဝ့ၫဒၪ အမံၩ့ဆံၫ့ဎံၪဆံၭ. ၦလၧအအၪ့ဎၬယဟိဝၩနီၪ, မွဲအၥုၪ့ထိၬၥၭထိၬဆံၭ.",
			"11": "<sup>11</sup> အၪ့ဎၬယဟိဝၩဒဲအဂဲးအဘၭနီၪး အၪ့ဎၬအမ့ၬလထံၪဎးလဘီၩ့ဎးဆံၭ.",
			"12": "<sup>12</sup> နၪ့ထၪ့ထဲၩ့အဆၧမၩလၩ့လၭ လၧအမၩဝ့ၫလဖၪနီၪ ဘီၪ. အဆၧလၩ့လၭလဖၪ, ဒဲအနိၭ အဆၧစ့ၩရၫ့လဖၪနီၪ ဘီၪ.",
			"13": "<sup>13</sup> အခ့ၫအၡၩအံၫစရ့လၭအချံၫအၥၪၥံၪဧ့း ၦလၧအရွံန့ဝ့ၫလဖၪ, စယၫကူၭအဖိၪအလံၩၥံၪဧ့း",
			"14": "<sup>14</sup> အဝ့ၫဒၪမွဲယဟိဝၩပယွၩတၭး အဆၧစ့ၩရၫ့လဖၪအီၪလၧဂၪ့ခိၪဎံၩ့လ့ၬလီၫ.",
			"15": "<sup>15</sup> နၪ့ထၪ့ထဲၩ့နၥံၪဝ့ၫအဆၧအုၩ့လၩ့နီၪဘီၪး ဆၧချဲၩ့လၧအမၪလူၬဝ့ၫ လၧၦအဆိၩအထီၫ့လဖၪနီၪး",
			"16": "<sup>16</sup> လၧအအုၩ့လၩ့ဝ့ၫလၧစအၫဘြဟၫ့နီၪ, ဒဲအဆၧဆိၪလၩ့အၥၭလၧစအံစၭဆ့း",
			"17": "<sup>17</sup> ဒဲမၩဂုးခၧၫ့ဝ့ၫ လၧစယၫကူၭ လၧဆၧအထူၫအရူၫအ ဂး, ဒဲလၧအံၫစရ့လၭနီၪ လၧဆၧအုၩ့လၩ့ အဆိၩအကၠၪ အဂး,",
			"18": "<sup>18</sup> စံၭဝ့ၫဒၪ, ယမိဖ့ၪလၫ့ခးကၫနအၫ့လၧနၧၩနီၪး မွဲနန့ၥၫဆၧအလးနီၪလီၫ.",
			"19": "<sup>19</sup> လၧနၥံၪမွဲၦၡၩဂၩနီၪ, ၦၡၩၡၩဂၩဒၪလ့ၬး ဒဲၦမွံၩၥံၪလၧအဖၧၩ့လီၫ.",
			"20": "<sup>20</sup> လၧအဝ့ၫၥံၪလ့ၩဆၧ လၧၦလဆၨၩဖိး လၧၦလဆၨၩ ဒၪနီၪ, ဒဲလၧဘၩ့မုးလစီၪ့ဖိးလၧၦခမျၧးဂူၫဂၩၥံၪး",
			"21": "<sup>21</sup> မွဲအဖ့ၪလၫ့ၦၡၩမၩအၧၩ့မၩနၭဝ့ၫနးဂၩအ့ၬး မွဲယူၭ, မွဲအအၪ့ၥီၪ့ စဎွၩလဖၪ လၧအဝ့ၫၥံၪအကၠီၩ့ လီၫ.",
			"22": "<sup>22</sup> တၭစံၭဝ့ၫ, ထီးထိၭဘၪယၡၩဘၪဂုၪအၥၭနီၪလဂ့ၩ ဒဲထီးမၩမၪဘၪယမီၪလဖၪနးဆံၭလဂ့ၩ,",
			"23": "<sup>23</sup> ၥံၫကျံၩထၪ့ယဟိဝၩဂၪ့ခိၪထီးအလူၬၥံၪဧ့း ဒုၭနဲၪဖျီၪထၪ့အဆၧထိးထဲၩ့တၩ့ထဲၩ့လနံၩဘၪလနံၩ လနံၩဘၪလနံၩနီၪဆံၭ.",
			"24": "<sup>24</sup> လီၩလၩ့လၬလၩ့ အဝ့ၫဒၪ အဆၧလၩဆၧဖၩ့ လၧၦ ဆၨၩၥံၪအကျၩဆံၭး အဆၧမၩလၩ့လၭလဖၪ လၧၦကိၭဆၨၩဒ့ၭ အကျၩ ဆံၭ.",
			"25": "<sup>25</sup> အဂဲးဘဲၫယီၩ ယဟိဝၩနီၪမွဲဖၭဒိၪ, ဒဲကြၨၭအဘၪဆၧ စံၭထၪ့အၪ့အူၭဝ့ၫအၪအၪလ့ၬဆ့လီၫ. ၦဘၪၥၭမဲၪအဝ့ၫဒၪလၧယွၩၥံၪထီးအလူၬအဖၫ့ခိၪဆ့ လီၫ.",
			"26": "<sup>26</sup> အဂဲးဘဲၫယီၩ ၦခမျၧးအယွၩၥံၪ ထီးအလူၬနီၪမွဲဆၧ ဂၩ့ဆၧဖၪ့လီၫ. အ့ၪမွဲယဟိဝၩနီၪဒုၭကဲၪထၪ့မူၭခိၪလဖၪလီၫ.",
			"27": "<sup>27</sup> ဆၧလၩဆၧဖၩ့ ဒဲဆၧယူၭယၪ့ၥံၪ အီၪလၧအမ့ၬယၫ ဆၧဂဲးဆၧဘၭ ဒဲဆၧၥုၪ့ထိၬၥၭထိၬ အီၪလၧအလး ဖၧၩ့နီၪလီၫ.",
			"28": "<sup>28</sup> ဖ့ၪလၫ့ဆၧလၧယဟိဝၩ, ၦခမျၧးအဂံၪ့ဒီၪ့ၥံၪဧ့း ဖ့ၪလၫ့ယဟိဝၩလၧဆၧလၩဆၧဖၩ့ ဒဲဆၧဂဲးဆၧဘၭ ဆံၭး",
			"29": "<sup>29</sup> ဖ့ၪလၫ့ယဟိဝၩ လၧဆၧလၩဆၧဖၩ့ ကြၨၭလၧအမံၩ့ အဂးနီၪဘီၪး ဂဲၫဆိၬဆၧမၩဘိၪ့တၭ, ဂဲၫထၪ့လၧအမ့ၬယၫဆံၭ. ဘိၪ့ထၪ့ဘၩထၪ့ ယဟိဝၩ လၧဆၧဆံၫ့ဎံၪ အဎံၫအ လၩအဖၧၩ့ဆံၭး",
			"30": "<sup>30</sup> ၥၭမဲၪဆၧလၧအမ့ၬယၫ, ဂၪ့ခိၪထီးအလူၬၥံၪဧ့း ဂၪ့ခိၪမိအီၪဂုးခၧၫ့ဝ့ၫဆ့, ဘဲၫၥိၭ အထီးဝၭဝ့ၫလဂ့ၩ လီၫ.",
			"31": "<sup>31</sup> မွဲမူၭခိၪၥံၪၥုၪ့ထိၬၥၭထိၬဆံၭ, ဒဲဂၪ့ခိၪနီၪ, မွဲအၥုၪ့ဎွံၫ ၥၭယီၫဆံၭး တၭလၧၦဆၨၩလဖၪအကျၩနီၪ, မွဲၦၡၩၥံၪစံၭ, ယဟိ ဝၩနီၪပၧၩ့ဆၧလီၫ.",
			"32": "<sup>32</sup> မၫဆမံၭဒဲအဆၧလၧၫ့ဎွ့ၩနီၪ, မွဲအၥီၫထၪ့ဝ့ၫဆံၭး ဆံၬၥံၪနၩၥံၪ, ဒဲကယဲဆၧအီၪလၧအဖၧၩ့နီၪ, မွဲအၥုၪ့ ထိၬၥၭထိၬဆံၭး",
			"33": "<sup>33</sup> ထီးနီၪလဖၧၫ့ကယဲၥံၪ့ၥံၪလၧမံၩ့လၬကျၩနီၪ မိၥံၫကျံၩ ထၪ့ဝ့ၫလၧယဟိဝၩအမ့ၬယၫနီၪ, အဂဲးဘဲၫယီၩ မွဲအဂဲၫလၩ့ဘဲၫၥိၭအမိစ့ၩရၫ့ဂၪ့ခိၪ လီၫ.",
			"34": "<sup>34</sup> စံၭထၪ့အၪ့အူၭယဟိဝၩအခိးအတၩဆံၭး အဂဲးဘဲၫ ယီၩ,ဆၧဂ့ၩဝ့ၫဒၪလီၫး အဂဲးဘဲၫယီၩ အခိးအတၩနီၪ အီၪဝ့ၫအဆိၩအကၠၪ လီၫ.",
			"35": "<sup>35</sup> တၭစံၭနၥံၪဝ့ၫ, ပဆၧထိးတဲၩ့တၩ့ထဲၩ့အယွၩဧ့, ထိး ထဲၩ့တၩ့ထဲၩ့ပၧၩယီၩဆံၭး တၭကိၭကီၪ့ပၧၩ, ဒဲမၩဖီၩ့မၩဖျ့ၭပၧၩ လၧၦဆၨၩလ ဖၪနီၪ, ဘဲၫၥိၭပမိစံၭထၪ့အၪ့အူၭ နမံၩ့ဆံၫ့ဎံၪ အခိးအတၩ, ဒဲမၩဖိၫလိၫပၥၭ လၧနဆၧစံၭထၪ့အၪ့အူၭအဖၧၩ့နီၪ လီၫ.",
			"36": "<sup>36</sup> ယဟိဝၩအံၫစရ့လၭအယွၩနီၪ, မွဲအဘၪဆၧဆိၪဂ့ၩ အဆိၩဆိၩအကၠၪကၠၪနီၪဆံၭ. တၭၦခမျၧးၥံၪထီးအလူၬနီၪ, စံၭ, အၩမံၩ့း ဒဲစံၭထၪ့ အၪ့အူၭယဟိဝၩနီၪလီၫ.",
			"37": "<sup>37</sup> အခိးမွဲအဝ့ၫဒၪအီၪက့ၪလၩ့ထးစအၫစၭ ဒဲအထၧၫ့ ဖုဝဲၥံၪ, လၧယဟိဝၩအဆၧအုၩ့လၩ့ အတလၫအမ့ၬ ယၫ,ဘဲၫၥိၭအမိမၩဆၧအခ့ၫအၡၩ အဆၧမၩလၧတ လၫနီၪအမ့ၬယၫ, ဘဲၫလနံၩဘၪလနံၩ လနံၩဘၪလနံၩ",
			"38": "<sup>38</sup> အဆၧမၩအီၪဝ့ၫအၥိၭနီၪ လထံၪဎးဆ့လီၫ.- ဒဲစအိၫ ဘဒံဒၧၫ့အီၪလၧအထၧၫ့ဖုဝဲၥံၪ ဎူၫဆံၫဎိၭဂၩနီၪး စယ့ၭ ဒုၫၥၫ့ အဖိၪခွၫ စအိၫဘဒံဒၧၫ့နီၪဆ့, ဒဲစဟိစၭ ၦပၧၩ့",
			"39": "<sup>39</sup> တရၫ့နီၪး- ဒဲၦလုဆၧစဇၫဒီၭ, ဒဲအထၧၫ့ဖုဝဲလဖၪၦလု ဆၧဆ့, လၧယဟိဝၩအတဲၩဆံၫ့ဎံၪနီၪအမ့ၬယၫလၧ",
			"40": "<sup>40</sup> ဆၧထၪ့ထီၫအလးလၧဂံဘအၧၫ့နီၪး- ဘဲၫၥိၭအမိလု ထၪ့ဆၧလၧမ့ၪလဖၪ, လၧဆၧလုမ့ၪအလး အဖၫ့ခိၪ မုဂီၩဒဲလၧမုဂၪလၩ့လထံၪဎးလဘီၩ့ဎးနီၪ, လၧယဟိ ဝၩအဂး, ဒဲမၩကယဲအဆၧမၩ ဘဲၫဆၧကွ့ၭအၥၭလၧ ယဟိဝၩအလူအထၫအဖၧၩ့, လၧအမၪလူၬ အံၫစရ့",
			"41": "<sup>41</sup> လၭနီၪလီၫ.- တၭစဟံမၫ့ဒဲစယ့ၭဒုၫၥၫ့အီၪလၧအဝ့ၫ ၥံၪအၥိၭ, ဒဲၦဂူၫဂၩၥံၪလၧအဘၪဆၧရွံန့ဝ့ၫ, လၧၦကိၭ ထၪ့အမံၩ့နီၪ, ဘဲၫၥိၭအမိစံၭထၪ့အၪ့အူၭ ယဟိဝၩ ဆ့း အဂဲးဘဲၫယီၩမွဲအခိးအတၩနီၪ အီၪဝ့ၫအဆိၩဆိၩ",
			"42": "<sup>42</sup> အကၠၪကၠၪလီၫ.- တၭစဟံမၫ့ဒဲစယ့ၭဒုၫၥၫ့ အီၪလၧ အဝ့ၫၥံၪအၥိၭတၭ အီၪလၧခွ့ၩၥံၪဒဲစံၩ့စံၩ့ၥံၪလၧၦမၩ ၥီၫဆၧအဂး, ဒဲလၧဆၧလၧအဒံၩ့ဝ့ၫလဖၪ လၧယွၩအ မ့ၬယၫနီၪဆ့လီၫ. တၭစယ့ၭဒုၫၥၫ့အဖိၪခွၫလဖၪနီၪမွဲ",
			"43": "<sup>43</sup> ၦပၧၩ့တရၫ့ၥံၪလီၫ.- တၭၦခမျၧး ထီးအလူၬၥံၪထဲၩ့ ထဲၩ့ဝ့ၫလၧအဂံၪ့အဎၫ့ကိၭဂၩဒ့ၭး ဒဲစဒၫဝံၭနီၪ ထဲၩ့ ထဲၩ့ဆိၪဂ့ၩအၡၩဂံၪ့ဖိၪလဖၪနီၪဆ့လီၫ."
		},
		"17": {
			"1": "<sup>1</sup> လၧစဒၫဝံၭဆၧၫ့နၩ့ လၧဂံၪ့ဖၧၩ့နီၪဆၧမၩအၥၭ, လၧစဒၫဝံၭစံၭမီၪစနၫၥၫ့လဂၩနီၪ, ယိခွါ, ယအီၪယ ဝ့ၫလၧဂံၪ့ၥံၪ့ၡိၫအ့ရ့ၭ, အ့ၪမွဲယဟိဝၩ အဆၧအုၩ့ လၩ့အတလၫနီၪ အီၪဒံၭ လၧကလကၫအဖၫ့လၬ ဒံၭ",
			"2": "<sup>2</sup> လီၫ.- ထီးနီၪလဖၧၫ့စနၫၥၫ့စံၭစဒၫဝံၭ, ကယဲဆၧလမံၩ့ လါလါအီၪလၧနၥၭခံဖၧၩ့နီၪ, မၩနဝ့ၫဘီၪး အဂဲးဘဲၫ",
			"3": "<sup>3</sup> ယီၩယွၩအီၪလၧနၥိၭလီၫ.- တၭဆၧမၩအၥၭ မုလ နၩဎးနီၪ, လၧယွၩအလူလၩ့ဘၪစနၫၥၫ့, စံၭဝ့ၫဒၪ,",
			"4": "<sup>4</sup> လ့ၩလီၩဘၪယခ့ၫယၡၩစဒၫဝံၭ, ယဟိဝၩစံၭဝ့ၫဘဲၫ ယီၩ,ဂံၪ့လၧယမိအီၪလၧအဖၧၩ့နီၪ, နမၩထၪ့ဘၪနဝ့ၫ",
			"5": "<sup>5</sup> လၧယဂးအ့ၬး- အဂဲးဘဲၫယီၩ လၧမုနံၩလၧယဒုၭစဲၪ့ အံၫစရ့လၭခီးမုဆၫလနံၩယီၩ, ယအီၪယဝ့ၫလၧဂံၪ့ ဖၧၩ့နးဆိၭအ့ၬး အ့ၪမွဲယလ့ၩယူၭလၧ လတဲၩဘၪလ",
			"6": "<sup>6</sup> တဲၩ,ဒဲလၧတဲၩဆံၫ့ဎံၪလစီၪ့စီၪ့နီၪလီၫ.- ထီးဒၪအလး လၧယလ့ၩဆၧလၧအံၫစရ့လၭအကျၩ လစီၪ့လါလါ နီၪ,ၦလၧအစ့ၩရၫ့အံၫစရ့လၭလဖၪ, လၧယအၪ့မၧၫ့ အလုအၪ့လုအီၩ ယၡၩခမျၧးၥံၪ, မွဲယချဲၩ့ဆၧလမံၩ့ မံၩ့လၧအဝ့ၫၥံၪ, စံၭ,ဂံၪ့ၥံၪ့ၡိၫအ့ရ့ၭနီၪနၥံၪလမၩထၪ့",
			"7": "<sup>7</sup> ဘၪလၧယဂးနီၪ, မွဲအဂဲးဘဲၫၥ့ၪလဲၪ, နီၪဆ့ဧၪ.- အ ခိးမွဲဘိၩ့နဲၪ့ယီၩ နဘၪလီၩဘၪယခ့ၫယၡၩစဒၫဝံၭဘဲၫ ယီၩ,ဆၧၥုၭမုခမျၧး အယဟိဝၩစံၭဝ့ၫဘဲၫယီၩ, ယ မၩန့ထၪ့နၧၩ လၧၥိၪဖီၩ့အဖၧၩ့နီၪ, လၧနယိၥိၪၥံၪ အဆၧမၩဘဲၫၥိၭနမိပၧၩ့ယၡၩခမျၧး အံၫစရ့လၭနီၪ",
			"8": "<sup>8</sup> လီၫ.- တၭထီးဒၪအလးလၧနဂၭဖၬယူၭ လစီၪ့လါလါ နီၪ,ယအီၪယူၭလၧနၥိၭကိၭစီၪ့ဒ့ၭ, ဘဲၫၥိၭယမိဒၪ့ထ့ၬ ခွံၬကယဲနဒုၪနဒၩၥံၪလၧနမ့ၬယၫကိၭဂၩဒ့ၭ, ဒဲမၩဒိၪ",
			"9": "<sup>9</sup> ထၪ့နမံၩ့လၧဂၪ့ခိၪချိၫ့ယီၩအၥိၭနီၪလီၫ.- တၭယမိအီၪ က့ၪလၩ့အလး လၧယၡၩခမျၧး အံၫစရ့လၭၥံၪအဂး ဆ့,ဒဲမိၥုၪ့လၩ့အဝ့ၫၥံၪတၭ, မိဘၪအီၪဂုးခၧၫ့လၧအ လးဒၪဝ့ၫနီၪ, မိၥုၭလၧၩ့အလးအ့ၬ. ဒဲၦအၧၩ့ဖိၪၥံၪမိ မၩၡၪ့မၩနၭလၧၩ့ဝ့ၫဘဲၫအမၩလၧအခၪ့ထံၭအၥိၭ,",
			"10": "<sup>10</sup> ဒဲခီၫလၧယအီၪက့ၪၦစ့ၩရၫ့ဆၧလဖၪ လၧယၡၩခမျၧး အံၫစရ့လၭၥံၪအဖၫ့ခိၪ ခီးဘိၩ့နဲၪ့ယီၩအ့ၬ. လၧနီၪအ မ့ၬယၫယမိမၩနၧၩ့မၩစၪ နဒုၪနဒၩၥံၪ ကိၭဂၩဒ့ၭဆ့ လီၫ.လၧနီၪအမ့ၬယၫ ယလီၩဘၪနၧၩ လၧယဟိဝၩ",
			"11": "<sup>11</sup> မိမၩထၪ့ဂံၪ့လၧနဂးဒၪနဝ့ၫလီၫ.- တၭဆၧမိမၩအၥၭ ထီးမုနံၩလဖၪ မိလူၬလၧနဘၪလ့ၩလၧ နဖါၥံၪအၥိၭ နီၪ,ယမိဒုၭဂဲထုၪ့နချံၫနၥၪ လၧနလးခဲၫ့လၧအဘၪဆဲၫ့ လၧနဖိၪခွၫၥံၪတၭး မိဒုၭဂုးခၧၫ့အဝ့ၫဒၪအဘၩ့အမုး",
			"12": "<sup>12</sup> နီၪလီၫ.- တၭအဝ့ၫဒၪမိဘၪမၩထၪ့ယဂံၪ့, ဒဲယမိဒုၭ အီၪဂုးခၧၫ့အဝ့ၫဒၪ အလးဆီၩ့ဆီနီၪ အဆိၩအကၠၪ",
			"13": "<sup>13</sup> လီၫ.- တၭယမိကဲၪအဝ့ၫဒၪအဖါ, ဒဲအဝ့ၫဒၪမိကဲၪယ ဖိၪခွၫဆ့လီၫ. တၭယမိမၩန့ခွံၬယဆၧယၫ့ၥၭလၧအ ဝ့ၫဒၪ,ဘဲၫယမၩန့ခွံၬ လၧၦအီၪလၧနလချႃၭအီၪဒံၭ",
			"14": "<sup>14</sup> ဘၪအၥိၭနီၪဆ့အ့ၬ.- အ့ၪမွဲယမိဒုၭအီၪဂုးခၧၫ့အဝ့ၫ ဒၪလၧယဂံၪ့ဒၪယဝ့ၫအဖၧၩ့ ဒဲလၧယဘၩ့ယမုးအဖၧၩ့ အဆိၩဆိၩအကၠၪကၠၪတၭး အလးဆီၩ့ဆီနီၪမိအီၪ",
			"15": "<sup>15</sup> ဂုးခၧၫ့လၩ့ဆိၩလၩ့ကၠၪလီၫ.- ဘဲၫဆၧချဲၩ့လဖၪယီၩ အၥိၭ, ဒဲဘဲၫဆၧဒၪဘၪ လၧယၫလခီၫယီၩအၥိၭနီၪ, ဘဲၫနီၪၥိၭစနၫၥၫ့ ချဲၩ့ဆၧလၧစဒၫဝံၭနီၪလီၫ.",
			"16": "<sup>16</sup> စဎွၩဒၫဝံၭနီၪဂဲၫဆၧၫ့နၩ့ လၧယဟိဝၩအမ့ၬယၫ တၭ,စံၭဝ့ၫဒၪ, ယဟိဝၩယွၩဧ့, လၧနၥိၫ့ယၧၩခီးဘိၩ့ နဲၪ့ယီၩနီၪယဝ့ၫဒၪယမွဲၦလဂၩလဲၪ, ဒဲယဂံၪ့နီၪမွဲဆၧ",
			"17": "<sup>17</sup> နီၪလမံၩ့လဲၪ.- မွဲလါနၫ့ဘိၩ, ယွၩဧ့,ဆၧယီၩလမံၩ့မွဲ ဆၧအဆံၭ လၧနမ့ၬၥၪလဖၪ အဖၧၩ့တၭး အဂဲးဘဲၫ ယီၩနလီၩဘၪယူၭနခ့ၫနၡၩအဂံၪ့အဂဲးအကၠီၪ့လၧ ယၫလခီၫယံၬယံၬလ့ၬ, တၭနအီၪက့ၪယူၭယၧၩဘဲၫၦ ၡၩလၧအလၩအဖၩ့အလးထီၫအၥိၭ, ယဟိဝၩယွၩ",
			"18": "<sup>18</sup> ဧ့.- မွဲစဒၫဝံၭချဲၩ့ဆၧလၧနၧၩ လၧနခ့ၫနၡၩအလၩအ ဖၩ့အဂးၥ့ၪဒံၭဘဲၫၥ့ၪလဲၪ. အဂဲးဘဲၫယီၩနၥ့ၪယၫနခ့ၫ",
			"19": "<sup>19</sup> နၡၩလီၫ.- ယဟိဝၩဧ့, လၧနခ့ၫနၡၩအဂး,ဒဲဘဲၫနၥၭ ဒၪနဝ့ၫအီၪဝ့ၫအၥိၭ, နမၩယူၭဆၧဖၭဒိၪလမံၩ့ယီၩ, လၧနဒုၭဖျီၪထၪ့ဆၧဖၭဒိၪလဖၪယီၩထီးအလူၬလီၫ.",
			"20": "<sup>20</sup> ယဟိဝၩဧ့, ၦလၩ့ဂၬနၧၩအီၪနးဂၩအ့ၬ, တၭအ့ၪလမွဲ ဘၪနၧၩယွၩအီၪဆ့အ့ၬ, ဘဲၫပနါဂၧၫ့လၧပနါဖၧၩ့အၥိၭ",
			"21": "<sup>21</sup> နီၪလီၫ.- တၭလၧဂၪ့ခိၪချိၫ့ယီၩမွဲၦလဆၨၩလၧအလၩ့ ဂၬနၡၩခမျၧးၥံၪအံၫစရ့လၭနီၪလဲၪး ၦလၧယွၩလ့ၩ ဎွ့ၩန့ဝ့ၫဘဲၫၥိၭအမိကဲၪထၪ့အၡၩခမျၧးဒၪဝ့ၫ, လၧအ မိမၩထၪ့နမံၩ့လၧဆၧဖၭဒိၪဒဲဆၧၥၭမဲၪအလး, လၧန နၫ့ထၪ့ခွံၬၦဆၨၩၥံၪ လၧနၡၩခမျၧးလဖၪ အမ့ၬယၫ ၦလဖၪလၧနဎွ့ၩန့ထဲၩ့ယူၭ လၧအံဇံၭအဖၧၩ့နီၪလီၫ.",
			"22": "<sup>22</sup> အဂဲးဘဲၫယီၩ နၡၩခမျၧးအံၫစရ့လၭလဖၪနီၪ မွဲနဒုၭ ကဲၪထၪ့နၡၩဒၪနဝ့ၫ အဆိၩအကၠၪနီၪလီၫ. ဒဲနဝ့ၫဒၪ,",
			"23": "<sup>23</sup> ယဟိဝၩဧ့, နကဲၪထၪ့အဝ့ၫၥံၪအယွၩလီၫ.- အခိးမွဲ ဘိၩ့နဲၪ့ယီၩ, ယဟိဝၩဧ့, ဆၧလၧနလီၩဘၪယူၭလၧ နခ့ၫနၡၩအဂဲးအကၠီၪ့, ဒဲအဂံၪ့အဂဲးအကၠီၪ့နီၪ, မွဲအ အီၪဂုးခၧၫ့အဆိၩအကၠၪ, ဒဲမၩဘဲၫနစံၭဆၧအၥိၭနီၪဆ့",
			"24": "<sup>24</sup> ဆံၭ.- မွဲအအီၪဂုးခၧၫ့ဒၪလ့ၬဘဲၫၥိၭနမံၩ့မိဒိၪထၪ့ဝ့ၫ အဆိၩအကၠၪ, စံၭဝ့ၫ, ဆၧၥုၭမုခမျၧးၥံၪအယဟိဝၩ နီၪ,မွဲအံၫစရ့လၭအယွၩတၭ, မွဲယွၩလၧအံၫစရ့လၭ အဂးတၭး မွဲနခ့ၫနၡၩစဒၫဝံၭအဂံၪ့နီၪအီၪဂုးခၧၫ့လၧ",
			"25": "<sup>25</sup> နမ့ၬယၫဆံၭ.- အဂဲးဘဲၫယီၩနဝ့ၫဒၪ,ယယွၩဧ့,နလီၩ ဘၪယူၭနခ့ၫနၡၩယူၭ, လၧနမိမၩထၪ့ဂံၪ့လၧအဂး အခိးမွဲနခ့ၫနၡၩအၥၭအီၪ လၧအမိအၪ့ကံၩ့ဘၩဆိၪ",
			"26": "<sup>26</sup> ဖၪလၧနမ့ၬယၫလီၫ.- တၭဘိၩ့နဲၪ့ယီၩယဟိဝၩဧ့,နမွဲ ယွၩ,ဒဲနအုၩ့လၩ့ဝဲၩယူၭဆၧဂ့ၩလမံၩ့ယီၩလၧနခ့ၫန",
			"27": "<sup>27</sup> ၡၩအဂးလီၫ.- အခိးမွဲဘိၩ့နဲၪ့ယီၩ, မွဲအဘၪနၥၭလၧန မိဆိၪဂ့ၩနခ့ၫနၡၩအဂံၪ့, ဘဲၫအမိအီၪလၧအမ့ၬယၫ အဆိၩဆိၩအကၠၪကၠၪဆံၭး အဂဲးဘဲၫယီၩ နဆိၪဂ့ၩ ဆၧ,ယဟိဝၩဧ့, တၭမွဲအဘၪဆၧဆိၪဂ့ၩအဆိၩဆိၩ အကၠၪကၠၪလီၫ."
		},
		"18": {
			"1": "<sup>1</sup> လၧဆၧယီၩလမံၩ့အလးခဲၫ့တၭ ဆၧမၩအၥၭလၧ စဒၫဝံၭကျီၪ့ခွံၬၦဖလံၡၫဖိၪၥံၪ, ဒဲမၩနၧၩ့မၩစၪအဝ့ၫ ၥံၪ,ဒဲမၩန့ခွံၬဂၭၥၫ ဒဲအတဝၫ့လဖၪလၧၦဖလံၡၫဖိၪ",
			"2": "<sup>2</sup> ၥံၪအစူၪဖၧၩ့လီၫ.- တၭအဝ့ၫဒၪကျီၪ့မိအၭနီၪး ၦမိအၭ ဖိၪၥံၪကဲၪစဒၫဝံၭ အခ့ၫအၡၩ ဒဲဂဲၫဆိၬဆၧဖ့ၪလၫ့လ",
			"3": "<sup>3</sup> ဖၪလီၫ.- တၭစဒၫဝံၭကျီၪ့ဇိဘၫအစဎွၩ စဟၭဒရံဇၧၫ ထီၩ့လၧဟၫမၭ, လၧအလ့ၩမၩဂုးထၪ့ အဘၩ့အမုး",
			"4": "<sup>4</sup> လၧထံၫမိၡါယုၫဖ့တံၫအနဲၩ့နီၪလီၫ.- တၭစဒၫဝံၭမၩ န့ခွံၬလဲၪ့ၥုၭလထီၫ့, ဒဲၦကၥ့ၪၥုၭနွ့ၫထီၫ့,ဒဲၦခၪ့ၥုၭနံၫ လၬလၧအဝ့ၫဒၪအစူၪဖၧၩ့း တၭစဒၫဝံၭဖ့ၬထ့ၬခွံၬလဲၪ့ ၥုၭအကၥ့ၪအခၪ့ထီၪ့ထီးအလူၬ, မွဲလါနၫ့တၭအီၪက့ၪ လၩ့ထးလဲၪ့ၥုၭၥံၪလယၩနီၪလီၫ.",
			"5": "<sup>5</sup> တၭထီးၦဘၪဆဲၫ့ လၧဒမၭစကၧၭၦစံရအၫဖိၪလ ဖၪဂဲၫဘဲၫၥိၭအမိမၩဘိၭမၩဆၧၩ့ ဇိဘၫအစဎွၩဟၭ ဒရံဇၧၫနီၪ, စဒၫဝံၭ ဖ့ၬခွံၬၦစံရအၫ အၡၩနံၫလၬနံၫ",
			"6": "<sup>6</sup> ထီၫ့လဖၪနီၪလီၫ.- ထီးနီၪလဖၧၫ့စဒၫဝံၭအီၪက့ၪၦၡၩ ခိၭဆၧလၧစံရအၫဒမၭစကၧၭအဖၧၩ့တၭး ၦစံရအၫ ဖိၪလဖၪကဲၪထၪ့စဒၫဝံၭအခ့ၫအၡၩ ဒဲဂဲၫဆိၬဆၧဖ့ၪ လၫ့လဖၪနီၪလီၫ. ဘဲၫနီၪၥိၭ ထီးဒၪအလးလၧစဒၫဝံၭ လ့ၩဝ့ၫလစီၪ့လါလါနီၪ, ယဟိဝၩယိထဲၩ့ခွါထဲၩ့မၩ",
			"7": "<sup>7</sup> ဖီၩ့မၩဖျ့ၭဝ့ၫဒၪဆ့လီၫ.- တၭစဒၫဝံၭမၩန့ထၩ့ဖံၭထီၫ့ ၥံၪလၧအအီၪဝ့ၫ လၧစဟၭဒရံဇၧၫ အခ့ၫအၡၩလဖၪ",
			"8": "<sup>8</sup> အလီၩ့နီၪတၭ, ဂဲၫဆိၬဝ့ၫလၧယရုစလံၫ့လီၫ.- ဘဲၫနီၪ ၥိၭဆ့လၧထံဘဟၭ, ဒဲလၧဆုၫ့နီၪ, မွဲဒိၩ့ၥံၪဘၪဆဲၫ့ လၧစဟၭဒရံဇၧၫတၭ, စဒၫဝံၭဂဲၫဆိၬန့ခွံၬထီးဘၩ့ အၪအၪလ့ၬ, လၧစစီလမၧၫ့မၩထၪ့ကမၫထီးဘၩ့နီၪ, ဒဲထုၪ့လဖၪ, ဒဲထွ့ၫထီးဘၩ့ၥံၪနီၪလီၫ.",
			"9": "<sup>9</sup> ထီးဟၫမၭအစဎွၩစထူနီၪ နါဂၧၫ့လၧစဒၫဝံၭကျီၪ့ ခွံၬဇိဘၫအစဎွၩ စဟၭဒရံဇၧၫ အၥုၭမုခမျၧးထီးအ",
			"10": "<sup>10</sup> လူၬတၭး- အဝ့ၫဒၪအၪ့မၧၫ့အဖိၪခွၫစဟဒိရၫ့လ့ၩလၧ စဎွၩဒၫဝံၭအအီၪ, ဘဲၫၥိၭအမိအၪ့စၪ့အအီၪမုၬဝ့ၫအ ဂဲးအကၠီၪ့နီၪ, ဒဲချဲၩ့မုၬအၥၭလၧအဒုၭထၫ့ဒၩစဟၭဒ ရံဇၧၫဒဲဖ့ၬခွံၬဝ့ၫဒၪဆ့, (အဂဲးဘဲၫယီၩ စဟၭဒရံဇၧၫ ဒဲစထူဒုၭလိၬအၥၭနီၪ) ဒဲမၩန့ကယဲထွ့ၫထီၫ့,ထွ့ၫစ့ၩ,",
			"11": "<sup>11</sup> ထွ့ၫထီးဝီၩၥံၪလမံၩ့လါလါကိၭအမံၩ့ဒ့ၭလီၫ.- တၭ ဆၧလဖၪနီၪစဎွၩဒၫဝံၭ အီၪက့ၪလၧဆၧဆံၫ့ဎံၪလၧ ယဟိဝၩအဂး, ဒဲစ့ၩ, ဒဲထီၫ့လၧအဂဲၫဆိၬထၪ့ခွံၬလၧ ၦဆၨၩၥံၪထီးအလူၬယီၩ, လၧအံဒၧၫ့,ဒဲလၧမိအၭ,ဒဲ လၧၦအၫမၧၫ့ဖိၪလဖၪ, ဒဲလၧၦဖလံၡၫဖိၪၥံၪ, ဒဲလၧ အၫမလ့ၭနီၪလီၫ.",
			"12": "<sup>12</sup> လၧနီၪအမ့ၬယၫနးဇ့ၫရုၫအဲအၫ အဖိၪခွၫစအၭဘၡဲၫ ဖ့ၬခွံၬၦအံဒၧၫ့ဖိၪၥံၪလလၬဎိၭထီၫ့ လၧခိၪလီၩ့ထံၫလၪ",
			"13": "<sup>13</sup> အဆူၭဖၧၩ့နီၪလီၫ.- အဝ့ၫဒၪအီၪက့ၪၦၡၩခိၭဆၧလၧ အံဒၧၫ့အဖၧၩ့တၭး ၦအံဒၧၫ့ဖိၪလဖၪကဲၪစဒၫဝံၭအခ့ၫ အၡၩကိၭဂၩဒ့ၭလီၫ. ဘဲၫနီၪၥိၭ ထီးဒၪအလးလၧစ ဒၫဝံၭလ့ၩဝ့ၫလစီၪ့လါလါနီၪ, ယဟိဝၩယိထဲၩ့ခွါထဲၩ့ မၩဖီၩ့မၩဖျ့ၭဝ့ၫဒၪဆ့လီၫ.",
			"14": "<sup>14</sup> တၭစဒၫဝံၭပၧၩ့အံၫစရ့လၭထီးအလူၬနီၪ, ဒဲဒုၭအီၪ ထၪ့ဆၧစ့ၩရၫ့လၧဆၧတီၩဆၧလီၩ့ လၧအၡၩခမျၧးၥံၪ",
			"15": "<sup>15</sup> ထီးအလူၬအကျၩနီၪလီၫ.- တၭနးဇ့ၫရုၫအဲအၫအဖိၪ ခွၫစယိအၭနီၪ အီၪလၧၦၥုၭမုခမျၧးၥံၪ အဖၫ့ခိၪနီၪး ဒဲစအဟဲလၧၭအဖိၪခွၫစယဟီၡဖၭ မွဲၦကွ့ၭနဲၪ့ဆၧ",
			"16": "<sup>16</sup> လီၫ.- တၭစအဟဲတၧၭအဖိၪခွၫစဇၫဒီၭ, ဒဲစအဘဲအ ၥၫအဖိၪခွၫစအဘံမလ့ၭၥံၪ မွဲၦလုဆၧတၭး စၡ့ၫဝၭ",
			"17": "<sup>17</sup> ၡၫမွဲၦကွ့ၭလံၬး- ဒဲစယဟီအဒၫအဖိၪခွၫစဘံၫ့နအဲအၫ အီၪလၧၦခ့ၫရ့ၭဖိၪဒဲၦဖံလ့ၭဖိၪၥံၪအဖၫ့ခိၪတၭး စဒၫ ဝံၭအဖိၪခွၫလဖၪ မွဲၦလၧစဎွၩအဂၩ့ထံၭလဖၪအခိၪ ၥံၪလီၫ."
		},
		"19": {
			"1": "<sup>1</sup> လၧဆၧယီၩလမံၩ့အလးခဲၫ့တၭ, ဆၧမၩအၥၭလၧ ၦအၫမၧၫ့ဖိၪၥံၪအစဎွၩနၫဟၭနီၪၥံၫဝ့ၫဒၪတၭ, အဖိၪ",
			"2": "<sup>2</sup> ခွၫပၧၩ့ဆၧလၧအလးလီၫ.- တၭစဒၫဝံၭစံၭဝ့ၫဒၪ,ယမိ ဒုၭနဲၪဆၧအခိးအတၩ လၧစနၫဟၭအဖိၪခွၫစဟၫနၧၫ့ နီၪ,အဂဲးဘဲၫယီၩ အဝ့ၫဒၪအဖါဒုၭနဲၪဆၧအခိးအတၩ လၧယၧၩလီၫ. တၭစဒၫဝံၭအၪ့မၧၫ့ၦၡၩလ့ၩချဲၩ့မုၬ အဝ့ၫဒၪလၧဆၧဘၪဆဲၫ့ လၧအဖါလဂၩနီၪလီၫ. တၭ စဒၫဝံၭအခ့ၫအၡၩၥံၪဂဲၫလၧၦအၫမၧၫ့ဖိၪၥံၪ အထံၫအ ခးလၧစဟၫနၧၫ့အအီၪ ဘဲၫၥိၭအမိမၩမုၬထၪ့အၥၭ",
			"3": "<sup>3</sup> လီၫ.- မွဲလါနၫ့ဘိၩ ၦအၫမၧၫ့ဖိၪၥံၪအၦဒိၪဖၭဒိၪလ ဖၪစံၭစဟၫနၧၫ့, စဒၫဝံၭအၪ့မၧၫ့ၦမၩမုၬဆၧၥံၪဂဲၫ လၧနအီၪတၭ, မွဲနဆီၫ့မီၪ့လၧအဒူၩယၪ့နဖါဆ့ဧၪး အ ခ့ၫအၡၩၥံၪဂဲၫလၧနအီၪ ဘဲၫၥိၭအမိအၪ့ဎၬယိဂူၪဂၪ့",
			"4": "<sup>4</sup> ခိၪယီၩ,ဒဲမၩဂၭဂီၩ့ခွံၬဝ့ၫ, မွဲအ့ၬဧၪ.- မၩအၥၭဘဲၫ နီၪတၭ,စဟၫနၧၫ့မၩန့စဒၫဝံၭ အခ့ၫအၡၩလဖၪနီၪ, လိၩ့ခွံၬအနိၭဆီၪ့, ဒဲထံၬခွံၬအကီၩ့အၥိၭ လၧအကျၩ",
			"5": "<sup>5</sup> ထီးအခဲၫ့ခွးနီၪတၭ, ဒုၭထဲၩ့ထဲၩ့အဝ့ၫၥံၪလီၫ.- ထီးနီၪ လဖၧၫ့ၦၡၩလ့ၩလီၩဘၪစဒၫဝံၭ လၧဆၧမၩၦၡၩနီၪ အဂဲးအကၠီၪ့လီၫ. တၭအဝ့ၫဒၪအၪ့မၧၫ့ၦၡၩလ့ၩထၪ့ အၪ့ဂၬအဝ့ၫၥံၪး အဂဲးဘဲၫယီၩၦၡၩၥံၪနီၪအမ့ၬမဲဖၭ ဒိၪလီၫ.တၭစဎွၩစံၭအဝ့ၫၥံၪ, အီၪခိၭဒၪခလူၬလၧယ့ၫ ရခိၫနီၪထီးနၥံၪအနိၭဆီၪ့ဂဲၫထၪ့ထဲၩ့ဒီၭတၭ, ဂဲၫထဲၩ့ ထဲၩ့နၥံၪဝ့ၫဆံၭ.",
			"6": "<sup>6</sup> တၭထီးၦအၫမၧၫ့ဖိၪၥံၪဒၪဘၪ လၧအမၩနၧၫ့အုၪ အၥၭလၧစဒၫဝံၭအမ့ၬယၫနီၪ, စဟၫနၧၫ့ဒဲၦအၫမၧၫ့ ဖိၪလဖၪဖ့ၪယုစ့ၩအကံကၫလထီၫ့နီၪ ဘဲၫၥိၭအမိအၪ့ လံၩ့န့အလဲၪ့ၥုၭလဖၪ ဒဲၦကၥ့ၪၥုၭၥံၪ လၧမ့ၭစိၫပတ့",
			"7": "<sup>7</sup> မၠၫနီၪ,ဒဲလၧစံရအၫမၫအခၫ, ဒဲလၧဇိဘၫနီၪလီၫ.- အ ခိးမွဲအဝ့ၫၥံၪအၪ့လံၩ့န့လဲၪ့ၥုၭၥံၪၥၧၫ့လၬနံၫထီၫ့,ဒဲမၫ အခၫအစဎွၩဒဲအၡၩခမျၧးလဖၪတၭး အဝ့ၫၥံၪဂဲၫၥုၪ့ အတဲၩၥံၪလၧမ့ၭဒဘၫအမ့ၬယၫနီၪလီၫ. တၭၦအၫ မၧၫ့ဖိၪၥံၪဂဲၫထၪ့ၡီၩ့လၧအဒိၩ့အတဝၫ့ၥံၪ အီၪကိၩ့ အီၪကီၪ့လၧအမိဒုၭၥုၭဝ့ၫဒၪနီၪလီၫ.",
			"8": "<sup>8</sup> ထီးစဒၫဝံၭနါဂၧၫ့ဝ့ၫတၭ, မွဲအအၪ့မၧၫ့လၩ့စယိအၭ, ဒဲကယဲၦၥုၭမုခမျၧး အဂဲးဆီၪ့လဖၪထီးအလူၬလီၫ.",
			"9": "<sup>9</sup> တၭၦအၫမၧၫ့ဖိၪလဖၪဂဲၫထၪ့နီၪ, တဲၩ့ဝဲၩဆၧဒုၭၥုၭ လၧဒိၩ့အတရၫ့အမ့ၬယၫနီၪလီၫ. တၭစဎွၩၥံၪလၧအ ဂဲၫနီၪ အီၪလၧဆၧပျၩ့ဖၧၩ့ လၧအလးလစီၪ့ဒၪလီၫ.",
			"10": "<sup>10</sup> ဘိၩ့နဲၪ့ယီၩ ထီးစယိအၭဒၪဘၪ လၧဆၧဒုၭၥုၭအီၪ တဲၩ့ဝဲၩအၥၭ ထၫ့ဒၩဝ့ၫလၧအမ့ၬယၫမွဲဂ့ၩ, လၧအ လးခဲၫ့မွဲဂ့ၩ,မွဲအရွံန့ၦဂဲးဆီၪ့လဖၪထီးအလူၬနီၪတဲၩ့",
			"11": "<sup>11</sup> ဝဲၩအဝ့ၫၥံၪထၫ့ဒၩ ၦစံရအၫဖိၪလဖၪနီၪလီၫ.- တၭၦ ၡၩဂူၫဂၩၥံၪမွဲအအီၪက့ၪဝ့ၫ လၧအထၧၫ့ဖုဝဲစအၭဘ ၡဲၫအစူၪဖၧၩ့တၭ, အဝ့ၫၥံၪတဲၩ့ဝဲၩအၥၭထၫ့ဒၩၦအၫ",
			"12": "<sup>12</sup> မၧၫ့ဖိၪၥံၪလီၫ.- တၭအဝ့ၫဒၪစံၭ, ၦစံရအၫဖိၪၥံၪအ့ၪ ဆီၪ့နဲၪ့ယၧၩတၭ, ထီးနီၪလဖၧၫ့ နဘၪဂဲၫမၩဘိၭမၩ ဆၧၩ့ယၧၩတၭး အ့ၪမွဲၦအၫမၧၫ့ဖိၪၥံၪအ့ၪဆီၪ့နဲၪ့နၧၩ တၭ,ထီးနီၪလဖၧၫ့ ယမိမၩဘိၭမၩဆၧၩ့နၧၩလီၫ.",
			"13": "<sup>13</sup> အီၪလၧနၥၭဒူၩဘီၪး မွဲပမၩဆီၪ့ပၥၭ လၧၦၡၩခမျၧး ၥံၪအဂး, ဒဲလၧပယွၩအဒိၩ့ၥံၪအဂးဘီၪ. တၭမွဲယဟိ ဝၩမၩထီးဒၪဆၧအဂ့ၩလၧအမ့ၬယၫနီၪဆံၭ.",
			"14": "<sup>14</sup> အခိးမွဲစယိအၭဒဲၦခမျၧးၥံၪ လၧအၥိၭၥုၭဘူၭအၥၭ လၧဆၧဒုၭၥုၭလၧၦစံရအၫဖိၪၥံၪ အမ့ၬယၫတၭး အ",
			"15": "<sup>15</sup> ဝ့ၫၥံၪစဲၪ့ဖျိၭလၧအမ့ၬယၫလီၫ.- တၭထီးၦအၫမၧၫ့ ဖိၪဒၪဘၪလၧၦစံရအၫဖိၪၥံၪစဲၪ့ဖျိၭယူၭတၭ, အဝ့ၫၥံၪ စဲၪ့ဖျိၭဆ့လၧအဝ့ၫဒၪအထၧၫ့ဖုဝဲ စအၭဘၡဲၫအမ့ၬ ယၫတၭ, နုၬဝ့ၫလၧဒိၩ့ဖၧၩ့နီၪလီၫ. ထီးနီၪလဖၧၫ့ စယိအၭဂဲၫထီၩ့လၧယရုစလံၫ့လီၫ.",
			"16": "<sup>16</sup> ထီးၦစံရအၫဖိၪၥံၪဒၪဘၪ လၧအဝ့ၫၥံၪစၪဝ့ၫလၧၦ အံၫစရ့လၭအမ့ၬယၫနီၪ, အဝ့ၫၥံၪအၪ့မၧၫ့အၥီၫ့ၥံၪ, ကိၭန့ၦစံရအၫဖိၪ လၧအအီၪလၧထံၫမိၡါဝါလခီၫနီၪး တၭစဟၭဒရံဇၧၫ အၥုၭမုခမျၧးအခိၪ စၡိဖၭနီၪလ့ၩ",
			"17": "<sup>17</sup> လၧအဝ့ၫၥံၪအမ့ၬယၫလီၫ.- ဆၧလီၩဘၪစဒၫဝံၭတၭး အဝ့ၫဒၪကိၭကီၪ့ၦအံၫစရ့လၭထီးအလူၬတၭ, ခၫ့ဂၬ ယီၫဒၫ့,ဘၪခီၩ့အဝ့ၫၥံၪတၭ, တဲၩ့ဝဲၩဆၧဒုၭၥုၭထၫ့ဒၩ အဝ့ၫၥံၪလီၫ. အခိးမွဲထီးစဒၫဝံၭတဲၩ့ဝဲၩဆၧဒုၭၥုၭထၫ့ ဒၩၦစံရအၫဖိၪလဖၪတၭ, အဝ့ၫၥံၪဒုၭဝ့ၫဒၪဆ့လီၫ.",
			"18": "<sup>18</sup> အ့ၪမွဲၦစံရအၫဖိၪလဖၪစဲၪ့ဖျိၭလၧအံၫစရ့လၭအမ့ၬ ယၫတၭး စဒၫဝံၭကျီၪ့ၥံၫၦစံရအၫဖိၪလဖၪဘၪဆဲၫ့လၧ လဲၪ့ၥုၭၥံၪနွ့ၫထီၫ့,ဒဲၦခၪ့ၥုၭဖိၪၥံၪလံလၬ, ဒဲမၩၥံၫၦ",
			"19": "<sup>19</sup> ၥုၭမုခမျၧးအခိၪစၡိဖၭနီၪလီၫ.- ထီးစဟၭဒရံဇၧၫအ ခ့ၫအၡၩဒၪဘၪလၧအစၪဝ့ၫလၧၦအံၫစရ့လၭ အမ့ၬ ယၫနီၪ,အဝ့ၫၥံၪမၩဘၪလိၬထဲၩ့အၥၭလၧစဒၫဝံၭတၭ, ကဲၪထၪ့အဝ့ၫဒၪအခ့ၫအၡၩလီၫ. တၭၦစံရအၫဖိၪၥံၪ မၩဘိၭမၩဆၧၩ့လၧၩ့ၦအၫမၧၫ့ဖိၪၥံၪဆ့အ့ၬ."
		},
		"20": {
			"1": "<sup>1</sup> ထီးနံၪ့ဆၧၫ့ထဲၩ့အလးဘၪတၭ, အဆၧၫ့အထီလၧ စဎွၩၥံၪလ့ၩထၪ့ဒုၭၥုၭနီၪ, ဆၧမၩအၥၭလၧစယိအၭ ၥိၫ့ထၪ့ၦၥုၭမုအစီၩ့အမၩ့တၭ, မၩဂၭဂီၩ့ခွံၬၦအၫမၧၫ့ ဖိၪၥံၪအထံၫအခးတၭ, ဂဲၫထီၩ့ဝၩ့ထၬရၭဘၫနီၪလီၫ. အ့ၪမွဲစဒၫဝံၭအီၪလၩ့ထးလၧ ယရုစလံၫ့နီၪလီၫ. တၭ",
			"2": "<sup>2</sup> စယိအၭကျီၪ့ရၭဘၫနီၪ, ဒဲမၩဂၭဂီၩ့ဝ့ၫဒၪလီၫ.- တၭ စဒၫဝံၭမၩန့ၥရဖူၩ လၧအဝ့ၫၥံၪအစဎွၩ အခိၪဎွံၪလီၩ့ တၭ,ဒၪန့အလယၧးနီၪ မွဲထီၫ့လကံကၫတၭ, အီၪလၧ မနံၬထၫ့မျါလၧအလီၩ့ဆ့တၭ, ဒုၭချႃၬဝ့ၫလၧစဒၫဝံၭ အခိၪဎွံၪနီၪလီၫ. အဝ့ၫဒၪဂဲၫဆိၬထၪ့ခွံၬ ဆၧအၪ့ဂူၬန့",
			"3": "<sup>3</sup> ဝ့ၫလၧဒိၩ့ဖၧၩ့နီၪအၪအၪလ့ၬဆ့လီၫ.- ဂဲၫဆိၬထၪ့ခွံၬ ၦၡၩၥံၪလၧအအီၪလၧအဖၧၩ့နီၪ, အီၪက့ၪဝ့ၫလၧလွၭ ၥံၪဒဲခါထၭၥံၪ, ဒဲကွၩၥံၪလီၫ. စဒၫဝံၭမၩၦအၫမၧၫ့ဖိၪ အဒိၩ့ထီးအလူၬလဖၪဘဲၫနီၪၥိၭဆ့လီၫ. တၭစဒၫဝံၭ ဒဲၦခမျၧးၥံၪထဲၩ့ထဲၩ့ လၧယရုစလံၫ့ကိၭဂၩဒ့ၭလီၫ.",
			"4": "<sup>4</sup> လၧဆၧယီၩလမံၩ့အလးခဲၫ့တၭ, ဆၧမၩအၥၭလၧ ဆၧဒုၭၥုၭအီၪထၪ့ လၧဂံဇၧၫ လၧၦဖလံၡၫဖိၪၥံၪနီၪ လီၫ. လၧအဆၧၫ့အထီနီၪၦဟုၡၫဖိၪစစံၭဘခ့ၫကျီၪ့ ၥံၫစစံၭပ့ၫဘၪဆဲၫ့လၧၦအဆီၪ့အဖိၪလဖၪနီၪတၭ, အ ဝ့ၫၥံၪဆၪ့လၩ့အၥၭလီၫ.",
			"5": "<sup>5</sup> တၭဆၧဒုၭၥုၭအီၪထၪ့ဒီၭ လၧၦဖလံၡၫဖိၪလဖၪနီၪ လီၫ. တၭစယၫအၧၫအဖိၪခွၫစအ့ၫလဟၫနၫ့ကျီၪ့ၥံၫၦ ဂံတဲၭဖိၪစဂိၫလဲအၫအထၧၫ့ဖုဝဲစလၫမဲၫနီၪ, အဝ့ၫဒၪအ ဖၩ့ဘီၩ့မၩအၥၭဘဲၫၦထၭထၪအထၪခိၪအၥိၭနီၪလီၫ.",
			"6": "<sup>6</sup> မၩဒီၭလဖၧၫ့ ဆၧဒုၭၥုၭအီၪထၪ့ဒီၭလၧဂၭၥၫတၭ, ထီးနီၪလစီၪ့ ၦၡၩအခံးအဂၩ့ဖၭဒိၪအီၪဝ့ၫလဂၩနီၪ, အဝ့ၫဒၪအစူၪနိၩ့ ဒဲအခၪ့နိၩ့ၥံၪအီၪဝ့ၫ နံၫဆံၫလံဘီၩ့, အစူၪလခီၫဎူၫဘီၩ့, အခၪ့လခီၫဎူၫဘီၩ့ ဆုၬဆုၬလီၫ.",
			"7": "<sup>7</sup> အဝ့ၫဒၪမွဲၦဆီၪ့အဖိၪခွၫလီၫ.- အ့ၪမွဲထီးအဝ့ၫဒၪအၪ့ ထၩန့အံၫစရ့လၭတၭ, စဒၫဝံၭအထၧၫ့ဖုဝဲ စၡံမအၫ",
			"8": "<sup>8</sup> အဖိၪခွၫစစၪ့နၥၧၫ့ကျီၪ့ၥံၫအဝ့ၫနီၪလီၫ.- အဝ့ၫၥံၪအီၪ ဖျဲၪလၧၦဆီၪ့လဂၩအဂး, လၧဂၭၥၫအဖၧၩ့တၭး မွဲအ လၩ့ထ့ၬဝ့ၫလၧစဒၫဝံၭအစူၪအကၠီၩ့ ဒဲလၧအခ့ၫအၡၩ ၥံၪအစူၪအကၠီၩ့လီၫ."
		},
		"21": {
			"1": "<sup>1</sup> တၭစၫတၫ့ဆၧၫ့ထုၪ့ထၫ့ဒုၪဒၩအံၫစရ့လၭနီၪ, ထိၪ ဂဲၩစဒၫဝံၭအၥၭဘဲၫၥိၭအမိဝံထၪ့နၬထၪ့ အံၫစရ့လၭ",
			"2": "<sup>2</sup> နီၪလီၫ.- တၭစဒၫဝံၭစံၭ, စယိအၭဒဲၦလၧအပၧၩ့ၦၡၩ ခမျၧးၥံၪ, လ့ၩဘီၪ, ဝံထၪ့နၬထၪ့အံၫစရ့လၭ လၧဘံ အၧၫၡံၫဘၫဖိးလၧဒၫ့နီၪတၭ, အဝ့ၫၥံၪအဆၧဝံဆၧနၬ နီၪဂဲၫထဲၩ့န့လၧယအီၪယီၩ, ဘဲၫၥိၭ ယမိၥ့ၪယၫယ",
			"3": "<sup>3</sup> ဝ့ၫဘီၪ.- တၭစယိအၭစံၭဆၧၫ့ဝ့ၫ, မွဲယဟိဝၩဒုၭအၪ ထၪ့အၡၩခမျၧးၥံၪ အၪနဲၪ့အအီၪနီၪ အဘျၩ့လယၩ ဆံၭး မွဲလါနၫ့ဘိၩယကဆါစဎွၩဧ့, အဝ့ၫၥံၪမွဲယက ဆါအခ့ၫအၡၩကိၭဂၩဒ့ၭ, မွဲအ့ၬဧၪ. အခိးမွဲယက ဆါဒုၭမၩတၡါဆၧလမံၩ့ယီၩ မွဲအဂဲးဘဲၫၥ့ၪလဲၪ. မွဲ",
			"4": "<sup>4</sup> အဒုၭမၪဘၪအံၫစရ့လၭနီၪ မွဲအဂဲးဘဲၫၥ့ၪလဲၪ.- မွဲ လါနၫ့ဘဲၫနီၪတၭစဎွၩအလူမၩနၧၩ့မၩစၪစယိအၭဆ့ လီၫ. အခိးမွဲစယိအၭစဲၪ့ထၪ့တၭ, လ့ၩလၧအံၫစရ့ လၭထီးအလူၬအကျၩနီၪဂီၩ့, ဂဲၫထဲၩ့ထီၩ့လၧယရုစ",
			"5": "<sup>5</sup> လံၫ့လီၫ.- ၦခမျၧးၥံၪအဆၧဝံဆၧနၬ စယိအၭအီၪက့ၪ ကီၪ့တၭ, ဖ့ၪလၫ့အန့နီၪလၧစဒၫဝံၭလီၫ. တၭၦအံၫစ ရ့လၭဖိၪၥံၪ လၧအထုၭထၪ့နၭကိၭဂၩဒ့ၭ မွဲလခွးလ ကုၬး ဒဲၦယုဒၫဖိၪၥံၪလၧအထုၭထၪ့နၭနီၪမွဲလံကုၬနွ့ၫ",
			"6": "<sup>6</sup> လၬဆ့လီၫ.- အ့ၪမွဲစလံဝဲၫဒဲစဘံၪ့ယမံၫ့ၥံၪအဝ့ၫဒၪဝံ ထၪ့နၬထၪ့လၧအဝ့ၫၥံၪအကျၩအ့ၬ. အဂဲးဘဲၫယီၩစ ဎွၩအလူနီၪမွဲဆၧဘၪၥၭလိၪလၧစယိအၭလီၫ.",
			"7": "<sup>7</sup> တၭဆၧလမံၩ့ယီၩ ဘၪယွၩအၥၭဆ့အ့ၬး အခိးမွဲ",
			"8": "<sup>8</sup> အကျီၪ့အံၫစရ့လၭလီၫ.- စဒၫဝံၭစံၭယွၩ, ယဝ့ၫဒၪယ မၩဆၧလမံၩ့ယီၩအကၠီၩ့တၭ, ယမၪဘၪဆၧဖၭဒိၪ ယူၭး အခိးမွဲယအၪ့ကံၩ့အၪ့ယၫနၧၩ မၩဖီၩ့မၩဖျ့ၭ ခွံၬနခ့ၫနၡၩအဆၧမၩအၧၩ့ယီၩဆံၭ. အဂဲးဘဲၫယီၩ ယမၩယူၭၦဂီၩ့ဖိၪအဆၧမၩဒိၪဒိၪလ့ၬလီၫ.",
			"9": "<sup>9</sup> တၭယဟိဝၩချဲၩ့ဆၧလၧစဒၫဝံၭအမီၪစဂၭနီၪ, စံၭ ဝ့ၫဒၪ, လ့ၩလီၩဘၪစဒၫဝံၭတၭ, စံၭအဝ့ၫ,ယဟိဝၩစံၭ ဝ့ၫဘဲၫယီၩ, ယအီၪက့ၪလၩ့ဆၧၥၧၫ့မံၩ့လၧနမ့ၬယၫး",
			"10": "<sup>10</sup> လၧဆၧၥၧၫ့မံၩ့အကျၩနီၪ ရွံန့နဝ့ၫ ဆၧနးမံၩ့ ဘဲၫၥိၭ",
			"11": "<sup>11</sup> ယမိမၩလၧနဂးဘီၪ.- အခိးမွဲစဂၭဂဲၫလၧစဒၫဝံၭအ",
			"12": "<sup>12</sup> အီၪတၭ စံၭအဝ့ၫဒၪ, ယဟိဝၩစံၭဝ့ၫဘဲၫယီၩ,- ဆၧ ၥၭဝံလၩ့ဒိၩၥၧၫ့နံၪ့မွဲဂ့ၩ, ဘၪဆၧမၩဂၭဂီၩ့လၧနဒုၪန ဒၩၥံၪအမ့ၬယၫလၩၥၧၫ့ဘံၪ့, လၧနဒုၪနဒၩၥံၪအနၭနီၪ ချႃၭန့နၧၩအဘိၩ့ဘၭမွဲဂ့ၩး အ့ၪလမွဲဘၪနီၪ မွဲယဟိ ဝၩအနၭ, ဆၧၥံၫချဲၫ့ဒၪလ့ၬ, လၧထံၫၥံၪခးၥံၪအဖၧၩ့, ဒဲယဟိဝၩ အၥီၫ့မၩဂၭဂီၩ့ဆၧ လၧအံၫစရ့လၭအခး နဲၩ့ထံၭနီၪမွဲဂ့ၩး ရွံန့နဝ့ၫဆၧနးမံၩ့နီၪဆံၭ. ဘိၩ့နဲၪ့ ယီၩစ့ၩရၫ့လၩ့ဒၪနနၫ့ဆါဒၪနဝ့ၫ, ဘဲၫၥိၭယမိဆိၬထဲၩ့ ဆၧအလူ လၧၦလၧအအၪ့မၧၫ့လၩ့န့ယၧၩ အအီၪနီၪ",
			"13": "<sup>13</sup> ဘီၪ.- တၭစဒၫဝံၭစံၭစဂၭနီၪ, ယအီၪလၧဆၧမၩထံၬ ထၬယၧၩဒိၪဒိၪလ့ၬအဘိၩ့ဆၧၩ့တၭး မွဲယမိလၩ့ထ့ၬ လၧယဟိဝၩ အစူၪဖၧၩ့နီၪး အဂဲးဘဲၫယီၩ အဝ့ၫဒၪ အဆၧယၫ့ၥၭၥံၪ အီၪအၪအၪလ့ၬး မွဲယထီးလၩ့ထ့ၬ လၧၦၡၩအစူၪဖၧၩ့လဂ့ၩ.",
			"14": "<sup>14</sup> အခိးမွဲယဟိဝၩအၪ့မၧၫ့လၩ့န့ ဆၧၥံၫချဲၫ့လၧအံၫစ ရ့လၭအကျၩနီၪလီၫ. တၭၦအံၫစရ့လၭဖိၪၥံၪ လၩ့",
			"15": "<sup>15</sup> ထ့ၬၦၡၩနွ့ၫလၬလီၫ.- တၭယွၩအၪ့မၧၫ့လၩ့အၥီၫ့လၧ ယရုစလံၫ့ဘဲၫၥိၭအမိမၩဂၭဂီၩ့ခွံၬဝ့ၫတၭး လၧအမၩ ဂၭဂီၩ့ဆၧအဘိၩ့ဘၭနီၪ, ယဟိဝၩယိဝ့ၫတၭ, နီၫ့ယါ လၩ့အၥၭလၧဆၧအၧၩ့အကၠီၩ့နီၪ, စံၭအၥီၫ့လၧအမၩ ဂၭဂီၩ့ဆၧနီၪ, အၪယူၭ, ထုၭလၩ့ထဲၩ့ နစူၪနီၪဆံၭ. တၭယဟိဝၩအၥီၫ့ဆၧၫ့ထုၪ့ လၧၦယ့ၫဘုၫဖိၪစအီနၫ့",
			"16": "<sup>16</sup> အခရဲးအနဲၩ့ထံၭနီၪလီၫ.- စဒၫဝံၭ စၪ့ထၪ့အမ့ၬၥၪ တၭ,ဒၪဘၪယဟိဝၩအၥီၫ့လဂၩ ဆၧၫ့ထုၪ့လၧဆၧဖိၭ ဖၫ့လၧမူၭခိၪ ဒဲဂၪ့ခိၪအဘိၩ့ဆၧၩ့နီၪ, နၭလၧအထုၭ ထၪ့အၥၭအီၪလၧအစူၪဖၧၩ့ လၧအယၩ့ထၪ့ဝ့ၫလၧယ ရုစလံၫ့အဖၫ့ခိၪနီၪလီၫ. ထီးနီၪလဖၧၫ့ စဒၫဝံၭ ဒဲအံၫ စရ့လၭအၥုၪ့က့ၭၥၭၡါၥံၪ လၧအကီၩ့ၥိၭရၧၬ အဆၧ",
			"17": "<sup>17</sup> ယၬနီၪ,လၩ့ထံၩဖါဝ့ၫဒၪလီၫ.- တၭစဒၫဝံၭစံၭယွၩ,မွဲ လၧယအၪ့မၧၫ့ဆၧဝံထၪ့နၬထၪ့ ၦခမျၧးၥံၪအကၠီၩ့နီၪ, မွဲအ့ၬဧၪ. မွဲယနၫ့ဆါဒၪလ့ၬလၧအမၪဘၪဆၧတၭ,ယ မၩအၧၩ့ဆၧတၡါလီၫ. အ့ၪမွဲၥိၪလဖၪယီၩ, အဝ့ၫၥံၪ မၩဆၧနီၪလမံၩ့လဲၪ. ယဟိဝၩ ယယွၩဧ့,မွဲနစူၪအီၪ လါလၧယလီၩ့ ဒဲလၧယဖါအဂံၪ့အလီၩ့ဆံၭး အ့ၪမွဲ လၧနၡၩခမျၧးၥံၪအလီၩ့ ဘဲၫၥိၭအမိဘၪဆၧခိဆၧဝီၩ နီၪ,ထီးမၩလဂ့ၩ.",
			"18": "<sup>18</sup> ထီးနီၪလဖၧၫ့ယဟိဝၩအၥီၫ့ မၪလူၬစဂၭလၧအဘၪ လီၩဘၪစဒၫဝံၭဘဲၫယီၩ, စဒၫဝံၭဘၪလ့ၩထၪ့လၧၦ ယ့ၫဘုၫဖိၪစအီနၫ့ အခရဲးဖၧၩ့နီၪ, မၩထၪ့ဆၧလုအ",
			"19": "<sup>19</sup> လးလၧယဟိဝၩအဂးထီးနီၪလစီၪ့လီၫ.- စဒၫဝံၭလ့ၩ ထၪ့ဝ့ၫဘဲၫစဂၭအဆၧချဲၩ့လၧအချဲၩ့ဝ့ၫ လၧယဟိဝၩ",
			"20": "<sup>20</sup> အမံၩ့နီၪတၭး- စအီနၫ့ကၠၪထဲၩ့အၥၭဒၪဘၪယဟိဝၩ အၥီၫ့နီၪတၭး အဖိၪခွၫအီၪလၧအၥိၭလံဂၩ အီၪက့ၪ",
			"21": "<sup>21</sup> ၥူၪခွံၬအၥၭလီၫ. တၭစအီနၫ့ယဲးဘုၪကၠိၩ့နီၪလီၫ.- စဒၫ ဝံၭဂဲၫလၧစအီနၫ့ အအီၪတၭ, စအီနၫ့ ယိထၪ့ဆၧဒၪ ဘၪစဒၫဝံၭတၭ, စဲၪ့ထၪ့ခွံၬဝ့ၫလၧအခရဲးဖၧၩ့, ၡီၩ့လၩ့ အၥၭလၧစဒၫဝံၭနီၪအမ့ၬယၫ ထီၩ့လၩ့ဝ့ၫ လၧဂၪ့ခိၪ",
			"22": "<sup>22</sup> လီၫ.- ထီးနီၪလဖၧၫ့စဒၫဝံၭစံၭ စအီနၫ့နီၪဘဲၫၥိၭယမိ မၩထၪ့ဆၧလုအလးလၧယဟိဝၩအဂးတၭ, အၪ့ဆၫ န့ယၧၩခရဲးအလးယီၩဘီၪး နဘၪအၪ့ဆၫန့ယၧၩလၧ အဎွ့ၩလၧၫ့ဎွ့ၩဘဲၫဆၧၥံၫချဲၫ့နီၪ မိလၩ့မါထဲၩ့လၧၦခ",
			"23": "<sup>23</sup> မျၧးအကျၩနီၪလီၫ.- တၭစအီနၫ့စံၭစဒၫဝံၭ, မၩန့က ဒၪဘီၪ,မွဲစဎွၩယကဆါနီၪ မၩထီးဒၪအဂ့ၩလၧအမ့ၬ ၥၪဖၧၩ့လမံၩ့လါလါဘီၪး ယိခွါ, ယဖ့ၪလၫ့ချီဖၫၥံၪ လၧဆၧလုမ့ၪအဂး, ဒဲနိၪထးလၧခရဲးဖၧၩ့နီၪလၧၥံၪ့မု အဂး,ဒဲဘုၪကၠိၩ့နီၪလၧဆၧမၩဘိၪ့အဂး, ယဖ့ၪလၫ့",
			"24": "<sup>24</sup> ထီးအလူၬလီၫ.- တၭစဎွၩဒၫဝံၭနီၪစံၭစအီနၫ့, မွဲအ့ၬး ယမိဎွ့ၩန့လၧအဎွ့ၩလၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩး အဂဲးဘဲၫယီၩ နဝ့ၫဒၪနဆၧနီၪယမိမၩန့လၧယဟိဝၩအဂးအ့ၬး ဒဲဆၧ လၧအဎွ့ၩလအီၪဘၪနီၪ ယမိလုထၪ့လၧဆၧလုမ့ၪအ",
			"25": "<sup>25</sup> ဂးဆ့အ့ၬ.- အခိးမွဲစဒၫဝံၭဖ့ၪလၫ့စအီနၫ့ လၧဆၧအ လးနီၪအဂး ထီၫ့ၡက့လၭ ဎူၫယၩလၧအခံၫ့န့ဝ့ၫနီၪ",
			"26": "<sup>26</sup> လီၫ.- တၭစဒၫဝံၭမၩထၪ့ ဆၧလုအလးလၧယဟိဝၩ အဂးထီးနီၪ, ဒဲလုထၪ့ဆၧလုမ့ၪၥံၪ, ဒဲဆၧလုဘၪလိၬ အိၭလိၬၥံၪ, ဒဲကိၭထၪ့ယဟိဝၩလီၫ. တၭအဝ့ၫဒၪစံၭ ဆၧၫ့ဝ့ၫလၧမူၭခိၪလခီၫနီၪ မွဲလၧမ့ၪအၪ့ဆၧလၧဆၧလု",
			"27": "<sup>27</sup> မ့ၪအလးအလီၩ့လီၫ.- ယဟိဝၩမၪလူၬအၥီၫ့တၭ,အ ဝ့ၫဒၪဒုၭနုၬထဲၩ့အနၭနီၪလၧအကၠိၭဖၧၩ့လီၫ.",
			"28": "<sup>28</sup> အဆၧၫ့အထီနီၪ ထီးစဒၫဝံၭဒၪဘၪလၧယဟိဝၩစံၭ ဆၧၫ့ဝ့ၫလၧၦယ့ၫဘုၫဖိၪစအီနၫ့ အခရဲးဖၧၩ့နီၪတၭ,",
			"29": "<sup>29</sup> ထီးနီၪလဖၧၫ့မွဲအလုထၪ့ဆၧထီးနီၪလီၫ.- အဂဲးဘဲၫ ယီၩယဟိဝၩအတဲၩဆံၫ့ဎံၪ, လၧစမိစ့ၭမၩထၪ့ဝ့ၫလၧ ၡါမုနၧၫ့ဖၫနီၪ, ဒဲဆၧလုအလးလၧဆၧလုမ့ၪအဂးနီၪ, အီၪဝ့ၫလၧဂံဘအၧၫ့အလးထၪ့ထီၫအဖၧၩ့လၧအဆၧၫ့",
			"30": "<sup>30</sup> အထီနီၪလီၫ.- အ့ၪမွဲစဒၫဝံၭလ့ၩထၪ့ လၧအမ့ၬယၫ အၪ့စၪ့ဆၧလၧယွၩနီၪၥ့ၪအ့ၬး အဂဲးဘဲၫယီၩ မွဲအၥၭ မဲၪယဟိဝၩအၥီၫ့အနၭလဘံၪ့နီၪလီၫ."
		},
		"22": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့စဒၫဝံၭစံၭဝ့ၫ, အယီၩမွဲယဟိဝၩယွၩ အဂံၪ့,ဒဲအယီၩမွဲ ဆၧလုမ့ၪအလးလၧအံၫစရ့လၭအဂးနီၪလီၫ.",
			"2": "<sup>2</sup> တၭစဒၫဝံၭအၪ့မၧၫ့ဆၧကိၭကီၪ့ ၦလခီၫဘၩ့မုးဖိၪ ၥံၪလၧအအီၪဝ့ၫလၧအံၫစရ့လၭအခးနီၪလီၫ. တၭၦ လၧအမၩဆၧလၧလိးၥံၪ, အီၪက့ၪလၩ့ဝ့ၫဘဲၫၥိၭအမိ စိၭန့လိးလဖၪ လၧအမိမၩထၪ့ဂံၪ့ လၧယွၩ အဂးနီၪ",
			"3": "<sup>3</sup> လီၫ.- တၭလၧဖနဲၬၥံၪအဂး ဒဲလၧတရၫ့ဖၭဒိၪအတ ရၫ့ဖိၪအဂး, ဒဲဆၧထၪ့ထိၪၥံၪ့အဂးနီၪ,စဒၫဝံၭတဲၩ့ဝဲၩ ထၭအၪအၪလ့ၬး ဒဲထီးဝီၩအၪလၧအလယၧးလအီၪ",
			"4": "<sup>4</sup> ဘၪနီၪ.- ဒဲၥံၪ့ၡိၫအ့ရ့ၭၥံၪအၪအၪလ့ၬဆ့း အဂဲးဘဲၫ ယီၩၦဇဲဒၧၫ့ဖိၪၥံၪဒဲၦအီၪလၧတဲအၫလဖၪနီၪဂဲၫဆိၬ",
			"5": "<sup>5</sup> ၥံၪ့ၡိၫအ့ရ့ၭ လၧစဒၫဝံၭအအီၪအၪအၪဆ့လီၫ.- တၭ စဒၫဝံၭစံၭဝ့ၫ, ယဖိၪခွၫစစီလမၧၫ့နီၪအၥၭဘၪ့ဒဲအဂဲး ဆါတၭ, ဂံၪ့လၧအဘၪကဲၪထၪ့လၧယဟိဝၩအဂးနီၪ ဘၪအီၪလၧအလၩအဖၩ့အၪအၪလ့ၬ, ဒဲအမံၩ့အလၩ အဖၩ့ လၧအဂၧၫ့ထၪ့ၥၩလၩ့ လၧကယဲထံၫၥံၪခးၥံၪ ဎံၩ့ဎံၩ့လ့ၬဆ့လီၫ. ယမိတဲၩ့ဝဲၩဆၧလၧအဂးဘိၩ့နဲၪ့ ယီၩလီၫ. အခိးမွဲဘိၩ့အလချႃၭၥံၫဒံၭဘၪနီၪ စဒၫဝံၭ တဲၩ့ဝဲၩဆၧအၪအၪလ့ၬလီၫ.",
			"6": "<sup>6</sup> ထီးနီၪလဖၧၫ့မွဲအကိၭအဖိၪခွၫစစီလမၧၫ့တၭ, မၪ လူၬဝ့ၫလၧအဘၪမၩထၪ့ဂံၪ့လၧယဟိဝၩအံၫစရ့လၭ",
			"7": "<sup>7</sup> အယွၩအဂးလီၫ.- တၭစဒၫဝံၭစံၭစစီလမၧၫ့, ယဖိၪခွၫ ဧ့,ယဝ့ၫဒၪယီၩ, ဆၧအီၪဝဲၩလၧယၥၭခံဖၧၩ့လၧယမိ",
			"8": "<sup>8</sup> မၩထၪ့ဂံၪ့ လၧယဟိဝၩယယွၩ အမံၩ့အဂးလီၫ.- မွဲ လါနၫ့ဘိၩယဟိဝၩ အလူလၩ့ဘၪယၧၩတၭ, စံၭဝ့ၫ ဒၪ,နဝ့ၫဒၪနလူၫလၩ့ဆၧၥွံၪအၪအၪလ့ၬ, ဒဲမၩကဲၪထၪ့ ဆၧဒုၭၥုၭၥံၪဒိၪဒိၪလ့ၬတၭး နဝ့ၫဒၪနမၩထၪ့ဘၪဂံၪ့ လၧယဂးအ့ၬ. အဂဲးဘဲၫယီၩ နလူၫလၩ့ဆၧၥွံၪလၧ",
			"9": "<sup>9</sup> ဂၪ့ခိၪချိၫ့ယီၩအၪအၪလ့ၬလၧယမ့ၬယၫလီၫ.- ယိခွါ, ဖိၪခွၫမိအီၪဖျဲၪလၧနဂးလဂၩ လၧအမိကဲၪၦၡၩအီၪ ပွံၭတၭ,ယမိဒုၭအီၪပွံၭအဝ့ၫဒၪ လၧကယဲအဒုၪအဒၩ ၥံၪလၧအအီၪဖီၩ့ဝ့ၫ ဝၬဝၬကိၭဂၩဒ့ၭလီၫ. အဂဲးဘဲၫ ယီၩအမံၩ့မွဲစစီလမၧၫ့တၭ, လၧအဝ့ၫဒၪအမုနံၩလဖၪ နီၪယမိဖ့ၪလၫ့အံၫစရ့လၭ လၧဆၧဘၪလိၬအိၭလိၬဒဲ",
			"10": "<sup>10</sup> ဆၧမုၬဆၧဎၩ့နီၪဆ့လီၫ.- အဝ့ၫဒၪမိမၩဘၪဂံၪ့လၧ ယမံၩ့အဂးတၭး အဝ့ၫဒၪမိကဲၪယဖိၪခွၫ, ဒဲယဝ့ၫဒၪ ယမိကဲၪထၪ့အဖါဆ့လီၫ. တၭယမိဒုၭဂုးထၪ့အဘၩ့ အမုးအလးဆီၩ့ဆီ လၧအံၫစရ့လၭအဖၫ့ခိၪအဆိၩ",
			"11": "<sup>11</sup> ဆိၩအကၠၪကၠၪလီၫ.- ဘိၩ့နဲၪ့ယီၩ, ယဖိၪခွၫဧ့,မွဲယဟိ ဝၩအီၪလၧနၥိၭး ဒဲဘီၪထၪ့ယီၫထၪ့နဝ့ၫ,ဒဲမၩထၪ့ယ ဟိဝၩနယွၩအဂံၪ့, ဘဲၫအဝ့ၫဒၪစံၭနၧၩအၥိၭနီၪဆံၭ.",
			"12": "<sup>12</sup> ဘဲၫနမိထီးန့ယဟိဝၩနယွၩအလူအထၫနီၪ, မွဲယဟိဝၩ ဖ့ၪလၫ့နၧၩလၧဆၧကိၪ့ၥ့ၪကိၪ့ဘၪ ဒဲၥုၪ့ဆၭၥၭဆၭ,ဒဲ",
			"13": "<sup>13</sup> မၪလူၬနၧၩလၧအံၫစရ့လၭအဂဲးအကၠီၪ့နီၪဆံၭ.- ထီး နီၪလဖၧၫ့,နအ့ၪထီးလၩ့နၥၭဘဲၫနမိမၩလၧၫ့ထၪ့ဎွ့ၩ ထၪ့ဆၧအထူၫအရူၫလဖၪ, ဒဲဆၧစ့ၩရၫ့လဖၪလၧယ ဟိဝၩမၪလူၬစမိစ့ၭလၧအံၫစရ့လၭအဂဲးအကၠီၪ့နီၪ န မိဘီၪထၪ့ယီၫထၪ့လီၫ. အီၪလၧနဂဲးဆီၪ့ဘီၪၬ မွဲနၥၭ ဒူၩဂ့ၩဘၪစဲၪဘီၪၬ ထီးၥၭမဲၪလဂ့ၩ, ထီးအၪ့ယိၪဆၧ လဂ့ၩဧီၪ.",
			"14": "<sup>14</sup> ဘိၩ့နဲၪ့ယီၩ,ယိခွါ, လၧယဆၧခိဆၧဝီၩအဖၧၩ့နီၪ, ယတဲၩ့ဝဲၩဆၧလၧယဟိဝၩအဂံၪ့အဂး ထီၫ့အကံကၫ လကုၬ, ဒဲစ့ၩအကံကၫလခွးနီၪး ဒဲထီးဝီၩထီးဘၩ့ဒဲထၭ လၧအလယၧးလအီၪဘၪး အဂဲးဘဲၫယီၩ မွဲအအီၪဝ့ၫ အၪအၪလ့ၬး ၥံၪ့ဒဲလိးနီၪယတဲၩ့ဝဲၩဆ့း တၭနမၩအၪ",
			"15": "<sup>15</sup> ထၪ့နဝ့ၫၥ့ၪဆ့လီၫ.- လၧနီၪအမ့ၬယၫၦၡၩမၩဆၧၥ့ၪ အီၪလၧနၥိၭအၪအၪလ့ၬး ၦတဲၩၥံၪ့ဒဲၦစိၭလိးၥံၪဒဲၦ လဲၬၥမါၥံၪ, ဒဲကယဲၦလၧအကိၪ့ဆၧၥ့ၪလၧကယဲဆၧ",
			"16": "<sup>16</sup> မၩကိၪ့ၥ့ၪလမံၩ့လါလါကိၭအမံၩ့ဒ့ၭလီၫ.- လၧထီၫ့ လၧစ့ၩ, ဒဲထီးဝီၩထီးဘၩ့, ဒဲထၭနီၪ,ဆၧဝံထၪ့နၬထၪ့ အ့ၬ.ဂဲထုၪ့တၭ, မၩဆၧဘီၪၬ မွဲယဟိဝၩအီၪလၧနၥိၭ ဆံၭ.",
			"17": "<sup>17</sup> စဒၫဝံၭမၪလူၬကယဲအံၫစရ့လၭ အၦဒိၪဖၭဒိၪၥံၪ ထီးအလူၬနီၪလၧအဘၪမၩဘိၭမၩဆၧၩ့ အဖိၪခွၫစစီ လမၧၫ့တၭ, မွဲယဟိဝၩနၥံၪအယွၩအီၪလၧနၥံၪအၥိၭ",
			"18": "<sup>18</sup> အ့ၬဧၪ.- တၭအဝ့ၫဒၪဖ့ၪလၫ့နၥံၪအီၪပွံၭဝၬဝၬနီၪ, မွဲ အ့ၬဧၪ. အဂဲးဘဲၫယီၩ အဝ့ၫဒၪဖ့ၪလၫ့ယူၭထံၫဖိၪခး ဖိၪၥံၪလၧယစူၪဖၧၩ့တၭ, ခးနီၪဘၪဆၧမၩနၧၩ့မၩစၪ ဝ့ၫလၧယဟိဝၩအမ့ၬယၫ, ဒဲအၡၩခမျၧးၥံၪအမ့ၬယၫ",
			"19": "<sup>19</sup> ဆ့လီၫ.- ဘိၩ့နဲၪ့ယီၩအီၪက့ၪနၥၭမၧၫ့ဒဲနၥၭၡီၩ့ၥံၪလၧ နမိအၪ့ဎၬယဟိဝၩနၥံၪအယွၩနီၪဆံၭး အခိးမွဲဂဲထုၪ့ တၭ,မၩကဲၪထၪ့ယဟိဝၩအလးဆံၫ့ဎံၪဆံၭ. မွဲဘဲၫ ၥိၭဆၧမိဂဲၫဆိၬယဟိဝၩအဆၧအုၩ့လၩ့အတလၫ, ဒဲ ယွၩအထွ့ၫဆံၫ့ဎံၪၥံၪ လၧဂံၪ့ဖၧၩ့ လၧဆၧမိမၩကဲၪ ထၪ့လၧယဟိဝၩအမံၩ့အဂးနီၪလီၫ."
		},
		"23": {
			"1": "<sup>1</sup> ထီးစဒၫဝံၭၥၭၡါထၪ့ဒဲအမုနံၩလဖၪ လၧၫ့ဎွ့ၩဝ့ၫဒၪ တၭ,အီၪက့ၪထၪ့အဖိၪခွၫစစီလမၧၫ့ လၧစဎွၩလၧအံၫ စရ့လၭအဖၫ့ခိၪလီၫ.",
			"2": "<sup>2</sup> တၭမွဲအဒုၭအီၪကီၪ့ကယဲအံၫစရ့လၭ အၦဒိၪဖၭဒိၪ လဖၪထီးအလူၬနီၪ, ဒဲၦလုဆၧလဖၪ ဒဲၦလံဝဲၫဖိၪလ",
			"3": "<sup>3</sup> ဖၪဆ့လီၫ.- ၦလံဝဲၫဖိၪၥံၪဘၪဆၧဝံထၪ့ဝ့ၫၦလၧအနံၪ့ ၥၧၫ့ဆံၫ ဒဲၥၧၫ့ဆံၫအဖၫ့ခိၪတၭး အဝ့ၫၥံၪအဆၧဝံဆၧ",
			"4": "<sup>4</sup> နၬ,လဂၩဘၪလဂၩနီၪ, မွဲၥၧၫ့လၬဎိၭထီၫ့လီၫ.- လၧ အဝ့ၫၥံၪအကျၩ, ၦနံၫလၬလံထီၫ့ၥံၪဘၪအီၪလၧယ ဟိဝၩအဂံၪ့အဆၧမၩအဖၫ့ခိၪနီၪလီၫ. ဒဲဎူၫထီၫ့ၥံၪမိ",
			"5": "<sup>5</sup> ကဲၪၦဒိၪ ဒဲၦစ့ၩရၫ့ဆၧၥံၪလီၫ.- လၧနီၪအမ့ၬယၫလံ ထီၫ့ဘၪပၧၩ့တရၫ့လဖၪ, ဒဲလံထီၫ့ၥံၪအၪ့အူၭ ယဟိ ဝၩလၧနါဒံၩ့ၥံၪၥၫ့ထီးၥံၪလၧယမၩကဲၪထၪ့ယဝ့ၫ, ဘဲၫ ၥိၭဆၧမိအၪ့အူၭထၪ့ဝ့ၫဒၪနီၪလီၫ.",
			"6": "<sup>6</sup> တၭစဒၫဝံၭအၪ့နၩ့ဖၭအဝ့ၫၥံၪ လၧလဒီၪ့လဒီၪ့နီၪ လၧစဒၫဝံၭအဖိၪခွၫၥံၪအကျၩ, စဂၧၡၧၫ့,စကိဟၭ,ဒဲစ မရၫရဲၫၥံၪလီၫ.",
			"7": "<sup>7</sup> ၦဘၪဆဲၫ့လၧၦဂၧၡၧၫ့ဖိၪနီၪ မွဲစလၫအဒၫ့, ဒဲစၡံမ",
			"8": "<sup>8</sup> အဲၫၥံၪလီၫ.- စလၫအဒၫ့အဖိၪခွၫလဖၪ, အခိၪမွဲစယ",
			"9": "<sup>9</sup> ဟဲၫအ့လၭ,ဒဲစဇံၥၫ့, ဒဲစယိၫအ့လၭ,ၥၧၫ့ဂၩလီၫ.- စၡံ မအဲၫအဖိၪခွၫလဖၪ, စၡံလိၫမ့ၭ, ဒဲစဟၫဇအ့လၭ,ဒဲ စဟၫရၫ့,ၥၧၫ့ဂၩလီၫ. အယီၩလဖၪမွဲစလၫအဒၫ့အဖါ",
			"10": "<sup>10</sup> ၥံၪအခိၪလဖၪလီၫ.- တၭစၡံမအဲၫအဖိၪခွၫလဖၪ,မွဲ စယၫဟၭ,စဇဲနၫ, ဒဲစဇံအၧၭ,ဒဲစဘရဲအၫၥံၪလီၫ. ၦ",
			"11": "<sup>11</sup> လံဂၩယီၩမွဲစၡံမအဲၫအဖိၪခွၫၥံၪလီၫ.- တၭအခိၪနီၪမွဲ စယၫဟၭ, ဒဲစဇံဇၫမွဲနံၫဂၩလဂၩတၭ, စဇံအၧၭ,ဒဲစ ဘရဲအၫၥံၪအဖိၪခွၫလဖၪ အီၪအၪဂၩအ့ၬ. အခိးမွဲဆ ရၫ့နီၪအီၪစီၪ့ဎး ဘဲၫအဝ့ၫၥံၪအဖါအဂံၪ့အၥိၭနီၪလီၫ.",
			"12": "<sup>12</sup> စကိဟၭအဖိၪခွၫလဖၪ, စအၫမရၫ့, စအံၭဇဟၫ,",
			"13": "<sup>13</sup> စဟံဘြၧၫ့,ဒဲစအၧၭဇဲၫအ့လၭၥံၪ,လံဂၩလီၫ.- စအၫ မရၫ့အဖိၪခွၫလဖၪး စအၫရၧၫ့, ဒဲစမိစ့ၭ, တၭစအၫ ရၧၫ့ဘၪဆၧအီၪက့ၪဖၭဝ့ၫဘဲၫၥိၭ အမိမၩဆံၫ့ဎံၪဆၧ ဆံၫ့ဎံၪထုၬလဖၪ, အဝ့ၫဒၪဒဲအဖိၪခွၫလဖၪအဆိၩအ ကၠၪနီၪ,လၧအမိဆူၭခဲၩထၪ့ဆၧနၧၫ့မၧၫ့ လၧယဟိဝၩ အမ့ၬယၫ, ဒဲမၩအဆၧဖံၭဆၧမၩ, ဒဲစံၭထၪ့အၪ့အူၭအ",
			"14": "<sup>14</sup> မံၩ့အဆိၩအကၠၪနီၪလီၫ.- တၭလၧယွၩအၡၩစမိစ့ၭ နီၪ,အဖိၪခွၫလဖၪဘၪဆဲၫ့ လၧစလံဝဲၫအဒီၪ့နီၪလီၫ.",
			"15": "<sup>15</sup> စမိစ့ၭအဖိၪခွၫလဖၪမွဲစဂၧၡၧၫ့, ဒဲစအံၫလအ့ဇၧၫၥံၪ",
			"16": "<sup>16</sup> လီၫ.- ၦဘၪဆဲၫ့လၧစဂၧၡၧၫ့အဖိၪခွၫၥံၪ, စၡ့ၫဘုၫအ့ လၭမွဲအခိၪလီၫ. တၭစအံၫလအ့ဇၧၫအဖိၪခွၫလဖၪ,",
			"17": "<sup>17</sup> စရံၫဟဘဲအၫမွဲအခိၪလီၫ.- တၭစအံၫလအ့ဇၧၫအဖိၪ ခွၫဂူၫဂၩၥံၪအီၪအ့ၬး အ့ၪမွဲစရံၫအဘဲအၫအဖိၪခွၫၥံၪ",
			"18": "<sup>18</sup> အီၪအၪဂၩလီၫ.- လၧစအံၭဇဟၫအဖိၪခွၫၥံၪ, စၡံၫလိ",
			"19": "<sup>19</sup> မ့ၭမွဲအခိၪလီၫ.- လၧစဟံဘြၧၫ့အဖိၪခွၫလဖၪနီၪ,အ ခၪ့ထံၭမွဲစယ့ၫရဲအၫ, နံၫဂၩလဂၩစအၫမရဲအၫ, ၥၧၫ့ ဂၩလဂၩစယဟၫဇအ့လၭ, လံဂၩလဂၩ စယ့ၭကမံ",
			"20": "<sup>20</sup> အၫ့ၥံၪလီၫ.- လၧစအၧၭဇဲအ့လၭ အဖိၪခွၫလဖၪနီၪ အခၪ့ထံၭမွဲစမဲခၫ, ဒဲနံၫဂၩလဂၩစယ့ၫစဲအၫၥံၪလီၫ.",
			"21": "<sup>21</sup> စမရၫရဲၫအဖိၪခွၫၥံၪနီၪ, မွဲစမၫလံၫ, ဒဲစမုၫၡဲၫၥံၪ လီၫ.စမၫလံၫအဖိၪခွၫလဖၪ, စအံၫလအ့ဇၧၫ,ဒဲစကံၭ",
			"22": "<sup>22</sup> ၥံၪလီၫ.- စအံၫလအ့ဇၧၫၥံၫဝ့ၫဒၪတၭ, အဖိၪခွၫလဖၪ အီၪအ့ၬ, အီၪန့ၫအဖိၪမုၪၥံၪတၭး အထၧၫ့ဖုဝဲၥံၪစကံၭ",
			"23": "<sup>23</sup> အဖိၪခွၫၥံၪမၩန့အဝ့ၫၥံၪလီၫ.- စမုၫၡဲၫအဖိၪခွၫလဖၪး စမၫလံၫ,ဒဲစအံဒၧၫ, ဒဲစယ့ၫရမီၭနီၪ, ၥၧၫ့ဂၩလီၫ.",
			"24": "<sup>24</sup> ၦလဖၪနီၪမွဲစလံဝဲၫအဖိၪခွၫလဖၪ ဘဲၫအဝ့ၫၥံၪအဖါ လဖၪအဂံၪ့အၥိၭနီၪ, ဖါၥံၪအခိၪ, ဘဲၫဆၧဝံထၪ့နၬထၪ့ ဝ့ၫအမံၩ့လဂၩဘၪလဂၩအၥိၭနီၪ, ၦလၧအမၩယဟိ ဝၩအဂံၪ့အဆၧမၩ, လၧအနံၪ့ထၪ့ဘၭနံၫဆံၫဒဲနံၫဆံၫ",
			"25": "<sup>25</sup> အဖၫ့ခိၪလီၫ.- အဂဲးဘဲၫယီၩစဒၫဝံၭစံၭဝ့ၫ, ယဟိဝၩ အံၫစရ့လၭအယွၩဖ့ၪလၫ့အၡၩခမျၧးၥံၪ လၧဆၧအီၪ ပွံၭ,ဘဲၫၥိၭအဝ့ၫၥံၪ မိအီၪလၧယရုစလံၫ့အဖၧၩ့အဆိၩ",
			"26": "<sup>26</sup> အကၠၪလီၫ.- ဒဲလၧၦလံဝဲၫဖိၪလဖၪနီၪဆ့တၭး တဲၩ ဆံၫ့ဎံၪနီၪမွဲဂ့ၩ, ထွ့ၫၥံၪဘၪဆဲၫ့ လၧအဆၧဖံၭဆၧမၩ",
			"27": "<sup>27</sup> နီၪမွဲဂ့ၩ, အဝ့ၫၥံၪမိဘၪဆိၬလၧၩ့အ့ၬ.- အဂဲးဘဲၫယီၩ လၧစဒၫဝံၭအဆၧချဲၩ့ လၧခဲၫ့ထုၬလဖၪအကၠီၩ့နီၪ,ၦ လံဝဲၫဖိၪၥံၪဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫ လၧအနံၪ့ထၪ့ဘၭ",
			"28": "<sup>28</sup> နံၫဆံၫဒဲနံၫဆံၫအဖၫ့ခိၪလီၫ.- အဂဲးဘဲၫယီၩအဝ့ၫၥံၪ အလးမွဲလၧအဘၪမၩ စအၫရၧၫ့အဖိၪခွၫလဖၪအဆၧ မၩလၧယဟိဝၩအဂံၪ့အဆၧမၩအဂး, လၧအဝၩ့ဖၧၩ့, ဒဲလၧဒူၭဖၧၩ့ၥံၪ, ဒဲလၧအမၩဆံၫ့ ကယဲဆၧဆံၫ့ဎံၪလ ဖၪထီးအလူၬ, ဒဲဆၧမၩဘၪဆဲၫ့လၧယွၩအဂံၪ့အဆၧ",
			"29": "<sup>29</sup> ဖံၭဆၧမၩနီၪး- လၧဆၧမ့ၬယၫအကိၪနီၪ အဂးမွဲဂ့ၩ, လၧကိၪမုၬလၧဆၧဘိၪ့ကိၪမုၬအဂးမွဲဂ့ၩ, ဒဲလၧကိၪပၪ ပဲၪမံၪလအီၪဘၪမွဲဂ့ၩ, ဒဲလၧဆၧလၧဖၧၩ့ ဖၧၩ့အဂးမွဲ ဂ့ၩ,ဒဲဆၧလၧအဘၪအၪ့ဆ့ၭအဂးမွဲဂ့ၩ, ဒဲကယဲဆၧ",
			"30": "<sup>30</sup> လၧဆၧတိၪ့မွဲဂ့ၩ, ဒဲဆၧထိၪဆၧလၧအဂး- ဒဲဆၧၫ့ထုၪ့ ကိၭဂီၩဒ့ၭဘဲၫၥိၭ အမိစံၭထၪ့အၪ့အူၭ ဒဲၥံၫကျံၩထၪ့ ယဟိဝၩနီၪ, ဒဲလၧမုဂၪလၩ့လခီၫဘဲၫနီၪၥိၭဆ့လီၫ.",
			"31": "<sup>31</sup> ဒဲလၧအမိလုထၪ့ယဟိဝၩ လၧကယဲဆၧလုမ့ၪၥံၪထီး အလူၬလၧမးၥံၫအနံၩ, လၧလၩၥံၫ, ဒဲလၧဆၧဘိၪ့ဖၭ ဝဲၩဝ့ၫ,ဘဲၫအဆၧဝံထၪ့အၥိၭ, ဘဲၫအထူၫအရူၫလၧ ဆၧမၪလူၬအဝ့ၫၥံၪအဂးအၥိၭ, လၧယဟိဝၩအမ့ၬ ယၫလထံၪဎးလဘီၩ့ဎးအၥိၭနီၪး",
			"32": "<sup>32</sup> ဒဲလၧအဝ့ၫၥံၪဘၪ ယိထဲၩ့ခွါထဲၩ့တဲၩဆံၫ့ဎံၪအဆၧအီၪကီၪ့, ဒဲယိအလး ဆံၫ့ဎံၪနီၪ, ဒဲယိအဝ့ၫၥံၪအထၧၫ့ဖုဝဲစအၫရၧၫ့အဖိၪခွၫ လဖၪ,လၧယဟိဝၩ အဂံၪ့အဆၧမၩနီၪအဖၧၩ့လီၫ."
		},
		"24": {
			"1": "<sup>1</sup> တၭစအၫရၧၫ့အဖိၪခွၫၥံၪ အဆၧအၪ့နၩ့ဖၭလိၬအ ၥၭမွဲအယီၩး စအၫရၧၫ့အဖိၪခွၫလဖၪနီၪး စနၫဒၭ,ဒဲစ",
			"2": "<sup>2</sup> အဘဲဟုၫ,စအံၫလအ့ဇၧၫ, ဒဲစအံၭၥမၫၥံၪလီၫ.- အ့ၪ မွဲစနၫဒၭ ဒဲစအဘဲဟုၫၥံၫဝ့ၫ ဘိၩ့အဖါ လချႃၭၥံၫဒံၭ ဘၪတၭ,အဖိၪအီၪနးဂၩအ့ၬ. အခိးမွဲစအံၫလအ့ဇၧၫ,",
			"3": "<sup>3</sup> ဒဲစအံၭၥမၫၥံၪမၩၦလုဆၧအလးနီၪလီၫ.- စဇၫဒီၭလၧ စအံၫလအ့ဇၧၫအဖိၪခွၫၥံၪ, ဒဲစအဟံမလ့ၭလၧစအံၭ ၥမၫအဖိၪခွၫၥံၪ, စဒၫဝံၭအၪ့နၩ့ဖၭအဝ့ၫၥံၪဘဲၫအဆၧ မၩအလးအီၪဝ့ၫအၥိၭနီၪလီၫ.",
			"4": "<sup>4</sup> တၭလၧစအံၫလအ့ဇၧၫအဖိၪခွၫၥံၪအကျၩနီၪ ၦအ ခိၪလဖၪအီၪအၪနဲၪ့ဒံၭ လၧစအံၭၥမၫအဖိၪခွၫအကျၩ နီၪတၭး ဆၧအၪ့နၩ့ဖၭအဝ့ၫၥံၪ ဘဲၫနီၪၥိၭလီၫ. လၧ စအံၫလအ့ဇၧၫအဖိၪခွၫလဖၪအကျၩနီၪ, ၦအခိၪၥံၪ ဘၪဆဲၫ့လၧအဝ့ၫၥံၪအဖါ အဂံၪ့အၥိၭ အီၪလဆံၫဎူၫ ဂၩး ဒဲလၧစအံၭၥမၫအဖိၪခွၫလဖၪအကျၩ ဘဲၫအဝ့ၫ",
			"5": "<sup>5</sup> ၥံၪအဖါအဂံၪ့အၥိၭအီၪဝ့ၫဎိၭဂၩၥံၪလီၫ.- ဖၭဝ့ၫဘဲၫ နီၪၥိၭတၭ,အၪ့နၩ့ဖၭအဝ့ၫၥံၪ ဘဲၫအလးဘၪဆဲၫ့လိၬ အၥၭအၥိၭနီၪး ၦပၧၩ့လးဆံၫ့ဎံၪအဂး, ၦပၧၩ့ယွၩအ ဂံၪ့အဂးနီၪ, ဘၪဆဲၫ့လၧစအံၫလအ့ဇၧၫအဖိၪခွၫၥံၪ, ဒဲစအံၭၥမၫအဖိၪခွၫၥံၪလီၫ.",
			"6": "<sup>6</sup> ၦကွ့ၭလံၬစနၥၫ့နအ့လၭအဖိၪခွၫ စၡံၫမအဲအၫ,ဘၪ ဆဲၫ့လၧၦလံဝဲၫဖိၪ, ကွ့ၭဆၧလဖၪနီၪ လၧစဎွၩအမ့ၬ ယၫ,ဒဲၦဒိၪဖၭဒိၪၥံၪ, ဒဲၦလုဆၧစဇၫဒီၭ, ဒဲစအဟံမ လ့ၭ,စအဘဲအၥၫအဖိၪခွၫနီၪ, ဒဲလၧဖါၥံၪအခိၪလဖၪ, ဒဲၦလုဆၧၥံၪဒဲၦလံဝဲၫဖိၪၥံၪအမ့ၬယၫဆ့လီၫ. ဆၧမၩ န့လၧစအံၫလအ့ဇၧၫအဂးဂံၪ့လဒီၪ့ဖၭဒိၪ, ဒဲလဒီၪ့လၧ စအံၭၥမၫအဂးနီၪဆ့လီၫ.",
			"7": "<sup>7</sup> တၭဆၧဖၭဝ့ၫလၧအခၪ့ထံၭလစီၪ့ ဘၪလၧစယဟိ",
			"8": "<sup>8</sup> အရ့ၭ,နံၫစီၪ့လစီၪ့ လၧစယဒဲၫယၫ,- ၥၧၫ့စီၪ့လစီၪ့လၧ",
			"9": "<sup>9</sup> စဟၫရံၫ့,လံစီၪ့လစီၪ့လၧစစံၫအိရံၫ့,- ယဲစီၪ့လစီၪ့လၧ",
			"10": "<sup>10</sup> စမၫလခဲအၫ, ဎူၫစီၪ့လစီၪ့လၧစမဲၫယမံၫ့,- နွ့ၫစီၪ့လစီၪ့",
			"11": "<sup>11</sup> လၧစဟၭကီၭ, ဎိၭစီၪ့လစီၪ့လၧစအဘဲယၫ,- ခွံၫစီၪ့ လစီၪ့လၧစယ့ၭရှုၫအၫ, ဆံၫစီၪ့လစီၪ့ လၧစၡ့ၭခနဲ",
			"12": "<sup>12</sup> အၫ,- ဆံၫလစီၪ့လစီၪ့လၧစအံၫလဲအၡံၭ, ဆံၫနံၫစီၪ့",
			"13": "<sup>13</sup> လစီၪ့လၧစယၫကံၫ့,- ဆံၫၥၧၫ့စီၪ့လစီၪ့လၧစဟုၭပၫ,",
			"14": "<sup>14</sup> ဆံၫလံစီၪ့လစီၪ့လၧစယ့ၭရှုၭဘအၭ,- ဆံၫယဲစီၪ့လ စီၪ့လၧစဘံလဂၫ, ဆံၫဎူၫစီၪ့လစီၪ့လၧစအံၭမၧၫ,",
			"15": "<sup>15</sup> ဆံၫနွ့ၫစီၪ့လစီၪ့ လၧစဟံဇၧၫ, ဆံၫဎိၭစီၪ့လစီၪ့လၧစ",
			"16": "<sup>16</sup> အၭဖစံၭ,- ဆံၫခွံၫစီၪ့လစီၪ့လၧစဖ့ၭၥဟဲအၫ, အလး",
			"17": "<sup>17</sup> နံၫဆံၫနီၪ လၧစယ့ၫဇံၫက့လၭ,- နံၫဆံၫလစီၪ့အလး",
			"18": "<sup>18</sup> လၧစယၫခံၫ့, နံၫဆံၫနံၫစီၪ့လစီၪ့လၧစဂၫမုၫလၭ,- နံၫ ဆံၫၥၧၫ့စီၪ့လစီၪ့လၧစဒံၫလအဲအၫ, နံၫဆံၫလံစီၪ့လစီၪ့ လၧစမၫအဇဲအၫနီၪလီၫ.",
			"19": "<sup>19</sup> ဆၧလဖၪနီၪ မွဲအဝ့ၫၥံၪအထူၫအရူၫ လၧအဆၧဖံၭ ဆၧမၩအဖၧၩ့, ဘဲၫၥိၭအမိဂဲၫနုၬလၧယဟိဝၩအဂံၪ့ ဖၧၩ့,ဘဲၫအလးအီၪဝ့ၫအၥိၭ, လၧအဝ့ၫၥံၪအဖါစအၫ ရၧၫ့အဖၫ့လၬ, ဘဲၫယဟိဝၩအံၫစရ့လၭအယွၩမၪလူၬ အဝ့ၫဒၪအၥိၭနီၪလီၫ.",
			"20": "<sup>20</sup> ၦလံဝဲၫအဖိၪခွၫၥံၪ လၧအအီၪလၩ့ထးဝ့ၫလဖၪမွဲအ ယီၩ,လၧစအၫမရၫ့အဖိၪခွၫၥံၪ, စရှုၫဘအ့လၭး စရှုၫ",
			"21": "<sup>21</sup> ဘအ့လၭအဖိၪခွၫၥံၪ, စယံၫဒဲအၫလီၫ.- ဆၧဘၪဆဲၫ့ လၧစရံၫဟဘဲအၫအဖိၪခွၫလဖၪနီၪ, အခၪ့ထံၭမွဲစအံၭ",
			"22": "<sup>22</sup> စဟဲအၫလီၫ.- လၧၦအံၭဇဟၫဖိၪလဖၪ, စၡံလိၫမီၭး",
			"23": "<sup>23</sup> လၧစၡံလိၫမီၭအဖိၪခွၫၥံၪနီၪ, စယၫဟၭလီၫ.- လၧစ ဟံဘြၧၫ့အဖိၪခွၫလဖၪ, စယ့ၫရဲအၫ, နံၫဂၩလဂၩ စအၫမရဲအၫ, ၥၧၫ့ဂၩလဂၩစယ့ၫဟၫဇအ့လၭ,လံ",
			"24": "<sup>24</sup> ဂၩလဂၩစယ့ၭကမံအၫ့လီၫ.- လၧစအၧဇဲၫအ့လၭအ ဖိၪခွၫလဖၪ,စမဲခၫး လၧစမဲခၫအဖိၪခွၫလဖၪ စၡၫမၧၫ",
			"25": "<sup>25</sup> လီၫ.- စမဲခၫ အထၧၫ့ဖုဝဲခွၫ မွဲစအံၭစဟဲအၫး လၧစ",
			"26": "<sup>26</sup> အံၭစဟဲအၫအဖိၪခွၫလဖၪ, စဇ့ၭခရဲအၫလီၫ.- စမရၫ ရဲၫအဖိၪခွၫလဖၪ, မွဲစမၫလံၫ,ဒဲစမုၫၡဲၫး စယၫအဇဲ",
			"27": "<sup>27</sup> အၫအဖိၪခွၫလဖၪ, စဘံနိၫလီၫ.- စမရၫရဲၫအဖိၪခွၫၥံၪ လၩ့ဆိၩထဲၩ့လၧစယၫအဇဲအၫနီၪ မွဲစဘံနိၫ,ဒဲစၡိဟၫ့",
			"28": "<sup>28</sup> ဒဲစဇၭခၧၫ,ဒဲစအံဘြဲၫလီၫ.- လၧစမၫလံၫမွဲစအံၫလ",
			"29": "<sup>29</sup> အ့ဇၧၫ လၧအဖိၪခွၫၥံၪအီၪနးဂၩအ့ၬ.- ဆၧဘၪဆဲၫ့ လၧစကံၭတၭး စကံၭအဖိၪခွၫ စယ့ၫရၫမအ့လၭလီၫ. စမုၫၡဲၫအဖိၪခွၫလဖၪ, စမၫလံၫ,ဒဲစအံဒၧၫ့, ဒဲစယ့ၫရ မီၭနီၪလီၫ.",
			"30": "<sup>30</sup> အနီၪလဖၪမွဲၦလံဝဲၫဖိၪၥံၪအဖိၪခွၫလဖၪ, ဘဲၫအဝ့ၫၥံၪအဖါလဖၪအဂံၪ့ၥံၪအၥိၭနီၪလီၫ.-",
			"31": "<sup>31</sup> အဝ့ၫ ၥံၪဖၭဝ့ၫမီၪ့ဎီၩ့ အထၧၫ့ဖုဝဲစအၫရၧၫ့ အဖိၪခွၫလဖၪ လၧစဎွၩဒၫဝံၭအမ့ၬယၫ, ဒဲလၧစဇၫဒီၭ, ဒဲစဟံမလ့ၭ, ဒဲလၧအဖါၥံၪအခိၪလဖၪ, လၧၦလုဆၧလဖၪ,ဒဲလၧၦ လံဝဲၫဖိၪၥံၪ, အဝ့ၫၥံၪအဖါၥံၪအခိၪလဖၪဒၪလ့ၬမီၪ့ဎီၩ့ လၧအထၧၫ့ဖုဝဲၥၭဘၪ့လဖၪနီၪလီၫ."
		},
		"25": {
			"1": "<sup>1</sup> လၧနီၪအမ့ၬယၫစဒၫဝံၭ ဒဲၦၥုၭမုခမျၧးအခိၪလဖၪ အီၪက့ၪၦၡၩလၧဆၧမၩအဂးနီၪ, ၦဘၪဆဲၫ့လၧစအၫ စၭအဖိၪခွၫၥံၪ, ဒဲလၧစဟံမၫ့, ဒဲလၧစယ့ၭဒုၫၥၫ့ၥံၪ,မွဲၦ လၧအမိအၪ့အူၭထၪ့ ဆၧလၧနါဒံၩ့ၥံၪ, လၧၥၫ့ထီးၥံၪ, ဒဲလၧစံၩ့စံၩ့ၥံၪလီၫ. တၭၦလၧအမၩဆၧဘဲၫအဆၧဖံၭ ဆၧမၩအီၪဝ့ၫအၥိၭ အဆၧဝံဆၧနၬနီၪမွဲဘဲၫယီၩး",
			"2": "<sup>2</sup> လၧစအၫစၭအဖိၪခွၫလဖၪ, စဇၭကၧၫ,ဒဲစယိၥၭ,ဒဲစ န့ၭၥနဲအၫ,ဒဲစအၭစရံလၫ, စအၫစၭအဖိၪခွၫၥံၪ,လၧ စအၫစၭအစူၪအဖၫ့လၬ, လၧအၥံၫကျံၩဆၧ,ဘဲၫစဎွၩ",
			"3": "<sup>3</sup> အထူၫအရူၫအီၪဝ့ၫအၥိၭနီၪလီၫ.- လၧစယ့ၭဒုၫၥၫ့း စ ယ့ၭဒုၫၥၫ့အဖိၪခွၫလဖၪး စဂ့ၭဒလဲအၫ, ဒဲစဇံရဲၫ,ဒဲစ ယ့ၭၡအဲအၫ, စဟၭၡဘဲအၫ,ဒဲစမၭတၥဲအၫ, ဎူၫဂၩ လၧအဝ့ၫၥံၪအဖါစယ့ၭဒုၫၥၫ့အစူၪအဖၫ့လၬ, ၦလၧ အၥံၫကျံၩထၪ့လၧနါဒံၩ့, လၧအမိဖ့ၪလၫ့ဆၧအခိးအ",
			"4": "<sup>4</sup> တၩဒဲအၪ့အူၭယဟိဝၩနီၪလီၫ.- လၧစဟံမၫ့း စဟံမၫ့ အဖိၪခွၫလဖၪး စဘၧၭကဲအၫ, စမၭတနဲအၫ,စအၧၭ ဇဲၫအ့လၭ,စၡ့ၫဘုၫအ့လၭ, ဒဲစယ့ၫရမီၭ, စဟၫ့အနဲ အၫ,စဟၫ့နနဲၫ,စအံၫလဲအၥၫ, စဂံၭဒၪလတဲၫ,ဒဲစရိၫ မၫတအံဇၧၫ,စယီၭၡဘ့ၭကၡၫ, စမၫလၥံၫ,စဟိၥၧၫ,",
			"5": "<sup>5</sup> စမဟၫဇအီၭး- အဝ့ၫၥံၪနီၪ ထီးအလူၬမွဲစဎွၩအမီၪ လၧဆၧဘၪဆဲၫ့လၧယွၩ, လၧအမိဆိၬထၪ့ဆၧနိၩ့,စဟံ မၫ့အဖိၪခွၫလဖၪလီၫ. တၭယွၩဖ့ၪလၫ့စဟံမၫ့အဖိၪ",
			"6": "<sup>6</sup> ခွၫလဖၪလဆံၫလံဂၩ, ဒဲအဖိၪမုၪၥံၪၥၧၫ့ဂၩလီၫ.- အဝ့ၫ ၥံၪထီးအလူၬအီၪလၧအဖါအစူၪအဖၫ့လၬ လၧဆၧၥံၫ ကျံၩအဂး,လၧယဟိဝၩအဂံၪ့ဖၧၩ့, အီၪလၧစံၩ့စံၩ့ၥံၪ, ၥၫ့ထီးၥံၪ, ဒဲနါဒံၩ့ၥံၪ, လၧဆၧမၩအဂးလၧယွၩအဂံၪ့ ဖၧၩ့နီၪ,ဘဲၫစဎွၩအဆၧမၪလူၬလၧစအၫစၭ, စယ့ၭဒုၫ",
			"7": "<sup>7</sup> ၥၫ့ဒဲစဟံမၫ့အၥိၭနီၪလီၫ.- အခိးမွဲအဝ့ၫၥံၪ အဆၧဝံ ဆၧနၬ, ဒဲအထၧၫ့ဖုဝဲၥံၪ လၧအဘၪဆၧၥီၪ့လိၪဝ့ၫလၧ ယဟိဝၩအလံၬထၭခိၪလဖၪ, ကယဲၦလၧအၥ့ၪဆၧနီၪ ထီးအလူၬ, မွဲနံၫယၩဎိၭဆံၫဎိၭဂၩၥံၪလီၫ.",
			"8": "<sup>8</sup> အဝ့ၫၥံၪဖၭဝ့ၫတၭ, ၦလဒီၪ့လၧၦလဒီၪ့, ၦအဆံၭ ဘဲၫၦအဒိၪအၥိၭ, ၦၥ့ၪဆၧဘဲၫၦမၩလိၪဆၧအၥိၭနီၪ",
			"9": "<sup>9</sup> လီၫ.- တၭဖၭဝ့ၫအခၪ့ထံၭနီၪဂဲၫထၪ့လၧစအၫစၭအ ဂး,ဘၪစယိၥၭး နံၫမံၩ့လမံၩ့ဘၪစဂံၭဒလဲအၫ, အဝ့ၫ ဒၪဒဲအထၧၫ့ဖုဝဲၥံၪ ဒဲအဖိၪခွၫၥံၪမွဲလဆံၫနံၫဂၩလီၫ.",
			"10": "<sup>10</sup> ၥၧၫ့မံၩ့လမံၩ့ဘၪစဇၭကၧၫ, အဝ့ၫဒၪ, ဒဲအဖိၪခွၫၥံၪ,ဒဲ",
			"11": "<sup>11</sup> အထၧၫ့ဖုဝဲၥံၪမွဲလဆံၫနံၫဂၩလီၫ.- လံမံၩ့လမံၩ့ဘၪစ အံၭဇရဲၫ,အဝ့ၫဒၪ, အဖိၪခွၫၥံၪဒဲအထၧၫ့ဖုဝဲၥံၪ, မွဲလ",
			"12": "<sup>12</sup> ဆံၫနံၫဂၩလီၫ.- ယဲမံၩ့လမံၩ့ဘၪစန့ၭၥနဲအၫ, အဝ့ၫ ဒၪ,အဖိၪခွၫၥံၪ, ဒဲအထၧၫ့ဖုဝဲၥံၪ,မွဲလဆံၫနံၫဂၩလီၫ.",
			"13": "<sup>13</sup> ဎူၫမံၩ့လမံၩ့ဘၪစဘၧၭကဲအၫ, အဝ့ၫဒၪ, အဖိၪခွၫၥံၪ,",
			"14": "<sup>14</sup> ဒဲအထၧၫ့ဖုဝဲၥံၪ, မွဲလဆံၫနံၫဂၩလီၫ.- နွ့ၫမံၩ့လမံၩ့ ဘၪစယ့ၭၡရံလၫ, အဝ့ၫဒၪ, အဖိၪခွၫၥံၪ,ဒဲအထၧၫ့ဖုဝဲ",
			"15": "<sup>15</sup> ၥံၪ,မွဲလဆံၫနံၫဂၩလီၫ.- ဎိၭမံၩ့လမံၩ့ဘၪစယံၭၡအဲ အၫ,အဝ့ၫဒၪ,အဖိၪခွၫၥံၪ, ဒဲအထၧၫ့ဖုဝဲၥံၪ, မွဲလဆံၫ",
			"16": "<sup>16</sup> နံၫဂၩလီၫ.- ခွံၫမံၩ့လမံၩ့ဘၪစမၭတနဲအၫ, အဝ့ၫဒၪ, အဖိၪခွၫၥံၪ, ဒဲအထၧၫ့ဖုဝဲၥံၪ, မွဲလဆံၫနံၫဂၩလီၫ.",
			"17": "<sup>17</sup> ဆံၫမံၩ့လမံၩ့ဘၪစၡံမအဲၫ, အဝ့ၫဒၪ, အဖိၪခွၫၥံၪ, ဒဲအ",
			"18": "<sup>18</sup> ထၧၫ့ဖုဝဲၥံၪ, မွဲလဆံၫနံၫဂၩလီၫ.- ဆံၫလမံၩ့လမံၩ့ဘၪ စအၭဇၫရ့လၭ, အဝ့ၫဒၪ, အဖိၪခွၫၥံၪ, ဒဲအထၧၫ့ဖုဝဲ",
			"19": "<sup>19</sup> ၥံၪ,မွဲလဆံၫနံၫဂၩလီၫ.- လဆံၫနံၫမံၩ့လမံၩ့ဘၪစဟၭ ၡဘဲအၫ,အဝ့ၫဒၪ, အဖိၪခွၫၥံၪ, ဒဲအထၧၫ့ဖုဝဲၥံၪ, မွဲလ",
			"20": "<sup>20</sup> ဆံၫနံၫဂၩလီၫ.- လဆံၫၥၧၫ့မံၩ့လမံၩ့ ဘၪစရှုၫဘအ့ လၭ,အဝ့ၫဒၪ,အဖိၪခွၫၥံၪ, ဒဲအထၧၫ့ဖုဝဲၥံၪ,မွဲလဆံၫ",
			"21": "<sup>21</sup> နံၫဂၩလီၫ.- လဆံၫလံမံၩ့လမံၩ့ဘၪစမၭတၥဲအၫ,အ ဝ့ၫဒၪ,အဖိၪခွၫၥံၪ, ဒဲအထၧၫ့ဖုဝဲၥံၪ, မွဲလဆံၫနံၫဂၩ",
			"22": "<sup>22</sup> လီၫ.- လဆံၫယဲမံၩ့လမံၩ့ဘၪစယ့ၫရမီၭ, အဝ့ၫဒၪ,အ",
			"23": "<sup>23</sup> ဖိၪခွၫၥံၪ,ဒဲအထၧၫ့ဖုဝဲၥံၪ, မွဲလဆံၫနံၫဂၩလီၫ.- လ ဆံၫဎူၫမံၩ့လမံၩ့ဘၪစဟၫ့အနဲအၫ, အဝ့ၫဒၪ,အဖိၪခွၫ",
			"24": "<sup>24</sup> ၥံၪ,ဒဲအထၧၫ့ဖုဝဲၥံၪ, မွဲလဆံၫနံၫဂၩလီၫ.- လဆံၫနွ့ၫ မံၩ့လမံၩ့ဘၪစယီၭၡဘ့ၭကၡၫ, အဝ့ၫဒၪ,အဖိၪခွၫၥံၪ,",
			"25": "<sup>25</sup> ဒဲအထၧၫ့ဖုဝဲၥံၪ, မွဲလဆံၫနံၫဂၩလီၫ.- လဆံၫဎိၭမံၩ့ လမံၩ့ဘၪစဟၫ့နနဲၫ, အဝ့ၫဒၪ, အဖိၪခွၫၥံၪ,ဒဲအထၧၫ့",
			"26": "<sup>26</sup> ဖုဝဲၥံၪ,မွဲလဆံၫနံၫဂၩလီၫ.- လဆံၫခွံၫမံၩ့လမံၩ့ဘၪ စမၫလိၫၥဲၫ, အဝ့ၫဒၪ, အဖိၪခွၫၥံၪ, ဒဲအထၧၫ့ဖုဝဲၥံၪ,",
			"27": "<sup>27</sup> မွဲလဆံၫနံၫဂၩလီၫ.- အမံၩ့နံၫဆံၫမံၩ့လမံၩ့ဘၪစအံၫ လဲအၥၫ, အဝ့ၫဒၪအဖိၪခွၫၥံၪ, ဒဲအထၧၫ့ဖုဝဲၥံၪ, မွဲလ",
			"28": "<sup>28</sup> ဆံၫနံၫဂၩလီၫ.- အမံၩ့နံၫဆံၫလမံၩ့လမံၩ့ ဘၪစဟိ ၥၧၫ,အဝ့ၫဒၪ, အဖိၪခွၫၥံၪ, ဒဲအထၧၫ့ဖုဝဲၥံၪ, မွဲလဆံၫ",
			"29": "<sup>29</sup> နံၫဂၩလီၫ.- နံၫဆံၫနံၫမံၩ့လမံၩ့ ဘၪစဂံၭဒၫလတဲၫ, အဝ့ၫဒၪအဖိၪခွၫၥံၪ, ဒဲအထၧၫ့ဖုဝဲၥံၪ, မွဲလဆံၫနံၫဂၩ",
			"30": "<sup>30</sup> လီၫ.- နံၫဆံၫၥၧၫ့မံၩ့လမံၩ့ ဘၪစမဟၫဇအီၭ, အဝ့ၫ ဒၪ,အဖိၪခွၫၥံၪ, ဒဲအထၧၫ့ဖုဝဲၥံၪ, မွဲလဆံၫနံၫဂၩလီၫ.",
			"31": "<sup>31</sup> နံၫဆံၫလံမံၩ့လမံၩ့ ဘၪစရိၫမၫတအံဇၧၫ, အဝ့ၫဒၪ, အဖိၪခွၫၥံၪ, ဒဲအထၧၫ့ဖုဝဲၥံၪ, မွဲလဆံၫနံၫဂၩလီၫ."
		},
		"26": {
			"1": "<sup>1</sup> ၦပၧၩ့တရၫ့ၥံၪအဆၧအၪ့နၩ့ဖၭအဂဲးအကၠီၪ့း လၧၦ ကိၭရံၫဖိၪအကျၩ, စကိၭရံၫအဖိၪခွၫစမၡ့လမဲအၫ,လၧ",
			"2": "<sup>2</sup> စအၫစၭအဖိၪခွၫလဖၪအကျၩနီၪလီၫ.- တၭစမၡ့လ မဲအၫအဖိၪခွၫလဖၪ, မွဲအဖိၪဝဲၡါစဇ့ၭခရဲအၫ, နံၫဂၩ လဂၩစယ့ၭဒအ့လၭ, ၥၧၫ့ဂၩလဂၩစဇ့ၭဘဒဲအၫ,လံ",
			"3": "<sup>3</sup> ဂၩလဂၩစယၭၥနဲၪအ့လၭ,- ယဲဂၩလဂၩစအံလၫ့, ဎူၫဂၩလဂၩ, စယ့ၫဟိဟၫနၫ့, နွ့ၫဂၩလဂၩစအံၫလ",
			"4": "<sup>4</sup> အံနအဲၫလီၫ.- တၭစအိၫဘဒံဒၧၫ့အဖိၪခွၫလဖၪ, မွဲအဝဲ ၡါစၡံမအဲအၫ, နံၫဂၩလဂၩစယ့ၫဟီၭဇဘၭ, ၥၧၫ့ဂၩ လဂၩစယိအၫ, လံဂၩလဂၩစစၫခၫ, ယဲဂၩလဂၩ,စန",
			"5": "<sup>5</sup> ၥၫ့နအ့လၭ,- ဎူၫဂၩလဂၩစအၫမအံလၭ, နွ့ၫဂၩလဂၩ စအံၫစခၫ, ဎိၭဂၩလဂၩ စဖုၫလၥဲၫး အဂဲးဘဲၫယီၩ",
			"6": "<sup>6</sup> ဘၪယွၩအဆၧဆိၪဂ့ၩလီၫ.- ဒဲလၧအဖိၪခွၫစၡံၫမအဲ အၫဆ့ဆၧအီၪဖျဲၪန့ဖိၪခွၫၥံၪလၧအဂး, ၦလၧအပၧၩ့ အဝ့ၫၥံၪအဖါအဂံၪ့နီၪ ထီးအလူၬး အဂဲးဘဲၫယီၩ မွဲၦ",
			"7": "<sup>7</sup> အဆီၪ့ဒဲအၥၭဒူၩလီၫ.- စၡံၫမအဲအၫအဖိၪခွၫၥံၪး စ အီၥနဲၫ,ဒဲစရ့ဖၫအ့လၭ, ဒဲစအိဘ့ၭအဝ့ၫဒၪအထၧၫ့ဖု ဝဲၥံၪ,ၦအဂဲးဆီၪ့, မွဲစအံၫလဲဟုၫ, ဒဲစစ့ၫမခဲအၫၥံၪ",
			"8": "<sup>8</sup> လီၫ.- အဝ့ၫၥံၪထီးအလူၬအီၪလၧစအိၫဘဒံဒၧၫ့အဖိၪ ခွၫၥံၪအကျၩလီၫ. အဝ့ၫၥံၪဒဲအဖိၪခွၫၥံၪ ဒဲအထၧၫ့ဖု ဝဲၥံၪ,ၦၡၩအီၪလၧအစီၩ့အမၩ့ လၧအဂဲးဆီၪ့ဘၭဆီၪ့ လၧဆၧဖံၭဆၧမၩအဂး, ဘၪဆဲၫ့လၧစအိဘဒံဒၧၫ့ဎူၫ",
			"9": "<sup>9</sup> ဆံၫနံၫဂၩလီၫ.- ဒဲစမၡ့လမဲအၫအီၪလၧအဖိၪခွၫၥံၪ,",
			"10": "<sup>10</sup> ဒဲအထၧၫ့ဖုဝဲၥံၪ, ၦဂဲးဆီၪ့နီၪ,လဆံၫဎိၭဂၩလီၫ.- ဒဲစ ဟိစၫ,လၧစမရၫရဲၫအဖိၪၥံၪအကျၩ, အီၪလၧအဖိၪခွၫ ၥံၪး အခိၪမွဲစစံမရဲၫ, (လမွဲဘၪအဝဲၡါလါနၫ့တၭ,",
			"11": "<sup>11</sup> အဖါဒုၭကဲၪထၪ့အခိၪ) - နံၫဂၩလဂၩစဟံၫလကဲအၫ, ၥၧၫ့ဂၩလဂၩ စတ့ၭဘလဲၫအၫ, လံဂၩလဂၩစဇ့ၭခရဲ အၫတၭး စဟိစၫအဖိၪခွၫၥံၪ ဒဲအထၧၫ့ဖုဝဲၥံၪ ထီးအ လူၬမွဲလဆံၫၥၧၫ့ဂၩလီၫ.",
			"12": "<sup>12</sup> လၧအဝ့ၫၥံၪအကျၩ လၧၦခိၪလဖၪဒၪလ့ၬအကျၩ နီၪ,ၦပၧၩ့တရၫ့ၥံၪအဆၧနၩ့ဖၭအီၪဝ့ၫ, လစီၪ့ဎးလၧ လစီၪ့ဒၪ, ဘဲၫၥိၭအမိမၩအခ့ၫအၡၩအဆၧမၩလၧယ",
			"13": "<sup>13</sup> ဟိဝၩအဂံၪ့ဖၧၩ့နီၪလီၫ.- အဝ့ၫၥံၪဖၭဝ့ၫတၭ, ၦအဆံၭ ဘဲၫၦအဒိၪအၥိၭ, ဘဲၫအဝ့ၫၥံၪအဖါအဂံၪ့အၥိၭ,လၧ",
			"14": "<sup>14</sup> တရၫ့ကိၭစီၪ့ဒ့ၭဆုၬဆုၬအဂးလီၫ.- တၭဆၧဖၭဘၪ ဆဲၫ့လၧမုထၪ့လခီၫဘၪစၡ့ၫလမဲအၫနီၪလီၫ. ထီးနီၪ လဖၧၫ့အဝ့ၫၥံၪဖၭဝ့ၫလၧအဖိၪခွၫ ၦကိၪ့ဆၧၥ့ၪအၥုၪ့ ဆၭအၥၭဆၭစဇ့ၫခရဲအၫအဂးတၭး အဝ့ၫဒၪအဆၧ ဖၭနီၪဂဲၫထၪ့လၧဆၧဘၪဆဲၫ့ လၧမုဖၩလခီၫလီၫ.",
			"15": "<sup>15</sup> လၧမုခံၫ့လခီၫဘၪစအိၫဘဒံဒၧၫ့, အဖိၪခွၫလဖၪစအၫ",
			"16": "<sup>16</sup> စုဖံၫ့အဂံၪ့နီၪလီၫ.- လၧမုနုၬလခီၫဘၪစရှုၭဖံၫ့ဒဲစဟိ စၫ,ဒဲတရၫ့ၡၪလခ့ၭလၧဖၧၩ့ၥၭမုအဆၧလ့ၩထၪ့နီၪ,",
			"17": "<sup>17</sup> ၦပၧၩ့ဆၧလစီၪ့ဎၩ့ လၧၦပၧၩ့ဆၧလစီၪ့လီၫ.- လၧမု ထၪ့လခီၫနီၪ ၦလံဝဲၫအီၪဎူၫဂၩ, လၧမုဖၩလခီၫနီၪလ နံၩဘၪလနံၩလံဂၩ, လၧမုခံၫ့လခီၫနီၪလနံၩဘၪလနံၩ လံဂၩ, ဒဲတီၩလၧအၫစုပံၫ့လခီၫနီၪ, နံၫဂၩ,နံၫဂၩလီၫ.",
			"18": "<sup>18</sup> လၧပၫဘၫလၧမုနုၬလခီၫနီၪ, လၧဖၧၩ့ၥၭမုလံဂၩ,ဒဲ",
			"19": "<sup>19</sup> လၧပၫဘၫနံၫဂၩလီၫ.- အနီၪလဖၪ မွဲၦပၧၩ့တရၫ့အ ဆၧနၩ့ဖၭလၧစကိရံၫအဖိၪခွၫၥံၪအကျၩ, ဒဲလၧစမရၫ ရဲၫအဖိၪခွၫၥံၪအကျၩလီၫ.",
			"20": "<sup>20</sup> တၭလၧၦလံဝဲၫဖိၪအကျၩနီၪ, စအဟဲယၫအီၪလၧ ယွၩအဂံၪ့အဆၧအီၪက့ၪကီၪ့အလးအဖၫ့ခိၪ, ဒဲလၧ ဆၧဆံၫ့ဎံၪၥံၪ အဆၧအီၪက့ၪကီၪ့အလးအဖၫ့ခိၪနီၪဆ့",
			"21": "<sup>21</sup> လီၫ.- ဆၧဘၪဆဲၫ့လၧစလၫအဒၫ့အဖိၪခွၫၥံၪး ဖါၥံၪ အခိၪ,ၦဂၧၡၧၫ့ဖိၪစလၫအဒၫ့အဖိၪခွၫၥံၪ,ၦဂၧၡၧၫ့ဖိၪ",
			"22": "<sup>22</sup> ဒၪလ့ၬစလၫအဒၫ့နီၪ, မွဲစယဟဲအလဲၫလီၫ.- စယဟဲ အလဲၫအဖိၪခွၫၥံၪး စဇံၥၫ့,ဒဲအထၧၫ့ဖုဝဲစယိၫအ့လၭ နီၪ,လၧအအီၪလၧယဟိဝၩအဂံၪ့အဆၧအီၪက့ၪကီၪ့",
			"23": "<sup>23</sup> အလးအဖၫ့ခိၪလီၫ.- လၧၦအၫမရၫ့ဖိၪၥံၪအကျၩနီၪ, ၦအံၭဇဟၫဖိၪလဖၪ, ၦဟံဘြၧၫ့ဖိၪလဖၪ, ၦအၧၭဇၫ",
			"24": "<sup>24</sup> အ့လၭဖိၪလဖၪလီၫ.- စဂၧၡၧၫ့အဖိၪခွၫ စၡ့ၫဘုၫအ့ လၭ,စမိစ့ၭအဖိၪခွၫ, လၧအပၧၩ့ဆၧအီၪက့ၪကီၪ့အ",
			"25": "<sup>25</sup> လးလဖၪလီၫ.- ဒဲအထၧၫ့ဖုဝဲၥံၪလၩ့ဆိၩထဲၩ့လၧစအံၫ လအ့ဇၧၫတၭး အဖိၪခွၫစရံၫဟဘဲအၫ, ဒဲအဖိၪခွၫစ ယ့ၭၡဟဲအၫ, ဒဲအဖိၪခွၫစယိရၫ့, ဒဲအဖိၪခွၫစဇံၭခြဲၫ,",
			"26": "<sup>26</sup> ဒဲအဖိၪခွၫစၡံလိၫမ့ၭလီၫ.- စၡံလိၫမ့ၭနီၪဒဲအထၧၫ့ဖု ဝဲၥံၪအီၪလၧဆၧဆံၫ့ဎံၪလဖၪ အဆၧအီၪက့ၪကီၪ့ထီး အလူၬအဖၫ့ခိၪလီၫ. မွဲလၧစဎွၩဒၫဝံၭနီၪ, ဒဲဖါၥံၪအ 7ခိၪလဖၪ,ၦလထီၫ့ၥံၪအခိၪလဖၪ, ဒဲလယၩၥံၪအခိၪ လဖၪ,ဒဲၦၥုၭမုခမျၧးၥံၪအခိၪလဖၪ မၩဆံၫ့ဎံၪထၪ့ဝ့ၫ",
			"27": "<sup>27</sup> ဒၪလီၫ.- ဆၧလၧအအၪ့ဂူၬန့, လၧဆၧဒုၭၥုၭအဖၧၩ့နီၪ, အဝ့ၫၥံၪမၩန့အီၪက့ၪဆံၫ့ဎံၪဝ့ၫ လၧယဟိဝၩအဂံၪ့အ",
			"28": "<sup>28</sup> ဆၧမၩအဂးလီၫ.- ဒဲကယဲဆၧလၧမီၪစစၫမုၫအ့လၭ ဒဲစကံၭအဖိၪခွၫစစီလူၫနီၪ, ဒဲစနၧၫအဖိၪခွၫ စအၭဘ နၧၫ,ဒဲနးဇ့ၫရုအဲအၫအဖိၪခွၫစယိအၭနီၪ, အီၪက့ၪဆံၫ့ ဎံၪဝ့ၫထီးအလူၬး ဒဲကယဲၦၡၩလဂၩလါလါ လၧအ အီၪက့ၪဆံၫ့ဎံၪ ဆၧလမံၩ့မံၩ့နီၪ, မွဲအအီၪလၧၡံလိၫ မ့ၭဒဲအထၧၫ့ဖုဝဲၥံၪအစူၪအဖၫ့လၬလီၫ.",
			"29": "<sup>29</sup> လၧၦအံၭဇဟၫဖိၪၥံၪအကျၩနီၪ, စစံၫနနဲအၫဒဲအ ဖိၪခွၫၥံၪအီၪလၧအံၫစရ့လၭအဖၫ့ခိၪ လၧဆၧမၩလၧ ခီၫ့အဂး, လၧၦဒိၪၥံၪဒဲၦစ့ၩရၫ့ဆၧလဖၪအဂးလီၫ.",
			"30": "<sup>30</sup> လၧၦဟံဘြၧၫ့ဖိၪအကျၩနီၪ, စဟၭၡဘဲအၫဒဲအထၧၫ့ ဖုဝဲၥံၪ,ၦၡၩအၥၭဒူၩ, လထီၫ့နွ့ၫယၩၥံၪ, ၦဒိၪၥံၪဘၪ ဆဲၫ့လၧအံၫစရ့လၭလၧအအီၪလၧ ယီၫဒၫ့မုနုၬဝါယီၩ လခီၫ, လၧယဟိဝၩအကဲၩ့အကၩထီးအလူၬအဖၧၩ့,",
			"31": "<sup>31</sup> ဒဲလၧစဎွၩအဆၧဖံၭဆၧမၩအဖၧၩ့လီၫ.- လၧၦဟံ ဘြၧၫ့ဖိၪၥံၪအကျၩနီၪ, စယရဲယၫမွဲအခိၪ, လၧၦဟံ ဘြၧၫ့ဖိၪအကျၩဒၪလ့ၬ, ဘဲၫအဖါၥံၪအဆိၩလဖၪအီၪ ဝ့ၫအၥိၭနီၪလီၫ. လၧစဒၫဝံၭကဲၪစဎွၩအနံၪ့လံဆံၫနံၪ့ လနံၪ့နီၪ,ဆၧအၪ့ဎၬ အဝ့ၫၥံၪတၭ, လၧအဝ့ၫၥံၪအ ကျၩနီၪဆၧဒၪန့ၦၡၩအဆီၪ့ ဒဲအၥၭဒူၩလၧယ့ၫဇၧၫ",
			"32": "<sup>32</sup> ဘၪဆဲၫ့လၧဂံလအၭနီၪလီၫ.- တၭအထၧၫ့ဖုဝဲၥံၪ, ၦ လၧအၥၭဒူၩ, ဖါၥံၪအခိၪလဖၪ, မွဲနံၫထီၫ့နွ့ၫယၩ,လၧ စဎွၩဒၫဝံၭဒုၭကဲၪၦပၧၩ့ဆၧလၧၦရုဘံၫ့ဖိၪၥံၪ အဖၫ့ ခိၪ,ဒဲၦဂၭဖိၪၥံၪ, ဒဲစမနၭစ့ၫအလခီၫဒီၪ့နီၪ, လၧကယဲ ဆၧလမံၩ့လါလါ ဘၪဆဲၫ့လၧယွၩနီၪ, ဒဲစဎွၩအမူၭအ ရါၥံၪလီၫ."
		},
		"27": {
			"1": "<sup>1</sup> တၭၦအံၫစရ့လၭဖိၪၥံၪ ဘဲၫအဆၧဝံဆၧနၬအၥိၭ, ဖါၥံၪအခိၪလဖၪ, ဒဲၦအထီၫ့ၥံၪအခိၪလဖၪ, ဒဲၦအ ယၩၥံၪအခိၪလဖၪ, ဒဲအဝ့ၫၥံၪအၦဒိၪလဖၪလၧအမၩ စဎွၩအဆၧမၩ လၧအဒီၪ့လဖၪအဖၧၩ့နီၪ, လၧအဂဲၫ နုၬဒဲစဲၪ့ထၪ့ခွံၬလၩလဘံၪ့ဘၪလဘံၪ့, လၧနံၪ့အလၩ ကိၭဘံၪ့ဒ့ၭ, လဒီၪ့လဒီၪ့ဆုၬဆုၬနီၪ, မွဲနံၫလၬလံထီၫ့ လီၫ.",
			"2": "<sup>2</sup> လၧအခၪ့ထံၭလဒီၪ့ လၧလၩအခၪ့ထံၭအဂးနီၪ, စဇၭဘဒၭအ့လၭအဖိၪခွၫ စယၡိဘအၫ့ အီၪလၧအဖၫ့ ခိၪတၭး လၧအဝ့ၫဒၪအဒီၪ့ဖၧၩ့ မွဲနံၫလၬလံထီၫ့လီၫ.",
			"3": "<sup>3</sup> လၧစပံရ့ၭအဖိၪအလံၩအကျၩၥံၪနီၪ, မွဲၦၥုၭမုခမျၧး",
			"4": "<sup>4</sup> ၥံၪအခိၪလဖၪအခိၪလၧလၩခၪ့ထံၭအဂးနီၪလီၫ.- တၭ လၧလၩနံၫဘံၪ့လဘံၪ့အဂးနီၪ, ၦအဟိဟဲၭဖိၪစဒိဒဲၫ နီၪအီၪလၧအဖၫ့ခိၪတၭ, လၧအဝ့ၫဒၪအဒီၪ့အကျၩမွဲ စမံကလီၭပၧၩ့ဆၧတၭး လၧအဝ့ၫဒၪအဒီၪ့ဖၧၩ့, မွဲနံၫ",
			"5": "<sup>5</sup> လၬလံထီၫ့ဆ့လီၫ.- ၦၥုၭမုခမျၧးအခိၪ ၥၧၫ့ဂၩလဂၩ လၧလၩၥၧၫ့ဘံၪ့လဘံၪ့အဂး, မွဲၦလုဆၧအခိၪစယဟီ အဒၫအဖိၪခွၫ စဘံၫ့နအဲအၫတၭး လၧအဝ့ၫဒၪအဒီၪ့",
			"6": "<sup>6</sup> ဖၧၩ့,မွဲနံၫလၬလံထီၫ့လီၫ.- အယီၩမွဲစဘံၫ့နအဲအၫလၧ အမွဲၦအဆီၪ့လၧၦၥၧၫ့ဆံၫအကျၩ, ဒဲအီၪလၧၦၥၧၫ့ဆံၫ အဖၫ့ခိၪလီၫ. တၭလၧအဝ့ၫဒၪအဒီၪ့အဖၧၩ့နီၪ, မွဲအ",
			"7": "<sup>7</sup> ဖိၪခွၫစအမံၭဇဘၭနီၪလီၫ.- အခိၪလံဂၩလဂၩ လၧ လၩလံဘံၪ့လဘံၪ့အဂးနီၪ, မွဲစယိအၭအထၧၫ့ဖုဝဲစ အၫစဟ့လၭ, ဒဲလၧအဝ့ၫဒၪအလးခဲၫ့, မွဲအဖိၪခွၫစဇ့ၭ ဘဒဲအၫတၭး လၧအဝ့ၫဒၪအဒီၪ့ဖၧၩ့, မွဲနံၫလၬလံထီၫ့",
			"8": "<sup>8</sup> လီၫ.- အခိၪယဲဂၩလဂၩလၧလၩယဲဘံၪ့လဘံၪ့အဂး နီၪ,မွဲၦအံၭဇရၫဖိၪစၡၫ့ဟုၭတၭး လၧအဝ့ၫဒၪအဒီၪ့",
			"9": "<sup>9</sup> ဖၧၩ့,မွဲနံၫလၬလံထီၫ့လီၫ.- အခိၪဎူၫဂၩလဂၩလၧလၩ ဎူၫဘံၪ့လဘံၪ့အဂးနီၪ, မွဲၦတကိဖိၪ စအံၭက့ၭအဖိၪ ခွၫစအဲရၫတၭး လၧအဝ့ၫဒၪအဒီၪ့ဖၧၩ့, မွဲနံၫလၬလံ",
			"10": "<sup>10</sup> ထီၫ့လီၫ.- အခိၪနွ့ၫဂၩလဂၩလၧလၩ နွ့ၫဘံၪ့လဘံၪ့ အဂးနီၪ,မွဲၦပ့ၭလနဲၭဖိၪစဟံလ့ၭ, လၧစအံဖံၫ့အဖိၪ အလံၩအကျၩတၭး လၧအဝ့ၫဒၪအဒီၪ့ဖၧၩ့, မွဲနံၫလၬ",
			"11": "<sup>11</sup> လံထီၫ့လီၫ.- အခိၪဎိၭဂၩလဂၩလၧလၩဎိၭဘံၪ့လဘံၪ့ အဂးနီၪ, မွဲၦဟုၡၫဖိၪစစ့ၭဘခ့ၫ, လၧၦဇၫဟဲၭဖိၪအ ကျၩတၭး လၧအဝ့ၫဒၪအဒီၪ့ဖၧၩ့, မွဲနံၫလၬလံထီၫ့လီၫ.",
			"12": "<sup>12</sup> အခိၪခွံၫဂၩလဂၩ လၧလၩခွံၫဘံၪ့လဘံၪ့အဂးနီၪ,မွဲ ၦန့ၭတၥဲၭဖိၪစအၭဘအံဇၧၫ, လၧၦဘံၪ့ယမံၫ့ဖိၪအ ကျၩတၭး လၧအဝ့ၫဒၪအဒီၪ့ဖၧၩ့,မွဲနံၫလၬလံထီၫ့လီၫ.",
			"13": "<sup>13</sup> အခိၪဆံၫဂၩလဂၩလၧ လၩဆံၫဘံၪ့လဘံၪ့အဂးနီၪ, မွဲၦန့ၭတဖၫဖိၪ စမဟၫရဲၫ, လၧၦဇၫရဲၭဖိၪ အကျၩ တၭး လၧအဝ့ၫဒၪအဒီၪ့ဖၧၩ့, မွဲနံၫလၬလံထီၫ့လီၫ.",
			"14": "<sup>14</sup> အခိၪဆံၫလဂၩလဂၩ လၧလၩဆံၫလဘံၪ့လဘံၪ့အဂး နီၪ,မွဲပံၫရၥၧၫ့ဖိၪစဘံၫ့နအဲအၫ လၧၦအံဖြံၫ့ဖိၪအကျၩ တၭး လၧအဝ့ၫဒၪအဒီၪ့ဖၧၩ့, မွဲနံၫလၬလံထီၫ့လီၫ.",
			"15": "<sup>15</sup> အခိၪဆံၫနံၫဂၩလဂၩ လၧလၩဆံၫနံၫဘံၪ့လဘံၪ့အဂး နီၪ,မွဲၦန့ၭတဖၫဖိၪ စဟ့လဒဲဘၪဆဲၫ့လၧအီၭၥနံၫအ့ လၭတၭး လၧအဝ့ၫဒၪအဒီၪ့ဖၧၩ့, မွဲနံၫလၬလံထီၫ့လီၫ.",
			"16": "<sup>16</sup> လၧနီၪအမ့ၬယၫ လၧအံၫစရ့လၭအဒီၪ့ၥံၪအဖၫ့ခိၪ နီၪတၭး ၦရုဘံၫ့ဖိၪၥံၪအၦဒိၪဖၭဒိၪနီၪ, မွဲစဇံၭခြဲၫအ ဖိၪခွၫစအံၫလအ့ဇၧၫလီၫ. လၧၦစံမအၧၫ့ဖိၪၥံၪအဂး",
			"17": "<sup>17</sup> နီၪ,မွဲစမၫအခၫအဖိၪခွၫစၡ့ၫဖတဲအၫတၭး- လၧၦလံ ဝဲၫဖိၪၥံၪအဂးနီၪ, စကၫမုၫအ့လၭ အဖိၪခွၫ စဟၭၡ ဘဲၫအၫတၭး လၧၦအၫရၧၫ့ဖိၪၥံၪအဂးနီၪ, စဇၫဒီၭ",
			"18": "<sup>18</sup> တၭး- လၧယုဒၫအဂးနီၪ, မွဲစအံၫလဲဟုၫ,လၧစဒၫဝံၭ အထၧၫ့ဖုဝဲအကျၩတၭး လၧစအံစခၫအဂးနီၪ, မွဲစမဲၫ",
			"19": "<sup>19</sup> ခအ့လၭအဖိၪခွၫစအီမရဲၫတၭး- လၧစဇ့ၭဘလၧၫ့အ ဂးနီၪ,မွဲစအိၫဘဒဲအၫအဖိၪခွၫစအံၭၡမဲအၫတၭး လၧ စနၭၥလဲၫအဂးနီၪ, မွဲစအၭဇရ့လၭအဖိၪခွၫစယ့ၫရမီၭ တၭး လၧစအံဖံၫ့အဖိၪအလံၩအဂးနီၪ, မွဲစအၭဇဇဲ",
			"20": "<sup>20</sup> အၫအဖိၪခွၫစဟိၫၡံအၫတၭး- လၧစမနၭစ့ၫလခီၫဒီၪ့",
			"21": "<sup>21</sup> အဂး,မွဲစပဒဲအၫအဖိၪခွၫစယိၫအ့လၭတၭး- လၧစမ နၭစ့ၫလခီၫဒီၪ့လၧဂံလအၭအဖၧၩ့နီၪအဂး, မွဲစဇ့ၭခရဲ",
			"22": "<sup>22</sup> အၫအဖိၪခွၫစအံၭဒိၫတၭး- လၧစဘံၪ့ယမံၫ့အဂးနီၪ, မွဲစအၭဘနၧၫအဖိၪခွၫစယအၫစအ့လၭတၭး လၧစဒၫ့ အဂးနီၪ, စယ့ၫရိဟၫ့အဖိၪခွၫစအၭဇရ့လၭၥံၪလီၫ. အဝ့ၫၥံၪမွဲအံၫစရ့လၭအဒီၪ့လဖၪ အၦဒိၪဖၭဒိၪလဖၪ လီၫ.",
			"23": "<sup>23</sup> အ့ၪမွဲၦလၧအနံၪ့နံၫဆံၫ ဒဲနံၫဆံၫအဖၫ့လၬလဖၪ နီၪ, စဒၫဝံၭဝံထၪ့နၬထၪ့ဝ့ၫအ့ၬး အဂဲးဘဲၫယီၩယဟိဝၩ စံၭဝဲၩဝ့ၫလၧအမိမၩအၪထၪ့ အံၫစရ့လၭဘဲၫၡၪၥံၪ",
			"24": "<sup>24</sup> လၧမူၭခိၪအၥိၭနီၪလီၫ.- နးဇ့ၫရုၫအဲအၫ အဖိၪခွၫ စယိအၭဝံထၪ့နၬထၪ့အခၪ့ထံၭလါနၫ့တၭ, မၩဝ့ၫထီး အဂီၩ့နီၪဆ့အ့ၬး အဂဲးဘဲၫယီၩ လၧဆၧနီၪလမံၩ့အ ကၠီၩ့တၭ, ဆၧၥၭထၪ့လၩ့ဘၪအံၫစရ့လၭနီၪး အဆၧဝံ ဆၧနၬနီၪမွဲအအီၪက့ၪဝ့ၫလၧ စဎွၩဒၫဝံၭအလံၬကွ့ၭနဲၪ့ ဆၧအဖၧၩ့နီၪဆ့အ့ၬ.",
			"25": "<sup>25</sup> တၭစအၫဒဲၫအ့လၭ အဖိၪခွၫစအၭဇမၫဝ့ၭနီၪအီၪ လၧစဎွၩအဎၧၩ့အဎီလဖၪအဖၫ့ခိၪတၭး လၧဆၧအီၪ က့ၪကီၪ့အလးၥံၪ လၧဆံၬဖၧၩ့မွဲဂ့ၩ, လၧဒိၩ့ဖၧၩ့မွဲ ဂ့ၩ,ဒဲလၧတဝၫ့ၥံၪအဖၧၩ့ဆ့, ဒဲလၧထိၬလဖၪဆ့, မွဲစ အၧၭဇဲအၫအဖိၪခွၫ စယဟီနၥၫ့ အီၪလၧအဝ့ၫၥံၪအ",
			"26": "<sup>26</sup> ဖၫ့ခိၪလီၫ.- တၭလၧၦမၩကၩလၧဂၪ့ခိၪဆံၬၥံၪနၩၥံၪ အဆၧဖံၭဆၧမၩအဖၫ့ခိၪနီၪ, မွဲစစံၫလၧၭ အဖိၪခွၫစ",
			"27": "<sup>27</sup> အံဇရဲၫနီၪလီၫ.- တၭလၧစဘံၭလးၥံၪအဖၫ့ခိၪနီၪ,မွဲ ၦရမၫဖိၪစၡံမအဲၫနီၪလီၫ. လၧစဘံၭလးအဆၧၥၪ အၪထၪ့ဝ့ၫ လၧစဘံၭထံၫ အီၪကီၪ့အလးအဖၫ့ခိၪနီၪ,",
			"28": "<sup>28</sup> မွဲၦၡံဖမဲၭဖိၪစဇၭဘဒဲၫၥံၪလီၫ.- တၭလၧၥံၪ့အလဲအိၫ့ ၥံၪဒဲလၧကူၪၥံၪအထံၭ လၧအအီၪဝ့ၫ လၧဆၧပျၩ့ဖၧၩ့ နီၪအဖၫ့ခိၪ, မွဲၦဂ့ဒၧၫဖိၪ စဘၫအလၭဟၫနၫ့နီၪလီၫ. လၧဆၧအီၪက့ၪၥိၪ အလးၥံၪအဖၫ့ခိၪၥံၪ, မွဲစယိအၭ",
			"29": "<sup>29</sup> လီၫ.- တၭလၧချီၥံၪအဒီၪ့လဖၪ လၧအအၪ့အဆၪလၧ ၡၫရၧၫ့အဖၧၩ့အဖၫ့ခိၪနီၪ, မွဲၦၡၫရၧၫ့ဖိၪ စၡံၭတရဲၫ လီၫ. တၭလၧချီၥံၪအဒီၪ့လဖၪ လၧအအၪ့အဆၪလၧ ခိၪလီၩ့ဆူၭဖၧၩ့နီၪအဖၫ့ခိၪ, မွဲစအၭဒလဲၫအဖိၪခွၫစ",
			"30": "<sup>30</sup> ၡၫဖၭနီၪလီၫ.- လၧကလအူၭၥံၪအဖၫ့ခိၪနီၪ, မွဲၦအံၡ မၫအ့လၭဖိၪစအိၫဘံလၭနီၪလီၫ. ဒဲလၧကၥ့ၪယီၩ့ၥံၪ",
			"31": "<sup>31</sup> အဖၫ့ခိၪနီၪ မွဲၦမ့ရၫ့ဖိၪစယ့ၫဒဲအၫနီၪလီၫ.- တၭလၧ ၥိၪၥံၪဘ့ၪၥံၪအဒီၪ့လဖၪအဖၫ့ခိၪနီၪ မွဲၦဟၫဂၧၫဖိၪစ ယၫဇံၭနီၪလီၫ. အဝ့ၫၥံၪထီးအလူၬမွဲၦပၧၩ့စဒၫဝံၭအ စူၪလးခၪ့ခိၪနီၪလီၫ.",
			"32": "<sup>32</sup> တၭစဒၫဝံၭအမၩ့စစၪ့နၥၧၫ့လဂၩမွဲ ၦဒုၭကိၪ့ဆၧ, ၦကိၪ့ဘၪကိၪ့ၥ့ၪလဂၩ, ဒဲၦကွ့ၭလံၬဆ့း ဒဲၦဟၭမနဲၭ ဖိၪစယဟဲၫအ့လၭ အီၪလၧစဎွၩ အဖိၪခွၫလဖၪအ",
			"33": "<sup>33</sup> ကျၩး- ဒဲစအဟံၭၥိၫဖ့လၭနီၪ မွဲစဎွၩ အၡၩဒုၭကိၪ့",
			"34": "<sup>34</sup> ဆၧး ဒဲၦအၫခဲၭဖိၪစဟုၡဲၫနီၪ, မွဲစဎွၩအၥိၭတၭး- လၧ စအဟံၭၥိၫဖ့လၭအလးခဲၫ့နီၪ, စဘံၫ့နအဲအၫအဖိၪခွၫ စယဟီအဒၫ, ဒဲစအဘဲအၥၫတၭ, စဎွၩအၥုၭမုၥံၪအ ခိၪမွဲစယိအၭနီၪလီၫ."
		},
		"28": {
			"1": "<sup>1</sup> တၭစဒၫဝံၭဒုၭအီၪကီၪ့အံၫစရ့လၭ အၦဒိၪဖၭဒိၪၥံၪ ထီးအလူၬ, အဒီၪ့လဖၪအၦဒိၪဖၭဒိၪၥံၪ, ဒဲအဒီၪ့ၥံၪ လၧအမၩစဎွၩအခ့ၫအၡၩအဆၧမၩနီၪ လဆၫ့ဘၪလ ဆၫ့လဆၫ့ဘၪလဆၫ့အခိၪလဖၪ, ဒဲၦအထီၫ့ၥံၪအခိၪ လဖၪ, အယၩၥံၪအခိၪလဖၪ, ဒဲၦယိဆၧအီၪ လၧစ ဎွၩအစူၪလးခၪ့ခိၪထီးအလူၬအဖၫ့ခိၪလဖၪနီၪ, ဒဲအ ဖိၪခွၫၥံၪအဆၧဆ့, ဒဲၦဒိၪၥံၪ, ဒဲၦၡၩအဆီၪ့လဖၪ, ဒဲ ကယဲၦလၧအၥၭဒူၩၥံၪ ထီးအလူၬ, လၧယရုစလံၫ့နီၪ လီၫ.",
			"2": "<sup>2</sup> ထီးနီၪလဖၧၫ့ စဎွၩဒၫဝံၭဆၧၫ့ထုၪ့လၧအခၪ့တၭ, စံၭဝ့ၫဒၪ, ယထၧၫ့ဖုဝဲၥံၪ, ဒဲယၡၩခမျၧးၥံၪဧ့, ခိၭနၪ ယၧၩဘီၪး ယဝ့ၫဒၪ, ဆၧအီၪဝဲၩလၧယၥၭခံဖၧၩ့လၧ ယမိမၩထၪ့ ဂံၪ့အီၪပွံၭလၧယဟိဝၩ အုၩ့လၩ့ဆၧအ တလၫအဂးနီၪး ဒဲလၧပယွၩယဲးလၩ့ဆၧအဂး, ဒဲတဲၩ့",
			"3": "<sup>3</sup> ဝဲၩဆၧလၧဂံၪ့နီၪအဂးဆ့လါနၫ့တၭး- ယွၩစံၭယၧၩ, နဝ့ၫဒၪနမၩထၪ့ဘၪဂံၪ့လၧယမံၩ့အဂးအ့ၬ, အဂဲးဘဲၫ ယီၩနမွဲၦၡၩဒုၭၥုၭတၭ, နဂါလၩ့ယူၭဆၧၥွံၪလီၫ.",
			"4": "<sup>4</sup> မွဲလါနၫ့ဘဲၫနီၪတၭ, ယဟိဝၩ အံၫစရ့လၭအယွၩရွံန့ ယၧၩလၧယဖါအဂံၪ့ထီးအလူၬအမ့ၬယၫ လၧယမိကဲၪ စဎွၩလၧအံၫစရ့လၭအဖၫ့ခိၪ အဆိၩဆိၩအကၠၪကၠၪ လီၫ. အဂဲးဘဲၫယီၩ မွဲအရွံန့ၦပၧၩ့ ဆၧစယုဒၫနီၪး ဒဲ လၧစယုဒၫအဂံၪ့အကျၩနီၪ, ယဖါအဂံၪ့း ဒဲလၧယဖါ အဖိၪခွၫၥံၪအကျၩနီၪ, မွဲအအဲၪဒိၭယၧၩလၧအမိဒုၭ ကဲၪထၪ့ယၧၩလၧစဎွၩလၧ အံၫစရ့လၭထီးအလူၬအ",
			"5": "<sup>5</sup> ဖၫ့ခိၪလီၫ.- တၭလၧယဖိၪခွၫၥံၪ ထီးအလူၬအကျၩ, (အဂဲးဘဲၫယီၩယဟိဝၩဖ့ၪလၫ့ယၧၩဖိၪခွၫၥံၪအၪဂၩ) မွဲအရွံန့ယဖိၪခွၫ စစီလမၧၫ့လၧအမိဆၧၫ့နၩ့လၧယဟိ ဝၩအဘၩ့အမုး အလးဆီၩ့ဆီအလီၩ့ လၧအံၫစရ့လၭ",
			"6": "<sup>6</sup> အဖၫ့ခိၪလီၫ.- တၭအဝ့ၫဒၪစံၭယၧၩ, နဖိၪခွၫစစီလ မၧၫ့နီၪ, အဝ့ၫဒၪမိမၩထၪ့ယဂံၪ့ဒဲယဝၩ့ၥံၪ, အဂဲးဘဲၫ ယီၩယရွံန့အဝ့ၫဒၪ လၧအမိကဲၪထၪ့ယဖိၪခွၫတၭ,ယ",
			"7": "<sup>7</sup> ဝ့ၫဒၪယမိကဲၪထၪ့အဖါလီၫ.- မၩအၥၭဘဲၫနီၪတၭအ ဝ့ၫဒၪအ့ၪအီၪက့ၪအၥၭဂုးခၧၫ့ လၧအမိမၩယဆၧမၪ လူၬၥံၪ, ဒဲယဆၧစ့ၩရၫ့ၥံၪ, ဘဲၫလၧမုလနံၩယီၩအၥိၭ တၭ,ယမိဒုၭဂုးခၧၫ့အဘၩ့အမုး အဆိၩအကၠၪလီၫ.",
			"8": "<sup>8</sup> အခိးမွဲဘိၩ့နဲၪ့ယီၩ လၧအံၫစရ့လၭထီးအလူၬယဟိ ဝၩအဆၧအီၪကီၪ့အမ့ၬယၫ, ဒဲလၧပယွၩအနါဖၧၩ့, ထီးန့ဒဲအၪ့ဎၬယဟိဝၩ နၥံၪအယွၩအဆၧမၪလူၬထီး အလူၬဆံၭ. ဘဲၫၥိၭနၥံၪမိန့ၥၫခးအဂ့ၩယီၩ, ဒဲဒုၭအီၪ လၩ့ထးဝ့ၫဒၪလၧနၥံၪအဖိၪအလံၩလဖၪ လၧနၥံၪအ လးခဲၫ့အဆၧန့ၥၫအဂးအဆိၩအကၠၪနီၪလီၫ.",
			"9": "<sup>9</sup> တၭနဝ့ၫဒၪ, ယဖိၪခွၫစစီလမၧၫ့ဧ့, ၥ့ၪယၫနဝ့ၫနဖါ အယွၩ,ဒဲမၩအဝ့ၫဒၪအဆၧ လၧနၥၭလၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩ ဒဲလၧနၥၭအီၪထၪ့ဒၪဆၧဘဲၫနီၪဆံၭ. အဂဲးဘဲၫယီၩ ယဟိဝၩအၪ့ဎၬယိၦၥၭထီးအလူၬ, ဒဲနၪၥ့ၪကယဲဆၧ ဆီၫ့မီၪ့အဆၧကိၪ့ထီးအလူၬတၭး နအ့ၪအၪ့ဎၬအဝ့ၫ ဒၪ,နမိဒၪန့ဝ့ၫ, နအ့ၪစဲၪ့ဒၪအဝ့ၫတၭ, မွဲအမိခွံၬၡိၭခွံၬ",
			"10": "<sup>10</sup> နၧၩအဆိၩအကၠၪဆ့လီၫ.- ဘိၩ့နဲၪ့ယီၩထီးလၩ့နၥၭ ဘီၪး အဂဲးဘဲၫယီၩ ယဟိဝၩရွံန့နၧၩဘဲၫၥိၭနမိမၩထၪ့ ဂံၪ့လၧဆၧဆံၫ့ဎံၪ အလးနီၪအဂးတၭး အီၪလၧဂဲး ဆီၪ့,ဒဲမၩဝ့ၫဘီၪၬ",
			"11": "<sup>11</sup> ထီးနီၪလဖၧၫ့ စဒၫဝံၭဖ့ၪလၫ့အဖိၪခွၫစစီလမၧၫ့ ဆၧအဒီၩ့အထ့ၬလၧဂံၪ့ၥံၪဒဲထိၬချိၫ့နီၪအဂး, ဒဲလၧဆၧ အီၪက့ၪကီၪ့ အစူၪလးအခၪ့ခိၪၥံၪအလးလဖၪအဂး, ဒဲဒူၭလၧထၭလခီၫအဂး, ဒဲဒူၭလၧအဖၧၩ့လခီၫနီၪအ",
			"12": "<sup>12</sup> ဂး,ဒဲဆၧယၫ့ၥၭအလး,- ဒဲကယဲဆၧအဒီၩ့အထ့ၬ, လၧအန့ဘၪဝ့ၫလၧၥၭနီၪ ယဟိဝၩအဂံၪ့ အဝၩ့ၥံၪမွဲ ဂ့ၩ,ဒဲအဒူၭၥံၪအီၪဖီၩ့ဝၬဝၬထီးအလူၬ, ယွၩအဂံၪ့အ ဆၧအီၪက့ၪကီၪ့စူၪလးခၪ့ခိၪလဖၪအဂး, ဒဲလၧဆၧ လၧၦအီၪက့ၪဆံၫ့ဎံၪဝ့ၫလဖၪ အဆၧအီၪက့ၪကီၪ့အ",
			"13": "<sup>13</sup> ဂး- ဒဲလၧၦလုဆၧၥံၪဒဲၦလံဝဲၫဖိၪၥံၪအဆၧမၩလစီၪ့ စီၪ့အဂးဆ့, ဒဲလၧယဟိဝၩအဂံၪ့အဆၧမၩ ထီးအ လူၬအဂး, ဒဲလၧဆၧမၩလၧယဟိဝၩ အဂံၪ့ဖၧၩ့အ",
			"14": "<sup>14</sup> ဖၧၩ့ၥံၪထွ့ၫၥံၪထီးအလူၬအဂးနီၪလီၫ.- အဝ့ၫဒၪခံၫ့န့ ထီၫ့လၧဆၧဘၪဆဲၫ့ လၧထီၫ့နီၪအဂး, ကယဲဆၧအ ဎၧၩ့အဎီလၧဆၧမၩလမံၩ့ဘၪလမံၩ့ ထီးအလူၬအဂး, ဒဲခံၫ့န့စ့ၩလၧကယဲဆၧအဎၧၩ့အဎီစ့ၩအဂး, ကယဲအ ဎၧၩ့အဎီလၧဆၧမၩလမံၩ့ဘၪလမံၩ့ လမံၩ့ဘၪလမံၩ့",
			"15": "<sup>15</sup> ထီးအလူၬအဂး,- လၧမ့ၪဒိၩ့အလးထီၫ့လဖၪအလ ယၧးဒၪလ့ၬအဂး, ဒဲအဝ့ၫၥံၪအမ့ၪဒိၩ့ထီၫ့လဖၪအဂး တၭ, ခံၫ့န့ဝ့ၫလၧမ့ၪဒိၩ့အလးအဂးဆုၬဆုၬ, ဒဲလၧအ ဝ့ၫၥံၪအမ့ၪဒိၩ့အဂး, ဒဲလၧမ့ၪဒိၩ့အလးစ့ၩအလယၧး အဂး,လၧမ့ၪဒိၩ့အလးအဂးမွဲဂ့ၩ, ဒဲလၧအမ့ၪဒိၩ့အ ဂးနီၪဆ့း ဘဲၫအလးအီၪဝ့ၫလၧလမံၩ့အဂး လမံၩ့အ",
			"16": "<sup>16</sup> ဂးအၥိၭနီၪလီၫ.- တၭမွဲအခံၫ့န့ထီၫ့ လၧဆၧမ့ၬယၫ အကိၪအစပွဲၥံၪအဂး, လၧစပွဲၥံၪဆုၬဆုၬအဂး,ဒဲစ့ၩ",
			"17": "<sup>17</sup> လၧစပွဲစ့ၩၥံၪအဂးဆ့း- ဒဲထီၫ့ဆံၫ့လၧနိၪပုၭဆၧယၪ အဂး,ဒဲထွ့ၫၥံၪ,လိၫ့ၥံၪ, ဒဲလၧထွ့ၫထီၫ့ၥံၪအဂး,မွဲအခံၫ့ န့ထီၫ့လၧထွ့ၫအဂးဆုၬဆုၬး ဒဲလၧထွ့ၫစ့ၩၥံၪအဂးခံၫ့",
			"18": "<sup>18</sup> န့ဝ့ၫစ့ၩလၧထွ့ၫအဂးဆုၬဆုၬး- ဒဲလၧဆၧနၧၫ့မၧၫ့အ ဆၧလုလးအဂး, မွဲအခံၫ့န့ထီၫ့လၧအဘၪဆၧမၩဆံၫ့ ထၪ့လၧမ့ၪး ဒဲထီၫ့လၧခ့ၫရူၬၥံၪ အလဲၪ့အဒီၩ့အဂး, လၧအယၩ့ထၪ့အဒံၭမၩဘံၭခွံၬ ယဟိဝၩအဆၧအုၩ့",
			"19": "<sup>19</sup> လၩ့အတလၫနီၪလီၫ.- ဆၧထီးအလူၬယီၩ လၧဆၧ ကွ့ၭဝ့ၫဆၧအဒီၩ့အထ့ၬယီၩ အဆၧမၩထီးအလူၬနီၪ, ယဟိဝၩဒုၭနၪၥ့ၪယၧၩ လၧအစူၪအီၪလၧယလီၩ့အ ကၠီၩ့လီၫ.",
			"20": "<sup>20</sup> တၭစဒၫဝံၭစံၭအဖိၪခွၫ စစီလမၧၫ့နီၪ, အီၪလၧဂဲး ဆီၪ့ဒဲအီၪလၧနၥၭဒူၩ, ဒဲမၩဆၧဘီၪ. ထီးၥၭမဲၪလဂ့ၩ, ထီးအၪ့ယိၪဆၧလဂ့ၩ, အဂဲးဘဲၫယီၩယဟိဝၩယွၩ, ယယွၩဒၪလ့ၬ, မိအီၪလၧနၥိၭတၭ, နလချႃၭမၩဂီၩ့ဒံၭ ဘၪဆၧမၩထီးအလူၬ လၧယဟိဝၩအဂံၪ့အဆၧမၩ ၥံၪအဂးနီၪတၭ, မွဲအၥၭလၩ့ဆါထဲၩ့လၧနဂးအ့ၬ. မိ",
			"21": "<sup>21</sup> စဲၪ့ဒၪနၧၩဆ့အ့ၬ.- တၭယိခွါ ၦလုဆၧၥံၪဒဲၦလံဝဲၫဖိၪ ၥံၪအလးလစီၪ့ဘၪလစီၪ့ လစီၪ့ဘၪလစီၪ့ၥံၪနီၪဘဲၫအ ဆၧမၩအလးအီၪဝ့ၫအၥိၭ, အီၪလၧယွၩအဂံၪ့နီၪအ ဆၧမၩထီးအလူၬအဂး တၭၦလၧအကိၪ့မၩဆၧၥ့ၪ လမံၩ့လါလါနီၪ, ကယဲၦလၧအမၩဆၧၥ့ၪလၧအၥၭ အီၪထၪ့ဒၪဆၧကိၭဂၩဒ့ၭဆုၬဆုၬနီၪ, အီၪလၧဆၧမၩ လမံၩ့လါလါအဂးလီၫ. ၦဒိၪဖၭဒိၪဆ့ဒဲၦခမျၧးၥံၪထီး အလူၬအီၪလၧနဆၧမၪလူၬအဂးနီၪလီၫ."
		},
		"29": {
			"1": "<sup>1</sup> လၧနီၪအမ့ၬယၫ စဎွၩဒၫဝံၭစံၭဆၧအီၪကီၪ့ထီးအ လူၬၥံၪ, ၦလၧယွၩရွံန့ဝ့ၫ န့ၫယဖိၪခွၫစစီလမၧၫ့နီၪ,မွဲ အၥၭဘၪ့ဒံၭဒဲအဂဲးဆါတၭ, ဆၧမၩနီၪမွဲဖၭဒိၪ,အဂဲး ဘဲၫယီၩနီးနီၪ မွဲလၧၦၡၩအဂးအ့ၬ, အ့ၪမွဲလၧယဟိ",
			"2": "<sup>2</sup> ဝၩယွၩနီၪအဂးလီၫ.- ဘိၩ့နဲၪ့ယီၩယတဲၩ့ဝဲၩဆၧလူၬ ယဂဲးယဘၭ လၧယယွၩအဂံၪ့အဂးနီၪ, ထီၫ့လၧဆၧ ဘၪဆဲၫ့လၧထီၫ့အဂး, ဒဲစ့ၩလၧဆၧဘၪဆဲၫ့လၧစ့ၩအ ဂး,ဒဲထီးဝီၩလၧဆၧဘၪဆဲၫ့ လၧထီးဝီၩအဂးနီၪ,ဒဲ ထၭလၧဆၧဘၪဆဲၫ့လၧထၭအဂး, ဒဲၥံၪ့လၧဆၧဘၪ ဆဲၫ့လၧၥံၪ့အဂး, ထၫ့မျါမဟူၩယၩ, လိးလၧအမိၥီၩ့ လၩ့ဝ့ၫ, လိးယုၩ့ယဲၥံၪ,လိးကံၪကဲၩ့, ဒဲလိးအလူဒိၪ",
			"3": "<sup>3</sup> ဎွ့ၩဒိၪကိၭအမံၩ့, ဒဲလိးဘွၩအၪအၪလ့ၬဆ့လီၫ.- လၧ ယအီၪက့ၪယၥၭ လၧယယွၩအဂံၪ့အဂးအကၠီၩ့နီၪ, လၧကယဲဆၧထီးအလူၬလၧယတဲၩ့ဝဲၩ ထီၫ့ဒဲစ့ၩၥံၪလၧ ဂံၪ့ဆံၫ့ဎံၪနီၪအဂးအဖၫ့ခိၪတၭး လၧယဆၧဒၪယဝ့ၫ",
			"4": "<sup>4</sup> ယီၩယဖ့ၪလၫ့ယူၭလၧယယွၩအဂံၪ့အဂး,- ထီၫ့အကံ ကၫၥၧၫ့ထီၫ့, ဘၪဆဲၫ့လၧအိဖၧၫအထီၫ့, ဒဲစ့ၩဘၪဆၧ မၩဆံၫ့လၧမ့ၪနီၪအကံကၫနွ့ၫထီၫ့, ဘဲၫၥိၭအမိဖၩ့ထၬ",
			"5": "<sup>5</sup> ဂံၪ့အဒီၪ့ၥံၪလီၫ.- ထီၫ့လၧဆၧဘၪဆဲၫ့လၧထီၫ့အဂး, ဒဲစ့ၩလၧဆၧဘၪဆဲၫ့လၧစ့ၩအဂး, ဒဲလၧဆၧမၩလမံၩ့ လါလါလၧၦကိၪ့မၩၥ့ၪနီၪမိမၩဝ့ၫဒၪလီၫ. တၭမုဆၫ လနံၩယီၩ, မွဲပလၫအၥၭအီၪထၪ့ဒၪဝ့ၫလၧအမိအီၪက့ၪ ဆံၫ့ဎံၪအဆၧမၩလၧယဟိဝၩအဂးလဂၩလဲၪ.",
			"6": "<sup>6</sup> ထီးနီၪလဖၧၫ့ဖါၥံၪအခိၪလဖၪ, ဒဲအံၫစရ့လၭအဒီၪ့ လဖၪအၦဒိၪဖၭဒိၪၥံၪ, ဒဲၦအထီၫ့ၥံၪအခိၪလဖၪ, ဒဲၦအ ယၩၥံၪအခိၪလဖၪ, ဒဲၦလၧအပၧၩ့စဎွၩအဆၧမၩ,အ",
			"7": "<sup>7</sup> ဝ့ၫၥံၪမၩဘိၪ့လၧအၥၭဒၪဝ့ၫအီၪထၪ့နီၪ,- ဒဲဖ့ၪလၫ့လၧ ယွၩအဂံၪ့အဆၧမၩအဂးနီၪ, ထီၫ့အကံကၫယဲထီၫ့, ဒဲဒၫရံၭလလၬ, ဒဲစ့ၩအကံကၫလလၬ, ဒဲထီးဝီၩအကံ",
			"8": "<sup>8</sup> ကၫလလၬဎိၭထီၫ့, ဒဲထၭအကံကၫလကုၬလီၫ.- တၭ ၦလၧအအီၪလၧမနံၬထၫ့မျါၥံၪ ဖ့ၪလၫ့ဝ့ၫလၧယဟိဝၩ အဂံၪ့အီၪက့ၪကီၪ့ဆၧအလး, လၧၦဂၧၡၧၫ့ဖိၪစယဟဲၫ",
			"9": "<sup>9</sup> အ့လၭအစူၪဖၧၩ့လီၫ.- ထီးနီၪလဖၧၫ့ၦခမျၧးၥံၪၥုၪ့ထိၬ ၥၭထိၬဝ့ၫ အဂဲးဘဲၫယီၩ မွဲအမၩဘိၪ့ဆၧလၧအၥၭ အီၪထၪ့ဒၪဆၧဘဲၫနီၪ မွဲလၧအဝ့ၫၥံၪအၥၭလၧၫ့လၧၫ့ ဎွ့ၩဎွ့ၩအကၠီၩ့နီၪ, မၩဘိၪ့ယဟိဝၩလၧအၥၭအီၪထၪ့ ဒၪဆၧဘဲၫနီၪလီၫ. တၭစဎွၩဒၫဝံၭဆ့ ၥုၪ့ထိၬၥၭထိၬ လၧဆၧၥၭထိၬဖၭဒိၪလီၫ.",
			"10": "<sup>10</sup> မၩအၥၭဘဲၫနီၪတၭ, စဒၫဝံၭဆိၪဂ့ၩ ယဟိဝၩလၧ ဆၧအီၪကီၪ့ထီးအလူၬအမ့ၬယၫတၭ, စဒၫဝံၭစံၭဝ့ၫ, နဝ့ၫဒၪ,ပဖါယဟိဝၩအံၫစရ့လၭအယွၩ, မွဲနဘၪဆၧ",
			"11": "<sup>11</sup> ဆိၪဂ့ၩအဆိၩဆိၩအကၠၪကၠၪဆံၭ.- ယဟိဝၩဧ့, ဆၧ ဖၭဒိၪနီၪ, ဒဲဆၧအစီၩ့အမၩ့နီၪ, ဒဲဆၧလၩဆၧဖၩ့နီၪ, ဒဲဆၧမၩနၧၩ့မၩစၪနီၪ, ဒဲဆၧၥူၭဆၧၥဲၪ့နီၪ, မွဲနဆၧဒၪ နဝ့ၫ,အဂဲးဘဲၫယီၩ ကယဲဆၧအီၪလၧမူၭခိၪဖၧၩ့,ဒဲလၧ ဂၪ့ခိၪချိၫ့ယီၩ, မွဲနဆၧ,ယဟိဝၩဧ့, ဆၧအဘၩ့အမုး နီၪမွဲနဆၧတၭ, နဘၪဆၧအီၪက့ၪထၪ့ထီၫနၧၩ, ဘဲၫဆၧ",
			"12": "<sup>12</sup> အခိၪလၧဆၧထီးအလူၬအဖၫ့ခိၪအၥိၭနီၪလီၫ.- ဆၧလူ ဒိၪဎွ့ၩဒိၪမွဲဂ့ၩ, ဆၧအလၩအဖၩ့မွဲဂ့ၩ, ဂဲၫလၩ့လၧနၧၩ တၭ,နပၧၩ့ဆၧလၧဆၧထီးအလူၬအဖၫ့ခိၪတၭ,လၧ နစူၪဖၧၩ့နီၪဆၧအစီၩ့အမၩ့ ဒဲဆၧဂဲးဆၧဘၭ အီၪဝ့ၫ တၭ,ဆၧမၩဘၪဆဲၫ့လၧဆၧဒိၪဆၧမုနီၪ, ဒဲမၩဆီၪ့ထၪ့",
			"13": "<sup>13</sup> ဆၧထီးအလူၬနီၪအီၪလၧနစူၪဖၧၩ့လီၫ.- အခိးမွဲဘိၩ့ နဲၪ့ယီၩ,ပယွၩဧ့, ပစံၭထၪ့အၪ့အူၭနၧၩ, ဒဲၥံၫကျံၩထၪ့",
			"14": "<sup>14</sup> အၪ့အူၭနမံၩ့လၩဖၩ့နီၪလီၫ.- အ့ၪမွဲလၧပမၩဘိၪ့ၥ့ၪ ဎွ့ၩယီၩၥိၭလၧပၥၭအီၪထၪ့ဒၪဆၧအကၠီၩ့နီၪ, ယဝ့ၫ ဒၪယမွဲၦလဂၩလဲၪး ဒဲၦၡၩခမျၧးၥံၪ မွဲဆၧနီၪလမံၩ့ လဲၪ.အဂဲးဘဲၫယီၩ ဆၧထီးအလူၬနီၪဂဲၫလၩ့လၧနၧၩ တၭ,ဆၧလၧအမွဲနဆၧဒၪနဝ့ၫနီၪ, ပဝ့ၫဒၪပဖ့ၪလၫ့ထဲၩ့",
			"15": "<sup>15</sup> နၧၩဆ့လီၫ.- အဂဲးဘဲၫယီၩပမွဲၦလခီၫဘၩ့မုးဖိၪလၧ နမ့ၬယၫ,ဒဲၦမွံၩဖိၪ, ဘဲၫပဖါၥံၪထီးအလူၬအၥိၭတၭး ပနံၩပၥၫ့လၧဂၪ့ခိၪချိၫ့ယီၩ, မွဲဘဲၫဆၧအလၩရှုၪအ",
			"16": "<sup>16</sup> ၥိၭတၭ, ဆၧအီၪဂုးခၧၫ့နီၪအီၪနးမံၩ့အ့ၬ.- ယဟိဝၩ ပယွၩဧ့, ကယဲဆၧလၧအအီၪပိၩ့ယီၩ လၧပတဲၩ့ဝဲၩ ဘဲၫၥိၭပမိမၩထၪ့နဂံၪ့လၧနမံၩ့ဆံၫ့ဎံၪအဂးနီၪ, ဂဲၫလၩ့",
			"17": "<sup>17</sup> လၧနစူၪဖၧၩ့တၭ, မွဲနဆၧထီးအလူၬလီၫ.- ယၥ့ၪယၫ ယဝ့ၫဆ့,ယယွၩဧ့, လၧနမၩခွါၥၭနီၪ, ဒဲမုၬလၩနၥၭလၧ ဆၧတီၩဆၧလီၩ့ယီၩအဖၧၩ့လီၫ. ယနၫ့ဆါဒၪယဝ့ၫ, လၧယၥၭအဆၧတီၩဆၧလီၩ့အဖၧၩ့နီၪ, ယမၩဘိၪ့ ဆၧထီးအလူၬဘဲၫယၥၭအီၪထၪ့ဒၪဆၧ အၥိၭနီၪလီၫ. ဘိၩ့နဲၪ့ယီၩလၧဆၧၥၭထိၬအဖၧၩ့တၭ, ယဒၪဘၪနၡၩ ခမျၧးၥံၪ, လၧအအီၪကီၪ့ယူၭထီးယီၩ, လၧအဝ့ၫၥံၪမၩ ဘိၪ့နၧၩဘဲၫအၥၭ အီၪထၪ့ဒၪဆၧအၥိၭနီၪဆ့လီၫ.",
			"18": "<sup>18</sup> ယဟိဝၩစအၫဘြဟၫ့, စအံစၭ,ဒဲစအံၫစရ့လၭပဖါၥံၪ အယွၩဧ့, အီၪက့ၪထၬဆၧယီၩ, လၧနၡၩခမျၧးၥံၪအ ၥၭအဆၧဆီၫ့မီၪ့အဆၧကိၪ့ၥံၪအဖၧၩ့ အဆိၩအကၠၪဒဲ",
			"19": "<sup>19</sup> ဒုၭအီၪဂုးခၧၫ့အဝ့ၫၥံၪအၥၭလၧနဂးဆံၭ.- ဒဲဖ့ၪလၫ့ ယဖိၪခွၫစစီလမၧၫ့နီၪ အၥၭလၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩ, လၧ အမိထီးန့နဆၧမၪလူၬလဖၪ, နဆၧထိးအၥၭလဖၪ, ဒဲနဆၧစ့ၩရၫ့လဖၪ, ဒဲလၧအမိမၩဆၧထီးအလူၬယီၩ, ဒဲမၩထၪ့နီး,လၧယတဲၩ့ဝဲၩယူၭ ဆၧလၧအဂးနီၪ ဆံၭ.",
			"20": "<sup>20</sup> တၭစဒၫဝံၭစံၭဆၧအီၪကီၪ့ထီးအလူၬနီၪ, ဘိၩ့နဲၪ့ ယီၩဆိၪဂ့ၩယဟိဝၩနၥံၪအယွၩဆံၭ. တၭဆၧအီၪ ကီၪ့ထီးအလူၬနီၪ ဆိၪဂ့ၩယဟိဝၩအဝ့ၫၥံၪအဖါလဖၪ အယွၩတၭ, အဝ့ၫၥံၪၡီၫ့လၩ့အခိၪ, ဒဲဘိၪ့ထၪ့ဘၩထၪ့",
			"21": "<sup>21</sup> ယဟိဝၩ, ဒဲစဎွၩနီၪလီၫ.- တၭအဝ့ၫၥံၪလုထၪ့ဆၧလု ၥံၪလၧယဟိဝၩနီၪ, ဒဲလုထၪ့ဆၧလုမ့ၪၥံၪလၧယဟိဝၩ လၧမုနံၩနီၪအလးခဲၫ့လနံၩ, မွဲချီဖၫၥံၪလထီၫ့, ၥိၪဖၫ လထီၫ့,ၥိၪဖိၪလထီၫ့, ဒဲအဝ့ၫၥံၪအဆၧလုအီၩၥံၪ,ဒဲ ဆၧလုလဖၪအၪအၪလ့ၬ လၧအံၫစရ့လၭထီးအလူၬ",
			"22": "<sup>22</sup> အဂးလီၫ.- တၭလၧမုလနံၩနီၪ မွဲအအၪ့ဆၧအီၩဆၧ လၧယဟိဝၩအမ့ၬယၫ လၧဆၧၥုၪ့ထိၬၥၭထိၬဖၭဒိၪ လီၫ. တၭအဝ့ၫၥံၪဒုၭကဲၪထၪ့ စဒၫဝံၭအဖိၪခွၫစစီလ မၧၫ့နီၪလၧစဎွၩနံၫဘျၩ့လဘျၩ့တၭ, ဂုၪဝ့ၫလၧၥိၪလၧ ယဟိဝၩအဂး, လၧၦပၧၩ့ဆၧအခိၪ, ဒဲစဇၫဒီၭလၧ ၦလုဆၧအဂးလီၫ.",
			"23": "<sup>23</sup> ထီးနီၪလဖၧၫ့စစီလမၧၫ့ဆၧၫ့နၩ့ လၧယဟိဝၩအလး ဆီၩ့ဆီအလီၩ့ ဘဲၫစဎွၩအၥိၭလၧအဖါ စဒၫဝံၭအဂး နီၪ,မွဲအဘီၪထၪ့ယီၫထၪ့တၭ, အံၫစရ့လၭထီးအလူၬ,",
			"24": "<sup>24</sup> ခိၭနၪအလူလီၫ.- တၭကယဲၦဒိၪဖၭဒိၪၥံၪထီးအလူၬ, ဒဲၦၡၩအဆီၪ့ၥံၪ, ဒဲစဒၫဝံၭအဖိၪခွၫၥံၪထီးအလူၬဆ့, အီၪက့ၪလၩ့အၥၭလၧစဎွၩ စီလမၧၫ့နီၪအဖၫ့လၬလီၫ.",
			"25": "<sup>25</sup> တၭယဟိဝၩဒုၭဒိၪထၪ့ စစီလမၧၫ့လၧအံၫစရ့လၭထီး အလူၬအမ့ၬယၫအၪအၪလ့ၬ, ဒဲဒုၭအီၪထၪ့အဝ့ၫဒၪ အဘၩ့အမုးအၥူၭအၥဲၪ့ ဘဲၫစဎွၩဂူၫဂၩၥံၪလၧအံၫစ ရ့လၭအဖၧၩ့ လၧအဝ့ၫဒၪလချႃၭအီၪဒံၭဘၪနီၪ, လန့ ဘၪဝ့ၫနးဂၩအၥိၭနီၪလီၫ.",
			"26": "<sup>26</sup> စယ့ၭစံၫအဖိၪခွၫစဒၫဝံၭနီၪ ပၧၩ့ဆၧလၧအံၫစရ့လၭ",
			"27": "<sup>27</sup> ထီးအလူၬအဖၫ့ခိၪဘဲၫနီၪလီၫ.- တၭအဆၧၫ့အထီ လၧအပၧၩ့ဆၧလၧအံၫစရ့လၭအဖၫ့ခိၪနီၪ, မွဲအနံၪ့လံ ဆံၫလီၫ. လၧဟံဘြၧၫ့အဖၧၩ့နီၪ မွဲအပၧၩ့ဆၧနွ့ၫနံၪ့း ဒဲလၧယရုစလံၫ့အဖၧၩ့နီၪ အနံၪ့ၥၧၫ့ဆံၫၥၧၫ့နံၪ့လီၫ.",
			"28": "<sup>28</sup> တၭလၧအၥၭၡါဂ့ၩဘၪစဲၪ, အမုနံၩလဖၪလၧၫ့ထၪ့ ဎွ့ၩထၪ့, အီၪလၧအဆၧလူဒိၪဎွ့ၩ့ဒိၪ ဒဲအလၩအဖၩ့ တၭ, ၥံၫဝ့ၫဒၪလီၫ. တၭအဖိၪခွၫစစီလမၧၫ့ပၧၩ့ဆၧ လၧအလးလီၫ.",
			"29": "<sup>29</sup> တၭစဎွၩဒၫဝံၭအဆၧဖံၭဆၧမၩလဖၪ, လၧအခၪ့ ထံၭထီးအထုၬ, ယိခွါ, ဆၧကွ့ၭလၩ့ဝ့ၫလၧမီၪစစၫမုၫ အ့လၭအလံၬဖၧၩ့, ဒဲလၧမီၪစနၫၥၫ့အလံၬဖၧၩ့, ဒဲလၧ",
			"30": "<sup>30</sup> မီၪစဂၭအလံၬဖၧၩ့,- ဒဲလၧအပၧၩ့ဆၧထီးအလူၬအ ဂဲးအကၠီၪ့ဒဲအစီၩ့အမၩ့နီၪ, ဒဲအဆၧၫ့အထီလဖၪလၧ အဘၪအဝ့ၫဒၪ, ဒဲအံၫစရ့လၭ, ဒဲထံၫၥံၪခးၥံၪ, ဘၩ့ၥံၪ မုးၥံၪထီးအလူၬလဖၪဆ့လီၫ."
		}
	}
};
module.exports = book;